INSERT INTO `comments` VALUES (9,'','I really like the take a paper leave a paper idea.  I also like the shroom design and the 40 degree or lower automatic radiating heaters. ','','',0,3,'Design',14,'2009-05-15 18:54:55','2009-04-22 04:10:49',NULL),(10,'','I like the shape of this bus station, very interesting and fun. The LED lights are well incorporated into the design, too. The heater idea is also good.  ','','',0,3,'Design',15,'2009-05-15 18:54:55','2009-04-22 20:01:11',NULL),(24,'','Having the TV would make the waiting period less boring, and letting people know the waiting time is also a good idea. ','','',0,5,'Design',15,'2009-05-15 18:54:55','2009-04-27 22:32:22',NULL),(25,'','I like how you included the Ski theme, and it is very different. ','','',0,10,'Design',15,'2009-05-15 18:54:55','2009-04-27 22:38:24',NULL),(32,'','I like how this design incorporates Utah\'s mountain landscape and the major attraction: skiing. ','','',0,10,'Design',21,'2009-05-15 18:54:55','2009-04-28 01:36:10',NULL),(33,'','I like the idea of a couch, but wouldn\'t the elements make it moldy or wet or something?','','',0,12,'Design',21,'2009-05-15 18:54:55','2009-04-28 01:37:14',NULL),(34,'','I love the idea of having food and a bus stop!','','',0,4,'Design',21,'2009-05-15 18:54:55','2009-04-28 01:37:58',NULL),(35,'','I think this idea is very Utah, but there is not much seating. Also is that thing going to swing back and forth like a real ski lift or no?','','',0,10,'Design',19,'2009-05-15 18:54:55','2009-04-28 01:51:57',NULL),(36,'','I like the recycle bin and the snack cart. But would you have to have a person working at it? Overall good design. ','','',0,4,'Design',19,'2009-05-15 18:54:55','2009-04-28 01:53:10',NULL),(37,'','I like the unique design and the heating system. I also like the circular seating around the base of the mushroom. Very different and innovative. ','','',0,3,'Design',19,'2009-05-15 18:54:55','2009-04-28 01:55:15',NULL),(43,'','How would someone change the channel? Will there be a remote, or will it just be set on a channel the whole time?','','',0,5,'Design',8,'2009-05-15 18:54:55','2009-04-28 23:41:02',NULL),(44,'','I think all bus stops should be implimented with a system like yours, but my question is, how does the system work...I know Trax has the timer in place, but I wonder if that is because it is on a fixed track.','','',0,6,'Design',8,'2009-05-15 18:54:55','2009-04-28 23:42:56',NULL),(45,'','Nice.  This is a perfect theme for Utah.  What about some sort of shelter from the hot/cold though?','','',0,10,'Design',8,'2009-05-15 18:54:55','2009-04-28 23:44:00',NULL),(49,'','I think it is an interesting design.  I think it is great that people are trying to be environmentally friendly.','','',0,14,'Design',23,'2009-05-15 18:54:55','2009-04-29 00:41:06',NULL),(50,'','I would like more than the scheduled arrival time being displayed.  It is a creative design though.','','',0,11,'Design',23,'2009-05-15 18:54:55','2009-04-29 00:45:07',NULL),(51,'','How long are people planning to wait at the bus stop for a bus... I mean do we need entire meals and books to read for a stop that has four different bus routes coming at very short intervals.','','',0,4,'Design',23,'2009-05-15 18:54:55','2009-04-29 00:47:56',NULL),(52,'','I really like the minimalist design and the lounge feel to it. \r\nAlso the idea of using recycled building materials is great, too. ','','',0,14,'Design',15,'2009-05-15 18:54:55','2009-04-29 01:42:29',NULL),(54,'','sideways.','','',0,16,'Design',22,'2009-05-15 18:54:55','2009-04-29 04:13:57',NULL),(60,'','great drawing but i dont understand how it works.','','',0,20,'Design',14,'2009-05-15 18:54:55','2009-04-30 04:43:20',NULL),(61,'','i like the trail mix and the idea of the branches for shade...its get hot as He** in Salt Lake City. We need some shade and snacks.','','',0,22,'Design',14,'2009-05-15 18:54:55','2009-04-30 04:49:39',NULL),(62,'','I think this is a great idea. I like the recycled materials. \"Go Green\" What I would like to know...would there be those nice hot beverages in the HOT HOT Summer?','','',0,14,'Design',14,'2009-05-15 18:54:55','2009-04-30 05:00:05',NULL),(63,'','I like this...GO GREEN this is a great idea...it seems a tad bit uncomfortable but hey it seems like a great way to help our enviornment. Did you think about the homeless population stealing your couch and selling your cans for money?','','',0,21,'Design',14,'2009-05-15 18:54:55','2009-04-30 05:04:45',NULL),(70,'','I love how eco friendly this is. Also i would love a place to serve warm drink in the winter while i wait! Love it!','','',0,14,'Design',22,'2009-05-15 18:54:55','2009-04-30 21:38:29',NULL),(71,'','I  love this! Not only would it be eco friendly, but it would be really colorful! I would totally use the couch!','','',0,21,'Design',22,'2009-05-15 18:54:55','2009-04-30 21:41:32',NULL),(72,'','I really like this idea, I\'m always down for some shade, a comfy bench, and some trail mix while i wait for the bus!','','',0,22,'Design',22,'2009-05-15 18:54:55','2009-04-30 21:44:10',NULL),(83,'','I think this is a great design. I like your idea about the Shuttle Tracker. ','','',0,9,'Design',9,'2009-05-15 18:54:55','2009-05-01 06:41:56',NULL),(84,'','If I found a bus stop with some good coffee I would go there all the time! I like the whole lounge idea and the glass doors.','','',0,14,'Design',9,'2009-05-15 18:54:55','2009-05-01 06:43:52',NULL),(85,'','I also thought of using a xeriscaping approach--good idea. I think the cylinder shape could work, but maybe making it large enough so that the floor isn\'t too round would be cool.','','',0,19,'Design',9,'2009-05-15 18:54:55','2009-05-01 06:47:56',NULL),(100,'','This is awesome. I really like the simplicity of it. The drink dispenser is a great idea too...ive never seen a bus stop with one before.','','',0,14,'Design',33,'2009-05-15 18:54:55','2009-05-03 18:49:31',NULL),(101,'','Seat warmers are an awesome idea...this would be the most 