you have special glass?','','',0,20,'Design',80,'2009-06-17 17:47:21','2009-06-17 17:47:21',NULL),(158,'','I don\'t understand how the space would work either internally for people in wheelchairs, or externally for the rooftop garden. Why is it elevated? ','','',0,19,'Design',80,'2009-06-17 17:51:23','2009-06-17 17:51:23',NULL),(159,'','Some nice ideas, but it needs to address, safety/escape through the doors, wheel chair and stroller accessibility and shade in the summer sun. ','','',0,14,'Design',80,'2009-06-18 04:22:43','2009-06-18 04:22:43',NULL),(160,'','The idea of a \"U\" is interesting.','','',0,16,'Design',80,'2009-06-18 04:24:43','2009-06-18 04:24:43',NULL),(161,'','Fun! A special, one-of-a-kind station!','','',0,3,'Design',80,'2009-06-18 04:27:14','2009-06-18 04:27:14',NULL),(162,'','How will the non-smoking group see if the bus is coming? The display is in their line of sight. Maybe your layout needs to be rotated.','','',0,17,'Design',80,'2009-06-18 04:32:09','2009-06-18 04:32:09',NULL),(163,'','Cool design.  The Summer heat and the freezing winter winds may be hard on the user of this structure.  ','','',0,39,'Design',60,'2009-06-18 16:08:28','2009-06-18 16:08:28',NULL),(164,'','That is very interesting.  I think it would be fun to to go to a teepee bus stop.','','',0,42,'Design',77,'2009-06-19 04:34:57','2009-06-19 04:34:57',NULL),(165,'','I love the look and simplicity of the design','','',0,43,'Design',97,'2009-06-27 01:20:06','2009-06-27 01:20:06',NULL),(166,'','This design is elegant and secures the bike.  I love using the Bike Arc in Palo Alto.','','',0,43,'Design',98,'2009-06-27 14:36:39','2009-06-27 14:36:39',NULL),(167,'','Great design, and looks to be assembled easily/low cost.','','',0,43,'Design',113,'2009-06-30 05:05:08','2009-06-30 05:05:08',NULL),(168,'','that is amazing\r\n','','',0,45,'Design',118,'2009-06-30 10:47:41','2009-06-30 10:47:41',NULL),(169,'','I like the simplicity of this design, but think it could use more seating','','',0,43,'Design',124,'2009-06-30 17:48:23','2009-06-30 17:48:23',NULL),(170,'','This design is so unique and totally user friendly!','','',0,43,'Design',127,'2009-06-30 21:57:16','2009-06-30 21:57:16',NULL),(171,'','Great, design.  However there are several issues in the design requirements that aren\'t addressed such as harsh winters, hot summers, wind protection etc.  simple is good when it meets all of the design requirements that the university sets.  But overall it provides very little protection.  A bench could be just as effective in my opinion.','','',0,43,'Design',129,'2009-07-01 00:25:47','2009-07-01 00:25:47',NULL),(172,'','sweet! but it\'s the same as the other one on the site.  So who really came up with the design?','','',0,9,'Design',60,'2009-07-01 21:03:36','2009-07-01 21:03:36',NULL),(173,'','The other design is the original - this i a technical error we are sorting out right now.  KLarsen\'s original design will be back up soon - sorry for the confusion','','',0,9,'Design',5,'2009-07-01 21:09:43','2009-07-01 21:09:43',NULL),(174,'','The brown strips seem to be right at eye level, so seeing a coming bus would be difficult.','','',0,47,'Design',141,'2009-07-01 23:36:37','2009-07-01 23:36:37',NULL),(175,'','This is for one location - the university of utah business loop and you can learn more about the location on the about this site page - go to specific site to look at the surroundings AND read the design considerations.  This is for a University stop that is heavily used by students/faculty/University employees and visitors.  Thus, the references to the U in many bus stops - ','','',0,17,'Idea',5,'2009-07-02 22:37:36','2009-07-02 22:37:36',NULL),(176,'','I love the wetland idea.  It is a cool design and eco-friendly.  ','','',0,42,'Design',129,'2009-07-03 01:07:26','2009-07-03 01:07:26',NULL),(177,'','thanks for the clarification.\r\nwhat would be your understanding of \"heavily used\"?','','',0,17,'Idea',115,'2009-07-03 04:23:02','2009-07-03 04:23:02',NULL),(178,'','cool - great design and new ideas','','',0,53,'Design',153,'2009-07-03 20:52:51','2009-07-03 20:52:51',NULL),(179,'','this is really great, it looks like it was made in a star wars movie :-)','','',0,53,'Design',154,'2009-07-03 20:59:14','2009-07-03 20:59:14',NULL),(180,'','where should i let my bicycle stay ?','','',0,39,'Design',153,'2009-07-03 21:27:05','2009-07-03 21:27:05',NULL),(181,'','it must be interresting to use it ','','',0,53,'Design',162,'2009-07-04 08:01:39','2009-07-04 08:01:39',NULL),(182,'','nice work\r\n','','',0,53,'Design',162,'2009-07-04 08:01:56','2009-07-04 08:01:56',NULL),(183,'','no,  it isnt made in in star wars or anything else, i just let 2 streams collide in one system; this should be an impulse for a new design line','','',0,53,'Design',153,'2009-07-04 08:34:57','2009-07-04 08:34:57',NULL),(184,'','overall its not bad. But what about when the wind blows right at you and its either raining or snowing. You need to rethink the front and the sides. Obviously this will change the overall look but with some rethinking you\'ll have an even  better design.','','',0,39,'Design',169,'2009-07-04 11:15:20','2009-07-04 11:15:20',NULL),(185,'','very nice!!! but the colors are very cheesy ;)','','',0,53,'Design',170,'2009-07-04 11:52:47','2009-07-04 11:52:47',NULL),(186,'','The University of Utah has about 30,000 students, all of which are provided with a bus and Trax pass for the year.  I can contact UTA and the University to get more specific numbers, but for now it looks like it serves two University shuttle lines that run evert 15 minutes, and about 9 different bus lines.  I will learn more and get back to you.  The busiest times of day are in the morning - 8 am to about 2 pm in the afternoon.  This is a commuter campus and tends to go more silent in the evening, though the lines are used throughout the day and evening.  Hope that helps. ','','',0,17,'Idea',5,'2009-07-04 15:57:43','2009-07-04 15:57:43',NULL),(187,'',':-)','','',0,53,'Design',153,'2009-07-04 16:44:53','2009-07-04 16:44:53',NULL),(188,'','sharp, if a little cynical.   maybe follow it up with a design to back up the idea...','','',0,57,'Design',174,'2009-07-06 23:01:19','2009-07-06 23:01:19',NULL),(189,'','Really nice concept, great organic shape.','','',0,53,'Design',180,'2009-07-06 23:07:37','2009-07-06 23:07:37',NULL),(190,'','It\'s nice that there is a sheltered space, but you need to consider how much solar heat gain there would be inside that space, given that it looks like that it is completely glazed.\r\n\r\nIs the step up to the bus stop necessary?  In fact, how would one get onto the bus?  You\'d be better off without the step, and thus losing the ramp.\r\n\r\nI feel that having the different roofs for the open and closed space creates a very alien space.  Maybe try having the same roof and creating a better blend between the two spaces.\r\n\r\nGive the design considerations section of this site another read :-).\r\n\r\nSorry for seeming overly critical but just my two cents :-).\r\n\r\nOne last thing, try using Sketchup\'s styles.  It\'s default style looks very tacky.','','',0,58,'Design',187,'2009-07-07 16:24:27','2009-07-07 16:24:27',NULL),(191,'','Very cool design, questions arise about heating & cooling, cleaning and ADA access.','','',0,54,'Design',85,'2009-07-07 20:58:02','2009-07-07 20:58:02',NULL),(192,'','my granny would love to wait for a bus here...good job','','',0,31,'Design',197,'2009-07-08 00:01:37','2009-07-08 00:01:37',NULL),(193,'','i assume this is a joke.','','',0,59,'Design',174,'2009-07-08 02:27:02','2009-07-08 02:27:02',NULL),(194,'','Nice concept. More of those are needed.','','',0,59,'Design',201,'2009-07-08 08:16:35','2009-07-08 08:16:35',NULL),(195,'','i think u have to renew your connection between the open and the closed area to get a bit of a flow into your design, ty for your comment in my box :-), i give u 4 stars','','',0,58,'Design',202,'2009-07-08 08:28:39','2009-07-08 08:28:39',NULL),(196,'','... because of the individual using ideas','','',0,58,'Design',202,'2009-07-08 08:30:23','2009-07-08 08:30:23',NULL),(197,'','yeah this design rocks!','','',0,57,'Design',185,'2009-07-08 12:58:05','2009-07-08 12:58:05',NULL),(198,'','It is an interesting concept to make the connection to the other side of the road.','','',0,20,'Design',196,'2009-07-08 14:33:59','2009-07-08 14:33:59',NULL),(199,'','Very good design.  The stop sign idea is perfect to view the bus stop from a distance.','','',0,60,'Design',208,'2009-07-08 16:29:45','2009-07-08 16:29:45',NULL),(200,'','nice design, which is thought through into detail. like it 5 stars!','','',0,52,'Design',185,'2009-07-08 21:07:09','2009-07-08 21:07:09',NULL),(201,'','comment please ','','',0,19,'Idea',137,'2009-07-08 21:37:29','2009-07-08 21:37:29',NULL),(202,'','bus is stationed!','','',0,63,'Design',217,'2009-07-09 16:18:22','2009-07-09 16:18:22',NULL),(203,'','images look nice. the canopy reminds me of a gas station.','','',0,62,'Design',217,'2009-07-09 16:21:52','2009-07-09 16:21:52',NULL),(204,'','Simple, practical, still functional and beautiful.','','',0,60,'Design',224,'2009-07-09 18:05:27','2009-07-09 18:05:27',NULL),(205,'','i hadn\'t actually thought of it in that way, but it actually makes a lot of sense, as they are both types of transportation hubs.   The functional requirements of both bus stops and gas stations imply simple, open, economical shelters, but i do hope this is seen as something a little more elegant and eco-friendly than a standard gas station.   it is a sharp observation though, and cheers for the compliment too.','','',0,62,'Design',174,'2009-07-09 23:04:06','2009-07-09 23:04:06',NULL),(206,'','a funky shape, but did you consider that every city has hundreds of bus stops, paid for by the taxpayer.   To build this would cost a fortune. For every one of these bus stops that would be built, it would prevent someone from going to college or being treated in hospital, which is either short sighted or a little selfish...','','',0,53,'Design',226,'2009-07-09 23:22:17','2009-07-09 23:22:17',NULL),(207,'','Intelligent design, good stuff','','',0,60,'Design',226,'2009-07-09 23:24:16','2009-07-09 23:24:16',NULL),(208,'','same problem as organic streams design, who\'s gonna pay for it?   And who is going to recognise it as a bus stop?   And cigarettes for everybody?   Seriously?','','',0,59,'Design',226,'2009-07-09 23:27:36','2009-07-09 23:27:36',NULL),(209,'','modular design is a very good idea','','',0,61,'Design',226,'2009-07-09 23:29:25','2009-07-09 23:29:25',NULL),(210,'','well, i you have ever heared from FLV´s you would know that it is the only way to produce with less energy and less costs a houndreds of peaces. Once u build a form you can use it in anyway again. That would make it a lot cheaper than buildings made of steel. The transport of the station to its place is also no problem because you can build it in for example 4 modules witch are easy to handle, and because of its weight 2 man could lift a peace\r\n','','',0,53,'Design',153,'2009-07-10 10:21:53','2009-07-10 10:21:53',NULL),(211,'','|it is cheaper - it is less weight - it is a chance| thats why we should try out new forms with new materials','','',0,53,'Design',153,'2009-07-10 10:27:54','2009-07-10 10:27:54',NULL),(212,'','interesting shapes, looks a bit like a 3dsmax generated formula :-) \r\n','','',0,59,'Design',153,'2009-07-10 10:32:13','2009-07-10 10:32:13',NULL),(213,'','Posted in error... I think this counts as a bus stop fail.','','',0,64,'Design',230,'2009-07-10 14:58:43','2009-07-10 14:58:43',NULL),(214,'','Very impressive, and well considered.','','',0,62,'Design',230,'2009-07-10 15:02:26','2009-07-10 15:02:26',NULL),(215,'','As i said, it looks cool, like something out of a Nickelodeon cartoon, but cartoons aren\'t real. And they\'re not new either. You say you\'re using new materials but you haven\'t said what the stop is made out of. You are following a similar approach to zaha hadid when she designed tram stops in innsbruck, with small irregular pieces forming a larger amorphous whole, but they were not cheap, in fact they were very expensive to build, and there were only 4 of them.   If you were to say that this design was for a one off bus stop, a piece of sculpture, you may be able to justify it. But to say it is the bus stop of the future is naive, or perhaps even a little arrogant. People are voting for you because it looks \'cool\', like something from \'star wars\', so you can continue to deny reality if you wish, but i worry for a future filled with such superficial ego-driven design.\r\n','','',0,53,'Design',226,'2009-07-10 15:45:20','2009-07-10 15:45:20',NULL),(216,'','Excellent color choice with a fabulous modern design. It would definitely spice up the community. ','','',0,60,'Design',231,'2009-07-10 18:40:43','2009-07-10 18:40:43',NULL),(217,'','the zombie bus stop could protect patrons in the future from real zombies','','',0,66,'Design',233,'2009-07-10 22:59:54','2009-07-10 22:59:54',NULL),(218,'','ok, again, FLV´s are a composite technology, that allows a serial production, just google for it :-). This lightweight structure are made of fibre composites and have:\r\n\r\n•Low thermal expansion\r\n• Corrosion resistance\r\n• Gradual failure\r\n• High dynamic strength\r\n• Good impact behaviour \r\n• Fewer components\r\n• Low material waste\r\n• Good mouldability\r\n\r\nIf you have any other questions, please write me an email that i can answer you, in this comment box is a bit less room for comments :-).\r\n\r\nThat you bring me in a context to zaha hadid is a pleasure for me, thank you. \r\n','','',0,53,'Design',153,'2009-07-11 08:37:19','2009-07-11 08:37:19',NULL),(219,'','it looks like prehistoric time has never gone ','','',0,59,'Design',166,'2009-07-11 08:47:09','2009-07-11 08:47:09',NULL),(220,'','this is a great example for new solutions and the composite technology is the technology for the future, go on man !!!','','',0,53,'Design',239,'2009-07-11 09:17:36','2009-07-11 09:17:36',NULL),(221,'','it is named captain america....gets my 5 stars...OKAY...GO!','','',0,59,'Design',116,'2009-07-11 10:59:59','2009-07-11 10:59:59',NULL),(222,'','I like it alot, reminds me of a prehistoric dinasour, materials used are great and would aid in longevity and low maintenance vs. what we currently see in so many cities which are basically billboards and designed for advertising, leave that to the buses. This design blends well with the environment','','',0,67,'Design',242,'2009-07-11 11:12:23','2009-07-11 11:12:23',NULL),(223,'','I love the design, the use of organic material.  It is attractive, but yet unusual.  I like the idea of greater visibility to oncoming traffic.','','',0,67,'Design',243,'2009-07-11 11:27:31','2009-07-11 11:27:31',NULL),(224,'','a architectural comparison to zaha hadid is not a compliment','','',0,53,'Design',226,'2009-07-11 14:05:36','2009-07-11 14:05:36',NULL),(225,'','and again it is worrying that you think it so. None of this is a personal attack, but your approach to design, and that of similar designers, is very very worrying.   i googled flv\'s. one of the first links showed me images of a formula one car and prototype aircraft. it is NOT ecologically or economically viable, so PLEASE stop saying that it is.','','',0,53,'Design',226,'2009-07-11 14:22:44','2009-07-11 14:22:44',NULL),(226,'','It\'s beautiful, functional and whimisical.','','',0,67,'Design',247,'2009-07-11 15:29:11','2009-07-11 15:29:11',NULL),(227,'','looks great and should be reasonable to build.','','',0,67,'Design',248,'2009-07-11 15:33:17','2009-07-11 15:33:17',NULL),(228,'','very pleasing and functional...','','',0,67,'Design',249,'2009-07-11 15:44:37','2009-07-11 15:44:37',NULL),(229,'','what does the shape achieve.   it would be more costly to mass produce and to erect. to make each stop, of hundreds, out of natural stone is going to cost taxpayers a fortune. also, there is a contradiction in describing it as organic, using materials in their natural states, and then incorporating a highly processed polycarbonate sheet. it makes the project schizophrenic and without conceptual cohesion. the attempt to use natural construction and materials is noble, but is a little misguided and impractical.','','',0,67,'Design',226,'2009-07-11 16:58:17','2009-07-11 16:58:17',NULL),(230,'','A wonderful blend of modern aerodynamics and primitive materials.','','',0,67,'Design',257,'2009-07-11 21:09:40','2009-07-11 21:09:40',NULL),(231,'','Although it\'s early days I\'ve noticed a rather low overall rating. But no-one\'s commented so I don\'t know what you don\'t like. Are there issues with the facilities? Does that woman on the poster annoy you? Let me know what you think, I\'ll try and respond to your points.','','',0,65,'Design',230,'2009-07-11 22:00:55','2009-07-11 22:00:55',NULL),(232,'','If my bus went to the moon, I\'d be late for work, although I would have an interesting excuse :)','','',0,57,'Design',230,'2009-07-11 22:27:56','2009-07-11 22:27:56',NULL),(233,'','Not the most practical idea, especially in terms of construction, but I don\'t see why transport networks can\'t have an occasional landmark.','','',0,53,'Design',230,'2009-07-11 22:31:31','2009-07-11 22:31:31',NULL),(234,'','I\'m not keen on the aesthetics (but that\'s a matter of taste) but I cannot fault the concept - good stuff.','','',0,61,'Design',230,'2009-07-11 22:34:37','2009-07-11 22:34:37',NULL),(235,'','i think its great that a project can produce a discussion, my father is building FLV´s for a concern in europe and it is not as complex as it looks on the first view. It is right that you can easily build a serial numbers of pieces, but it is complex to build the first form, it is like a foundry or so. Anyway i like that project because it is really new and gives a lot of discussion staff, and only by discussion problems can be detached at the beginning.  ','','',0,53,'Design',154,'2009-07-12 09:05:32','2009-07-12 09:05:32',NULL),(236,'','oh my god, a turtle on a cube :-)','','',0,67,'Design',262,'2009-07-12 09:14:10','2009-07-12 09:14:10',NULL),(237,'','dinosaurs are back :-)','','',0,59,'Design',263,'2009-07-12 09:21:22','2009-07-12 09:21:22',NULL),(238,'','I do not really know any of your designs or what kind of job you do kavbar, but i dont think you are an architectural expert to say that a architectural comparison to zaha hadid is not a compliment. She is one the top 5 architects in the world building offices, theaters and of course bus stations all over the world. I can not believe so many people be off base.  The only argument you delivered for your position was that you have googled and the first thing you have seen was an example in formular one. But google is bigger that the first 2 rows :-). New techniques always finds their way first in protypes and buisness with high costs, but i think i have explained enough about the chance beyond it. To say the design makes as high costs as going to college is very naive and shows that you do not have any anticipation about it. I think that the reason for your enuciation is that your design is a cube nobody votes for. Your frustation is ok, but please dont act out your feelings again organic forms and the possibility to use them in future in here. If you dont like them it is ok, it is your statement.','','',0,53,'Design',153,'2009-07-12 09:42:50','2009-07-12 09:42:50',NULL),(239,'','Beautiful and functional with options for different locational needs','','',0,67,'Design',264,'2009-07-12 17:30:21','2009-07-12 17:30:21',NULL),(240,'','Peaceful, comfortable and contemporary.  I would enjoy waiting for public transportation here. Great imagination!','','',0,67,'Design',266,'2009-07-12 17:45:02','2009-07-12 17:45:02',NULL),(241,'','your design seems to work well. the only issue I have with it is that its not practical to enclose the bikes with all that glass. also consider the snow and muck will get the lower part of the windows rather dirty and increase maintenance issues. consider metal panel curtain wall for 3 the first three feet. ','','',0,65,'Design',214,'2009-07-12 18:44:08','2009-07-12 18:44:08',NULL),(242,'','what recycled material would you use to construct this?\r\n','','',0,66,'Design',214,'2009-07-12 18:46:59','2009-07-12 18:46:59',NULL),(243,'','by far the coolest and most original bus stop of the bunch','','',0,66,'Design',268,'2009-07-12 21:07:43','2009-07-12 21:07:43',NULL),(244,'','I like the long overhang for protection from the weather.','','',0,62,'Design',26,'2009-07-12 23:21:02','2009-07-12 23:21:02',NULL),(245,'','I liked the fluid lines of the design.  It was pleasing,','','',0,67,'Design',270,'2009-07-13 00:56:10','2009-07-13 00:56:10',NULL),(246,'','This is most unique one of the bunch\r\n','','',0,66,'Design',234,'2009-07-13 09:30:55','2009-07-13 09:30:55',NULL),(247,'','This is so cool love your explanations','','',0,66,'Design',275,'2009-07-13 09:46:19','2009-07-13 09:46:19',NULL),(248,'','Very nice design. I too wouldn\'t mind waiting for a bus under something like this','','',0,67,'Design',279,'2009-07-13 14:11:51','2009-07-13 14:11:51',NULL),(249,'','Nice use of natural materials and pleasing aesthetic.','','',0,67,'Design',281,'2009-07-13 15:09:56','2009-07-13 15:09:56',NULL),(250,'','i really think you should be winning this competition. there is a real honest beauty in this design','','',0,60,'Design',174,'2009-07-13 19:29:18','2009-07-13 19:29:18',NULL),(251,'','Check out the design by Future Systems (National Library of Prague )www.future-systems.com ','','',0,53,'Design',217,'2009-07-13 21:11:32','2009-07-13 21:11:32',NULL),(252,'','only if you can incorporate a place for advertisements, map and information...','','',0,67,'Design',217,'2009-07-13 21:23:14','2009-07-13 21:23:14',NULL),(253,'','Nice design, but it really isn\'t suited too well for cold, windy winter weather.','','',0,67,'Design',285,'2009-07-13 21:28:15','2009-07-13 21:28:15',NULL),(254,'','As zombies go, I think this one is particularly well reasoned and considered. Perhaps these zombie stops could be installed without prior notice, it would be interesting to see the faces of the commuters when they arrive on Monday morning to find their stop replaced by The Undead... They might be shocked but they\'ll appreciate the facilities :)','','',0,66,'Design',230,'2009-07-13 22:02:36','2009-07-13 22:02:36',NULL),(255,'','I really like the look. but it needs wi-fi, Lan, and cell phone charging ports. Plus, a heater built into ceiling to keep us warm in winter. ','','',0,67,'Design',292,'2009-07-14 16:27:29','2009-07-14 16:27:29',NULL),(256,'','Love the Theme as I too am a Ute. but it just doesn\'t feel right. Not sure if it is Maintance free and will the red fade?','','',0,42,'Design',292,'2009-07-14 16:29:18','2009-07-14 16:29:18',NULL),(257,'','very ugly','','',0,66,'Design',292,'2009-07-14 16:30:36','2009-07-14 16:30:36',NULL),(258,'','to expensive to build not functional','','',0,59,'Design',292,'2009-07-14 16:31:31','2009-07-14 16:31:31',NULL),(259,'','I like it add LAN, wifi, and cell ph charging port. and it will be perfect','','',0,47,'Design',292,'2009-07-14 16:33:34','2009-07-14 16:33:34',NULL),(260,'','It looks really interesting. A shape that would work well all over SLC. But there is not much discription on features. Add LAN and wi-fi and it woudl be perfect.','','',0,56,'Design',292,'2009-07-14 16:35:23','2009-07-14 16:35:23',NULL),(261,'','doesn\'t respond to the breif...','','',0,59,'Design',293,'2009-07-14 17:49:35','2009-07-14 17:49:35',NULL),(262,'','as requested, some observations.   using modular design for such a project is a noble idea, but what is the module you have used? it looks like this design is divisible into 3 parts, no more.   the project entitled \'flexible bus stop\' is a much better example of workable modular design. \r\n\r\nAlso, why concrete.   no explanation, and not the most ecologically sound choice for small bus shelters.   high energy input, low recycling potential, and structurally unnecessary at this scale.\r\n\r\nshop would only be necessary at major hubs, and should be more open. it is a commercial enterprise and should be visible to customers.\r\n\r\nyou say the materials are somewhat cold looking, but you picked them. you are creating your own problems unfortunately, which is the opposite of what architecture is about. this is the biggest downfall for me.   also, is the crimson painted on, or is it an integrated coating on metal panels, for instance. if its paint, it will erode and require a lot of maintanance.   i personally don\'t like the colours, but that is just a personal opinion.\r\n\r\nsaying wifi is available isnt necessarily a bad thing, but who cares. its not a design concern, and anyone can say it, you know. every design here could have wifi,big whoop.\r\n\r\nticket vending machine is a good idea, but should not be incorporated into a concrete structure. once the concrete is set, thats it, no upgrades without demolition.\r\n\r\ni hope this helps, don\'t mean to be harsh, because there are a LOT worse designs doing a whole lot better, so maybe if you work up something new you might get lucky, or indeed respond to these points with vigour.','','',0,65,'Design',226,'2009-07-15 02:07:57','2009-07-15 02:07:57',NULL),(263,'','wilhelm, i was never getting personal, but just have very strong feelings regarding the real world problems facing architecture.   The blind comments about my architectural ability and expertise come across as very unprofessional.  There is more to design than aesthetics. Designers are duty bound to solve problems, not contribute to them, and that is why i made these points. I do not doubt that you have ability, especially in aesthetics, but I asked you about the realities of construction economics to see if there was more here than an image. i looked at your website to see where you were coming from, and you have a lot of ability as a visualist. Maybe more so than as a designer in my opinion, so good luck with the movie projects. But if you are considering a future in design i would recommend you read a book called \'cradle 2 cradle\' by William McDonough. It could help to add real substance to what you create. and try not to get angry with critics.   criticism is the key to improving quality.','','',0,53,'Design',226,'2009-07-15 02:32:01','2009-07-15 02:32:01',NULL),(264,'','Great! Its got LAN and WI-Fi :) And a nice little screen that says when the buses are arriving and gives news snippets, weather etc','','',0,56,'Design',184,'2009-07-15 05:27:31','2009-07-15 05:27:31',NULL),(265,'','Very nice inviting bus stop.  I like that it is set at an angle so that you can view on coming traffic.','','',0,67,'Design',304,'2009-07-15 13:42:50','2009-07-15 13:42:50',NULL),(266,'','The floor plan is implying that the bus stop is facing away form the on coming bus traffic...','','',0,67,'Design',217,'2009-07-15 14:08:11','2009-07-15 14:08:11',NULL),(267,'','Many thanks for your feedback. With regards the staffed shop, the intentions are to deter vandalism and provide a stepchange in passenger facilities (e.g. advice on the right tickets, help during service disruption). I admit to being uncertain whether it is entirely necessary - perhaps a mobile catering van could serve passengers in the morning peak? I\'ve seen it happen at a local railway station.\r\n\r\nTo clarify, the wall structure is formed from: 1.75m concrete, 1.75m glass, 1.5m glass doors and 1.5m coloured (all 3m high). Each section uses a combination of these e.g. the central waiting area uses 4 concrete panels, 4 glass and 4 doors. Larger order quantities (e.g. for other stops) of these panels may lead to bulk-buying economies. I will certainly consider the use of curtain walls to prevent damage, and perhaps shuttered concrete may be more appealing visually.\r\n\r\nRegarding the coloured finishes, some good points have been made. Paint is perhaps most practical, since most materials will eventually deteriorate (e.g. discolouration, graffiti) and need refreshing - paint seems a sensible option since it can be covered and replaced with different colours in line with the fashion at the time.\r\n\r\nI will revise the design over the next few weeks, and I appreciate the comments, keep them coming. I\'m hoping to study Urban Studies and Planning at Uni in October, and this exercise could prove quite useful in gauging and dealing with public opinion...','','',0,65,'Design',230,'2009-07-15 19:20:10','2009-07-15 19:20:10',NULL),(268,'','Wonderful design and am glad to have had a chance to say so!!','','',0,67,'Design',310,'2009-07-16 19:02:00','2009-07-16 19:02:00',NULL),(269,'','Good use of technology, but something this nice would get defaced / destroyed quickly in most American cities.','','',0,25,'Design',311,'2009-07-16 19:20:11','2009-07-16 19:20:11',NULL),(270,'','We need some perspective here.','','',0,16,'Design',311,'2009-07-16 19:21:31','2009-07-16 19:21:31',NULL),(271,'','Beautiful, but too expensive to be practical. Keep it up.','','',0,69,'Design',311,'2009-07-16 19:22:07','2009-07-16 19:22:07',NULL),(272,'','Interesting for a warm-climate location, but the lack of walls would not suit the northern half of the United States -- that winter wind is cold.','','',0,3,'Design',311,'2009-07-16 19:23:28','2009-07-16 19:23:28',NULL),(273,'','What about moving some bus stops to locations directly under real trees? Good ideas here!','','',0,22,'Design',311,'2009-07-16 19:25:56','2009-07-16 19:25:56',NULL),(274,'','More seating needed. Good shape for cutting the wind!','','',0,36,'Design',311,'2009-07-16 19:27:01','2009-07-16 19:27:01',NULL),(275,'','Practical, inexpensive, and highly customizable. Love it!','','',0,40,'Design',311,'2009-07-16 19:29:58','2009-07-16 19:29:58',NULL),(276,'','This would go well as a decorative stop (outside an art museum or something of the sort) but the cost would most likely be prohibitive. Very interesting!','','',0,20,'Design',311,'2009-07-16 19:31:13','2009-07-16 19:31:13',NULL),(277,'','I\'m loving the relatively inexpensive customization here!','','',0,62,'Design',311,'2009-07-16 19:33:34','2009-07-16 19:33:34',NULL),(278,'','\"Going Green\" is good anywhere nowadays. \'A\' for effort!','','',0,19,'Design',311,'2009-07-16 19:34:30','2009-07-16 19:34:30',NULL),(279,'','Low-cost, but it could stand to be a bit larger - just a little bit.','','',0,43,'Design',311,'2009-07-16 19:35:45','2009-07-16 19:35:45',NULL),(280,'','Putting a commercial interest inside a busy transit stop is a WONDERFUL idea! Think \'airport terminal\' but less intrusive/expensive.','','',0,65,'Design',311,'2009-07-16 19:36:51','2009-07-16 19:36:51',NULL),(281,'','A tad bit messy/crowded.','','',0,68,'Design',311,'2009-07-16 19:37:55','2009-07-16 19:37:55',NULL),(282,'','Impractical but GREAT as a \"special stop\" somewhere.','','',0,56,'Design',311,'2009-07-16 19:39:11','2009-07-16 19:39:11',NULL),(283,'','Simple and efficient. Good.','','',0,9,'Design',311,'2009-07-16 19:39:51','2009-07-16 19:39:51',NULL),(284,'','Nice idea, fountains are always popular. There might be maintenence issues given the extreme climate of the location.','','',0,19,'Idea',230,'2009-07-16 22:28:03','2009-07-16 22:28:03',NULL),(285,'','I don\'t think zombies are suppose to be pretty are they?','','',0,66,'Design',275,'2009-07-17 14:12:21','2009-07-17 14:12:21',NULL),(286,'','I think its a very nice artwork, but Frank Llloyd Wright\'s philosophy is to have designs harmonizing with the existing site. This design can\'t be called \"inspired by Frank Lloyd Wright\" if it ignores that crucial aspect. \r\n\r\nThe background isn\'t even the same, neither is the shape of the curved road. ','','',0,67,'Design',316,'2009-07-17 16:07:36','2009-07-17 16:07:36',NULL),(287,'','nice artwork, I can tell you spent a lot of time on it. What program did you use? ','','',0,69,'Design',316,'2009-07-17 16:12:14','2009-07-17 16:12:14',NULL),(288,'','are you sure the fins would work??\r\n\r\nanyways very creative','','',0,69,'Design',316,'2009-07-17 16:12:50','2009-07-17 16:12:50',NULL),(289,'','Reminds me of that show \"monster house\". \r\n\r\n','','',0,63,'Design',316,'2009-07-17 16:15:34','2009-07-17 16:15:34',NULL),(290,'','Its nice, but i wonder if the solar panels would work. \r\n\r\nGood luck on your future endeavors! ','','',0,68,'Design',316,'2009-07-17 16:17:26','2009-07-17 16:17:26',NULL),(291,'','very creative! \r\n\r\n','','',0,66,'Design',316,'2009-07-17 16:19:20','2009-07-17 16:19:20',NULL),(292,'','except it looks like it is taking up too much space, and blocking the paths of the students. Also, one of the fingers is blocking the path of the bus. There may be issues of the lack of headroom and accessibility. ','','',0,66,'Design',316,'2009-07-17 16:21:46','2009-07-17 16:21:46',NULL),(293,'','Good luck in your studies!! \r\n\r\nI have to agree with kavbar. My philosphy is a bus stop should just be a bus stop. Everything else could be put besides the bus stop if needed, or could already be existing inside the university, which is located about 15 meters from the bus stop. \r\n\r\nIf I was to revise this, I would first read up more on your favourite architects and their design philosophy, basic concepts of architecture, etc. Good luck!','','',0,65,'Design',316,'2009-07-17 16:35:37','2009-07-17 16:35:37',NULL),(294,'','This is probably my favourite design. \r\n\r\nExcept it seems a bit too big, and it doesn\'t look like the existing columns can take the TENSION load that results from the addition (concrete is only good at compression). Plus what about the snowfall and someone climbing on top. \r\n\r\nAnyways, I like how you think outside the box and gave this 5stars. ','','',0,62,'Design',316,'2009-07-17 16:39:17','2009-07-17 16:39:17',NULL),(295,'','what program did you use?','','',0,59,'Design',316,'2009-07-17 16:42:09','2009-07-17 16:42:09',NULL),(296,'','Its simple, and hard for me to find any flaws. But doesn\'t seem to have any exceptional points either. I gave it 4 stars. ','','',0,60,'Design',316,'2009-07-17 16:43:30','2009-07-17 16:43:30',NULL),(297,'','It seemed like you took all the requirements of this bus stop and tried to meet all of them. Its a good approach, but there are some subjective requirements that are more important and not listed, such as aethestics, originality, etc. ','','',0,58,'Design',316,'2009-07-17 16:46:08','2009-07-17 16:46:08',NULL),(298,'','yay. ','','',0,57,'Design',316,'2009-07-17 16:46:36','2009-07-17 16:46:36',NULL),(299,'','creative idea, but why does the size have to be flexible? ','','',0,61,'Design',316,'2009-07-17 16:52:14','2009-07-17 16:52:14',NULL),(300,'','Nice artwork. But why?','','',0,56,'Design',316,'2009-07-17 16:52:53','2009-07-17 16:52:53',NULL),(301,'','good luck on your future endeavors!','','',0,55,'Design',316,'2009-07-17 16:53:28','2009-07-17 16:53:28',NULL),(302,'','its nice, but don\'t you think the seats are too small? also is there enough headroom, and wheelchair accesibility? Why is it located so far away from the bus? ','','',0,54,'Design',316,'2009-07-17 16:54:28','2009-07-17 16:54:28',NULL),(303,'','Its nice artwork, but what materials will be used to take live and dead loads? \r\n\r\nI\'m particulary worried about people tripping over the bike poles, the strength of the bike poles, and people abandoning their bikes on the bike poles. ','','',0,53,'Design',316,'2009-07-17 16:58:13','2009-07-17 16:58:13',NULL),(304,'','I have to agree with kavbar. We think rather alike, looking past the initial aethestics. \r\n\r\nAnyways I\'m done with my comments for now. Hope you don\'t take it personally. It looks really good on the computer. ','','',0,53,'Design',316,'2009-07-17 17:01:30','2009-07-17 17:01:30',NULL),(305,'','\"does the women on the poster annoy you?\" \r\n\r\n-Personally I don\'t think great architectural works should have big ads on them, but that\'s just my personal opinion. I\'m sure there are exceptions. ','','',0,65,'Design',316,'2009-07-17 17:53:58','2009-07-17 17:53:58',NULL),(306,'','Reminds me of cell phones. They keep on adding more and more features to the cell phones to tempt you to use new ones, as well as to make the old ones become obsolete quicker. ','','',0,52,'Design',316,'2009-07-17 18:06:35','2009-07-17 18:06:35',NULL),(307,'','I think that\'s a restuarant called \"Bus Stop Cafe\", not a government bus stop. ','','',0,20,'Idea',316,'2009-07-18 01:37:50','2009-07-18 01:37:50',NULL),(308,'','again great points, cheers. the structural strategy for this design is a diagram for the time being, an ideological concept, as to go beyond that would be impossible without an engineer\'s survey.   Indeed, the columns nearer the street would be under compression due to the cantilever, and those at the back would be in tension, and depending on an engineer\'s recommendation might require reinforcing.   ideally over 75% of the roof\'s loading would be in the solar system directly over the columns to minimise this problem.   i forgot to mention how the snow would be dealt with too, sorry.   there are only really 2 ways to go, a very steep pitch or to prevent snow from settling at all. i went with the latter.   the roof box would be lined with heating elements similar to those on the rear windshield of a car, immediately melting any falling flakes, allowing them to drain off.   the small amount of power necessary for this would also come from the solar generator.  thanks Critique, for the advice and the support.','','',0,62,'Design',174,'2009-07-18 02:01:21','2009-07-18 02:01:21',NULL),(309,'','i think the flexible size is for a citywide bus stop system.   the busier a given stop, the more modules are applied.   .','','',0,61,'Design',174,'2009-07-18 02:10:00','2009-07-18 02:10:00',NULL),(310,'','i don\'t see the relevance of making a bus stop out of a vase.   its like trying to eat your dinner out of a shoe, it just doesn\'t make sense, but at least it\'s interesting.   i imagine you have some crazy dreams morgan.','','',0,20,'Design',226,'2009-07-18 02:19:33','2009-07-18 02:19:33',NULL),(311,'','It seems more like a great piece of art that could be placed on campus for asthetic reasons...but it doesn\'t seem to meet the design requirements.  The function of a bus stop is to protect the user and make them comfortable while they wait for the bus.','','',0,69,'Design',140,'2009-07-18 04:39:29','2009-07-18 04:39:29',NULL),(312,'','For a bus stop, it\'s a little overboard there is a fine line between function and what looks good, I would say its a little to far on the asthetic side of things.  This will be for students mostly...maybe integrate some colors at least from the U and make it safer..those bike racks look like a safety hazard.','','',0,53,'Design',140,'2009-07-18 04:47:56','2009-07-18 04:47:56',NULL),(313,'','intergalactic planetary!!!!!!!','','',0,55,'Design',140,'2009-07-18 04:49:39','2009-07-18 04:49:39',NULL),(314,'','Park benches and bike racks are cheaper and acheive the same thing as this design.','','',0,43,'Design',140,'2009-07-18 04:59:28','2009-07-18 04:59:28',NULL),(315,'','It would be a bloody greenhouse in the summer!! A little confusing..the pictures don\'t show as much as want to see.','','',0,54,'Design',140,'2009-07-18 05:02:11','2009-07-18 05:02:11',NULL),(316,'','That chick for sure annoys me.  She has nice lips though ha ha.  Keep at it...Remember it\'s a bus stop...','','',0,65,'Design',140,'2009-07-18 05:05:45','2009-07-18 05:05:45',NULL),(317,'','Does the Zombie eat people? I bet verizon gets reception even in this Dead Zone ha ha yeah stupid joke.  It\'s late and I\'m bored.','','',0,66,'Design',140,'2009-07-18 05:12:40','2009-07-18 05:12:40',NULL),(318,'','But really who is ever going to build this? I can see it now...Welcome to the business loop of the University of Utah here is the bus stop...people would wonder what kind of school this really is.','','',0,66,'Design',140,'2009-07-18 05:14:30','2009-07-18 05:14:30',NULL),(319,'','its not a bus stop, its a cartoon of a zombie photoshopped onto a photo of a footpath, and it is a bit of an insult to all of the competitors who made a genuine effort ','','',0,66,'Design',226,'2009-07-18 19:31:57','2009-07-18 19:31:57',NULL),(320,'','it\'s not a design, it\'s two designs.   why?   i can see a lot of problems, with both designs, and you have made no attempt to explain either of them, so i just can\'t vote for them.   i\'ll hold off voting to see if you get around to explaining the reasons behind the the designs...','','',0,71,'Design',226,'2009-07-18 19:37:48','2009-07-18 19:37:48',NULL),(321,'','Once again thank you for the comments. I understand your points about the shop being perhaps too much. It would need to serve more than just bus stop users to be viable, and attract custom from across the university. Currently in the form of a newsagent, it probably won\'t. When I revise the design I will use a more flexible set-up for retail provision. And the adverts (and the woman gazing wistfully towards a better tomorrow) will stay, since they generate revenue which can be reinvested into the bus service.','','',0,65,'Design',230,'2009-07-18 20:01:12','2009-07-18 20:01:12',NULL),(322,'','I think you will make a good architect in the future. Very imaginative!','','',0,20,'Design',316,'2009-07-19 04:06:17','2009-07-19 04:06:17',NULL),(323,'','what an ugly design','','',0,67,'Design',327,'2009-07-19 07:24:03','2009-07-19 07:24:03',NULL),(324,'','very elegant design','','',0,53,'Design',330,'2009-07-19 07:37:49','2009-07-19 07:37:49',NULL),(325,'','the usage is ok i think, there is also enough place for more funktions','','',0,53,'Design',330,'2009-07-19 07:38:59','2009-07-19 07:38:59',NULL),(326,'','there is not really a design shape, i think a turtle could be the best model for this idea :-)','','',0,67,'Design',331,'2009-07-19 07:44:48','2009-07-19 07:44:48',NULL),(327,'','Very original design! This concept would actually cause interest in mass transit and attract people to use mass transit. This is genius.Not just another boring shelter. Being built of recycled materials and reuse of the rainwater is exactly what is being preached in the green movement that we are presently promoting. This will definitely help promote the use of mass transit which is what this is all about. Awesome!!','','',0,66,'Design',335,'2009-07-19 14:45:13','2009-07-19 14:45:13',NULL),(328,'','I chose the geometry of salt to embody the site context of being in a drying salt lake valley.  Also the cubic formations lend themselves nicely to indoor and outdoor seating, reclined back support, tilted monitors and also visual interest.  It could be made of Sheets of HTPE Plastic and Aluminum which are recyclable and easily replaced if damaged.','','',0,56,'Design',184,'2009-07-19 21:16:03','2009-07-19 21:16:03',NULL),(329,'','your right steve. the idea was to have uniformity within the system without being restricted to one size of a stop...some stops require more or less coverage depending on the specific location.','','',0,61,'Design',204,'2009-07-20 19:39:57','2009-07-20 19:39:57',NULL),(330,'','Very cool design!  People will go out of their way just to say they used this bus stop. If selected, this will definitely become a top tourist attraction! Great for photos as well.  Allen','','',0,66,'Design',345,'2009-07-20 22:46:16','2009-07-20 22:46:16',NULL),(331,'','very nice.','','',0,73,'Design',217,'2009-07-21 04:50:04','2009-07-21 04:50:04',NULL),(332,'','This bus-stop was designed to send a visual message to the bus drivers.. so they can stop at the right place to pick up the pasengers.\r\n\r\nThe design that forced the bus door to be aligned to the portal of the bus-stop to help controll and manage people to form a line to abored the bus. \r\n\r\nIn the long-run more people will exit to the rear of the bus, createing a smoother flow of people movement.\r\n\r\n','','',0,60,'Design',217,'2009-07-21 05:19:39','2009-07-21 05:19:39',NULL),(333,'','AWESOME','','',0,66,'Design',349,'2009-07-21 11:21:48','2009-07-21 11:21:48',NULL),(334,'','I love zombies!!','','',0,66,'Design',352,'2009-07-21 12:14:00','2009-07-21 12:14:00',NULL),(335,'','This design is awesome!  It is a very creative usage of space, and I love the eco-friendliness.  I would like to ride the bus that goes along with this bus stop!  Kudos to its creator!  ','','',0,66,'Design',355,'2009-07-21 14:59:27','2009-07-21 14:59:27',NULL),(336,'','I can not lie...pretty amazing...though thriller 24/7 would make me happy that I own an Ipod. ','','',0,66,'Design',357,'2009-07-21 16:58:39','2009-07-21 16:58:39',NULL),(337,'','i did this in a studio 2 architecture class.  it was not designed for this competition, so i did not really think it would meet any of the requirements.  modeled in 3ds max 7.  standard lighting.','','',0,69,'Design',295,'2009-07-21 21:40:28','2009-07-21 21:40:28',NULL),(338,'','I don\'t think it\'s ugly actually, it looks fine for construction price. Just random and out of context. ','','',0,67,'Design',316,'2009-07-22 16:22:09','2009-07-22 16:22:09',NULL),(339,'','This design will be outdated in no time.\r\nLooking at it again I realised it already is: it looks like a 1960\'s disco dancing room. sad. Imagine this thing scattered all over your own town...','','',0,53,'Design',373,'2009-07-22 19:00:00','2009-07-22 19:00:00',NULL),(340,'','Critique... I should explain that this bus stop was designed 7 years ago for a competition in Bloomington Indiana. The drawings and model are from then. The design was for a non-site-specific bus stop that could be placed at many different locations throughout the city (I think they had 3). Although Wright is famous for designing for the site, many of his designs were re-used or adapted for other places (Price Tower for example). He even had a series of prefab houses in the last years of his life. I feel this design could easily be adapted to any site if needed. Thanks for your input.','','',0,67,'Design',235,'2009-07-23 03:33:13','2009-07-23 03:33:13',NULL),(341,'','Like the bike racks.','','',0,82,'Design',379,'2009-07-23 17:44:09','2009-07-23 17:44:09',NULL),(342,'','it is different and interesting for many, but surely could give children the scare and older people a heart attack.','','',0,66,'Design',375,'2009-07-24 09:34:19','2009-07-24 09:34:19',NULL),(343,'','great design, simple and functional.','','',0,83,'Design',375,'2009-07-24 09:45:32','2009-07-24 09:45:32',NULL),(344,'','Do Not Vote on this Design right now.  It has been replaced with someone else\'s design (as you may notice the duplicate) and we are working to fix the problem.  The other design can be fairly voted on.  Thanks - admin','','',0,56,'Design',1,'2009-07-24 17:38:03','2009-07-24 17:38:03',NULL),(345,'','The design issue has been fixed - this is the original design and people can vote on the design again.  Sorry about the inconvenience.','','',0,56,'Design',1,'2009-07-24 21:36:04','2009-07-24 21:36:04',NULL),(346,'','This isn\'t about accuracy necessarily - it is about active engagement and participation in the design process.  More than 400 people are registered on the site, so participation is not just limited to the designers, but also to those who vote and comment. Though some might be rating other designs down - as you suggest, people are also providing comment and feedback and I don\'t think what you are suggesting is necessarily the rule - but more the exception. People can also change their votes if they decide they like newer designs better, and designers can take the comments and criticisms of their peers and submit updated/newer designs - as many as they wish. ','','',0,22,'Idea',1,'2009-07-24 21:51:04','2009-07-24 21:51:04',NULL),(347,'','There\'s got to be a law against situating a structure there. ','','',0,83,'Design',316,'2009-07-24 22:21:33','2009-07-24 22:21:33',NULL),(348,'','Terrific--college students will appreciate','','',0,66,'Design',387,'2009-07-25 00:09:55','2009-07-25 00:09:55',NULL),(349,'','There isn\'t. It is very common in places that have a grass boulevard separating the street from the sidewalk or in newer sections of cities where the bus stops are planned into the development. ','','',0,83,'Design',285,'2009-07-25 00:53:07','2009-07-25 00:53:07',NULL),(350,'','How would the green roof retain water (primary purpose of a green roof), and stay green? How is the use of a material that requires large amounts of maintenance and replacement sustainable? Natural is not the same as sustainable. And your images don\'t match the glass you specify. Glazing with a 10% sunlight transmission is near black, and would create a dangerous place for people using the stop. On the plus side, I like the overall plan and form.','','',0,84,'Design',285,'2009-07-25 01:00:05','2009-07-25 01:00:05',NULL),(351,'','Other than throwing a green roof on top of it, how is this different than the bus stations in Curitiba, Brazil?\r\n\r\n@amberbski- I assume that this would work something like the bus stops in Curitiba. The elevated platform provides a step-less entry into the bus and each tube has a lift to facilitate wheelchair access. The reason for this configuration is that the tubes are also ticket stations, where you need a ticket to get onto the platform. This makes boarding the buses faster, and important issue with a system as large and well used as theirs. ','','',0,19,'Design',285,'2009-07-25 01:57:03','2009-07-25 01:57:03',NULL),(352,'','Sorry if my previous comment seems harsh. I don\'t intend it that way. Just constructive criticism, that\'s all. ','','',0,84,'Design',285,'2009-07-25 04:53:00','2009-07-25 04:53:00',NULL),(353,'','I dont think it has to retain everything, i have seen ancient buildings in Norway with such construction and its definitely done in the same way. The glazing i mention is not dark at all, try to google for it and its been use in japan, and its not dark at all. This is the link, http://www.treehugger.com/files/2004/10/pvtv_exterior_b.php i Hope this helps and get betetr rating :)','','',0,84,'Design',375,'2009-07-25 07:36:22','2009-07-25 07:36:22',NULL),(354,'','oh i forgot to mention bout the wood, yes the timber would be treated and stay as long as possible, im just stating the possibilities if things go wrong, thats all.','','',0,84,'Design',375,'2009-07-25 07:44:35','2009-07-25 07:44:35',NULL),(355,'','Very unusual and elegent bus stop.','','',0,84,'Design',393,'2009-07-25 07:50:16','2009-07-25 07:50:16',NULL),(356,'','Blutdrache, i think green roof\'s main priority is to provide insulation, and also let me rephrase the retain bit, if it does overflow, it would flow onto the small garden by the side.','','',0,84,'Design',375,'2009-07-25 07:59:43','2009-07-25 07:59:43',NULL),(357,'','This comment is very true, there was a design that was voted with 5* then after just 2 votes, its average is 3, hence the second vote must be 1*, which i think is very unfair cause compared to some of the other design, it was way ahead in feature.','','',0,22,'Idea',375,'2009-07-25 11:07:17','2009-07-25 11:07:17',NULL),(358,'','I see what you are saying with the glazing. I was confused because in standard glazing specifications glass with  a 10% transmittal is a very dark tint. As for the green roof, the amount of insulation that you would receive from the roof would undoubtedly be counteracted by the amount of glass, but really, in a bus stop it shouldn\'t matter much. I live in one of the coldest cities in the entire U.S. and our bus stops (when there is a shelter present) are little more than glass boxes, no hint of insulation. I\'m not saying a green roof is a bad idea, just that you shouldn\'t defend it the same way a green roof on an office building would be defended. In my opinion, it offers an opportunity to showcase the technology and the concept more than anything because it is so close to the ground and visible to so many people.','','',0,84,'Design',285,'2009-07-25 14:20:40','2009-07-25 14:20:40',NULL),(359,'','Wifi should not be optional.','','',0,84,'Design',399,'2009-07-25 14:31:36','2009-07-25 14:31:36',NULL),(360,'','I don\'t understand why the zombie is green.','','',0,66,'Design',399,'2009-07-25 14:34:39','2009-07-25 14:34:39',NULL),(361,'','Blutdrache - The amount of glasses wont counteract as it is a glaze that gives proper insulation to the shelter itself like how it is being used in Japan. It is not advertise widely yet but would hope to reach Europe soon. I understand bout the green roof, its my idea, we will see what the organizers would prefer.\r\n\r\nHobgoblin - I am saying its optional because it gives the organizer to choose their own preference. I do prefer it to be essential.','','',0,84,'Design',375,'2009-07-25 14:44:46','2009-07-25 14:44:46',NULL),(362,'','Reminds me of a trailer home, and the bike racks are a nice touch.','','',0,82,'Design',399,'2009-07-25 14:51:54','2009-07-25 14:51:54',NULL),(363,'','Modular has the word \'mod\' in it... that\'s cool.','','',0,61,'Design',399,'2009-07-25 14:59:15','2009-07-25 14:59:15',NULL),(364,'','Bus stop, wet day, she\'s there I say\r\nPlease share my umbrella\r\nBus stop, bus go, she stays love grows\r\nUnder my umbrella\r\nAll that summer we enjoyed it\r\nWind and rain and shine\r\nThat umbrella we employed it\r\nBy August she was mine','','',0,60,'Design',399,'2009-07-25 15:02:15','2009-07-25 15:02:15',NULL),(365,'','i like the fluidity, it must be great to work for FLW.','','',0,67,'Design',375,'2009-07-25 15:47:25','2009-07-25 15:47:25',NULL),(366,'','the competition is called next stop design, not 2002\'s stop designs.   why the regurgitation?','','',0,73,'Design',226,'2009-07-25 16:58:51','2009-07-25 16:58:51',NULL),(367,'','Just a few points. Blutdrache is right, natural does not mean sustainable.   tree bark and stones will not stay on a curved green roof because of gravity.   incorporating a system that would hold loose pebbles and bark shavings in place would probably be too elaborate and expensive for a repeatable bus stop system. that\'s why green rooves are usually comprised of grass.   the grass absorbs moisture controlling the flow of storm water, and grass roots bind the soil/base together.   no point building a cheap green roof if it doesnt do anything, and no point having an expensive one if it costs the city too much.  a grass roof is a noble gesture, but tree bark probably wont work here.  the curve would require that the timber go through a process of glu-lamination, adding to the cost, incorporating unnatural adhesives that could not be burned as you suggest due to potentially toxic chemicals in the glue.   the roof structure, being accessible, would need to be able to support 20-30 people on it at any given time, which is do-able given its arched form, but is a problem that you, as designer, introduced.  it just  creates problems for you and your client that don\'t need to be there, so making the roof accessible might need some justification.   as i mentioned to someone else, the wifi thing is irrelevant.   every design here could have it, so what? its not a design concern.   that glass is extremely expensive, way beyond the budget of a city run transit company, but at least you\'re looking forward.   also if it allows only 10% of light through it, it might be ok on the inside, but will appear dark from the outside, and will therefore be uninviting. It will be much like trying to see into a house through net curtains in the middle of the day, you wont see a thing.   finally, there are a number of assumptions that natural, old-fashioned construction techniques cost less.   they don\'t, and that\'s why they aren\'t used more, and this economic barrier is one of the main obstacles to the environmental movement.   but it looks quite nice and it got me thinking, so thanks for that.','','',0,84,'Design',226,'2009-07-25 17:33:12','2009-07-25 17:33:12',NULL),(368,'','that roof will not work.   fact.','','',0,72,'Design',226,'2009-07-25 17:51:23','2009-07-25 17:51:23',NULL),(369,'','kavbar - thanks for the comment, ill show you what im trying to experiment on for this design, its something i learnt during my holiday. I know you mention about gravity and glue being the problem to the roof design but looking at this methods, i beg to differ and would definitely try to convince you. If you look at the links i provided, http://s86.photobucket.com/albums/k120/naijiao/?action=view&current=DSC01439.jpg It is some traditional houses i saw. If you look at this roof detail http://s86.photobucket.com/albums/k120/naijiao/?action=view&current=DSC01435.jpg it somehow would work, tree barks, stones and soil/grass with some modification of course. It definitely can be pushed to a certain extend like this one. http://s86.photobucket.com/albums/k120/naijiao/?action=view&current=DSC01450.jpg If it does help for this old buildings, its something  i would definitely want to try and cooperate into the design\r\n\r\nThe roof is not really for human access though.\r\n\r\nAbout the glazing, this is the best picture i can find. http://www.gunda.co.za/solar/pv_tv_building_integrated.php It is not that bad and with its capability to project tv commercial on the glazing, it would definitely be inviting.\r\n\r\nI did assume abit on the traditional method would be cheaper due to using just holes/poles and nails, lol. It is something that i would need to reconsider.\r\n\r\nThanks for the comment.\r\n','','',0,84,'Design',375,'2009-07-25 18:13:56','2009-07-25 18:13:56',NULL),(370,'','the link does not seem to work, try this one. http://s86.photobucket.com/albums/k120/naijiao/\r\nlook at the first 3 pictures\r\n1] The roof detailing which has tree bark, stones and soil/grass\r\n\r\n2] It can be pushed to that extent\r\n\r\n3] Those are the houses i mentioned that uses this method, if it can be use to protect againts the elements in the past, with some modification, it would definitely work.','','',0,84,'Design',375,'2009-07-25 18:17:10','2009-07-25 18:17:10',NULL),(371,'','i like the design, the only problems i have with it over all are, besides the interior of the arch, there is no protection from the weather which could become cumbersome if the inside of the arch was full of people and you have to stand outside.  i don\'t know how hard integrating a simple canvas cover in front of the arch to cover the shown benches would be, but i feel something would be better then nothing imho. ','','',0,84,'Design',404,'2009-07-25 21:18:03','2009-07-25 21:18:03',NULL),(372,'','milky - integrating an external shading would definitely not be a problem, the design can definitely be modified, however, stay away from the canvas, it just takes the aesthetic feature away. :)','','',0,84,'Design',375,'2009-07-25 21:34:22','2009-07-25 21:34:22',NULL),(373,'','A crowd of people waiting inside the bus stop. A truck driver takes his eyes off the road for 1 second to answer a cell phone call. Goes off the path by only 10 inches, crashing into the bus stop sending glass shards flying everywhere. I think it is great that you are promoting public transit, but we must consider safety as well. ','','',0,83,'Design',316,'2009-07-26 03:44:23','2009-07-26 03:44:23',NULL),(374,'','Critique, I live in a city that has dozens of bus stops located street side, it is nothing new. I have used bus stops located street side in cities all across North America. I understand your argument, but based on your logic, sidewalks shouldn\'t be on the sides of roads, they should be set back ten feet. ','','',0,83,'Design',285,'2009-07-26 04:08:07','2009-07-26 04:08:07',NULL),(375,'','I\'m more worried about people rating their own designs high multiple times, or people rating other designs low multiple times. Like hacking the high scores of a java game, except harder to detect. ','','',0,22,'Id