0521292/, here is a picture of a bus stop and a bike lane but the stop isn\'t at the edge of the street http://www.flickr.com/photos/jeffyoungstrom/2520998372/ and here is a set of guidelines that are used by the city of Chicago http://www.activelivingresources.org/assets/chicagosbikelanedesignguide.pdf page 29 is a good example. Oh and here is one more picture of a stop that is street side, in Salt Lake City http://www.flickr.com/photos/sterkworks/2400036788/. I hope this clears things up some. ','','',0,83,'Design',285,'2009-07-26 07:18:07','2009-07-26 07:18:07',NULL),(384,'','Thanks, there is a tiny ramp but its not the best at all, it is more noticeable on the minimal design. Look at the second page.','','',0,84,'Design',375,'2009-07-26 07:30:43','2009-07-26 07:30:43',NULL),(385,'','Its pretty cool as a concept, even better with the \'web-by human\' :)','','',0,56,'Design',375,'2009-07-26 13:54:50','2009-07-26 13:54:50',NULL),(386,'','Best thing here! ','','',0,59,'Design',408,'2009-07-26 17:06:42','2009-07-26 17:06:42',NULL),(387,'','Ah if it is on a raised platform that is not the bikelane then it should be fine. From your first drawing it looks like it is on a bike lane. \r\n\r\n ','','',0,83,'Design',316,'2009-07-26 17:48:05','2009-07-26 17:48:05',NULL),(388,'','Elegant design, but I agree that the roof might topple over without sufficient counterbalance. Interesting colour scheme, quite vibrant.','','',0,72,'Design',230,'2009-07-26 21:02:58','2009-07-26 21:02:58',NULL),(389,'','Very good point. Tactical voting is not in the spirit of the competition.','','',0,22,'Idea',230,'2009-07-26 21:13:33','2009-07-26 21:13:33',NULL),(390,'','Quite unacceptable on the part of the bus driver - probably illegal too.','','',0,24,'Idea',230,'2009-07-26 21:14:51','2009-07-26 21:14:51',NULL),(391,'','Good point, how relevant would it be though for the university stop? It sounds as if it would see most use during standard working hours. If one tried to relieve themselves in t