gy over green roof is a very informed decision too. the detail will cost money, but unlike other crazy designs it\'s more than do-able. this is one of the few designs in this competition that actually is a bus stop, and though its not my style and may not be the \'next\' stop design, i can fully appreciate the maturity of the designers\' approach.','','',0,88,'Design',226,'2009-07-28 19:17:59','2009-07-28 19:17:59',NULL),(421,'','Looks like the bus is on the wrong side of the street!','','',0,56,'Design',415,'2009-07-28 22:22:13','2009-07-28 22:22:13',NULL),(422,'','Sorry I have been doing to much International Design in Singapore and Qatar :)','','',0,56,'Design',184,'2009-07-29 02:29:22','2009-07-29 02:29:22',NULL),(423,'','The budget is purposefully not set so creativity is not inhibited.......','','',0,26,'Idea',5,'2009-07-29 03:38:35','2009-07-29 03:38:35',NULL),(424,'','Are you serious? My small children would not even go near this.','','',0,66,'Design',471,'2009-07-29 12:46:08','2009-07-29 12:46:08',NULL),(425,'','bad. total pastiche design. try designing like you give a damn!','','',0,88,'Design',474,'2009-07-29 13:50:21','2009-07-29 13:50:21',NULL),(426,'','looks like every bus stop ever designed and built in the UK. trad and unoriginal.','','',0,89,'Design',474,'2009-07-29 13:51:16','2009-07-29 13:51:16',NULL),(427,'','more Bruce Goff or Bart Prince then FLW, but a decent effort none the less.','','',0,67,'Design',474,'2009-07-29 13:52:31','2009-07-29 13:52:31',NULL),(428,'','nice.','','',0,52,'Design',474,'2009-07-29 13:53:41','2009-07-29 13:53:41',NULL),(429,'','a decent attempt.','','',0,85,'Design',474,'2009-07-29 13:54:18','2009-07-29 13:54:18',NULL),(430,'','errr....it would look great in Disney Land.','','',0,38,'Design',474,'2009-07-29 13:54:51','2009-07-29 13:54:51',NULL),(431,'','like it.','','',0,56,'Design',474,'2009-07-29 13:55:20','2009-07-29 13:55:20',NULL),(432,'','this leaves my cold...awful attempt at a future-esque hi-tec aesthetic.','',