r than just being more street noise residents need to filter out. ','','',0,88,'Design',478,'2009-07-29 15:51:59','2009-07-29 15:51:59',NULL),(444,'','I like the way the bus stop was designed because there are the sides that enclose the bus stop. I am glad there is a seat because there are people who get tired of waiting and need a rest from all that standing. The bus schedule is very handy when anyone wants to know when the next bus will come. And it is great that there is a digital sign saying when the next bus is coming, it helps when you are waiting.','','',0,89,'Design',480,'2009-07-29 16:30:47','2009-07-29 16:30:47',NULL),(445,'','Very nice concept. What about accessibility?','','',0,95,'Design',454,'2009-07-29 16:37:38','2009-07-29 16:37:38',NULL),(446,'','It\'s very simple and straight to the issue of mixing modern and retro style of NY metro','','',0,89,'Design',483,'2009-07-29 17:08:23','2009-07-29 17:08:23',NULL),(447,'','Simple, elegant, tasteful, classy, pleasant, functional, affordable, low-maintaince and attractive.  This is the perfect design.','','',0,88,'Design',463,'2009-07-29 17:28:05','2009-07-29 17:28:05',NULL),(448,'','I like the digital display that says when the next bus will arrive.  I think it is very practical and useful.  I think the seats are also a great idea because not enough bus stops have them.  I like the glass design because it lets in light and does not make the space look dark.  With glass it is easy to see an oncoming bus.  The schedule is a great idea.  ','','',0,89,'Design',484,'2009-07-29 17:28:18','2009-07-29 17:28:18',NULL),(449,'','My favorite one so far!','','',0,88,'Design',486,'2009-07-29 21:09:19','2009-07-29 21:09:19',NULL),(450,'','Good news: having taken on board previous comments, I have created a substantially revised design, under the title of \'More than a bus stop?\'. The woman in the poster is sadly no more, but the rest of the design further develops the modular structure and addresses key concerns.','','',0,65,'Design',230,'2009-07-29 22:01:14','2009-07-29 22:01:14',NULL),(451,'','something fresh for a change.nice,modern yet classic design.doesn\'t try to be flamboyant.quite the contrary,it meets the needs for elderly & disable.kudos. ','','',0,89,'Design',461,'2009-07-29 22:11:23','2009-07-29 22:11:23',NULL),(452,'','Really disappointed to hear your ideas are not original to yourself. Maybe everyone else should be allowed to resubmit, based on new knowledge?','','',0,96,'Design',418,'2009-07-29 23:10:06','2009-07-29 23:10:06',NULL),(453,'','just curious, hand drawn?','','',0,83,'Design',204,'2009-07-29 23:10:34','2009-07-29 23:10:34',NULL),(454,'','Thank you for your comment. In response, it is surely sensible to gauge reaction - that way faults can be found which might not otherwise have been noticed and develop a more robust design. For instance, in the first model it did not come across clearly that the design was modular - I have put more thought into it this time. The ideas are still original - as an example no other design yet has provision for staffed retail facilities.','','',0,96,'Design',230,'2009-07-29 23:23:40','2009-07-29 23:23:40',NULL),(455,'','An comment was that Prince Charles might like it, presumably a bad thing. I think that if Charles might like it, it must be first rate. I am most impressed by the graceful swooping curves of the roof and the ornamental nature of the columns, though they could be more substantial. I also liked one comment that said the design would make us feel like gods, not like rats - a nice allusion to a famous comment about Penn Station after it was torn down and replaced by the hulk that\'s there now. One used to enter Penn Station like a god, and now you enter it like a rat - that\'s the essence of the quote. And I see someone else used the word \"pastiche.\" Where might that person be coming from!!!','','',0,88,'Design',488,'2009-07-30 00:49:41','2009-07-30 00:49:41',NULL),(456,'','tradarch - you can submit as much design as you want, thats the information i got from the organizers.','','',0,96,'Design',375,'2009-07-30 01:00:56','2009-07-30 01:00:56',NULL),(457,'','Great Bus Stop for the Olympics.','','',0,88,'Design',399,'2009-07-30 01:26:14','2009-07-30 01:26:14',NULL),(458,'','I like wood.','','',0,84,'Design',399,'2009-07-30 01:27:39','2009-07-30 01:27:39',NULL),(459,'','I like mobile catering, I am always hungry.','','',0,96,'Design',399,'2009-07-30 01:28:48','2009-07-30 01:28:48',NULL),(460,'','Nice Bus.','','',0,56,'Design',399,'2009-07-30 01:30:44','2009-07-30 01:30:44',NULL),(461,'','why adding stairs - this keeps it from being barrier-free...\r\n\r\nalso, have a look at the new bus stops in San Francisco, they also use solar energy to power the integrated electronic devices of the bus stop.','','',0,95,'Design',115,'2009-07-30 01:35:50','2009-07-30 01:35:50',NULL),(462,'','I like dinosaurs.','','',0,67,'Design',399,'2009-07-30 01:37:36','2009-07-30 01:37:36',NULL),(463,'','One word... Flashback, man. Oh thats two words.','','',0,3,'Design',399,'2009-07-30 01:40:59','2009-07-30 01:40:59',NULL),(464,'','I like Gas Stations. Actually I like the smell of gasoline.','','',0,62,'Design',399,'2009-07-30 01:44:32','2009-07-30 01:44:32',NULL),(465,'','I wish every bus was 2 minutes away. ','','',0,89,'Design',399,'2009-07-30 01:47:52','2009-07-30 01:47:52',NULL),(466,'','can i have this design to sell my toys in Disney?','','',0,88,'Design',472,'2009-07-30 02:17:13','2009-07-30 02:17:13',NULL),(467,'','in terms of the environment, this would be harming too many trees.. it goes against the whole design. i <3 trees','','',0,84,'Design',472,'2009-07-30 02:34:29','2009-07-30 02:34:29',NULL),(468,'','i cant see the design','','',0,41,'Design',472,'2009-07-30 02:36:01','2009-07-30 02:36:01',NULL),(469,'','Proportional, friendly, and sensitive to the human scale. An honest and respectable entry. ','','',0,88,'Design',418,'2009-07-30 02:53:24','2009-07-30 02:53:24',NULL),(470,'','The design appears to be very functional, yet misses critical design elements.','','',0,89,'Design',418,'2009-07-30 02:57:02','2009-07-30 02:57:02',NULL),(471,'','Captain: Oh! Who lives in a pineapple under the sea? \r\nKids: SpongeBob SquarePants! \r\nCaptain: Absorbent and yellow and porous is he! \r\nKids: SpongeBob SquarePants! \r\nCaptain: If nautical nonsense be something you wish... \r\nKids: SpongeBob SquarePants! \r\nCaptain: Then drop on the deck and flop like a fish! \r\n','','',0,53,'Design',418,'2009-07-30 03:04:11','2009-07-30 03:04:11',NULL),(472,'','If it rains?','','',0,84,'Design',418,'2009-07-30 03:17:12','2009-07-30 03:17:12',NULL),(473,'','The design intent feels more like a highway rest stop than an intercity bus stop.','','',0,67,'Design',418,'2009-07-30 03:21:38','2009-07-30 03:21:38',NULL),(474,'','The character leaning up against the structure further highlights the problem with stairs. It discourages people from going up them. Unfortunately, the enclosed waiting area feels cramped and could easily become messy. ','','',0,95,'Design',418,'2009-07-30 04:12:06','2009-07-30 04:12:06',NULL),(475,'','I enjoy the parallel relationship the artist makes between  people who ride the bus and zombies: they are nothing short of stupid, mindless, halfdead creatures with a proclivity for fattening food. But since the music selection was Michael Jackson, and not ROB ZOMBIE, I\'ll have to downgrade the design. Sorry, I really thought you were onto something.','','',0,66,'Design',418,'2009-07-30 04:25:23','2009-07-30 04:25:23',NULL),(476,'','How does every male voter not give this one 5 stars? They should have silicone seat cushions.','','',0,47,'Design',418,'2009-07-30 04:27:49','2009-07-30 04:27:49',NULL),(477,'','Although it lacks considerably in detailing, I do like the flow and circulation.','','',0,83,'Design',418,'2009-07-30 04:30:12','2009-07-30 04:30:12',NULL),(478,'','@mfritchie - not at all, some Sketchup, and some Photoshop with a Wacom Tablet. I really just did this competition as an excuse to play with some ideas I had for quick and nice presentation drawings (Photo-real renderings are getting old).','','',0,83,'Design',285,'2009-07-30 06:16:37','2009-07-30 06:16:37',NULL),(479,'','I don\'t really care if this comment costs me votes, that\'s not what everything is about. This is one of the worst designs on here. It does nothing to reflect the site, it has \"decorative\" design elements that would be more at home in an early 1980\'s Trump Hotel and Casino, and it has no vision as to what a future bus stop should be. The competition is called NEXT STOP, not last stop. \r\n\r\nNow as to why this design is currently the top rated and has received so many ratings in so short a time, well we would all probably like to have a website forum to post our designs on and have all of its members come vote for us, but we can\'t all do that. ','','',0,88,'Design',285,'2009-07-30 06:36:38','2009-07-30 06:36:38',NULL),(480,'','About that comment on having this posted on a forum, not real problem with that, but why not link to the main website rather than drive traffic through your design page? \r\n\r\nhttp://grandtradition.net/nextstopdesign-bus-stop-competition','','',0,88,'Design',285,'2009-07-30 06:41:59','2009-07-30 06:41:59',NULL),(481,'','there is always the planting programme, make one bus stop, plant 5 trees :). if it rains, you go into the bus stop, ill definitely incooperate some shading on the exterior that goes along the concept.','','',0,84,'Design',375,'2009-07-30 07:53:16','2009-07-30 07:53:16',NULL),(482,'','Why is it a traditional design if it uses modern building techniques? Doesn\'t it come off as fake?  \r\n\r\nIf your going to do a traditional design, why did you do one that is not of Utah traditions? \r\n\r\nWhy does the solar cells that you mentioned not shown as solar cells? \r\n\r\n\r\n\r\n','','',0,88,'Design',316,'2009-07-30 08:08:14','2009-07-30 08:08:14',NULL),(483,'','Also you said that it would blend in with the city, but its of a toally different style - why? \r\n\r\nPlus how would you keep the gold colored paint from fading? \r\n\r\nYour furnitures on your website is nice though. Good luck on your future business. ','','',0,88,'Design',316,'2009-07-30 08:12:43','2009-07-30 08:12:43',NULL),(484,'','It\'s functional. You even considered easy cleaning. Good job. Though it\'s not really visionary.   \r\n\r\nI give it 4 stars. ','','',0,89,'Design',316,'2009-07-30 08:53:08','2009-07-30 08:53:08',NULL),(485,'','I think it is well thought out, and the look is a lot better than the original. \r\n\r\nIf it was me, I\'d make it so the space can be even more flexible; the design can modular to the point where you can customize the size and whether the indoor or outdoor space is included. Otherwise, this bus stop would only be practical for busy locations. \r\n\r\nTradarch: that\'s the point of the contest. ','','',0,96,'Design',316,'2009-07-30 09:01:56','2009-07-30 09:01:56',NULL),(486,'','Also, most architects like to anchor their design to the site somehow, so that it only works for that specific site (or if it\'s a mass produced bus stop, that specific city). ','','',0,96,'Design',316,'2009-07-30 09:05:14','2009-07-30 09:05:14',NULL),(487,'','I rode the bus for over 2 years, until they canceled the line from my house to my school. This would have been amazing to have while waiting for the bus! I love the idea of the shaded seating area, plus the area to protect you from the elements if need be. The solar panels to help support the stop in a \"green\" way is awesome, too.','','',0,95,'Design',494,'2009-07-30 09:22:10','2009-07-30 09:22:10',NULL),(488,'','The model looks particularly welcoming at night, the arched shape lends itself well to feature lighting. It will be interesting to see how the wood will age - the colour will dull but it would match any trees or plants in the surroundings well. The only thing needing addressing is passenger information, but otherwise a good design, 4*.','','',0,84,'Design',230,'2009-07-30 11:22:49','2009-07-30 11:22:49',NULL),(489,'','In response, it should be possible to place the walls and posts in any combination to create the desired rooms and shelters. This is an important stop, so it has a waiting room. A smaller stop might only need 2 walls along the back, one on each side, and an exposed front, to create a simple shelter. Roofing and infill materials can be altered depending upon location.','','',0,96,'Design',230,'2009-07-30 12:08:07','2009-07-30 12:08:07',NULL),(490,'','it\'s a standard contemporary bus stop, but with expensive led displays.   not that this is a bad thing, but it\'s hardly inspirational. There is no real joy, which means it has to be almost perfectly detailed to get points, and because it is highly unlikely that the four thin poles that support the structure could support all of the cantilevering weight, it leaves this design wanting in my opinion.','','',0,89,'Design',226,'2009-07-30 14:09:55','2009-07-30 14:09:55',NULL),(491,'','i have to congratulate you on the maturity of your response, one or two others have simply told me i was wrong, which was a little arrogant.   just one thing to consider...unfortunately, in practise, just because you don\'t intend for the roof to accessed doesn\'t mean it wont be, so you have to consider that as architect.   if not, and some drunken baffoon falls and injures himself you will be sued.   but there are ways of dealing with that.  thanks for the links too, they were interesting.','','',0,84,'Design',226,'2009-07-30 14:22:15','2009-07-30 14:22:15',NULL),(492,'','a definite improvement, but i would suggest that the box be made of glass and nothing else, so that the structure, and the envelope read as distinctive elements, and the more chunky roof seems to just float above people.   check out the barcelona pavilion by mies, and the way that he seperated out the various elements of the building.   http://www.e-architect.co.uk/barcelona/jpgs/barcelona_pavilion_5.jpg        much better though.','','',0,96,'Design',226,'2009-07-30 14:33:56','2009-07-30 14:33:56',NULL),(493,'','oh, and tradarch, are you seriously declaring an opposition to architectural progress?   Do you seriously think that going back to the drawing board to improve a design is a bad thing?   By that logic, we would all still be living in caves.   Everything we do and are capable of doing is a result of previously gained knowledge.   It comes across as very limiting that you would suggest we do not reconsider what we have done before.   It is called \'bettering ourselves\'.   ','','',0,96,'Design',226,'2009-07-30 14:42:07','2009-07-30 14:42:07',NULL),(494,'','pricey.','','',0,94,'Design',226,'2009-07-30 14:44:34','2009-07-30 14:44:34',NULL),(495,'','tradarch, that\'s two comments of yours i have read now, and i have to say, your an idiot. ','','',0,66,'Design',226,'2009-07-30 14:48:16','2009-07-30 14:48:16',NULL),(496,'','sorry thewes, but you tried to defend this design by pointing out that it was designed 7 years ago, which seems quite contradictory to the point of the competition.   it is called \'next stop design\'.   also, you call this building organic but suggest the use of concrete shingles.   come on, seriously.','','',0,67,'Design',226,'2009-07-30 14:53:50','2009-07-30 14:53:50',NULL),(497,'','Most of the other designs look like they\'d be hard to maintain--that is to say, most of the other designs be a n expensive nightmare for the city to keep in good and safe condition.','','',0,88,'Design',500,'2009-07-30 16:26:44','2009-07-30 16:26:44',NULL),(498,'','Absolutely the best design. It makes you want to take the bus!','','',0,88,'Design',501,'2009-07-30 16:30:44','2009-07-30 16:30:44',NULL),(499,'','The artist was clearly having fun and I was clearly playing along. But I see your bigotry and angry tongue has slobbered on every submission here. The only guy you have given a pass was the college student that efeminately went back to redesign according to your angry comments. I don\'t know who you are, but leave me alone. I think the competition is great and enjoy seeing new ideas, whether they are serious submissions or not.','','',0,66,'Design',418,'2009-07-30 17:09:15','2009-07-30 17:09:15',NULL),(500,'','Gotta give points on originality! Details need refined, but could lead to an interesting result.','','',0,38,'Design',418,'2009-07-30 17:14:16','2009-07-30 17:14:16',NULL),(501,'','The canopy element is visually very strong, just not sure about the \"addition\". I especially like that this designer shed the posterboards and commercialism found on others.','','',0,73,'Design',418,'2009-07-30 17:19:55','2009-07-30 17:19:55',NULL),(502,'','tradarch: the way i saw the design was to be practical for a city. I felt the design elements suggested would create a large bus stop more like a house or a patio, much like many have been creating. Space on a city street is limited. \r\nkavbar: consulting structural engineers will easily produce this design, and LED lights are to display info which many ppl have told me they wished they had','','',0,89,'Design',232,'2009-07-30 21:44:13','2009-07-30 21:44:13',NULL),(503,'','but thank you both for ur comments, =)','','',0,89,'Design',232,'2009-07-30 21:44:44','2009-07-30 21:44:44',NULL),(504,'','Very nice. However, it reminds me of a window seats at a hip cafe.','','',0,97,'Design',217,'2009-07-30 23:02:22','2009-07-30 23:02:22',NULL),(505,'','excellent civilized and gracious design','','',0,88,'Design',509,'2009-07-30 23:46:00','2009-07-30 23:46:00',NULL),(506,'','tradarch, my comment was a reaction to you referring to all public commuters as \'nothing short of stupid, mindless, halfdead creatures with a proclivity for fattening food\'.   i find it ironic that you would make a statement such as this and then call me bigotted. it was a silly thing to say.   You question somebody for trying to improve themselves, and then congratulate someone for taking the piss.  But that\'s your decision. im glad you enjoy this design, truly, but dont presume to call hundreds of millions of people that you have never met \'stupid, mindless, halfdead creatures with a proclivity for fattening food\', and expect to be left alone.   Im not angered by what you said, just disappointed.','','',0,66,'Design',226,'2009-07-31 00:59:00','2009-07-31 00:59:00',NULL),(507,'','Thank you Ethan. Thats a good thought - window seats.:)','','',0,97,'Design',218,'2009-07-31 08:02:05','2009-07-31 08:02:05',NULL),(508,'','my type of design, really nice. :)','','',0,97,'Design',375,'2009-07-31 08:49:35','2009-07-31 08:49:35',NULL),(509,'','It\'s simple and functional...that\'s what good design is all about...A suggestion would be to help offset the electrical costs by incorporating some type of decorative solar panels....Otherwise, nicely done!!!','','',0,89,'Design',512,'2009-07-31 15:32:09','2009-07-31 15:32:09',NULL),(510,'','Vibrant and modern design, although perhaps prone to becoming dated? I like the use of colour and illumination - it\'s particularly eye-catching. Sensible construction methods too.','','',0,99,'Design',230,'2009-07-31 16:07:11','2009-07-31 16:07:11',NULL),(511,'','Very edgy, architecturally I like it a lot.','','',0,83,'Design',230,'2009-07-31 16:08:37','2009-07-31 16:08:37',NULL),(512,'','dinky','','',0,89,'Design',513,'2009-07-31 16:09:47','2009-07-31 16:09:47',NULL),(513,'','foreign','','',0,97,'Design',513,'2009-07-31 16:10:53','2009-07-31 16:10:53',NULL),(514,'','needs a better roof','','',0,67,'Design',513,'2009-07-31 16:11:24','2009-07-31 16:11:24',NULL),(515,'','WTF?!','','',0,53,'Design',513,'2009-07-31 16:11:46','2009-07-31 16:11:46',NULL),(516,'','old skool','','',0,88,'Design',513,'2009-07-31 16:12:04','2009-07-31 16:12:04',NULL),(517,'','barf','','',0,66,'Design',513,'2009-07-31 16:12:31','2009-07-31 16:12:31',NULL),(518,'','it came from the 70s','','',0,96,'Design',513,'2009-07-31 16:13:09','2009-07-31 16:13