lion by the way) however I opted for filled-in bases in response to a point made about upkeep and repair. For instance, if one of the smaller windows was damaged, it will be cheaper to replace than a floor to ceiling equivalent. The solid panels should help mitigate any \'greenhouse\' effect and so make cooling of the room a little more efficient.\r\nIn response to Tradarch kc, I absolutely do not appreciate being described as \'efeminate\'(sic), as you put it in the zombie entry. I have sought feedback because it became evident my previous design had serious shortcomings. The comments were not in any way \'angry\'. By reworking the design, I have placed much more thought into it than I might have otherwise.','','',0,96,'Design',230,'2009-07-31 16:39:37','2009-07-31 16:39:37',NULL),(532,'','battlestar galactica!!!','','',0,73,'Design',513,'2009-07-31 16:41:30','2009-07-31 16:41:30',NULL),(533,'','I can see how much thought went into this.','','',0,17,'Design',513,'2009-07-31 16:42:27','2009-07-31 16:42:27',NULL),(534,'','calatrava','','',0,59,'Design',513,'2009-07-31 16:43:38','2009-07-31 16:43:38',NULL),(535,'','I hanker for a hunka cheese YAHOO!','','',0,38,'Design',513,'2009-07-31 16:44:45','2009-07-31 16:44:45',NULL),(536,'','the girl is more attractive than the bus stop.','','',0,60,'Design',513,'2009-07-31 16:48:23','2009-07-31 16:48:23',NULL),(537,'','This design is underrated in my eyes. There has been clear thought given to accessibility and the passenger experience.','','',0,39,'Design',230,'2009-07-31 16:48:45','2009-07-31 16:48:45',NULL),(538,'','rickety','','',0,86,'Design',513,'2009-07-31 16:50:04','2009-07-31 16:50:04',NULL),(539,'','a little saggy and wonky...','','',0,47,'Design',513,'2009-07-31 16:51:36','2009-07-31 16:51:36',NULL),(540,'','I AM A ROBOT. THIS IS WHERE I GET MY ROBOT COFFEE.','','',0,14,'Design',513,'2009-07-31 16:52:48','2009-07-31 16:52:48',NULL),(541,'','Yomama, it actually draws inspiration from the 50s and 60s, read the Architecture paragraph for my reasoning.','','',0,96,'Design',230,'2009-07-31 16:55:38','2009-07-31 16:55:38',NULL),(542,'','construction in just 6 easy steps','','',0,62,'Design',513,'2009-07-31 16:57:06','2009-07-31 16:57:06',NULL),(543,'','Sensible point about the projection of timetables. Something similar is being trialled on the London Underground.','','',0,84,'Design',230,'2009-07-31 17:01:09','2009-07-31 17:01:09',NULL),(544,'','unlovable dreck','','',0,65,'Design',513,'2009-07-31 17:05:36','2009-07-31 17:05:36',NULL),(545,'','ch-ch-ch CHIA!','','',0,50,'Design',513,'2009-07-31 17:06:22','2009-07-31 17:06:22',NULL),(546,'','There are M&M\'s under the couch cushion.','','',0,31,'Design',513,'2009-07-31 17:07:30','2009-07-31 17:07:30',NULL),(547,'','The Utah Jazz team bus.','','',0,63,'Design',513,'2009-07-31 17:32:43','2009-07-31 17:32:43',NULL),(548,'','You mean YOU draw inspiration from the 50s and 60s.  You don\'t think it\'s a little drab?  Nice espresso cart, though!','','',0,96,'Design',513,'2009-07-31 17:38:10','2009-07-31 17:38:10',NULL),(549,'','really? im not aware of that but hopefully they would start that after the remodelling of king cross.','','',0,84,'Design',375,'2009-07-31 17:51:37','2009-07-31 17:51:37',NULL),(550,'','I think that this bus stop is gauche with its ringed medallions, clock, and bamboo columns trimmed in brass. The roof is a thoughtful element but a construction nightmare. Rid this of the brass and ornamentation, and provide some sort of side protection against the elements, and I\'ll average out the low score.','','',0,88,'Design',515,'2009-07-31 18:16:11','2009-07-31 18:16:11',NULL),(551,'','glam','','',0,99,'Design',513,'2009-07-31 20:32:24','2009-07-31 20:32:24',NULL),(552,'','Love this design','','',0,95,'Design',516,'2009-07-31 22:17:47','2009-07-31 22:17:47',NULL),(553,'','if you can sell a > 50% cantilever like that, i have some ice that needs sold to some Eskimos ','','',0,72,'Design',214,'2009-07-31 22:52:24','2009-07-31 22:52:24',NULL),(554,'','I couldn\'t imagine an uglier bus stop. The gold details, the \"classic\" design elements. Ugly. I like classic architecture. I hate new architecture that tries to look classic. Maybe coming up with something new and original was just too hard? This design impulse is the same one that creates new houses and offices with Doric columns and pediments. Disgusting. ','','',0,88,'Design',388,'2009-08-01 16:43:25','2009-08-01 16:43:25',NULL),(555,'','Maybe coming up with something new and original is a concept only avant-garde fetishists would die for.\r\n\r\nNormal people deserve to get sensitive, elegant, well-detailed designs like this one, not to be the guinea pigs of some artist\'s self-proclaimed novelty.','','',0,88,'Design',419,'2009-08-01 21:27:39','2009-08-01 21:27:39',NULL),(556,'','I\'m not talking about puking out some Gehry or Zaha type of design, but this submittion takes a typical, mundane bus stop and adorns it with trite, decorative touches and then proceeds to call itself graceful. Ham handed and unimaginative seem more apt. It is one thing to borrow from classic architecture and design, it is another to utilize it as a \"style\". Rather than borrowing from the creative substance of classic design (the ideals and fundamentals behind the objects) it copies its style. The result is something that would best be left in Disneyland, or perhaps Las Vegas. ','','',0,88,'Design',388,'2009-08-01 22:52:56','2009-08-01 22:52:56',NULL),(557,'','beautiful design','','',0,53,'Design',534,'2009-08-02 10:38:37','2009-08-02 10:38:37',NULL),(558,'','i think the idea is to take a trip on the bus, not on acid. next.','','',0,53,'Design',423,'2009-08-02 20:05:21','2009-08-02 20:05:21',NULL),(559,'','um, the idea of a bus shelter is to provide SHELTER! it is not a backdrop for easy rider','','',0,59,'Design',423,'2009-08-02 20:11:30','2009-08-02 20:11:30',NULL),(560,'','why did you design it with a giant circa 1980 portable b&w TV? ditch the tv thing an