hing i noticed, maybe you have a way to solve it?','','',0,110,'Design',375,'2009-08-05 20:29:10','2009-08-05 20:29:10',NULL),(598,'','looks like a U-Stor-It with windows','','',0,110,'Design',513,'2009-08-05 21:08:56','2009-08-05 21:08:56',NULL),(599,'','Total pisser.','','',0,107,'Design',513,'2009-08-05 21:09:33','2009-08-05 21:09:33',NULL),(600,'','the back solid wall can be used for advertising....','','',0,107,'Design',558,'2009-08-05 21:18:05','2009-08-05 21:18:05',NULL),(601,'','I like it,simple and modern.','','',0,107,'Design',567,'2009-08-05 21:21:17','2009-08-05 21:21:17',NULL),(602,'','Is that steel siding? Just curious.','','',0,110,'Design',418,'2009-08-05 22:06:46','2009-08-05 22:06:46',NULL),(603,'','the sarcasm of the last few comments is genius. very funny','','',0,88,'Design',555,'2009-08-05 22:37:00','2009-08-05 22:37:00',NULL),(604,'','the roof would shed water between the waiting riders and the bus','','',0,107,'Design',513,'2009-08-06 12:22:33','2009-08-06 12:22:33',NULL),(605,'','Yes, you are right. I hadn\'t read the brief. I am working on another.','','',0,87,'Design',413,'2009-08-06 14:14:26','2009-08-06 14:14:26',NULL),(606,'','Sorry, I am working on another. There is no way to remove the work.','','',0,86,'Design',413,'2009-08-06 14:16:06','2009-08-06 14:16:06',NULL),(607,'','elegant....like it','','',0,107,'Design',578,'2009-08-06 17:52:56','2009-08-06 17:52:56',NULL),(608,'','good design','','',0,107,'Design',583,'2009-08-06 18:24:33','2009-08-06 18:24:33',NULL),(609,'','a giant crossword puzzle... are you trying to encourage people to write on the bus stop walls?','','',0,102,'Design',423,'2009-08-06 20:05:39','2009-08-06 20:05:39',NULL),(610,'','This is very good and it also looks cost effective. Good shelter during the rainy period and easy to clean as well. it also looks well made to suit disabled travellers It also doesn\'t have too much glasses.','','',0,95,'Design',591,'2009-08-07 19:50:29','2009-08-07 19:50:29',NULL),(611,'','