-10 09:46:18','2009-08-10 09:46:18',NULL),(634,'','looks like a great place to loiter ','','',0,115,'Design',370,'2009-08-10 15:13:59','2009-08-10 15:13:59',NULL),(635,'','This is a very nice concept. I like the ideea and I think it\'s a promising future project.','','',0,122,'Design',629,'2009-08-11 08:47:10','2009-08-11 08:47:10',NULL),(636,'','Anything but functional. Not only do people have to look over their shoulders to see if the bus is coming, they will also bang their heads on the edges of the roof.','','',0,108,'Design',419,'2009-08-11 14:28:09','2009-08-11 14:28:09',NULL),(637,'','This idea has already been done :-)','','',0,27,'Idea',631,'2009-08-11 18:43:04','2009-08-11 18:43:04',NULL),(638,'',' - Hey, the traction pad and pole acts like a \"braille\" signature for blind people..... ','','',0,28,'Idea',631,'2009-08-11 18:46:17','2009-08-11 18:46:17',NULL),(641,'','i like it.  easily identifiable, the ability to add length is also marketable. ','','',0,123,'Design',633,'2009-08-12 08:13:16','2009-08-12 08:13:16',NULL),(642,'','sorry mate, but you lost me.   i thought the previous design was the best in the comp, but this hi-tech gimmickry just ruins it.  its way too pricey, and bus stops are often vandalised.   utopian but impractical.   you could protect the displays with sheets of plastic, but you would have to ditch the touch screen ability.   still a very good bus stop though.','','',0,124,'Design',226,'2009-08-13 02:04:22','2009-08-13 02:04:22',NULL),(643,'','the roof alone deserves a bit more credit.   would look really cool lit up at night.seating is just a bit arbitrary, but still, ill absolutely give you some points for concept','','',0,98,'Design',226,'2009-08-13 02:18:15','2009-08-13 02:18:15',NULL),(644,'','flamboyant.   the water thing is a bit of a gimmick that wont have a huge effect on an outdoor environment.   would also have to flow or it would become filthy.   this would cost a fortune to build, but might be justified as the one off terminal that it looks like, instead of as a repeated bus stop unit.   find it hard to imagine commuting suits prefering imposed music to their own ipod, but why not.   it could be really interesting, or an absolute disaster, and its hard to tell because so much of the design deals with senses that text and images cant convey.   the scale might also be better justified if it doubled as a downtown bicycle park or something. i would be more convinced if it was accompanied by a smaller scale version for the majority of the city\'s suburban stops...','','',0,115,'Design',226,'2009-08-13 02:30:18','2009-08-13 02:30:18',NULL),(645,'','sure why not...','','',0,123,'Design',226,'2009-08-13 02:31:34','2009-08-13 02:31:34',NULL),(646,'','this is really awsome','','',0,115,'Design',653,'2009-08-13 09:54:57','2009-08-13 09:54:57',NULL),(647,'','really interesting project','','',0,114,'Design',653,'2009-08-13 09:56:19','2009-08-13 09:56:19',NULL),(648,'','a little bit to classic for a bus stop.... rings at the top mean the olympic games??????','','',0,88,'Design',653,'2009-08-13 09:58:16','2009-08-13 09:58:16',NULL),(649,'','no comment...iphone????','','',0,124,'Design',653,'2009-08-13 09:59:34','2009-08-13 09:59:34',NULL),(650,'','interesting shape which permits to see outside even if this is a closing space...should be taken into consideration','','',0,125,'Design',653,'2009-08-13 10:02:33','2009-08-13 10:02:33',NULL),(651,'','Its pretty, but poorly designed. The brief for the competition is right, with a bus shelter, as with any building, its function and construction are just as important as its aesthetic. Much of this is frivolous without drama.','','',0,107,'Design',655,'2009-08-13 10:35:37','2009-08-13 10:35:37',NULL),(652,'','its like a pile of woods being put together by a kid and has no proper protection at all.','','',0,114,'Design',414,'2009-08-13 10:41:31','2009-08-13 10:41:31',NULL),(653,'','This is a very good design. Very pratical and environmentally friendly.\r\nWELL DONE TO YOU!!!','','',0,104,'Design',662,'2009-08-13 18:13:54','2009-08-13 18:13:54',NULL),(654,'','I would have to agree with these observations. I think it is great to have involvement from as many people as possible, both designing and critiquing proposals, but perhaps it would be best to get rid of a rating system altogether. That would leave comments as the best way to express opinions about each project, rather than an indiscernible rating. Instead of getting a 5* or 1* or a whatever* rating, you would have to actually explain why it is good, or bad, or otherwise. It becomes a much more collaborative effort with more feedback. Also, I believe that the entries shouldn\'t include the names of the person(s) submitting them, to avoid \"retaliation\" voting for comments that users might not agree with. These are just ideas for \"next time\".','','',0,22,'Idea',285,'2009-08-13 18:24:42','2009-08-13 18:24:42',NULL),(655,'','The water concept is very interesting, but should they attempt to take this element out of the design later on, it would make it far less appealing.','','',0,115,'Design',418,'2009-08-13 19:50:39','2009-08-13 19:50:39',NULL),(656,'','Ummm... this is really similar to one a few blocks from my office in Miami Beach... which is weathering very poorly, BTW. But the likely lack of durability isn\'t the biggest issue. Rather, if you\'re designing something that is one of the civic elements of a city, why should it look like this? Architects talk about forms, surfaces, juxtapositions, etc. Non-architects, however, aren\'t usually equipped with the theoretical background to think in abstract design terms. So their most common question is \"what does it look like?\" And the joke\'s normally on us (I\'m an architect, FWIW) because the answers to that question are normally things that the abstractly-thinking architect never conceived of. In this case, one of those answers might possibly the remains of a shipping container? What else might a non-architect say it looks like? Something damaged in an earthquake? You say you want to increase the profile of bus travel, yet you degrade the place where people wait for the bus? I\'m sorry, but that simply doesn\'t make sense.','','',0,83,'Design',664,'2009-08-13 22:29:36','2009-08-13 22:29:36',NULL),(657,'','I\'m still trying to figure out why a bus stop should look like the tail of a fish??? This is more skillfully done than some of the entries... as pure form, but shouldn\'t there be some reason why things are the way they are?','','',0,55,'Design',664,'2009-08-13 22:37:21','2009-08-13 22:37:21',NULL),(658,'','Excellent work! This one actually looks like a civic structure, and is ennobling rather than demeaning.','','',0,88,'Design',664,'2009-08-13 22:38:22','2009-08-13 22:38:22',NULL),(659,'','worm = vierme (romanian)\r\n\r\nwarm = caldura (romanian)\r\n\r\nSorry to say these but the whole project is kinda funny because of that mistake.','','',0,122,'Design',669,'2009-08-14 08:07:38','2009-08-14 08:07:38',NULL),(660,'','I\'m sorry, but I don\'t know anyone, designer or not, that would go as afar as saying this \"degrades the place where people wait for the bus\". I also think your comparisons show how close minded you are. How exactly does this look like something damaged in an earthquake? Have you ever been in an earthquake? Same question for the shipping container... I assume that you\'ve actually seen a real shipping container (you know, boxed metal frame, corrugated sides), and because of that I am led to the conclusion that you just want to be rude, and critical without leaving and valuable feedback. As for the form, I would say that two powder-coated metal forms that look like folded origami (I used folded card stock when I was coming up with the design) probably wouldn\'t come across the way your narrow mind thinks it would. Thanks a lot for the great feedback, it\'ll be really useful.','','',0,83,'Design',285,'2009-08-14 14:42:32','2009-08-14 14:42:32',NULL),(661,'','No Thanks.  It looks like the design for a third-world ironing board.','','',0,109,'Design',562,'2009-08-14 14:45:14','2009-08-14 14:45:14',NULL),(662,'','And I assume that the deteriorating Miami stop you are referring to is this one- http://www.flickr.com/photos/emissman/327597226/ \r\nThanks for the illustration on how unobservant you really are. Similarities: Angles. That\'s it. ','','',0,83,'Design',285,'2009-08-14 14:47:20','2009-08-14 14:47:20',NULL),(663,'','Trying to hard to make an over-sized statement.','','',0,125,'Design',562,'2009-08-14 14:47:29','2009-08-14 14:47:29',NULL),(664,'','Remind me where is the \'Shelter\' in this indulgent, over-the-top nonsense?  ','','',0,69,'Design',562,'2009-08-14 14:49:14','2009-08-14 14:49:14',NULL),(665,'','The pretentious comment of the previous poster is like a look into the unformed mindset of the half-assed designers who are ruining our cities today.','','',0,56,'Design',562,'2009-08-14 14:50:55','2009-08-14 14:50:55',NULL),(666,'','Dumb jokes are replacing design.','','',0,38,'Design',562,'2009-08-14 14:51:53','2009-08-14 14:51:53',NULL),(667,'','Im not pretentious.  I am a nice guy.  I am humble and love design, art and architecture.  However you sound mean and bitter.','','',0,56,'Design',184,'2009-08-14 15:14:23','2009-08-14 15:14:23',NULL),(668,'','Good design and excellent intentions.  To be picky, Too similar to Stern\'s Chicago bus stops,  Slightly top heavy, not an adequate appropriation for signage, possible advertisements, and wind protection.  ','','',0,88,'Design',674,'2009-08-15 00:28:52','2009-08-15 00:28:52',NULL),(670,'','Very good for all weater conditions what is extremly important. The grass on the roof makes it original.','','',0,104,'Design',682,'2009-08-15 13:53:43','2009-08-15 13:53:43',NULL),(671,'','nice idea.','','',0,128,'Design',115,'2009-08-17 01:01:34','2009-08-17 01:01:34',NULL),(672,'','This could be a seriously fun waterpark pavilion-cum-bird-bath, but it would be a ridiculous bus stop.  Salt Lake City gets very cold a lot of the time, and even aside from this fact, a fantastical design such as this would be a net loss for the environment due to horrific expense and maintenance costs.  Also, who wants to hear five different songs at the same time?','','',0,115,'Design',440,'2009-08-17 16:02:56','2009-08-17 16:02:56',NULL),(673,'','1.individual busstop just for 4 bikes and 2 people....when the university has about 30,000 students and 18,000 employees\r\n\r\n2.and i still do not completely understand why for busStop needs bicycle storage, when it\'s assigned for peoplw who wait busses.\r\n','','',0,43,'Design',692,'2009-08-17 20:18:25','2009-08-17 20:18:25',NULL),(674,'','Nice design Captain Calatrava!  I\'m sure SLC will be able to come up with some stimulus money to build more than a dozen of these. FYI, budgets do exist.','','',0,59,'Design',695,'2009-08-17 22:10:00','2009-08-17 22:10:00',NULL),(675,'','Critique - Do your research before you critique.  I live in Seattle and there are plenty of bus stops right on the bike lanes.  They work quite well actually.  ','','',0,83,'Design',695,'2009-08-17 22:12:59','2009-08-17 22:12:59',NULL),(676,'','Good rebuttal Blutdrache!  I think that someone should revoke SAMouzon\'s license of critical opinion.  Go back to using your cookie cutter!','','',0,83,'Design',695,'2009-08-17 22:15:59','2009-08-17 22:15:59',NULL),(677,'','Oregon Trail!  The designer has died of dysentery.','','',0,108,'Design',695,'2009-08-17 22:23:47','2009-08-17 22:23:47',NULL),(678,'','your exploded axonometric is nifty.  it\'s nice to see the consideration of construction.  ','','',0,111,'Design',695,'2009-08-17 22:28:16','2009-08-17 22:28:16',NULL),(679,'','May the rest of the public and I use your bus stop too?  You seem to be building a bus stop for yourself when you refer to it as \'my bus stop\'.','','',0,113,'Design',695,'2009-08-17 22:38:33','2009-08-17 22:38:33',NULL),(680,'','interesting.  but it might be nice to have covered seating.','','',0,114,'Design',695,'2009-08-17 22:40:18','2009-08-17 22:40:18',NULL),(681,'','this could work nice at a major bus hub. it seems this design would create an opportunity for many people to use it as shelter... wanted and unwanted.  i am not opposed to creating shelter for the homeless, but it is the wrong place for that to happen.','','',0,115,'Design',695,'2009-08-17 22:44:26','2009-08-17 22:44:26',NULL),(682,'','nice.  it seems that each element could be isolated and used seperately as well.  ','','',0,122,'Design',695,'2009-08-17 22:46:32','2009-08-17 22:46:32',NULL),(683,'','it looks like one of those things you get your money in at the bank drive through.  too heavy, needs more transparency.','','',0,123,'Design',695,'2009-08-17 22:47:25','2009-08-17 22:47:25',NULL),(684,'','looks like a scene from resident evil minus the zombies.  ','','',0,124,'Design',695,'2009-08-17 22:48:29','2009-08-17 22:48:29',NULL),(685,'','i dont see how a leaf translates into steel.  i believe your metaphor is lost...','','',0,127,'Design',695,'2009-08-17 22:50:59','2009-08-17 22:50:59',NULL),(686,'','this would be nice for a stop at the university, otherwise, tacky.','','',0,128,'Design',695,'2009-08-17 22:51:37','2009-08-17 22:51:37',NULL),(687,'','extremely generic.  ','','',0,129,'Design',695,'2009-08-17 22:52:11','2009-08-17 22:52:11',NULL),(688,'','this is great continue the great work...is just a bus station..','','',0,59,'Design',559,'2009-08-18 01:07:16','2009-08-18 01:07:16',NULL),(689,'','if every building\'s form was based on the shape of the first letter of its location, architecture would be meaningless and useless.   Its too literal dude.   identity is icredibly important, but there is beauty in subtlety.\r\n\r\nthese fools took it to an extreme, and its completely counter intuitive and irrelevant to real life...\r\n\r\nhttp://www.designboom.com/eng/interview/jds/dd.jpg','','',0,128,'Design',226,'2009-08-18 01:56:18','2009-08-18 01:56:18',NULL),(690,'','Detsa, thanks.  Technically it\'s not an axonometric, rather a perspective.  The technique does help in visualizing the assembly.','','',0,111,'Design',457,'2009-08-18 14:18:17','2009-08-18 14:18:17',NULL),(691,'','I meant \"my bus stop\" as my concept for a bus stop. As you know these bus stops are for public use. Why would there be a cafe and seating for multiple people if it were just for me. So yes you may use the space if you please.','','',0,113,'Design',540,'2009-08-18 20:14:58','2009-08-18 20:14:58',NULL),(692,'','I like this \"cleanliness\" of the design.  The size issues cited at another comment above are not real problems as they can be easily addressed.  I only wish that the images posted here were a little larger so we could read them better.','','',0,103,'Design',623,'2009-08-19 05:37:25','2009-08-19 05:37:25',NULL),(693,'','best so far...simple yet powerful!','','',0,131,'Design',705,'2009-08-19 06:27:22','2009-08-19 06:27:22',NULL),(694,'','very good...compelling','','',0,19,'Design',705,'2009-08-19 06:30:03','2009-08-19 06:30:03',NULL),(695,'','responsive...tough competition to the others.','','',0,62,'Design',705,'2009-08-19 06:32:53','2009-08-19 06:32:53',NULL),(696,'','roof can work....thickness and materials specification is a must.','','',0,72,'Design',705,'2009-08-19 06:34:43','2009-08-19 06:34:43',NULL),(697,'','kitsch','','',0,88,'Design',698,'2009-08-19 06:58:54','2009-08-19 06:58:54',NULL),(698,'','what brief?','','',0,87,'Design',687,'2009-08-19 09:36:36','2009-08-19 09:36:36',NULL),(699,'','looks like a sauna!','','',0,130,'Design',115,'2009-08-20 08:15:10','2009-08-20 08:15:10',NULL),(700,'','Simple, clear and reasonable. I like it.','','',0,112,'Design',711,'2009-08-20 13:56:34','2009-08-20 13:56:34',NULL),(701,'','This is a beast.','','',0,104,'Design',711,'2009-08-20 13:59:25','2009-08-20 13:59:25',NULL),(702,'','Only about 50% of the interior space would be functional.','','',0,84,'Design',711,'2009-08-20 14:01:33','2009-08-20 14:01:33',NULL),(703,'','Over designed.','','',0,103,'Design',711,'2009-08-20 14:02:00','2009-08-20 14:02:00',NULL),(704,'','Slick and multifunctional. Well done.','','',0,43,'Design',711,'2009-08-20 14:02:59','2009-08-20 14:02:59',NULL),(705,'','Cool idea and in large numbers could actually be cost effective.','','',0,14,'Design',711,'2009-08-20 14:03:49','2009-08-20 14:03:49',NULL),(706,'','I really like this submission.  It looks clinical and functional but still has warmth and beauty.  With its accessibility, sustainability and simple functionality.  For me, this shelter evokes thoughts of the far East.','','',0,104,'Design',712,'2009-08-20 15:24:58','2009-08-20 15:24:58',NULL),(707,'','Like the way the tree is incorporated in the design and the stop is simple but light and airy whils providing shelter','','',0,134,'Design',713,'2009-08-20 21:27:14','2009-08-20 21:27:14',NULL),(708,'','the presentation suits the design really well. Looks simple and effective, easy to construct too.My favourite part of the design is how the seating extends to the outside of the shelter, with the roof extended to also cover this. After studying a little about the psychology of how people behave and sit in spaces, these outdoor seats would be a lot more popular than those inside, as people tend to try and space themselves out as much as possible, and don\'t like to sit where other people can \'watch\' them. However, people may be reluctant to the use seats facing away from the oncoming traffic, for fear of missing a bus, maybe this could have been considered in the design a little more. Overall its a very attractive design, that would be cost effective and simple.','','',0,130,'Design',694,'2009-08-20 22:35:47','2009-08-20 22:35:47',NULL),(709,'','very good','','',0,134,'Design',472,'2009-08-20 23:16:54','2009-08-20 23:16:54',NULL),(710,'','simple, effective design. use of a tree would promote the idea of greener cities, combat co2 emissions. would it be spoilt by graffiti?','','',0,134,'Design',716,'2009-08-21 06:33:23','2009-08-21 06:33:23',NULL),(711,'','nice presentation, helps the design stand out. simple shelter, could be prone to overcrowding.','','',0,112,'Design',716,'2009-08-21 06:38:41','2009-08-21 06:38:41',NULL),(712,'','nice concept but not executed as successfully, a subtler incorporation of the U would make a less brass design','','',0,128,'Design',716,'2009-08-21 06:42:15','2009-08-21 06:42:15',NULL),(713,'','very sleek, looks great! the whole proportion of the design looks fantastic and well thought out. ','','',0,106,'Design',694,'2009-08-21 06:59:51','2009-08-21 06:59:51',NULL),(714,'','oh and is this a hand made model? ','','',0,106,'Design',694,'2009-08-21 07:01:49','2009-08-21 07:01:49',NULL),(715,'','nice presentation of a good idea, the shape of the shelter is great. Would be interesting to see how it fits onto a site though (how close it is to roadside, how pedestrians walking past have to interact with it etc.)','','',0,131,'Design',694,'2009-08-21 07:54:27','2009-08-21 07:54:27',NULL),(716,'','\"would it be spoilt by graffiti?\"\r\n\r\nI suppose this could be asked of any of the bus stop designs on the site. It wouldn\'t necessarily have to be be spoiled by graffiti, the other side of the brick wall could even be a designated graffiti wall. Perhaps even some artistic graffiti could improve the design perhaps?:\r\n\r\nhttp://farm1.static.flickr.com/50/107817554_7071340181.jpg?v=0\r\n\r\nhttp://www.kidacne.com/blog/','','',0,134,'Design',694,'2009-08-21 09:03:04','2009-08-21 09:03:04',NULL),(717,'','the perspective and section look absolutely great! very good.','','',0,112,'Design',694,'2009-08-21 09:29:14','2009-08-21 09:29:14',NULL),(718,'','nice idea well graphically presented. does it fit in with the site though? what do you think of the view of the competitions site? ','','',0,135,'Design',694,'2009-08-21 10:27:49','2009-08-21 10:27:49',NULL),(719,'','really simple idea but rather than overcomplicate it you\'ve let it stay really bold and simple. I think I agree with the more transparency comment but for me this is a really good attempt.','','',0,123,'Design',694,'2009-08-21 11:25:25','2009-08-21 11:25:25',NULL),(720,'','Your design is showing that tree who\'s boss!','','',0,134,'Design',513,'2009-08-21 12:35:44','2009-08-21 12:35:44',NULL),(721,'','Quick Question: How do you plan on accounting for the growth of the tree and maintain structural intergrity of the structure? Thanks','','',0,134,'Design',418,'2009-08-21 16:05:46','2009-08-21 16:05:46',NULL),(722,'','tradarch, the steel clamp that is attached to the tree would have to be made in two parts that can be tightened/loosened with bolts. The timber beams would be fabricated to a size that could fit into the clamp, still with enough space to allow for slight movement (if you look at my main image, the part of the steel clamp that supports the timber beam protrudes out quite a distance, meaning the beam doesn\'t actually have  to reach all the way to the tree trunk). This would allow room for very slight movement of the beams at the end nearest the tree. With a little maintenance once every year or two simply adjusting the bolts, I think that any structural pressure caused by tree growth would be relieved.','','',0,134,'Design',694,'2009-08-21 16:39:37','2009-08-21 16:39:37',NULL),(723,'','nice!','','',0,83,'Design',722,'2009-08-21 18:24:00','2009-08-21 18:24:00',NULL),(724,'','well thought out design, one of the best on here!','','',0,134,'Design',722,'2009-08-21 18:24:45','2009-08-21 18:24:45',NULL),(725,'','I think this is a nice idea, in concept, and would be well suited in the right location, but what protection does this offer from driving winter wind? Aside from missing that aspect of the design, the images, presentation, and concept are elegant and simple. I like it.','','',0,135,'Design',388,'2009-08-21 20:41:51','2009-08-21 20:41:51',NULL),(726,'','Elegant and inventive!','','',0,88,'Design',729,'2009-08-22 01:59:43','2009-08-22 01:59:43',NULL),(727,'','What about the idea of making registered users\' profiles public, including their voting record?  I am thinking this might make people more accountable for their votes - and show what 2 or 3 stars means to one person vs. another.  The rating system is necessary for the \"winning\" aspect, but the value for all participants should be the process - and this might make that process more transparent.....thoughts?','','',0,22,'Idea',5,'2009-08-22 17:24:11','2009-08-22 17:24:11',NULL),(728,'','Just a thought. The population of the Campus is 30.000 people. The location of the stop is at a very busy and pertinent area. The image supplied appears to hold ten people squeezed with an acute angle. (THinking of the weather). Increasing the possible capacity might significant help the merging of form and function.','','',0,134,'Design',597,'2009-08-23 04:52:25','2009-08-23 04:52:25',NULL),(729,'','oruchimaru, thanks a lot for the comment and suggestion. The question of size is a valid one, however, it is one that could be asked of nearly all of the designs on the site. My design could quite easily be scaled up depending on its site (basically extending the beams, or increasing the angle between them). For shelter, If you look at my third image, you\'ll see that not only is there room under the main structure to stand, but actually quite a lot of space as the roof is extended backwards. Additionally, the tree would act as a natural shelter if it does begin raining! I think someone on the ideas section made a good comment about how shelter isn\'t the be all and end all for a bus stop, as many people will carry an umbrella if they see the weather will be bad. ','','',0,134,'Design',694,'2009-08-23 09:13:04','2009-08-23 09:13:04',NULL),(730,'','héhé j\'adore le \"were is brian\" je vous reconnais bien là!! non sans rire c\'est super vos concept bravo la french team','','',0,114,'Design',739,'2009-08-23 11:54:28','2009-08-23 11:54:28',NULL),(731,'','I really like this one- it has the scale of a sculptural object rather than a building.','','',0,106,'Design',742,'2009-08-23 16:55:46','2009-08-23 16:55:46',NULL),(732,'','badass','','',0,32,'Design',742,'2009-08-23 16:59:41','2009-08-23 16:59:41',NULL),(733,'','i wanted to love this, but the lack of shelter lets it down, unfortunately.   still among the best without a doubt.   great potential.','','',0,135,'Design',226,'2009-08-24 01:01:53','2009-08-24 01:01:53',NULL),(734,'','i always like to see a tree being planted, but if you plan on planting a tree to use in this way, you might be waiting a few decades for it to mature.   to me the bus stop also feel a little claustrophobic.   that\'s not jus the scale, but triangular spaces in general fel that way.   images and materials are very good though.','','',0,134,'Design',226,'2009-08-24 01:08:36','2009-08-24 01:08:36',NULL),(735,'','wel d design seems interesting .but i guess a lot of issues still untouched ,for ex.a radial seating would not work for a single lane ..\r\n','','',0,54,'Design',745,'2009-08-24 04:19:30','2009-08-24 04:19:30',NULL),(736,'','it\'s a very good idea!i love this concept','','',0,115,'Design',747,'2009-08-24 07:58:55','2009-08-24 07:58:55',NULL),(737,'','http://www.treemover.com/project_detail.cfm/43/The_Campus_at_Legacy\r\n\r\nI realise that no design can wait decades for a tree to grow, thats why I specified a re-planted tree in my project description. I accept that triangular spaces may feel claustrophobic, thats why one side is left fully open and the other is made from a clear material (PVC). The triangular shape of the main stop was to emphasise the relationship of the of the tree with the rest of the structure.  Thanks for the feedback','','',0,134,'Design',694,'2009-08-24 08:27:51','2009-08-24 08:27:51',NULL),(738,'','I LOVE THIS CONCEPT.\r\nA beautiful, intelligent solution that feels like a natural shelter  rather than a piece of metropolitan furniture.\r\nBravo','','',0,104,'Design',753,'2009-08-24 09:34:49','2009-08-24 09:34:49',NULL),(739,'','a modern ideea...very nice','','',0,122,'Design',755,'2009-08-24 12:08:33','2009-08-24 12:08:33',NULL),(740,'','yes. it\'s for a kid\'s nursery.','','',0,50,'Design',123,'2009-08-24 12:16:14','2009-08-24 12:16:14',NULL),(742,'','Do you know of the term Greenwash? This project, among many others on this site, is a perfect example. Claiming to be sustainable by calling the design \"GreenStop\" but then constructing it from petroleum based PVC and requiring a replanted tree. That replanted tree would require removing concrete and asphalt in a 4-5 meter circle around the tree in order to create a proper hole to insert a tree large enough and accommodate its root structure. The concrete (high CO2 producing material) and asphalt (petroleum based) would have to be replaced. You can argue recycleability about the PVC and the concrete and asphalt being removed, but the asphalt and concrete only become aggregate, not their original material. So those are down-cycled. And the PVC not only requires lots of energy to recycle, it produces chlorine gas (a common WWI chemical weapon). So before claiming a design to be \"Green\" do some reasearch, and don\'t ever believe what the manufacturer claims, they Greenwash worse than anyone.','','',0,134,'Design',388,'2009-08-24 14:09:07','2009-08-24 14:09:07',NULL),(743,'','Needs more explanation','','',0,26,'Idea',756,'2009-08-24 15:47:05','2009-08-24 15:47:05',NULL),(744,'','Reading the brief sounds like a good idea.','','',0,29,'Idea',756,'2009-08-24 15:48:12','2009-08-24 15:48:12',NULL),(745,'','Two tired people or two friends will sit next to each other.  \r\n\r\nA drunk person could pee on anything - it is not a reason to avoid building it, but it is a good reason to make more public toilets.','','',0,23,'Idea',756,'2009-08-24 15:50:35','2009-08-24 15:50:35',NULL),(746,'','I really appreciate the attempt to use existing structure.','','',0,62,'Design',756,'2009-08-24 16:02:18','2009-08-24 16:02:18',NULL),(747,'','Thanks for taking the time to show your opinion. I can see how you may have misunderstood my design aims, but I don\'t believe that I have intentionally tried to claim my design to be more \'green\' or sustainable than it actually is. I can understand how the name GreenStop may have misled you into believing my shelter claims to be sustainable. The idea of using a tree started out as an aesthetical idea, and then developed as I liked the idea of it promoting more tree plantations that could possibly be used in design for the future. \r\nThe choice to use PVC was due to the fact that it is less brittle than glass and less likely to break, reducing maintenance. Glass could quite easily be used as an alternative. The concrete and asphalt that would need to be dug up wouldn\'t all need to be replaced either, surely it would be mostly replaced with soil for the trees roots? Some could be re-used as the hardcore layer on top of the soil too. I believe there is a more environmentally friendly concrete available too now (although I don\'t know if this is greenwash!) that could be used for the top layer of ground replacement. I feel that the use of a tree as part of design in an urban area would help to encourage more plantation in the future. However,  I will now refer to my design simply as \'Stop\', to avoid unintentional green-washing on my part. Feel free to add any more comment/debate please!','','',0,134,'Design',694,'2009-08-24 16:26:27','2009-08-24 16:26:27',NULL),(748,'','i have never seen tree relocation on that scale before.   it seems a little contradictory, claiming that it is a green initiative, yet the removal, transportation and replanting of each tree would require a lot of energy, and result in a lot of carbon emmissions if every stop in a city was built this way.   not as green as you might imagine.   you might want to consider looking for existing trees if you want to be truly green.','','',0,134,'Design',226,'2009-08-24 18:13:57','2009-08-24 18:13:57',NULL),(749,'','kavbar, the link the tree moving site was simply to show that trees can be relocated, rather than me having to wait decades for my design to be possible! For one stop however, it wouldn\'t be any more detrimental (transport wise) than any other construction material. I accept that for for multiple stops being built the transport emmissions would start to rise substantially. The tree could inspire more designers to actually consider using existing trees in their work, but there isn\'t one on this particular site. As I mentioned above, my design wasn\'t pushed by a desire to be green, simply to provide an innovative approach to designing a bus stop (and promoting the use of public transport in the long run). Thanks a lot for the interest','','',0,134,'Design',694,'2009-08-24 18:37:08','2009-08-24 18:37:08',NULL),(750,'','bravo pour développement économie durable','','',0,125,'Design',765,'2009-08-24 18:45:44','2009-08-24 18:45:44',NULL),(751,'','Beautiful graphics, and it would be great to incorporate a tree into the design.  Like previous commenters, however, I have concerns about the practicality of the idea.  (a) It depends on dedicated maintenance staff to \"loosen the bolts\" to allow for tree growth.  Do you really trust the folks on the ground in SLC (or anywhere) to do this? (b) If I understand correctly, the structural integrity of the stop depends on the health of the tree.  But I\'m sure you\'ve noticed that urban trees don\'t always succeed.  What happens when the tree fails, right when I\'m waiting for the bus?  (c) Mature tree transplants are indeed possible.  But have you priced any lately?  For a tree of a caliper like you\'re showing, you\'re talking well over $10,000.  For an urban situation, probably more.  I just can\'t see UTA shelling that out for mere aesthetics.\r\n\r\nAll that said, I think you\'re really on to something.  Why not incorporate a newly-planted tree or trees into the structure, while not requiring the trees to provide structural stability?','','',0,134,'Design',769,'2009-08-25 01:24:22','2009-08-25 01:24:22',NULL),(752,'','Thanks for the feedback. Firstly, I agree with the fact that having a tree incorporated into a design in such a way raises a few questions about maintenance, structure etc. In fact, a lot of the feedback I\'ve had has basically been questions about trees and not even mentioning the design! a) I don\'t feel maintenance would too much of a difficult task. The steel clamp would be supported from the ground so when it is loosened there would be no movement. The support is removed afterwards, job done!\r\nb) I can\'t see the tree simply failing and snapping one day without warning. A tree has more chance of being uprooted than it does failing structurally. If there were any problems arising such as rotting, it would be seen well in advance. c) I didn\'t really think about budget for this project, as there isn\'t one given in the brief (so creativity isn\'t limited). I agree with you wholly if it really is that much, I can\'t see UTA being wiling to spend that much. However, I have done a little research and one company quotes $175 per caliper inch of the tree (plus costs of planting etc.) I think at a push, it could rise to $4000.\r\nYour comments about perhaps planting a new tree to use as part of the design are interesting, and it could be a fantastic idea to have a tree growing throughout the life-span of a piece of design. For my design proposal, however, I can\'t see it working. Take away the tree concept (a tree used as structure) from my design, and your left with quite an average design. The rest of the stop was purposefully left very simple, to emphasize the trees importance to the structure and design. ','','',0,134,'Design',694,'2009-08-25 07:36:11','2009-08-25 07:36:11',NULL),(753,'','My only suggestion would be to lose the slits in the roof- the design is much stronger without these; they seem arbitrary. Then you will have 5 simple unbroken elements: plinth, bench, rail, roof and wall.','','',0,106,'Design',742,'2009-08-25 10:21:24','2009-08-25 10:21:24',NULL),(754,'','this design worries me- would huge insects turn up and start devouring people?','','',0,20,'Design',742,'2009-08-25 11:03:30','2009-08-25 11:03:30',NULL),(755,'','I can miss the bus now','','',0,115,'Design',772,'2009-08-25 11:43:30','2009-08-25 11:43:30',NULL),(756,'','I like your design, but it does have issues and you seem to just rebut all of the suggestions and questions given without taking into account that they are all really appropriate. The material choice of PVC lacks durability and isn\'t a very sustainable material. The wedge shape isn\'t ideal. The tree could fail without warning; just in the last month a jogger in Philadelphia had a tree suddenly fall on them and put them in a coma and another in Central Park had a large section of a tree fall on them and kill them, all within 3 days. So it happens. The tree would be very expensive to plant; on top of the debatable caliper cost there is also the cost of tearing out sidewalk and road, which, despite one of your responses, would need to be replaced. I think the concept is great, but you need to take some of this criticism as an asset, rather than fighting it. Its not like they are telling you its ugly or something. It\'s all helpful advice.','','',0,134,'Design',285,'2009-08-25 13:50:01','2009-08-25 13:50:01',NULL),(757,'','Nice work. Easy deployment at various sites, using low cost materials. Congratulations! (Alberto Santana)','','',0,137,'Design',777,'2009-08-25 15:04:18','2009-08-25 15:04:18',NULL),(758,'','These images are really beautiful, but the design doesn\'t address the competition site, Salt Lake City. In a tropical site, like you\'ve specified, shade is all you really need from a bus stop, and this does the job simply and elegantly. Nice work.','','',0,137,'Design',285,'2009-08-25 15:41:59','2009-08-25 15:41:59',NULL),(759,'','I haven\'t particularly meant to \'fight\' any critisism, I\'m simply offering reasoning behind my design when it is questioned. When I take a project into a design review/crit, people question all aspects of the work that I present. I\'m not dismissing their comments and refusing to accept them, I\'m taking them on board, but at the same time trying to show the reasoning behind my design decisions. The triangular shape of my design was described as claustrophobic, I\'ve taken that on board and explained why I chose that shape, and how I attempted to prevent it from feeling crowded. Someone described PVC as a bad material choice environmentally, I\'ve accepted that (and again, explained my reasons behind it), and suggested that another material could be used instead. I really appreciate all comments and suggestions, whether they are positive or negative. Please don\'t feel I\'m dismissing anyones opinions outright, I\'m treating this as I would in a design crit, and trying to answer everyones comments/suggestions with the reasons behind my design.','','',0,134,'Design',694,'2009-08-25 16:29:52','2009-08-25 16:29:52',NULL),(760,'','your section looks like it doesn\'t match your bird\'s eye view...','','',0,115,'Design',513,'2009-08-25 17:27:36','2009-08-25 17:27:36',NULL),(761,'','Your main pic is probably the nicest presentation image on the site, it helps to sell your idea before the design even comes into consideration. Is it just the yellow section that is made of the folded metal? A design consisting of such a large amount of glass (if the roof is also glazed) could get pretty hot in the summer. Very attractive design though','','',0,83,'Design',694,'2009-08-25 19:59:16','2009-08-25 19:59:16',NULL),(762,'','@matsheffield09 - the stop uses two overlapping pieces of metal, one yellow and one white. Thanks for the question and the nice comments, I appreciate it.','','',0,83,'Design',285,'2009-08-25 20:02:49','2009-08-25 20:02:49',NULL),(763,'','Good response, and I understand that\'s how you are treating it. In a crit situation, those answers work perfect. And it is important for everyone  to know that none of these designs would probably be constructed exactly as shown because the critique process causes designs to evolve and improve (I\'m not really referring that comment to you, because you seem to get this). ','','',0,134,'Design',285,'2009-08-25 20:07:37','2009-08-25 20:07:37',NULL),(764,'','ah I see. It could have been like a greenhouse in there if that thing was exposed to sun from above!','','',0,83,'Design',694,'2009-08-25 20:56:32','2009-08-25 20:56:32',NULL),(765,'','Why does visibility to the bus driver matter? They know where the stops are. What kind of protection does this stop offer for wind? Cold winter wind, driving rain and snow are something that needs to be considered. ','','',0,138,'Design',388,'2009-08-27 00:56:56','2009-08-27 00:56:56',NULL),(766,'','These trees are planted in the sidewalk.  This would be an obstacle to good pedestrian traffic flow and on top of that trees cannot grow in such a medium.','','',0,63,'Design',794,'2009-08-27 02:45:28','2009-08-27 02:45:28',NULL),(767,'','Lack of seating area.','','',0,85,'Design',794,'2009-08-27 02:46:18','2009-08-27 02:46:18',NULL),(768,'','Trees would not have sufficient soil to grow under this bus stop.','','',0,132,'Design',794,'2009-08-27 02:48:35','2009-08-27 02:48:35',NULL),(769,'','The irony of this design is that affixing a steel clamp to a tree as has been done here would, under all circumstances, result in the death of the tree; not such a \'Green\' stop after all.  Even if it were possible to grow a tree under such conditions, its ever increasing size would cause serious problems in terms of the structural soundness of this shelter.','','',0,134,'Design',794,'2009-08-27 02:58:33','2009-08-27 02:58:33',NULL),(770,'','This design suits very well for warmer countries, but cannot work for countries like Sweden. 3 stars from me.','','',0,85,'Design',799,'2009-08-27 11:40:16','2009-08-27 11:40:16',NULL),(771,'','I liked very much the simplicity of the design - \"Minimalism doesn\'t mean minimum effort\" The \'Module\' idea is very good too. 4 stars from me.','','',0,123,'Design',799,'2009-08-27 11:47:19','2009-08-27 11:47:19',NULL),(772,'','The tree must be the dominant of the composition in this case. The problem is that it doesn\'t feels to me like this. It looks like the bus stop has grabbed the tree with a pair of tongs. Great idea, but in my opinion could be greater. 3 stars from me.','','',0,134,'Design',799,'2009-08-27 12:16:03','2009-08-27 12:16:03',NULL),(773,'','Very flexible design which I like most. That would make adaptation easy for a variety of places. 4 stars from me.','','',0,99,'Design',799,'2009-08-27 12:20:59','2009-08-27 12:20:59',NULL),(774,'','Тhe sitting places facing each other, instead facing the road, makes it more social place. Great simple design. The only thing missing is the information board which is also an important element of the composition. 5 stars from me.','','',0,131,'Design',799,'2009-08-27 12:32:19','2009-08-27 12:32:19',NULL),(775,'','very beautiful and intelligent!','','',0,122,'Design',800,'2009-08-27 12:42:39','2009-08-27 12:42:39',NULL),(776,'','This is function but with a campus vibe. It can accommodate several peopel for protection from the sun or the rain.','','',0,139,'Design',802,'2009-08-27 12:58:57','2009-08-27 12:58:57',NULL),(777,'','The back rack is a great feature, but it does not look suitable to allow for secure lockup of a bicycle. It looks like it only allows for attachment by the front wheel.','','',0,130,'Design',801,'2009-08-27 12:59:19','2009-08-27 12:59:19',NULL),(778,'','Looks very resistant to vandalism, compared to many other designs.','','',0,87,'Design',801,'2009-08-27 13:01:55','2009-08-27 13:01:55',NULL),(779,'','Anytime you damage the root zone directly under the drip line of a mature tree, you KILL IT! Since the selection of trees that survive in urban situations can be quite limited. Another very serious problem is the haress chaffing against the bark. If the tree manages the shock of losing most of its roots, the rubbing action of the harness with eventually invite disease and kill it. Sorry to be a downer, but this is common knowledge in the horticulture world. ','','',0,134,'Design',418,'2009-08-27 13:48:34','2009-08-27 13:48:34',NULL),(780,'','Gas station.','','',0,96,'Design',806,'2009-08-27 17:27:50','2009-08-27 17:27:50',NULL),(781,'','Nice looking.','','',0,97,'Design',806,'2009-08-27 17:29:32','2009-08-27 17:29:32',NULL),(782,'','Is it sponsored by chiclets?','','',0,98,'Design',806,'2009-08-27 17:30:35','2009-08-27 17:30:35',NULL),(783,'','Beautiful and practical!','','',0,99,'Design',806,'2009-08-27 17:31:51','2009-08-27 17:31:51',NULL),(784,'','Will Alsop.','','',0,102,'Design',806,'2009-08-27 17:32:42','2009-08-27 17:32:42',NULL),(785,'','Zaha Hadid.','','',0,106,'Design',806,'2009-08-27 17:34:33','2009-08-27 17:34:33',NULL),(786,'','Or is it Rem Koolhaus?','','',0,106,'Design',806,'2009-08-27 17:34:54','2009-08-27 17:34:54',NULL),(787,'','Calatrava does Dallas.','','',0,108,'Design',806,'2009-08-27 17:35:44','2009-08-27 17:35:44',NULL),(788,'','It\'ll become a kite.','','',0,109,'Design',806,'2009-08-27 17:36:26','2009-08-27 17:36:26',NULL),(789,'','Disneyland.','','',0,115,'Design',806,'2009-08-27 17:39:17','2009-08-27 17:39:17',NULL),(790,'','Great!','','',0,122,'Design',806,'2009-08-27 17:39:46','2009-08-27 17:39:46',NULL),(791,'','Wonderful design.','','',0,127,'Design',806,'2009-08-27 17:41:03','2009-08-27 17:41:03',NULL),(792,'','The passengers should be wearing towels.','','',0,130,'Design',806,'2009-08-27 17:41:54','2009-08-27 17:41:54',NULL),(793,'','Trees will be strangled and rip apart shelter in wind.','','',0,132,'Design',806,'2009-08-27 17:42:48','2009-08-27 17:42:48',NULL),(794,'','70\'s','','',0,133,'Design',806,'2009-08-27 17:42:59','2009-08-27