very stop could claim to have it, it\'s a little irrelevant, but i digress.   it doesnt really show whether or not you can move from the cantilever-covered standing area, through the seats to the main space, and i would suggest it is important to be able to do this, than having to walk around. anything else i could say has been said.  generally, not bad though.','','',0,145,'Design',226,'2009-08-30 00:46:55','2009-08-30 00:46:55',NULL),(914,'','oh, and metaphysician777, your comment on the importance of rethinking and requestioning is spot on. But, unfortunately, in most countries (america more so than most, adopt the damn metric system!), such innovation takes years to develop, years to test, years to acquire financial and political support and years to implement, meaning we are unfortunately always behind were we need to be.   In fact, streets existed long before motorised transport, and so were never meant to carry high speed traffic.   But to apply your point to the sad reality that we are stuck with buses for the time being, i would suggest the best designs here are those that imagine their bus stops not even existing in 10 years, but instead being reintegrated into a technical cycle of redesign and reproduction, and this design shows some of that modular, forward thinking humility.','','',0,145,'Design',226,'2009-08-30 00:57:02','2009-08-30 00:57:02',NULL),(915,'','im having all of it.   lots of room for adapting this design to stops of different sizes, perhaps slicing it to have a single bench and cantilevered shelter at quieter destinations.   spacious, economic, potentially sustainable, all good but the concrete might need some rationalising.   the impermanence of bus stops doesn\'t match the permanence and limited reusability of concrete. the absence of gimmicky crap, also very respectable. i would mention bikes, but im sure you could get them in. well done.','','',0,131,'Design',226,'2009-08-30 01:04:29','2009-08-30 01:04:29',NULL),(916,'','not just illogical, but dangerous.  unsupervised climbing wall, i smell a law suit...','','',0,148,'Design',226,'2009-08-30 01:07:31','2009-08-30 01:07:31',NULL),(917,'','damn zaha hadid and her wayward influences. its an interesting shape, that might fall out of fashion very quickly, but seeing as you have made shape the most important thing, forgetting to mention materiality, cost, energy, lifespan and reuse, etc., means i couldnt give it marks, even if i wanted to.','','',0,146,'Design',226,'2009-08-30 01:18:41','2009-08-30 01:18:41',NULL),(918,'','Cool design - sleek, very clean and practical to construct. Disadvantage is that there is not much protection against wind, or blowing precipitation.','','',0,143,'Design',867,'2009-08-30 05:14:35','2009-08-30 05:14:35',NULL),(919,'','excellent!','','',0,114,'Design',894,'2009-08-30 16:51:20','2009-08-30 16:51:20',NULL),(920,'','Excellent !! \r\n','','',0,115,'Design',896,'2009-08-30 18:12:22','2009-08-30 18:12:22',NULL),(921,'','ITS A WONDERFUL DESIGN... I CAN FEEL THE SPACE IN THE DESIGN... AND IT HAS SOME UNITY... FREE FLOWING FORM IS REALLY HELPING TO MAKE THE SPACE HAPPENING...','','',0,106,'Design',897,'2009-08-30 18:13:06','2009-08-30 18:13:06',NULL),(922,'','I HAV READ SOME COMMENTS NOW... SUM1 HAS SAID TO REMOVE THE SLITS... BUT ACTUALLY THESE SLITS ARE BREAKING THE MONOTONY OF THE SHELTER...','','',0,106,'Design',897,'2009-08-30 18:14:49','2009-08-30 18:14:49',NULL),(923,'','Très pratique ! L\'aspect futuriste me plait bien, surtout le toit transparent!','','',0,55,'Design',896,'2009-08-30 18:15:50','2009-08-30 18:15:50',NULL),(924,'','Très bien, mais est-ce pratique ?','','',0,114,'Design',896,'2009-08-30 18:17:43','2009-08-30 18:17:43',NULL),(925,'','IM NOT AT ALL INTERESTED IN HOW THEY ALL ARE CONNECTED... OR WHETHER ITS PHYSICALLY POSSIBLE OR NOT... ITS A FANTASTIC   N THOUGHTFUL DESIGN... ONCE I ALSO TRIED TO WORKOUT WID CUBES LIKE U HAV DONE... BT I WSNT SO INNOVATIVE N WID FLUIDITY AS UR... GUD JOB... ','','',0,102,