atings in the same day? yea a bit questionable','','',0,149,'Design',925,'2009-08-31 03:39:09','2009-08-31 03:39:09',NULL),(936,'','your comment pretty much confirms what I thought if your going to try and rig the experiment, you should at least have a good design, nice images and not be so obvious, just look at the other compeition im suprised you actually want would try to get people to beleive that you have votes becuase they like your design?','','',0,149,'Design',902,'2009-08-31 03:46:11','2009-08-31 03:46:11',NULL),(941,'','Dude, this is awesome!  I can imagine myself sitting there and reading a newspaper.','','',0,149,'Design',934,'2009-08-31 04:05:09','2009-08-31 04:05:09',NULL),(944,'','WOW!, It is amazing you have so many votes lately!  This makes me want to follow others and vote for you.  Looks great to me.','','',0,149,'Design',939,'2009-08-31 04:32:02','2009-08-31 04:32:02',NULL),(947,'','This design is being flagged for removal.  Please refer to section 2.1 in the terms of use.  Votes are also being reviewed, and will be restored shortly.  Sorry for any inconvenience to honest users.  ','','',0,149,'Design',5,'2009-08-31 04:41:19','2009-08-31 04:41:19',NULL),(948,'','This is being flagged for removal.  Please refer to section 2.1 in the terms of service.  Voting records are under review and will be restored shortly.  Apologies to honest users.','','',0,147,'Design',5,'2009-08-31 04:42:24','2009-08-31 04:42:24',NULL),(953,'','This design is rated higher than it currently shows.  It should be fixed shortly - our apologies for any inconvenience.','','',0,145,'Design',5,'2009-08-31 05:00:02','2009-08-31 05:00:02',NULL),(958,'','Thank all of you for the wonderful comments.  ','','',0,149,'Design',868,'2009-08-31 05:39:42','2009-08-31 05:39:42',NULL),(969,'','gud work ','','',0,153,'Design',959,'2009-08-31 06:03:03','2009-08-31 06:03:03',NULL),(970,'','its death like few others here','','',0,153,'Design',960,'2009-08-31 06:07:06','2009-08-31 06:07:06',NULL)