f including surrounding space into design.  Well done.','','',0,146,'Design',597,'2009-08-31 18:40:40','2009-08-31 18:40:40',NULL),(1003,'','nice and simple, really like it!  would be nice to see it in some sort of context perhaps, how close it is to the roadside etc.','','',0,156,'Design',694,'2009-08-31 19:42:28','2009-08-31 19:42:28',NULL),(1004,'','the idea to divide up space is an interesting one, but is it worth having seats facing away from the road? People waiting for public transport have a strong need to keep an eye on the oncoming vehicles, for fear of missing their bus. Individual space is a great idea, and with a little re-arrangement of the booths, this could be great','','',0,154,'Design',694,'2009-08-31 19:49:09','2009-08-31 19:49:09',NULL),(1005,'','Really good presentation (perhaps some people in there too would be nice to give it some \'life\'). I\'ve said this on other designs too, but it seems you have a large proportion of seats that cannot view oncoming traffic. People won\'t want to sit where they can\'t see their bus coming until its actually at the stop. You say yourself that it looks complex, and it is. It does look a little over the top for a bus stop, it looks more suitable for a shopping complex or other large public building.','','',0,153,'Design',694,'2009-08-31 19:57:10','2009-08-31 19:57:10',NULL),(1006,'','I LOVE THE DESIGN OF THIS STOP, IT IS VERY COMFORTABLE TO EXPECT THE PUBLIC TRANSPORT! CONGRATULATIONS TO THIS FABULOUS DESIGNER STOP ','','',0,156,'Design',977,'2009-08-31 20:18:25','2009-08-31 20:18:25','200.84.21.157'),(1007,'','excellent design! would be very gratifying and satisfying to have a stop like this in the avenues. Designs like these are needed. ','','',0,156,'Design',978,'2009-08-31 20:49:52','2009-08-31 20:49:52','200.84.21.157'),(1008,'','so far I have seen many designs, some made me laugh, others have made my eyes hurt, others I have seen: simple and tasteful at the same time, I think that yours is among the ones that make my eyes hurt','','',0,153,'Design',472,'2009-08-31 21:33:57','2009-08-31 21:33:57','74.72.32.184'),(1009,'','I like the design, but is very large, and would have to invest much money, remember that it is not just a stop, there are several bus stops','','',0,156,'Design',472,'2009-08-31 21:39:23','2009-08-31 21:39:23','74.72.32.184'),(1010,'','The contest is for, bus stations, not for entertainment in a park','','',0,148,'Design',472,'2009-08-31 21:41:40','2009-08-31 21:41:40','74.72.32.184'),(1011,'','Nice work, finally another design that pushes the envelope, very basic concept which is done well ','','',0,153,'Design',808,'2009-08-31 22:52:12','2009-08-31 22:52:12','98.117.185.199'),(1012,'','thank you oruchimaru =)','','',0,146,'Design',770,'2009-09-01 02:16:36','2009-09-01 02:16:36','119.160.162.192'),(1013,'','I like it, the desing is perfect, comfortable to the public transport and very important to the usuary, because is very space. Congratulations to this excellent!! desing. ','','',0,156,'Design',982,'2009-09-01 02:28:23','2009-09-01 02:28:23','190.200.42.159'),(1018,'','This looks like the most common bus stop in the northern mid-west US. Common, and not original.  You really shouldn\'t be allowed to post a design that is available from a number of suppliers already. http://www.globalindustrial.com/gcs/group/4916/productsPerPicGroups.web#gridAnchor','','',0,161,'Design',388,'2009-09-01 12:37:15','2009-09-01 12:37:15','72.24.136.114'),(1019,'','Salt Lake? What waterfront in Utah?','','',0,87,'Design',972,'2009-09-01 17:22:15','2009-09-01 17:22:15','69.222.233.9'),(1020,'','Well done!','','',0,145,'Design',1012,'2009-09-02 12:58:00','2009-09-02 12:58:00','209.18.49.15'),(1021,'','The Modular concept is quite nice and could be very useful, if quite expensive as currently designed, but the aesthetic component of this concept sterile and unlovely--even graceless.','','',0,145,'Design',440,'2009-09-02 16:38:15','2009-09-02 16:38:15','24.250.21.28'),(1022,'','I love this simple design. ','','',0,131,'Design',1020,'2009-09-02 18:18:36','2009-09-02 18:18:36','88.25.152.204'),(1023,'','good concept but slightly overkill','','',0,128,'Design',1024,'2009-09-02 22:10:34','2009-09-02 22:10:34','71.178.69.95'),(1024,'','o my word','','',0,59,'Design',1024,'2009-09-02 22:12:41','2009-09-02 22:12:41','71.178.69.95'),(1025,'','i\'m really into the detail portion of your design. very conceptual yet informative','','',0,52,'Design',1024,'2009-09-02 22:17:43','2009-09-02 22:17:43','71.178.69.95'),(1026,'','very good design.   bicycles might be sheltered, i hate finding my bike with a wet seat, but i suppose that im just looking for problems there.   it would be good if you could expand on the materials you would use and why, though.   very humble and mature design, and i love the way that the solar panels float.   niccce.','','',0,164,'Design',226,'2009-09-02 22:24:57','2009-09-02 22:24:57','79.97.114.159'),(1027,'','i dont get it.   the box is very uninviting.   at first glance i cant even make out an entrance.   the way you have presented it makes it look very close to the street, uncomfortably close.   if youre designing a box, why not and try to integrate the seating and the bike rack into the stop.   play with the box...http://www.guggenheim.org/new-york/education/sackler-center/design-it-shelter/view-shelters/project/169 & http://www.guggenheim.org/new-york/education/sackler-center/design-it-shelter/view-shelters/project/124.   that bench looks like something the city council might add several years after the stop is built.   the roof is quite nice and simple, but why does the entrance to the shelter slope down to the road?   do wheelchair users in utah use the roads?  to me, it looks like a box with tumors. sorry.','','',0,156,'Design',226,'2009-09-02 22:38:03','2009-09-02 22:38:03','79.97.114.159'),(1028,'','grass rooves are extremely top heavy, and this structure doesnt really look like it would hold it.   add snow to this, and you have a problem.   permeability is nice, but indoor space looks a bit uninspiring.   bigger doors might be more inviting.   that tree structure interests me, and i dont know why.   it makes no sense, but i dont hate it.   the fact that you dont show other angles makes me wonder if you have considered them.   it looks environmentaly friendly, but the cost, size and complicated construction/deconstruction make it quite unsustainable for a simple bus stop, unfortunately.','','',0,104,'Design',226,'2009-09-02 22:45:11','2009-09-02 22:45:11','79.97.114.159'),(1029,'','many people have also said that it is low cost, but it isn\'t.   that roof, the tree column, the size of the glass panels and the use of timber cladding make it quite costly.   even the addition of louvres is an unnecessary luxury for a bus stop that adds cost and uses more material.   had to be pointed out.','','',0,104,'Design',226,'2009-09-02 22:48:02','2009-09-02 22:48:02','79.97.114.159'),(1030,'','adnan, youre a scary individual.   this looks more like a terminus sized project than a repeatable bus stop, unless you feel like funding it.   if it is a terminal, it probably shouldnt be unilaterally focussed.   terminals usually serve routes going in many different directions.   if it was open on both sides, it would make a bit more sense, but you seemed to suspend reality for this.   the size of the stop compared to the amount of seating and shelter is sheer lunacy.   it would make an amazing stage for live music, but its not a bus stop.','','',0,153,'Design',226,'2009-09-02 22:58:31','2009-09-02 22:58:31','79.97.114.159'),(1031,'','you can barely access the shelter.   id prefer to just stand on the path beside it.','','',0,155,'Design',226,'2009-09-02 23:03:43','2009-09-02 23:03:43','79.97.114.159'),(1032,'','why is the seat not under the shelter?   you seem to have put graphics ahead of use here, leaving the project feeling hollow.   also you cant have people walking on cans.   come on.   think about it.   they break, and they leave sharp edges.   they collapse under someone\'s foot, they twist their ankle, and they sue the city.   this style of ill-conceived conceptual design causes problems that real designers have to solve.','','',0,152,'Design',226,'2009-09-02 23:09:06','2009-09-02 23:09:06','79.97.114.159'),(1033,'','ok, yeah, nice.\r\n\r\nmaybe discuss the materials that you might use.   this will look very nice when it is new, but might degrade quickly.   how do you keep it clean and vibrant.   i would also suggest you use the university\'s U, instead of a times new roman U.   it makes sense with the loudness of the stop.\r\n\r\npretty good stuff.','','',0,150,'Design',226,'2009-09-02 23:15:06','2009-09-02 23:15:06','79.97.114.159'),(1034,'','Hi kavbar, you are right...I could have included more information about potential materials and also about the font of the ‘U’.  The white and black U-shaped walls could possibly be solid phenolic exterior wall panels. I have researched that this provides good structural integrity, as well as UV, impact, moisture, and graffiti resistance. Since they are available in a variety of textures and designs, the white could be glossy and the black maybe a rock texture. The red colored shelter with trellises could be made of water resistant plywood elements treated for outdoor use. I wanted to maintain a contrast with the materials to help further define the major elements that make up the bus stop. Thanks for your input!','','',0,150,'Design',841,'2009-09-03 03:09:23','2009-09-03 03:09:23','98.218.245.33'),(1035,'','Fun!','','',0,167,'Design',1028,'2009-09-03 07:39:54','2009-09-03 07:39:54','75.3.231.251'),(1036,'','Looks like a card table after a really hard night of euchre.','','',0,109,'Design',1028,'2009-09-03 08:03:24','2009-09-03 08:03:24','75.3.231.251'),(1037,'','The form is nice, but it just wouldn\'t work well. First of all, other than an overhead canopy, it offers no protection from the elements. And second, the cantilever would require setting the \"Pre-engineered\" metal frame far below ground with an ample concrete ballasted foundation. Otherwise it would tip over; even more so with snow and wind loads in the mix. It could be done, but for a bus stop it seems the cost and the lack of protection would make this a poor choice. ','','',0,143,'Design',388,'2009-09-03 16:02:56','2009-09-03 16:02:56','72.24.136.114'),(1038,'','Very modern and practical','','',0,164,'Design',1043,'2009-09-03 18:17:46','2009-09-03 18:17:46','190.30.80.44'),(1039,'','The design is so beautiful. But the fact I can park my bike there is the best','','',0,164,'Design',1045,'2009-09-03 18:29:11','2009-09-03 18:29:11','190.30.80.44'),(1040,'','that roof is pretty ugly','','',0,88,'Design',1045,'2009-09-03 18:30:21','2009-09-03 18:30:21','190.30.80.44'),(1041,'','5 stars,one of my favourites','','',0,164,'Design',1046,'2009-09-03 18:36:33','2009-09-03 18:36:33','190.30.80.44'),(1042,'','awesome concept!','','',0,145,'Design',1051,'2009-09-04 00:02:58','2009-09-04 00:02:58','72.25.55.83'),(1043,'','This does not promote the long-term health of the tree, much like tree grates.  This should be a factor in \'green\' designs.','','',0,134,'Design',1056,'2009-09-04 10:25:17','2009-09-04 10:25:17','173.29.151.141'),(1044,'','Finally a front runner.  Good work.','','',0,164,'Design',1056,'2009-09-04 10:28:54','2009-09-04 10:28:54','173.29.151.141'),(1045,'','Maria, \r\n\"first place in 2 min.\"\r\ngood luck.','','',0,89,'Design',217,'2009-09-04 14:16:11','2009-09-04 14:16:11','65.112.106.250'),(1046,'','Very exciting design! The design is very functional and constructable. Great presentation!\r\n\r\n','','',0,145,'Design',1060,'2009-09-04 17:00:23','2009-09-04 17:00:23','66.202.2.103'),(1047,'','Bike racks that only come up to the tires do not allow cyclists to lock their bikes properly.','','',0,164,'Design',1063,'2009-09-04 17:41:32','2009-09-04 17:41:32','72.29.180.81'),(1048,'','It is beauty. Its a class.\r\nkeep it up. love you.','','',0,153,'Design',1066,'2009-09-04 18:49:10','2009-09-04 18:49:10','119.153.35.112'),(1049,'','There is no enclosure; what\'s so ambiguous about that? The existing one is a better stop than this thing.','','',0,172,'Design',388,'2009-09-04 19:16:37','2009-09-04 19:16:37','72.24.136.114'),(1050,'','What is holding that roof up? Magic? Because those curved poles sure aren\'t.  What\'s with all of these projects slapping solar power on the roofs and then calling it sustainable? The energy used by bus stops isn\'t a big issue, but the choice and quantity of materials is. Solar panels are like putting a band-aid on a bullet wound. ','','',0,170,'Design',388,'2009-09-04 19:20:48','2009-09-04 19:20:48','72.24.136.114'),(1051,'','Would you like a full structural engineers report? The energy used by bus stops may not be a big issue, but every little helps... I wouldn\'t call it a bullet wound either... more like a bruise from a BB gun... ','','',0,170,'Design',1010,'2009-09-04 19:27:14','2009-09-04 19:27:14','92.3.21.226'),(1052,'','I like the permeability of the sides and rear of the pavilion.','','',0,171,'Design',1073,'2009-09-04 21:04:07','2009-09-04 21:04:07','74.237.82.128'),(1053,'','Holy buckets. I\'m just having fun. This project is not about to be commissioned so you do not need to worry about getting cut. Relax. ','','',0,152,'Design',900,'2009-09-04 21:05:17','2009-09-04 21:05:17','129.93.161.150'),(1054,'','is one of my favorites, the only problem I see is: the maintenance of the bus stations, so the economy is bad, you think there will be money to pay for the care of the station?','','',0,176,'Design',1078,'2009-09-04 22:34:51','2009-09-04 22:34:51','74.72.32.184'),(1056,'','Very good work !','','',0,114,'Design',1089,'2009-09-05 10:13:18','2009-09-05 10:13:18','79.80.215.80'),(1057,'','a different design with fantastic renderings','','',0,134,'Design',1032,'2009-09-05 11:24:29','2009-09-05 11:24:29','93.110.139.195'),(1058,'','lovely social place','','',0,131,'Design',998,'2009-09-05 13:13:27','2009-09-05 13:13:27','89.144.153.80'),(1059,'','Good idea','','',0,151,'Design',998,'2009-09-05 13:18:56','2009-09-05 13:18:56','89.144.153.80'),(1060,'','A pretty thoughtful design. Well shown.  Nice work.','','',0,180,'Design',1077,'2009-09-05 22:42:54','2009-09-05 22:42:54','67.175.162.225'),(1061,'','Good design','','',0,176,'Design',1100,'2009-09-05 23:25:12','2009-09-05 23:25:12','74.126.254.242'),(1062,'','What an awesome design.  Very futuristic','','',0,145,'Design',1101,'2009-09-05 23:29:15','2009-09-05 23:29:15','70.44.54.195'),(1063,'','nice variety in the types of spaces for users as they wait','','',0,150,'Design',1102,'2009-09-05 23:50:35','2009-09-05 23:50:35','98.218.245.33'),(1064,'','i like this. i agree, thoughtful too','','',0,180,'Design',1102,'2009-09-05 23:53:06','2009-09-05 23:53:06','98.218.245.33'),(1065,'','I think once you start representing the materials with their actual sizes you are going to find out that the whole project will take a very different hierarchy in terms of the relationships between planes. Right now the roofs are a fourth of the size that they will be in real life. Also, the project is too dependent in vegetation, which will not be there in winter. So the architecture needs to be a lot stronger so it works all year round. The first thing i think of when I see this project is \'Barcelona Pavilion\' which works in its minimality because of the complexity of its reflections. That is not happening here. At the end of the day we need to ask our selves, would we like to use this space? ','','',0,176,'Design',560,'2009-09-06 00:09:32','2009-09-06 00:09:32','68.160.196.135'),(1066,'','I like this one the best. It\'s open architecture with non-linear lines provides an emotional lift to the user.','','',0,180,'Design',1103,'2009-09-06 00:13:28','2009-09-06 00:13:28','71.67.183.192'),(1067,'','So the energy crisis isn\'t a problem? And no, I don\'t need