','2009-09-06 14:37:00','68.160.196.135'),(1077,'','I love it ... it greats and very functional!!!','','',0,164,'Design',1121,'2009-09-06 14:43:45','2009-09-06 14:43:45','97.91.114.218'),(1078,'','I like the modularity of this design.','','',0,164,'Design',1122,'2009-09-06 15:06:14','2009-09-06 15:06:14','67.9.133.211'),(1079,'','awesome!','','',0,145,'Design',1129,'2009-09-06 20:34:09','2009-09-06 20:34:09','64.9.41.220'),(1080,'','nice attempt....its really simple yet bold n attractive....dont worry about th english u will learn soon....good work...','','',0,133,'Design',181,'2009-09-06 22:23:18','2009-09-06 22:23:18','119.153.31.122'),(1081,'','well done!\r\nonly the walls towards the road seem too high - how should drivers spot little kids who want to cross the street?','','',0,176,'Design',115,'2009-09-07 02:35:37','2009-09-07 02:35:37','118.103.24.253'),(1082,'','Practical, multi-use, simple design and construction, allows for wall space for postings/materials for riders, would actually keep riders dry while waiting.','','',0,180,'Design',1143,'2009-09-07 04:59:07','2009-09-07 04:59:07','207.216.11.3'),(1083,'','I think this project is going in a good direction.  I like that the design moves away from just built structure and incorporates the landscape to define space.  It would have been nice to see a bit more process work (diagrams that explain your concepts) to understand the project more. I get distracted by the manufactured feeling of the rendering.  In reality I also think you\'d need a lot more space than you show here... it\'s going to feel cramped.  I feel like the space is over-developed and compartmentalized.  Perhaps diagrams would have addressed this observation.  But again, it\'s good to see a design that strives to use landscape as a contributing element in the definition of the space.','','',0,176,'Design',392,'2009-09-07 09:25:06','2009-09-07 09:25:06','84.80.163.19'),(1084,'','Hi kavbar\r\nI have other angle drawings showing all the sides and interiors but the site doeas not allow me to load the images.\r\nAny idea i can i do it?\r\n\r\nThanks for your feedback.\r\n\r\n','','',0,104,'Design',390,'2009-09-07 10:08:41','2009-09-07 10:08:41','82.35.115.109'),(1085,'','i\'m not going to comment on the aesthetics.. seems like that department has been covered.  beyond that discussion, i fail to see how the overall concept introduces anything new to the idea of a bus shelter in a climate that experiences a high shift in climate.  For one, the PV cell argument for the roof doesn\'t make a lot of sense.  In reality, very little energy would actually be harvested from the sun from your roof if it were to be adorned in lovely pv cells. It\'s small and has very little surface area that would be south facing. Considering meteorological conditions, I fail to see how the shelter really provides shelter for the occupants.  Perhaps in the middle of summer, in the middle of the day, shade will be provided over some seating.  But how does this structure address the intense heat of the low afternoon sun?  Or in the winter, the cold winds which shift direction?  Or the splashing slush of passing cars for that matter.','','',0,88,'Design',392,'2009-09-07 10:23:48','2009-09-07 10:23:48','84.80.163.19'),(1086,'','Excellent work, very creative I am impressed!I would like that at my city. well done. ','','',0,184,'Design',1153,'2009-09-07 14:38:54','2009-09-07 14:38:54','94.67.255.128'),(1087,'','This is a very interesting attempt, I particularly like the lights which are protruding through the canopy...however I still prefer the hand drawn fallen vase of flowers....','','',0,170,'Design',1013,'2009-09-07 15:01:35','2009-09-07 15:01:35','86.148.219.32'),(1088,'','Interesting concept. What are the strips made of?','','',0,184,'Design',388,'2009-09-07 15:20:52','2009-09-07 15:20:52','72.24.136.114'),(1089,'','-great idea for portable bus stop which a city authority can easily place when & where & whenever it needs to especially in times of fair, exhibitions and time of increased visitors\r\n\r\n\r\n','','',0,184,'Design',1159,'2009-09-07 15:31:08','2009-09-07 15:31:08','83.235.19.168'),(1090,'','awesome design! love how people can stay dry in bad weather-i hate waiting for the bus in the rain!','','',0,145,'Design',1161,'2009-09-07 15:45:36','2009-09-07 15:45:36','76.111.161.77'),(1091,'','nice concept.......if workable......can be used in many ways and places....','','',0,184,'Design',181,'2009-09-07 16:27:17','2009-09-07 16:27:17','119.153.34.8'),(1092,'','very well though of, shows deep consideration of the design process','','',0,184,'Design',1169,'2009-09-07 16:28:42','2009-09-07 16:28:42','94.68.140.190'),(1093,'','impressive!','','',0,184,'Design',1171,'2009-09-07 16:38:15','2009-09-07 16:38:15','89.210.161.14'),(1094,'','Great concept.  excellent design.','','',0,145,'Design',1176,'2009-09-07 17:30:28','2009-09-07 17:30:28','24.229.112.47'),(1095,'','i loves it- especially for making accommodations for bicyclists.','','',0,180,'Design',1180,'2009-09-07 18:36:26','2009-09-07 18:36:26','98.246.75.177'),(1096,'','u-g-l-y you aint go no alibi!','','',0,88,'Design',1180,'2009-09-07 18:38:32','2009-09-07 18:38:32','98.246.75.177'),(1097,'','Thoughtful design.\r\namazing concept.','','',0,184,'Design',1186,'2009-09-07 19:15:22','2009-09-07 19:15:22','62.1.135.152'),(1098,'','a very impressive and fresh design!','','',0,184,'Design',1191,'2009-09-07 19:57:21','2009-09-07 19:57:21','94.67.207.239'),(1099,'','wont stand up','','',0,181,'Design',226,'2009-09-07 19:58:06','2009-09-07 19:58:06','79.97.114.159'),(1100,'','Well done!This could be so cool if is used in big cities.Nice concept!','','',0,184,'Design',1192,'2009-09-07 19:59:43','2009-09-07 19:59:43','89.210.162.76'),(1101,'','roof can be accessed, so it needs a balustrade.   this cannot be just tacked on because it will change the look entirely. design consequences not fully considered.','','',0,185,'Design',226,'2009-09-07 20:00:18','2009-09-07 20:00:18','79.97.114.159'),(1102,'','quite interesting.   i would be inclined to remove the glass from one side to open the stop up, making it more inviting and safe, and to increase the limited amount of seating space you have provided, but otherwise its quite good.','','',0,184,'Design',226,'2009-09-07 20:03:33','2009-09-07 20:03:33','79.97.114.159'),(1103,'','i suggest you become an artist.   you dont know what architecture is, and irresponsible anti-design such as this will cause the world to burn up.   you are undoubtedly talented, but this is economic lunacy.','','',0,182,'Design',226,'2009-09-07 20:06:52','2009-09-07 20:06:52','79.97.114.159'),(1104,'','very nice design (if only you did a little more with the columns).   visuals are spectacularly good.   what program did you use, is niiice!','','',0,180,'Design',226,'2009-09-07 20:10:28','2009-09-07 20:10:28','79.97.114.159'),(1105,'','i actually like this a lot.   it could direct itself toward oncoming traffic, but would have to be the other way round for the US!   i think the bech should also keep going, wrapping itself around the plantear box providing seating where nobody is trying to walk past.   very nice graphic.','','',0,179,'Design',226,'2009-09-07 20:13:46','2009-09-07 20:13:46','79.97.114.159'),(1106,'','the streetside glazing makes the stop feel claustrophobic.   to stop car splashing, it would probably be enough to have glass 1m high.','','',0,177,'Design',226,'2009-09-07 20:15:28','2009-09-07 20:15:28','79.97.114.159'),(1107,'','amazing','','',0,145,'Design',1198,'2009-09-07 20:18:39','2009-09-07 20:18:39','74.220.50.19'),(1108,'','nice subtle design, but its uneconomical, and more importantly, you have completely ommited structure of ant kind.   glass cannot float.   it would be unfair of me to give this high marks when you have ignored something that everyone else has considered (well, almost everyone).   sorry.','','',0,176,'Design',226,'2009-09-07 20:18:44','2009-09-07 20:18:44','79.97.114.159'),(1109,'','already considered - as can be seen from the concept sketches...thats why the grassed area stops short of the roof. it can be handled in other ways then just the standard solution of a handrail or ballustrade. the angle of the sloped area will also be a deterrent...but maybe people going on the roof isnt a bad thing...? public realm (inthe UK and USA is over protected anyway - from skate stoppers on benches to fenced-in courtyards for those lucky few who happen to work in the building its attached too. urban appropriation is the way forward.','','',0,185,'Design',474,'2009-09-07 20:21:16','2009-09-07 20:21:16','82.11.11.97'),(1110,'','despite its apparent flamboyancy, i think this can work.   repeated material used with litle waste, and an openness and uniqueness make it enjoyable and economically viable.  why not? ','','',0,175,'Design',226,'2009-09-07 20:22:00','2009-09-07 20:22:00','79.97.114.159'),(1111,'','the walls divide the stop in half, one side facing the car park.   why would you do this?','','',0,174,'Design',226,'2009-09-07 20:23:06','2009-09-07 20:23:06','79.97.114.159'),(1112,'','great design!','','',0,145,'Design',1199,'2009-09-07 20:24:27','2009-09-07 20:24:27','74.220.50.19'),(1113,'','its not bad, but the delineation of footpath kerbs by unifying paving patterns is dangerous.   it exists on o connell st in dublin, and two women died because they could not see the edge of the path and stepped in front of a bus.   safety comes before pride.','','',0,173,'Design',226,'2009-09-07 20:25:44','2009-09-07 20:25:44','79.97.114.159'),(1114,'','unfortunately, i agree with ausdrucks strong comments.   it just begs the question why?   its quite complicated while achieves very little.','','',0,172,'Design',226,'2009-09-07 20:28:14','2009-09-07 20:28:14','79.97.114.159'),(1115,'','Clever design and interesting concept! ','','',0,184,'Design',1200,'2009-09-07 20:28:14','2009-09-07 20:28:14','83.212.52.30'),(1116,'','i like it.   i dont know if it will stand up with the cantilevering weight of the roof. i would love to have seen the roof made the same way as the walls, creating a homogenous mini-structure, with the gaps in the roof filled with glass or efte.   i have to say, i love the section drawing through the bus.   fantastic.','','',0,171,'Design',226,'2009-09-07 20:31:39','2009-09-07 20:31:39','79.97.114.159'),(1117,'','sketch-up to 3dsmax to cs3.','','',0,180,'Design',392,'2009-09-07 20:34:24','2009-09-07 20:34:24','84.80.163.19'),(1118,'','ausdruck\'s rage is a mischanneled truth.   this design shows a despairing lack of structural insight.   for those poles to hold up that roof, they would have to be embedded in foundations unjustifiably deep for a simple bus stop.   the fact that you haven\'t shown the joints between glazing panels, or any sense of real materiality, shows a real sense of superficiality.','','',0,170,'Design',226,'2009-09-07 20:36:40','2009-09-07 20:36:40','79.97.114.159'),(1119,'','i dont think most people will enjoy having to squeeze in between your imposed style and form to sit, and to be quite frank, if every building, or even every small project, was formally composed of its spelling, i would go insane.   mansilla and tunon architects did this a thousand times better than you have.','','',0,169,'Design',226,'2009-09-07 20:40:01','2009-09-07 20:40:01','79.97.114.159'),(1120,'','someone already submitted this. and it looked better.   and it was easier to visualise it in use.   and it was generally better.   and this is already in the sample bus stops that the competition provided.   its already been done, so why did you do it worse?','','',0,168,'Design',226,'2009-09-07 20:42:10','2009-09-07 20:42:10','79.97.114.159'),(1121,'','strong and clear presentation. Nice movement in the design.','','',0,180,'Design',1203,'2009-09-07 20:48:08','2009-09-07 20:48:08','84.105.16.144'),(1122,'','Nice concept, we could definitely use a few of these at school!','','',0,145,'Design',120