 05:09:10','205.206.132.36'),(1312,'','Well thought out both visually and with the right materials so to extend its useful life beyond 50 years.. Best one I have seen.','','',0,194,'Design',1467,'2009-09-11 05:17:14','2009-09-11 05:17:14','68.105.153.223'),(1313,'','Why did you decide to have it white..I like the ideas, but not really the plasma television..how would this bus stop be maintained','','',0,210,'Design',1468,'2009-09-11 05:31:14','2009-09-11 05:31:14','198.166.230.88'),(1314,'','Well done! omer Look good even from technical point of view..Reg, ali kashif','','',0,210,'Design',1470,'2009-09-11 06:00:33','2009-09-11 06:00:33','118.107.132.31'),(1315,'','um, its a bus stop not a rubiks cube. do i have to assemble the bus stop while waiting for the bus?','','',0,184,'Design',423,'2009-09-11 09:38:41','2009-09-11 09:38:41','98.246.154.234'),(1316,'','!','','',0,184,'Design',1479,'2009-09-11 13:35:29','2009-09-11 13:35:29','94.67.211.199'),(1317,'','i think there would be hidrence in movement of visitors due to seating arrangement, any how nice work.','','',0,210,'Design',1480,'2009-09-11 15:14:53','2009-09-11 15:14:53','119.153.1.53'),(1318,'','It is clear that a great deal of thought has gone into this design.  This concept utilizes the most modern materials to provide the maximum benefit to the community within a highly efficient footprint.','','',0,194,'Design',1481,'2009-09-11 15:24:23','2009-09-11 15:24:23','74.7.95.174'),(1319,'','@Frank Lloyd Wrong - You are wrong. If you look at any of Calatrava\'s work you can plainly trace the structural loads through the buildings. This building, as shown, does not offer enough structure to support the roof. It would be really nice to see a design that actually has some sort of viable structure, but this doesn\'t.','','',0,170,'Design',388,'2009-09-11 15:57:23','2009-09-11 15:57:23','72.24.136.114'),(1320,'','As far as i know, most of the people has to wait for the next bus,\r\nthe waiting period has to be informed and trusted.\r\nWisely then this waiting area can be opportunity to enhance the public service, \r\nnot with advertising but a social communication hub in order to promote local community focal points.\r\nEach bus stop can be specifically designed in ordert o represent the locality among the public network. \r\neach stops can empower local image at it will provide connection to a whole real network of different localities. \r\nIf a vision of local identities can be integrated in global city or regional network, it will help and enhance the great consideration from the people to their public services.\r\nBy eluding local identities, public services are missing an opportunity to strengthen the confident and respectful relationship with their users.\r\nConsidering a bus stop as a local space of physical exchange from users to users and people and public transportation is what will enhance forever a constantly improved and  considered service design by users and public services providers, with full respects and longterm considerations.\r\nIt is not about designing a single bus stop for a global public transportation network, but a modular design enhancing and empowering local identities revealed by a public service provider in total respect for their local users.\r\nEach stop is a unique opportunity to reveal local communities\' identities.\r\nOlivier Clerc, service designer.','','',0,36,'Idea',1482,'2009-09-11 16:27:19','2009-09-11 16:27:19','90.178.74.233'),(1321,'','For that span it would be a lot easier just to cantilever the roof from the wall. Could keep the aesthetic effect though.','','',0,134,'Design',1485,'2009-09-11 18:00:15','2009-09-11 18:00:15','82.8.155.136'),(1322,'','tradarch i agree with you','','',0,185,'Design',1004,'2009-09-11 19:44:29','2009-09-11 19:44:29','74.72.32.184'),(1323,'','from the beginning you criticized most of the designs and rightfully so, but your design seems more of an imitation of previous submittals than anything innovative as would be expected from someone who has scrutinized others.  ','','',0,185,'Design',734,'2009-09-11 20:00:46','2009-09-11 20:00:46','74.72.32.184'),(1324,'','@andrew.pun - Thanks for the comment and question. I used SketchUp for the modeling, but then used Photoshop and a Wacom Tablet to add all of the color, texture, and shading. ','','',0,83,'Design',285,'2009-09-11 20:04:20','2009-09-11 20:04:20','72.24.136.114'),(1325,'','is this a bus stop......?\r\n','','',0,213,'Design',181,'2009-09-11 22:30:31','2009-09-11 22:30:31','203.99.184.58'),(1326,'','This design is pleasing to the eye, looks relatively inexpensive to build,and commuter friendly. Having the option to buy snacks on the go is great, the way this design accomplishes it is genius','','',0,191,'Design',1493,'2009-09-11 23:01:15','2009-09-11 23:01:15','76.213.245.58'),(1327,'','I like your design, but I keep seeing all these stops with bike racks.  I ride the bus every day and I would never leave my bike at a bus stop--even if there was a rack and I could lock it up.  Also, if you are riding the bus somewhere, chances are that you will need your bike when you get off.  Good design, but the bike rack seems risky and useless.','','',0,164,'Design',1492,'2009-09-11 23:07:45','2009-09-11 23:07:45','76.230.122.54'),(1328,'','out of blue','','',0,153,'Design',1504,'2009-09-12 05:03:16','2009-09-12 05:03:16','119.153.60.157'),(1329,'','try next time dear','','',0,184,'Design',1504,'2009-09-12 05:19:06','2009-09-12 05:19:06','119.153.60.157'),(1330,'','interesting section, would be nice to visit. ','','',0,214,'Design',83,'2009-09-12 05:24:22','2009-09-12 05:24:22','75.152.167.98'),(1331,'','great sketches','','',0,212,'Design',83,'2009-09-12 05:26:40','2009-09-12 05:26:40','75.152.167.98'),(1332,'','mmmmmmmmm','','',0,208,'Design',1504,'2009-09-12 05:28:17','2009-09-12 05:28:17','119.153.60.157'),(1333,'','really like the design. one thing i\'d like to ask is how cost-effective would this design be? ','','',0,204,'Design',83,'2009-09-12 05:32:47','2009-09-12 05:32:47','75.152.167.98'),(1334,'','nice buddy','','',0,153,'Design',1506,'2009-09-12 05:37:05','2009-09-12 05:37:05','119.153.60.157'),(1335,'','a really functional bus stop.','','',0,153,'Design',1507,'2009-09-12 05:39:53','2009-09-12 05:39:53','119.153.60.157'),(1336,'','Nice design\r\nSarfraz Hussain,','','',0,210,'Design',1513,'2009-09-12 08:41:13','2009-09-12 08:41:13','195.229.235.42'),(1337,'','Nice Design\r\n','','',0,100,'Design',1513,'2009-09-12 08:43:38','2009-09-12 08:43:38','195.229.235.42'),(1338,'','Nice effort but unfortunately failed to inspire/attract me. I, being a frequnt public transport user,can challange everyone stating it as a functional design. As a user, I want a bus stop to facilitate me and turn my wait for the bus a bearable act and not distract me with plasma screen. By enclosing it and providing it with plasma screen, you are facilitating homeless people a nice place to stay at, students to smoke at and hiding place for bunking, which i am afraid is not what it is intended for. Other thing is that from outside, it seemed more like fuel/CNG station present here in our country.\r\n\r\nother thing which is very confusing for me is the providing of bicycle parking along with your waiting area. By doing this\r\nit would become a place for teenagers to park their bicycles outside it and enjoy doing inside whatever they want to do, and you know well what they want to do. If you know what i mean.\r\n\r\nFrom inside, it looks more like an informal sitting space like Cafe etc. with which i don\'t have much issues but I have issues with the sitting which is highly uncomfortable(those solid boxes), atleast for me.\r\nMoreover in your second image, the postures of people are strong point in justifyng my above mentioned opinion that it would not be used by persons waiting for bus but by people looking for a place for resting and other such activities but not for waiting for bus. So how can it be called \"Highly Functional\". I think you should first understand the real function of a bus stop and then analyze it again.\r\nCan someone explain to me that from where is this design \"ENVIRONMENTAL AND CULTURAL FREINDLY AND PURPOSE MADE\" as commented by MR. SHUJAT ALI HAMID, at least i am unable to understand it.\r\nwaiting for explanations and .......\r\n\r\nA positive note to conclude it that it is very positive thing that at least you are the only student from COMSATS who keep on getting time for such activities from his busy scedule.\r\nRegards\r\nHaseeb Saeed.','','',0,210,'Design',1509,'2009-09-12 09:43:00','2009-09-12 09:43:00','203.82.58.50'),(1339,'','@ Haseeb Saeed .........finally u came up to the atge.....i appreciate it first.....secondly u make a clear criticising effort for the design analysis....highly acceptable.......thiirdly there will b issues with the proposed design.......i agree......4th the place for which it is build....it acts as a community place......5th this bus stop will definately not proposed for the murree road in rawalpindi.....6th the culture of utah and the salt lake has been far more different the climate or the scenario of the environment is different from rawalpindi.......7th oh bhai kabi sms ka jawab bi dia karo har waqt kanjoosi par hi hotay ho.......8th its a very vast area so people there r using bicycles to park at the stands from from where they go by bus to their destinations....so they needed one....9th plasma screen acts as a source to make their time for waiting more comfortable....they have the sence of using the time properly......n kindly go through my statement the plasma will mainly provide view of the bus from the camera on the front side of the bus stop so that people sitting in opposite direction doesnt miss it....it will also chow the bus schedules along with some music etc......i guess.....thats it for the time rest we can discuss back in the office or in any bus stop....bye bye... ','','',0,210,'Design',181