,'','@ annawoo - I would have to disagree somewhat with your observation of that other design. Both this design and that one offer zero stability for dynamic loads, like wind. I do agree that the other design would likely stand up, but I believe it would have a very tough time in any substantial wind. This project on the other hand has a substantial butterfly roof that rests on glass and has no real support for 90% of its span.','','',0,170,'Design',388,'2009-09-14 14:33:35','2009-09-14 14:33:35','72.24.136.114'),(1387,'','nice man','','',0,153,'Design',1628,'2009-09-14 17:04:29','2009-09-14 17:04:29','119.153.142.68'),(1388,'','How much time did this design take you to come up?? Probably a ton... I mean 5 colors randomly spaced apart with seating facing all different directions.  Then spanning it with an enormous roof..... I mean the consideration, insight, form and function, graphics,... its just almost too much.....must have taken so long to think of.','','',0,154,'Design',1626,'2009-09-14 17:07:01','2009-09-14 17:07:01','24.180.7.51'),(1389,'','waitg for the result.','','',0,153,'Design',1629,'2009-09-14 17:11:40','2009-09-14 17:11:40','119.153.142.68'),(1390,'','the picture is just to satisfy the requirement so I can post my statement. It is not my own work.','','',0,223,'Design',1631,'2009-09-14 18:42:17','2009-09-14 18:42:17','71.94.63.101'),(1391,'','Great design!','','',0,215,'Design',1632,'2009-09-14 19:08:33','2009-09-14 19:08:33','70.103.167.23'),(1392,'','A bus stop is supposed to be a communal space, where different people interact, not just wait for buses like robots. Socialising is one of the biggest issues of our age, and it provides a very good environment. The importance of plasma can only be understood when u visit an area whose bus routes you dont know, so its very thoughtful. The basic point of criticism should be suggestions for improvement. The attempt is good. Keep it up & Best of Luck. I agree that its too white, colors need to be added. ',