'','',0,184,'Design',1688,'2009-09-16 00:19:46','2009-09-16 00:19:46','207.180.155.240'),(1413,'','Colors could be embedded in materials for better durability. I like your use of solar/LED for tower. Tower matches some themes already on campus.','','',0,150,'Design',1689,'2009-09-16 00:36:24','2009-09-16 00:36:24','71.32.199.31'),(1414,'','The design considers the people waiting in all kinds of weather and the cleaver use of a clear glass for easy viewing and safety','','',0,196,'Design',1690,'2009-09-16 01:21:17','2009-09-16 01:21:17','76.203.72.246'),(1415,'','Very well designed and well thought out.  I am especially impressed with the use of recyclable materials and energy.  I also like the fact that the designer looked into the natural element of the design in terms of garden designs and use of sunlight.  Very well done.','','',0,225,'Design',1692,'2009-09-16 01:27:19','2009-09-16 01:27:19','71.174.224.32'),(1416,'','I like the use of sustainable materials and the intention to integrate the sun\'s power and rainwater into maintaining the site.  This also seems cost effective in the long-run.  The design is simple, but well thought out to accomodate all the needs of people at a bus stop and it also seems financially reasonable to complete.','','',0,225,'Design',1693,'2009-09-16 01:48:24','2009-09-16 01:48:24','65.35.16.166'),(1417,'','This design stood out to me right away!  It is unique and I appreciate the designers use of natural resources and recyclable materials.  The eco-friendly vibe of the bus stop makes it warm and inviting.  It seems extremely practical in every sense.','','',0,225,'Design',1695,'2009-09-16 02:07:26','2009-09-16 02:07:26','24.63.24.222'),(1418,'','I like the garden element with well chosen plants. This lends a peaceful element to a spot where people are often stressed. The use of solar power is\r\nalso very effective','','',0,225,'Design',1696,'2009-09-16 02:13:53','2009-09-16 02:13:53','209.6.4.44'),(1419,'','Climb aboard!\r\n\r\nThis one made me laugh.....not a bad thing at all.','','',0,148,'Design',1697,'2009-09-16 02:27:03','2009-09-16 02:27:03','71.98.166.33'),(1420,'','This captures the essence of FLLW\'s organic architecture without mimickry or or pastiche.\r\n\r\nVery nice.','','',0,67,'Design',1697,'2009-09-16 02:30:22','2009-09-16 02:30:22','71.98.166.33'),(1421,'','Interesting that this submission is one of the few (or only?) that shows inclement weather instead of a nice sunny day. It is a shelter, after all.........','','',0,145,'Design',1697,'2009-09-16 02:45:21','2009-09-16 02:45:21','71.98.166.33'),(1422,'','Very nice - light, simnple and inviting.','','',0,208,'Design',1699,'2009-09-16 02:45:29','2009-09-16 02:45:29','68.4.25.165'),(1423,'','immediately engaging, innovative and inviting.','','',0,214,'Design',1698,'2009-09-16 02:53:34','2009-09-16 02:53:34','75.140.118.178'),(1425,'','I am impressed with the comprehensive solution achieved in this design. It\'s form is deeply rooted in enhancing and accommodating the function of a bus stop, while its materiality has positive sustainable impacts on both the macro and immediate site scales. This evokes a welcome site-specific responsiveness to a program far too often under served by utilitarian prefab bus stops. \r\n','','',0,225,'Design',1703,'2009-09-16 03:47:43','2009-09-16 03:47:43','207.180.155.240'),(1426,'','Is this really a folding bus stop? At the end of the day its just a container.','','',0,184,'Design',1707,'2009-09-16 05:09:44','2009-09-16 05:09:44','207.180.155.240'),(1427,'','Full text on page 2:\r\n\r\nThe concept for the bus stop on the Utah State’s campus is to create a lively environment that fosters collaboration and interaction between student, faculty, and public life. The mission of the university fits well with this concept. Utah State has created a master planning process composed of seven principles to consider.\r\n \r\n1. A lively campus; a magnet for student, faculty, staff and public life\r\n2. State of the art facilities to support the university’s mission for teaching, research and public life\r\n3. A setting to foster interdisciplinary collaboration and interaction\r\n4. Campus as a destination for the public\r\n5. Functional and sustainable transportation\r\n6. Capitalize on the natural landscape setting, and\r\n7. Leadership in environmental stewardship\r\n\r\nA campus bus stop was developed with these principles in mind. In order to achieve an interdisciplinary collaboration and interaction, the idea arose to use LCD screens to present information to the public regarding campus activities. Sustainable efforts were used in several ways to follow with the mission of the university. Photovoltaic panels are installed to power the LCD screen and other energy the building may need for its water fixtures. Water collection is a large part of the sustainable design of the bus stop. Pervious paving materials were used to permit water to enter a cistern by virtue of the porous nature or large spaces in the material. The structure was slanted in areas to allow the water to flow into a cistern underneath an above ground water fixture. From this cistern, water is then pumped when necessary to irrigate the surrounding landscape. To create a pleasant environment, the building is oriented so that the sun is both exposed and concealed from the interior of the structure. This orientation enables the building to have warm areas in the cold winter months and cools areas in the hot summer months. Landscaping is used to create a fun destination for the public and a welcoming entrance to the structure. Together, all of these principles set up an ideal lively campus environment.\r\n','','',0,220,'Design',1584,'2009-09-16 06:02:28','2009-09-16 06:02:28','72.207.233.208'),(1428,'','very interesting communal space; I like the white and the complexity but may be a bit too complex in the day to day usage.\r\nUwe R. Fitz Architect','','',0,210,'Design',1711,'2009-09-16 08:13:16','2009-09-16 08:13:16','84.178.35.166'),(1429,'','budget?','','',0,214,'Design',1010,'2009-09-16 12:53:33','2009-09-16 12:53:33','86.148.219.32'),(1430,'','Very modern design that takes the environment and users of public transportation into thoughtful consideration.','','',0,225,'Design',1736,'2009-09-16 13:50:39','2009-09-16 13:50:39','128.103.18.81'),(1431,'','nice work! interesting stuff you\'ve got going on here.\r\n\r\n\r\nnot sure what all that fuss about street-side stops was about. every city that i\'ve lived in has had them...\r\n\r\n\r\n\r\n','','',0,83,'Design',1737,'2009-09-16 14:09:19','2009-09-16 14:09:19','24.220.78.218'),(1432,'','A well thought out proposal that provides a simple, modern design that blends well with any environment.  The use of \"green\" materials, as well, as natural greenery creates an ecological balance.  The design is streamlined enough to allow pedestrian flow, protection from the elements for those waiting for the bus and easy maintenance for urban crews.','','',0,225,'Design',1745,'2009-09-16 16:02:53','2009-09-16 16:02:53','71.29.208.81'),(1435,'','great piece of work ','','',0,228,'Design',1747,'2009-09-16 16:26:31','2009-09-16 16:26:31','136.148.234.21'),(1436,'','Very practical and manageable...The atmosphere and convenience it provides will do wonders for a city... Great job Jim!','','',0,225,'Design',1748,'2009-09-16 16:32:55','2009-09-16 16:32:55','65.96.205.20'),(1437,'','Is this a joke?','','',0,228,'Design',1749,'2009-09-16 16:44:40','2009-09-16 16:44:40','207.180.155.240'),(1443,'','Now this this is a poor imitation of today\'s \'Starachitects\'... who needs a bench on a rail? So we can have sculptural control? yay! Let me guess everything will be fastened with glue and a hot gun?','','',0,228,'Design',1755,'2009-09-16 17:18:05','2009-09-16 17:18:05','207.180.155.240'),(1444,'','This design has a nice aesthetic. I\'m not sure if I see it as a bus stop or some sort of small pavilion. Where this really fails is in your choice of material. That timber, even if reclaimed, seems like an excessive waste of precious resources. With some modifications this could be a really nice design. 3 stars.','','',0,229,'Design',388,'2009-09-16 18:28:26','2009-09-16 18:28:26','72.24.136.114'),(1445,'','I believe the last thing I would want to do while waiting for a bus is try and move furniture/walls around so that I may sit down in a more comfortable area. Maybe I am wrong? Maybe its hypocrisy because this is most surely not a \"Starchitect\" style design. IT is a design for a \"bus stop\" where form is ALL ABOUT function. As a sculptural piece in a landscape or plaza... it is wonderful.  As a bus stop it lacks many rudimentary things. Still very creative and well done.','','',0,228,'Design',1522,'2009-09-16 18:45:04','2009-09-16 18:45:04','24.180.7.51'),(1446,'','The best \"Campus Stop\" I\'ve ever seen!!!','','',0,220,'Design',1767,'2009-09-16 19:46:49','2009-09-16 19:46:49','143.228.129.9'),(1447,'','This makes me want to move to Utah.','','',0,220,'Design',1768,'2009-09-16 19:55:56','2009-09-16 19:55:56','70.163.51.223'),(1448,'','Postives include: safety considerations, environmental impact,\r\nand asthetics \r\n\r\nPossible improvements:\r\nAnyway to offer something beyond traditional? (WI-FI, place to recharge cell phones, news or entertainment, expert advice on routing given start and end places and current conditions)','','',0,225,'Design',1770,'2009-09-16 20:25:03','2009-09-16 20:25:03','69.40.146.174'),(1449,'','good job!!!','','',0,229,'Design',1771,'2009-09-16 21:41:37','2009-09-16 21:41:37','82.57.160.210'),(1450,'','Very modern and simple. This looks like it would be at home in a city atmosphere','','',0,225,'Design',1776,'2009-09-17 00:34:43','2009-09-17 00:34:43','216.82.251.227'),(1454,'','arquiteturaumvicio.blogspot.com','','',0,232,'Design',1757,'2009-09-17 02:40:23','2009-09-17 02:40:23','201.68.109.89'),(1455,'','Great idea with the movable seating.  Night shots very effective.  Lo