SIGN\",\r\nwith a great concept.','','',0,240,'Design',2139,'2009-09-22 10:40:53','2009-09-22 10:40:53','78.39.14.250'),(1614,'','i think its a great idea. there are a lot of designs on here that serve the designer more than the project, but this has an element of amusement that every campus should have. ','','',0,249,'Design',2141,'2009-09-22 10:55:20','2009-09-22 10:55:20','173.30.25.57'),(1615,'','feathers! love it!','','',0,249,'Design',2143,'2009-09-22 11:02:16','2009-09-22 11:02:16','173.30.25.57'),(1616,'','good job! i think its very compelling. very well designed.','','',0,249,'Design',2147,'2009-09-22 11:12:04','2009-09-22 11:12:04','173.30.25.57'),(1617,'','Are you Norman Foster?!\r\nIt\'s WONDERFUL!\r\n\r\nI think you\'ll be a great architect.','','',0,240,'Design',2145,'2009-09-22 11:23:21','2009-09-22 11:23:21','78.39.14.250'),(1618,'','bright and cheerful without being too much. i think this design could be adapted to many college campuses.','','',0,249,'Design',2154,'2009-09-22 11:45:43','2009-09-22 11:45:43','173.30.25.57'),(1619,'','Great design. I love the open but protected feel of the glass roof and the efficiency of the self powered energy system.','','',0,180,'Design',2165,'2009-09-22 12:47:05','2009-09-22 12:47:05','65.81.99.230'),(1620,'','This design is intriguing.  Love the greenery and artwork, clean lines, and the lack of UTA graphics, which helps it blend in.  I like that there is no plexi glass or surfaces that would be scratched up or prone to graffiti.  I want to hang out in this space.','','',0,256,'Design',2182,'2009-09-22 14:38:20','2009-09-22 14:38:20','207.200.116.71'),(1621,'','The design caters to the basic requirements of the bus stop and is minimalistic in terms of material usage which works well for a public structure to be mass produced.','','',0,258,'Design',997,'2009-09-22 14:39:15','2009-09-22 14:39:15','59.182.139.147'),(1622,'','the flow of the grass up from the ground is visually stunning.  how enjoyable','','',0,256,'Design',2183,'2009-09-22 14:41:52','2009-09-22 14:41:52','199.67.131.151'),(1623,'','This is an incomplete entry. Please rate the design on the following link:\r\n\r\nhttp://www.nextstopdesign.com/designs/258-The-Convenient-stop','','',0,257,'Design',856,'2009-09-22 14:42:54','2009-09-22 14:42:54','116.72.53.156'),(1624,'','Likes-\r\nSustainable design\r\ncaters for physically disabled\r\nRevenue generation by advertisement\r\n\r\nPoints to consider-\r\nTicket vending machines at bus stops is a very expensive option\r\nProtection from sun, wind, rain for those sat at the front?\r\n\r\n','','',0,258,'Design',2184,'2009-09-22 15:16:43','2009-09-22 15:16:43','81.138.234.132'),(1625,'','Thank you both.','','',0,246,'Design',1855,'2009-09-22 16:19:05','2009-09-22 16:19:05','65.23.224.250'),(1626,'','@ jaspalboparai:\r\nTicket vending machine is optional, if required by local transport authority\r\nThe bus stop roof extends till the road/curb edge. The front seating is recessed inside by 30 centimeters (1 foot) so that the people seated here are protected from vertical rain, sun and snow. A larger roof overhang would be ideal, but considering that the bus stop is fairly large at 3 meter depth (approximately 10 feet) it would be inappropriate to widen the bus stop further.\r\nThe large depth is meant to accommodate more standing people in case the bus stop is overused.','','',0,258,'Design',856,'2009-09-22 16:44:47','2009-09-22 16:44:47','116.72.53.156'),(1627,'','THIS ENTRY IS INCOMPLETE. PLEASE VOTE FOR THE COMPLETE ENTRY ON:\r\n\r\nhttp://www.nextstopdesign.com/designs/258-The-Convenient-stop \r\n\r\n','','',0,257,'Design',856,'2009-09-22 16:52:34','2009-09-22 16:52:34','116.72.53.156'),(1628,'','I like your idea. Very fresh and clever. Congratulations','','',0,236,'Design',152,'2009-09-22 17:11:17','2009-09-22 17:11:17','94.68.182.45'),(1629,'','Very nice idea. I like it. Bravo','','',0,152,'Design',152,'2009-09-22 17:14:01','2009-09-22 17:14:01','94.68.182.45'),(1630,'','Nice design. I like it. Very nice form and shape. ','','',0,246,'Design',152,'2009-09-22 17:16:47','2009-09-22 17:16:47','94.68.182.45'),(1631,'','An experimental prototype for interim use of space encompassing unique contemporary design qualities ','','',0,184,'Design',2195,'2009-09-22 17:30:49','2009-09-22 17:30:49','81.153.47.25'),(1632,'','Very cool.  Appreciate the use of high efficiency materials and the incorporation of natural landscape and high tech elements.  It captures in a microenviroment the essence of the U culture.','','',0,256,'Design',2174,'2009-09-22 17:33:52','2009-09-22 17:33:52','97.117.8.159'),(1633,'','Nice incorporation of photovoltaic system for energy use. The interactive screen and wi-fi are also great additions to the design. ','','',0,215,'Design',2197,'2009-09-22 18:01:31','2009-09-22 18:01:31','168.215.222.4'),(1634,'','Minimal usage of material and the thought of having the seating and the roof formed from the same material will diffinitly trigger thoughts on our environment and how to save it, everything is connected. ','','',0,184,'Design',2203,'2009-09-22 19:29:06','2009-09-22 19:29:06','81.154.8.9'),(1635,'','I can\'t say this proposal is visually pleasing, but design is subjective. From your presentation one cannot figure out why it is easy constructable or maintainable. How about access? It seems really hard to access the shelter and the step at the only entrance make it hard for people w/ disabilities. Moreover, this design may be ideal for a heavy winter (Utah\'s winters are moderate)but during Utah\'s hot summers it will be a furnace. Finally I think you mention that your design is historically inspired? Horizontal and vertical elements don\'t make a design historical.','','',0,155,'Design',1035,'2009-09-22 20:10:18','2009-09-22 20:10:18','68.160.198.128'),(1636,'','akyrialanis... beautiful graphics, concept, and design. Well thought out for actual site, multi-use, and adaptability. Best design overall except for ours. Good luck. I hope you get more votes then some of the other trash out there. peace','','',0,260,'Design',597,'2009-09-22 20:42:30','2009-09-22 20:42:30','24.180.7.51'),(1637,'','very nice looks a greek stile....','','',0,184,'Design',2213,'2009-09-22 21:10:23','2009-09-22 21:10:23','195.190.181.73'),(1638,'','I would like to have this in my city Lugano!','','',0,184,'Design',2214,'2009-09-22 21:14:27','2009-09-22 21:14:27','195.190.181.73'),(1639,'','nice design! :-)','','',0,184,'Design',2215,'2009-09-22 21:20:32','2009-09-22 21:20:32','195.190.181.73'),(1640,'','Great feeling of lightness. Fantastic design. The bicycle idea is really great ! Practical, functional and likely to be easy to maintain.','','',0,164,'Design',2228,'2009-09-23 00:14:41','2009-09-23 00:14:41','187.146.66.125'),(1641,'','Excellent program/solution for contemporary concerns (like energy use) and standard bus-stop concerns (like being cold and bored).','','',0,256,'Design',2233,'2009-09-23 00:31:26','2009-09-23 00:31:26','71.189.146.149'),(1642,'','the rock garden is quite new concept. the rock has to be big that people can sit on it while waiting. does the shelter has a phone too?','','',0,206,'Design',2067,'2009-09-23 00:45:42','2009-09-23 00:45:42','66.183.21.250'),(1643,'','There\'s a major issue with this proposal. You cannot fold fiberglass after it has hardened. Especially as thick as you show it to be. So in reality this structure would come prefabricated and not assembled on site. So there\'s no modularity involved. Still I think it would be easy to fabricate. Other issues that i can think of, the seating area is too small for its overall size. 1.2m, enough space for roughly 2 people (typical chair dimension: 0.55x0.55), and it makes a good graffiti canvas, which is not necessarily a bad thing...\r\nStill I can\'t deny that there was some though involved and the design is above average.','','',0,184,'Design',1035,'2009-09-23 01:11:52','2009-09-23 01:11:52','71.5.71.169'),(1644,'','Apparently you don\'t know neither how triangulation or keystones work (or trusses and sheering). I guess you just tried to use those fancy terms and clearly they don\'t reflect on your design. I understand this is an ideas competition, but if you are going to talk about engineering at least try to make your design a bit more realistic. \r\nEven if someone overlooks this fact, your design is intimidating, and in real life I can\'t see anyone sitting underneath it. ','','',0,230,'Design',1035,'2009-09-23 01:20:02','2009-09-23 01:20:02','71.5.71.169'),(1645,'','Yeah Kavbar...you should mind your own business','','',0,216,'Design',2240,'2009-09-23 01:59:08','2009-09-23 01:59:08','72.207.239.194'),(1646,'','This design is so innovative and  it is a symbol of future in present time.','','',0,240,'Design',2216,'2009-09-23 01:59:43','2009-09-23 01:59:43','74.12.204.99'),(1647,'','Reminds me a bit of the Einstein Observatory in Potsdam, Germany by Erich Mendelsohn. Not sure if it is right for a bus stop. http://media-2.web.britannica.com/eb-media/63/118563-004-17FB6D32.jpg','','',0,261,'Design',388,'2009-09-23 02:52:09','2009-09-23 02:52:09','72.24.136.114'),(1648,'','I really like the clean edged structure of the bus stop. Also the form and its vibrant colour makes it easily noticeable from a distance.','','',0,258,'Design',2254,'2009-09-23 08:34:03','2009-09-23 08:34:03','59.182.159.75'),(1649,'','I like the fact that the design takes into account the needs of disabled.','','',0,258,'Design',2255,'2009-09-23 08:45:19','2009-09-23 08:45:19','141.228.106.147'),(1650,'','This design looks as if some fun box has opened up and what comes out is your bus stop. 2 sides open up sideways and form the ramp, the top and part front side tilt upwards to form the roof. I must say - very interesting thought.','','',0,258,'Design',2256,'2009-09-23 08:50:56','2009-09-23 08:50:56','59.182.159.75'),(1651,'','Superb design, beautifully balanced, innovative concept. Looking forward to seeing in as many urban areas as possible.','','',0,240,'Design',2212,'2009-09-23 10:59:14','2009-09-23 10:59:14','78.39.14.250'),(1652,'','very bad presentation.','','',0,249,'Design',2212,'2009-09-23 11:10:54','2009-09-23 11:10:54','78.39.14.250'),(1653,'','Again another design that doesn\'t have a realistic understanding of the size of materials and the structures needed to hold things up. And it would be nice if at least some of the requirements of the competition were met!!!!','','',0,249,'Design',560,'2009-09-23 12:08:35','2009-09-23 12:08:35','24.239.161.53'),(1654,'','Very nice design, simple and modern','','',0,263,'Design',2275,'2009-09-23 12:37:04','2009-09-23 12:37:04','190.113.146.23'),(1655,'','Awesome!!. I would love to see it built it soon. ','','',0,263,'Design',2275,'2009-09-23 12:40:07','2009-09-23 12:40:07','190.113.146.23'),(1656,'','appears to be easily configured in modules for expansion','','',0,100,'Design',2281,'2009-09-23 13:13:21','2009-09-23 13:13:21','71.111.214.84'),(1657,'','Very well thought out design, good use of modular components, looks to be adaptable to a variety of program requirements.  Your renderings in the rain are good!','','',0,145,'Design',2283,'2009-09-23 13:29:44','2009-09-23 13:29:44','74.232.30.85'),(1658,'','I really like the form you created.  Your drawing is what caught my eye, as it shows your idea nicely.','','',0,240,'Design',2283,'2009-09-23 13:33:44','2009-09-23 13:33:44','74.232.30.85'),(1659,'','What protects pedestrians from extreme weather?  Eleven architects worked together on this concept?!...hmmm...seems quite a group missed a lot!','','',0,256,'Design',853,'2009-09-23 13:36:30','2009-09-23 13:36:30','58.250.108.56'),(1660,'','Great idea to turn the shelter toward the approach of the bus.  You need a place for graphics, advertising, etc.  The roof form is interesting with the skylight on the ridge between the two halves.  The overhang at either end provide extra sheltered space.  Nice.','','',0,67,'Design',228