d well presented!  I\'d be happy to sit and wait for a bus here.','','',0,266,'Design',2248,'2009-09-23 16:05:27','2009-09-23 16:05:27','76.17.155.12'),(1672,'','this one seems to be the best for our times, i would just add a panel where people could leave their own graffitti.\r\ncombining bikes with this seems like a good idea. \r\nposted by parece\r\n','','',0,164,'Design',2302,'2009-09-23 16:25:18','2009-09-23 16:25:18','207.200.116.71'),(1673,'','Very creative I am impressed!I would like it in my town. ','','',0,263,'Design',2307,'2009-09-23 16:41:32','2009-09-23 16:41:32','190.113.146.23'),(1674,'','Love the look of this one. I can see the circular shape really fostering a sense of community on campus.  ','','',0,206,'Design',2308,'2009-09-23 16:58:12','2009-09-23 16:58:12','96.51.79.17'),(1675,'','Clever design and interesting concept! ','','',0,263,'Design',2314,'2009-09-23 17:39:50','2009-09-23 17:39:50','190.113.146.23'),(1676,'','That is a really good design. Simple, easy to construct, efficient, reversible and it can be installed anywhere. Well presented as well. If you would change something, you should lose one of the glass panels. I don\'t think you need so much enclosure. Winters are moderate in Utah. Anyways, great job, five stars from me!','','',0,266,'Design',1035,'2009-09-23 18:05:43','2009-09-23 18:05:43','68.160.198.128'),(1677,'','how does someone in a wheelchair use this since its lifted off the sidewalk? What about bus information? The lighting is nice, but if you remove that from the design, it\'s the same old bus stop.','','',0,263,'Design',2321,'2009-09-23 18:14:06','2009-09-23 18:14:06','67.159.45.24'),(1678,'','This would make an ok design for a small house but definitely not a bus stop. Secondly i don\'t think it is possible to construct this roof.\r\nThere is an actual place for this bus stop and it\'s not inclined. Check the brief next time. And if you\'re gonna copy another design of your, at least adjust it for the competition. According to your proposals, passengers will have to run from a rooftop, down a long flight of stairs, or go inside a store and through one door to catch the bus?','','',0,261,'Design',1035,'2009-09-23 18:16:20','2009-09-23 18:16:20','68.160.198.128'),(1679,'','i meant the ground is not inclined.','','',0,261,'Design',1035,'2009-09-23 18:16:54','2009-09-23 18:16:54','68.160.198.128'),(1680,'','It seems like this bus stop is trying to do a lot, but I like the idea that students work can be shown... good graphics','','',0,256,'Design',2321,'2009-09-23 18:19:57','2009-09-23 18:19:57','67.159.45.24'),(1681,'','air condition? for an open outdoor bus stop? such a waste of energy.','','',0,233,'Design',2321,'2009-09-23 18:23:26','2009-09-23 18:23:26','67.159.45.24'),(1682,'','this isn\'t a new way of thinking. and the folding construction steps aren\'t real steps. how would you attach one end to another? not to mention how can someone in a wheelchair use it?','','',0,184,'Design',2321,'2009-09-23 18:27:53','2009-09-23 18:27:53','67.159.45.24'),(1683,'','The advantage of this design compared to others is that the architect paid attention to the function as well as the form. The bus stop is mainly a temporary shelter to house commuters and to allow them to see the bus approaching the station without any obstruction. This open view  was achieved by introducing the cantilevered corner. The form is simple and nice but can be nicer if height is reduced by one module. The introduction of lights on the top part is a clever way to make sure that no one will miss the bus stop. Well done','','',0,263,'Design',2289,'2009-09-23 19:44:34','2009-09-23 19:44:34','87.194.2.37'),(1684,'','awesome design! would love to see it in san fran','','',0,273,'Design',2329,'2009-09-23 19:48:29','2009-09-23 19:48:29','84.203.171.23'),(1685,'','very cool','','',0,273,'Design',2331,'2009-09-23 19:56:26','2009-09-23 19:56:26','84.203.171.23'),(1686,'','It will stand, very nice transparent concept, the cantil