sentation, doable and realistic!!!','','',0,266,'Design',560,'2009-09-24 11:15:51','2009-09-24 11:15:51','24.239.161.53'),(1721,'','It is very inventive, at the same time it leaves a lot of questions unanswered. But one of the best projects in the competition never the less!!!!','','',0,184,'Design',560,'2009-09-24 11:17:55','2009-09-24 11:17:55','24.239.161.53'),(1722,'','It looks like real. nice very nice','','',0,263,'Design',2428,'2009-09-24 11:18:21','2009-09-24 11:18:21','190.113.146.23'),(1723,'','rerfecto!','','',0,246,'Design',671,'2009-09-24 11:33:22','2009-09-24 11:33:22','89.105.244.186'),(1724,'','Very cool!','','',0,276,'Design',2434,'2009-09-24 11:42:12','2009-09-24 11:42:12','93.72.151.151'),(1725,'','Dear dharma\r\nOur design has wheel chairs access. It is behind the red wall. The color red get attention on the information panels and with the height would get a landmark on that corner.','','',0,263,'Design',1774,'2009-09-24 11:44:40','2009-09-24 11:44:40','190.113.146.23'),(1726,'','A little out of context at the U.  The low things look like tripping hazards.','','',0,85,'Design',2437,'2009-09-24 11:44:40','2009-09-24 11:44:40','68.40.122.222'),(1727,'','Dear dharma I would like to show a complete project but, i can uploaded just 3 images\r\n','','',0,263,'Design',1774,'2009-09-24 11:55:51','2009-09-24 11:55:51','190.113.146.23'),(1728,'','I love radiant heat!  Adding radiant to a bus stop is sure to make it more welcoming to travelers in colder climates.  The shelter provides plenty of protection from the elements, but will still allow a breeze through on a warm summer day.  Prefabricating the components will make for quick assembly.  Great work!','','',0,266,'Design',2438,'2009-09-24 11:56:46','2009-09-24 11:56:46','208.53.229.232'),(1729,'','Great design very modern and interesting. I would love to wait for bus under this :)','','',0,273,'Design',2441,'2009-09-24 12:11:21','2009-09-24 12:11:21','79.97.240.184'),(1730,'','Fits really well into the U of U context (where I have spent a lot of time).  Concern: how does the grass get mowed, or is it a maintenance nightmare?  Suggestion: make it a wifi hotspot for students\' smartphones and netbooks.','','',0,256,'Design',2437,'2009-09-24 12:15:51','2009-09-24 12:15:51','68.40.122.222'),(1731,'','Trivia is fun! Bus stops are stinky and boring. Trivia + bus stop equals more fun, less boring, same amount of stink. I was going to say that she has a smoke...but i guess eating the lover is good too. This design concept is genious because it allows for diversity in building styles across the globe. It is an attractive addition that I assume can be retrofitted to any and all existing sites. Simple, not overbearing, educational, and informative. \"Crap, I missed my bus!\"\r\n5 stars in my mind. But I have a small brain...so I don\'t know much. And I can\'t jump. ','','',0,275,'Design',2452,'2009-09-24 13:02:13','2009-09-24 13:02:13','64.25.196.92'),(1732,'','I tried to give it 5 stars and I wasn\'t able to do so. Sounds like a weiner to me!','','',0,275,'Design',2333,'2009-09-24 13:15:57','2009-09-24 13:15:57','171.159.194.11'),(1733,'','enviro friendly and informative','','',0,275,'Design',2461,'2009-09-24 13:17:07','2009-09-24 13:17:07','63.161.156.129'),(1734,'','I fail to see how the unit attaches to the ground.  Marginal!','','',0,145,'Design',853,'2009-09-24 13:22:40','2009-09-24 13:22:40','58.250.105.219'),(1735,'','Great idea and use of a captive audience... it will enhance and excite the mondaine daily commute.  ','','',0,275,'Design',2467,'2009-09-24 13:26:07','2009-09-24 13:26:07','71.156.181.174'),(1736,'','A very legit design amongst many that are unbuildable.','','',0,266,'Design',1056,'2009-09-24 13:31:13','2009-09-24 13:31:13','71.32.179.178'),(1737,'','I guess you\'ve never stood at a bus stop with blowing and pouring rain.  No, this unit would not protect pedestrians from any extreme weather.  It might be best served as a sculpture in the middle of a shopping mall designed by professionals.  Besides true architects would never enter such a mindless online competition as this.  I find it hard to imagine eleven, true architects worked on this concept.  Perhaps first year graphic design students with elementary CAD experience might attempt an online submission.  Get certified and then impress me.\r\n\r\n','','',0,256,'Design',853,'2009-09-24 13:33:08','2009-09-24 13:33:08','58.250.105.219'),(1738,'','It looks very Utahan','','',0,277,'Design',2468,'2009-09-24 13:34:31','2009-09-24 13:34:31','138.208.5.3'),(1739,'','Very interesting!Well done!','','',0,184,'Design',2471,'2009-09-24 13:42:08','2009-09-24 13:42:08','94.67.211.114'),(1740,'','Structural shapes is one element of design.  You missed the bigger picture, how does the unit protect pedestrians from weather?','','',0,259,'Design',853,'2009-09-24 13:44:04','2009-09-24 13:44:04','58.250.105.219'),(1741,'','I\'d like the see the structural calculations for this unit.  I suggest you stay in school and perhaps one day you might have knowledge.','','',0,283,'Design',853,'2009-09-24 13:53:09','2009-09-24 13:53:09','58.250.105.219'),(1742,'','umm... yeah. it won\'t let me rate it 5 stars... wtf? this is a smart and fun design. i would have a great time chilling at this bus stop. ','','',0,275,'Design',2474,'2009-09-24 13:53:44','2009-09-24 13:53:44','206.221.237.82'),(1743,'','I like this design!  It\'s the new stop of the future.','','',0,266,'Design',2477,'2009-09-24 13:57:13','2009-09-24 13:57:13','68.113.188.186'),(1744,'','Congrats, you have successfully incorporated ten telephone booths along a defined radius.  Looks like a terrible high school art project.  I wish you luck in whatever.','','',0,279,'Design',853,'2009-09-24 13:58:11','2009-09-24 13:58:11','58.250.105.219'),(1745,'','It is accepting your star rating. Watch the overall rating change when you click on [hopefully] the 5th star. It works...its just not visually stimulating us with stars flying all ove