0.116.71'),(1932,'','5-year old?','','',0,16,'Design',2786,'2009-09-25 02:18:07','2009-09-25 02:18:07','71.38.169.187'),(1933,'','thoughtful lighting design','','',0,140,'Design',2399,'2009-09-25 02:18:55','2009-09-25 02:18:55','116.236.228.187'),(1934,'','No benches, no wind protection?','','',0,273,'Design',2786,'2009-09-25 02:19:55','2009-09-25 02:19:55','71.38.169.187'),(1935,'','Mullions may be made of any material, but wood and aluminum[2] are most common, although stone is also used between windows. Mullions are vertical elements and are often confused with transoms, which lie horizontally. The word is also confused with the \"muntin\" (or \"glazing bar\" in the UK) which is the precise word for the very small strips of wood or metal that divide a sash into smaller glass \"panes\" or \"lites\".\r\n\r\nA mullion acts as a structural member, and it carries the dead load of the weight above the opening and the wind load acting on the window unit back to the building structure. The term is also properly applied to very large and deep structural members in many curtain wall systems.\r\n\r\nWhen a very large glazed area was desired before the middle of the nineteenth century, such as in the large windows seen in gothic churches or Elizabethan palaces, the openings necessarily required division into a framework of mullions and transoms, often of stone. It was further necessary for each glazed panel, sash or casement to be further subdivided by muntins or lead cames because large panes of glass were reserved primarily for use as mirrors, being far too costly to use for glazing windows or doors.\r\n','','',0,284,'Design',1858,'2009-09-25 02:22:58','2009-09-25 02:22:58','76.184.105.22'),(1936,'','Smart and cost effective. Woul dlove to see built.','','',0,169,'Design',2777,'2009-09-25 02:25:40','2009-09-25 02:25:40','207.200.116.71'),(1937,'','intriging and elegant, a little minimal though','','',0,232,'Design',2399,'2009-09-25 02:27:01','2009-09-25 02:27:01','116.236.