9','2009-09-25 02:57:19','76.184.105.22'),(1950,'','Yeah, recycling is the cool thing now... what about creating architecture? I mean, are we forgetting about spacial definition, scale, beauty, functionality...? And then we can talk about recycling.','','',0,272,'Design',2492,'2009-09-25 03:02:15','2009-09-25 03:02:15','76.184.105.22'),(1951,'','Nice graphics, but how does it work as a bus stop? I see it more as a piece of public art, very attractive, but with no specific function.','','',0,273,'Design',2492,'2009-09-25 03:05:48','2009-09-25 03:05:48','76.184.105.22'),(1952,'','Just another metal box','','',0,266,'Design',418,'2009-09-25 03:07:11','2009-09-25 03:07:11','65.28.65.17'),(1953,'','a little too minimal?','','',0,302,'Design',2399,'2009-09-25 03:08:52','2009-09-25 03:08:52','116.236.228.187'),(1954,'','This submittal shows up and recently landed over 100 votes in a weekend? Ok, whatever.','','',0,263,'Design',418,'2009-09-25 03:11:25','2009-09-25 03:11:25','65.28.65.17'),(1955,'','I think that the solid vs void concept could describe almost any object, and probably any of the projects in this competition. I don\'t see what is contemporary about this boxes with a pergola. I disagree with your description.','','',0,302,'Design',2492,'2009-09-25 03:11:46','2009-09-25 03:11:46','76.184.105.22'),(1956,'','That\'s fine, save the history lesson.  I know what \'mullions\' are.....I was curious about your \'molliums\' you speak about in your description.  Mullions do not act as structural members unless they are apart from a typical stick-built system, and unless they are sized to do so.  Even with a structural tube or with proprietary reinforcement, they\'re only functional for resisting lateral forces and not for deading a monstrous canopy from above.  Maybe I\'d change my mind if I saw the framing and foundation drawings to prove it.  No one would confuse mullions with transoms.....one is framing and the other is glazing.  ','','',0,284,'Design',1056,'2009-09-25 03:16:26','2009-09-25 03:16:26','173.29.151.141'),(1957,'','I don\'t see the practicality of this design. This will not work on an urban setting, it takes up half a block of space! Nice concept for an office lobby perhaps.','','',0,154,'Design',2492,'2009-09-25 03:17:32','2009-09-25 03:17:32','76.184.105.22'),(1958,'','Who\'s paying for this?  I hope there\'s a loose-pocketed alum available.','','',0,220,'Design',1056,'2009-09-25 03:19:40','2009-09-25 03:19:40','173.29.151.141'),(1959,'','design is very inovative','','',0,164,'Design',2387,'2009-09-25 03:20:45','2009-09-25 03:20:45','122.169.86.209'),(1960,'','Design #342 that is carried by the rendering.  There\'s no seating and it\'s durability is poor.  Can you say \'UV degradation\'?','','',0,184,'Design',1056,'2009-09-25 03:23:30','2009-09-25 03:23:30','173.29.151.141'),(1961,'','Having taken the bus every day for an entire school year, I now despise the stops in the town in which I live.  This design would bring much-needed practicality, self-sufficiency, and appropriate aesthetics to a new variation on an old theme.  Well done.','','',0,266,'Design',2807,'2009-09-25 03:43:06','2009-09-25 03:43:06','75.73.154.187'),(1962,'','this design is pretty fantastical - much appreciated and well thought out','','',0,115,'Design',2399,'2009-09-25 04:01:15','2009-09-25 04:01:15','116.236.228.187'),(1963,'','Having taken the bus every day for an entire school year, I now despise the stops in the town in which I live.  This design would bring much-needed practicality, self-sufficiency, and appropriate aesthetics to a new variation on an old theme.  Well done.','','',0,266,'Design',2807,'2009-09-25 04:04:54','2009-09-25 04:04:54','75.73.154.187'),(1964,'','this design is pretty fantastical - much appreciated and well thought out','','',0,115,'Design',2399,'2009-09-25 04:05:52','2009-09-25 04:05:52','116.236.228.187'),(1965,'','Why do we want to make personal spaces out of a public transportation system? The beauty of public transportation is social interaction and exposition to the society, etc. I don\'t think that this project leads to a safe environment, there are too many hidden corners. Complicated design, the overall composition as an object looks more attractive from the top, but it will not be effective as a bus stop because it lacks visibility among other functional aspects for a bus stop.','','',0,279,'Design',2492,'2009-09-25 04:12:24','2009-09-25 04:12:24','76.184.105.22'),(1966,'','this design is pretty fantastical - much appreciated and well thought out','','',0,115,'Design',2399,'2009-09-25 04:12:33','2009-09-25 04:12:33','116.236.228.187'),(1967,'','The desire for individual space is held by nearly any person that uses it.  It\'s the reason why a partially populated subway will have people scattered about the seating area.  It\'s why people will wear headphones or read a magazine or stare out the window.  It\'s why you use the urinal 2 spots down from the next guy.  Public transportation is a sociological testament of how humans carve out a small piece of the world to inhabit by themselves.  In addition, this idea removes the wasted seating space between separated people and translates it into circulation space.   ','','',0,279,'Design',1056,'2009-09-25 04:32:26','2009-09-25 04:32:26','173.29.151.141'),(1968,'','The separated layout allows for the lighting to leak out in multiple locations to eliminate dark spots that could be attractive to the wrong person.  The multi-directional seating also can lessen blind spots for the users and the passers by.  The intent was to completely get away from a uni-directional facing design with everyone\'s back against a wall.   ','','',0,279,'Design',1056,'2009-09-25 04:38:15','2009-09-25 04:38:15','173.29.151.141'),(1969,'','Who knows how this would be accepted on a college campus, but at least its BUILDABLE.','','',0,304,'Design',1056,'2009-09-25 04:50:07','2009-09-25 04:50:07','173.29.151.141'),(1970,'','I like all the panels of glass, protects from wind, rain, snow, etc. I really like the green and the clean design.  ','','',0,266,'Design',2812,'2009-09-25 04:53:12','2009-09-25 04:53:12','99.185.121.134'),(1971,'','Not seeing which parts function as they are intended........no shelter, no tickets, no maps at eye-height, no seating, no bike racks.  And this waves in the wind!?!?!?!','','',0,273,'Design',1056,'2009-09-25 04:54:08','2009-09-25 04:54:08','173.29.151.141'),(1972,'','How did you become so bitter? Poor, poor SuWeiYin. A silly competition for sure, but to find no pleasure in it, only pain? And to keep coming back for more? \r\n\r\nI love the idea of criticism, but poor Matthew Facundus probably doesn\'t appreciate his (unfortunate) work being stolen. Please, try to find a sense of humor and stop being so devious and depressing. I sense you\'re trying to be funny, but creative humor would be so much more satisfying!\r\n ','','',0,287,'Design',2009,'2009-09-25 04:58:11','2009-09-25 04:58:11','68.40.201.203'),(1973,'','Not the prettiest design, but practical and cheap.  Ingenious way to recycle shipping containers.','','',0,304,'Design',2816,'2009-09-25 05:27:19','2009-09-25 05:27:19','75.80.35.192'),(1974,'','the fact that there are no ceiling lights is going to make this one dark bus stop.. ','','',0,154,'Design',2399,'2009-09-25 05:39:19','2009-09-25 05:39:19','116.236.228.187'),(1975,'','A unique, well thought through design. I like the presentation too!','','',0,184,'Design',2818,'2009-09-25 05:46:51','2009-09-25 05:46:51','213.7.25.121'),(1976,'','This a nice and original idea. Furthermore, it recycles the containers from shipping lines and can look great with art work painted.','','',0,304,'Design',2822,'2009-09-25 06:05:15','2009-09-25 06:05:15','202.69.102.114'),(1977,'','this is ugly on so many levels','','',0,82,'Design',2814,'2009-09-25 06:12:33','2009-09-25 06:12:33','68.101.209.173'),(1978,'','yikes','','',0,85,'Design',2814,'2009-09-25 06:14:17','2009-09-25 06:14:17','6