','190.113.146.23'),(2001,'','It\'s got a really nice structural shape, reminds me of the raygun gothic era of design :D!!','','',0,300,'Design',2909,'2009-09-25 12:33:38','2009-09-25 12:33:38','82.33.8.45'),(2002,'','I like it.  It\'s simple, clean, functional, modern, and attractive.','','',0,266,'Design',2917,'2009-09-25 12:47:32','2009-09-25 12:47:32','75.72.1.44'),(2003,'','its awesome!!!!!!!naved excellent job......','','',0,283,'Design',2918,'2009-09-25 12:47:53','2009-09-25 12:47:53','123.50.161.190'),(2004,'','This is a modular design without looking modular.  Shape is futuristic, yet fits the need. Gives me a feel of movement and flow --ie \"transporting\" ','','',0,145,'Design',2921,'2009-09-25 12:59:42','2009-09-25 12:59:42','209.18.49.15'),(2005,'','I like the idea that it gives shade and cover from the weather elements bout also gives heat on colder days while being self sustainable.  All over great design!','','',0,266,'Design',2933,'2009-09-25 13:15:11','2009-09-25 13:15:11','205.235.218.10'),(2006,'','This has everything going for it. The design is attractive and the concept is incredibly functional. A great example of form following function. The idea of having them produced in a kit form for adaptability of size and location is wonderful. The concept of the self sustaining solar panels is great.  My only question is will it sustain itself  after five days of cloud cover and rain? If so this stop can be placed any where without having to be tied to a power source to keep all of its features functional. Safe, practical, attractive,adaptable size and self sustaining with all the needs of the modern commuter taken into consideration makes this a a terrific option for any municipality.  those worried about high density systems and jet tubes?  They were asked to design a bus stop!!  This one is excellent. Before we design for high density transportation and jet tubes we have to find a way to pay for the infrastructure to support them.  One step at a time.  this time it is a bus stop!','','',0,145,'Design',2894,'2009-09-25 13:16:50','2009-09-25 13:16:50','209.18.49.15'),(2007,'','aren\'t people oversaturated with enough digital images and advertisements already?  this would be great outside of an Apple store for perpetually plugged-in hipsters to gawk at, but as a bus stop at a university, I think it misses the mark.  nice renderings though.','','',0,273,'Design',783,'2009-09-25 13:32:51','2009-09-25 13:32:51','216.178.74.186'),(2008,'','nice presentation (all non-site specific ones seem to be...), but I think alot of what needs to be said already has.  What about a lighting system, visibility for safety issues, lack of seating, the folding makes no sense (is this process done in the field or off-site?), the fact that waiting for a bus inside of this would be like waiting in a shipping container.  Nice to look at it, but is it inviting enough for people to want to use is the question.','','',0,184,'Design',783,'2009-09-25 13:45:31','2009-09-25 13:45:31','216.178.74.186'),(2009,'','Me encanto! Bien por la acentuacion de la perspectiva con el cielorraso inclinado','','',0,263,'Design',2948,'2009-09-25 13:50:02','2009-09-25 13:50:02','190.176.61.152'),(2010,'','great idea!!!!!!','','',0,145,'Design',2954,'2009-09-25 14:12:28','2009-09-25 14:12:28','188.2.138.209'),(2011,'','interesting idea, but looking at the immensity of the overall plan, I think this would work better as seating outside of a cafe.  The problem is, I don\'t see this as being inducive to waiting for a bus, but more for relaxing and socializing. Too much comfort almost works against the concept of a small bus stop. ','','',0,286,'Design',783,'2009-09-25 14:12:55','2009-09-25 14:12:55','216.178.74.186'),(2012,'','Thank you everyone for your comments... \r\n\r\nThe bus stop was designed keeping in mind the cost of production and the cost of maintenance, both of which I have tried to keep as low as possible.\r\n\r\nMinimal, simple and utilitarian are the key design features.\r\n\r\nThe neutral yet noticeable yellow color was chosen to make the  bus stop easy to locate without disrupting the visual harmony of the area.\r\n\r\nThe bus stop is airy and well ventilated, with adequate protection from the sun, wind, rain and snow to seamlessly integrate it in any area, irrespective of the climate.','','',0,258,'Design',856,'2009-09-25 14:16:12','2009-09-25 14:16:12','116.72.53.156'),(2013,'','WOW!!! Great creative design, features and very cost effective!','','',0,266,'Design',2951,'2009-09-25 14:23:31','2009-09-25 14:23:31','207.230.223.54'),(2014,'','Don\'t you know that public projects have open specifications? how does this meet ADA regulations if the booth leg in in the middle? Are you discriminating those on a wheel chair to access you both?  ','','',0,279,'Design',2955,'2009-09-25 14:27:35','2009-09-25 14:27:35','76.184.105.22'),(2015,'','That is the coolest bus stop I have ever seen! ','','',0,274,'Design',2965,'2009-09-25 14:33:10','2009-09-25 14:33:10','156.61.2.70'),(2016,'','very beautiful idea:)\r\n\r\nLaima','','',0,307,'Design',2969,'2009-09-25 14:40:42','2009-09-25 14:40:42','78.62.52.212'),(2017,'','All the openings on the north side of the structure exceed ADAAG widths, and there\'s plenty of interior area for any arrangement for 30\"x48\" spaces.  What\'s the concern?','','',0,279,'Design',1056,'2009-09-25 14:44:41','2009-09-25 14:44:41','71.32.179.178'),(2018,'','It can also be used as a lavatory by vagrants.','','',0,168,'Design',2623,'2009-09-25 14:48:40','2009-09-25 14:48:40','64.223.94.111'),(2019,'','Reference all the names you like, but that isn\'t going to remain standing the real world, no matter how much you want it to.','','',0,170,'Design',1056,'2009-09-25 15:15:41','2009-09-25 15:15:41','71.32.179.178'),(2020,'','I like turtles.','','',0,66,'Design',2623,'2009-09-25 15:20:35','2009-09-25 15:20:35','64.223.94.111'),(2021,'','It reminds me of a video arcade filled with those car games.  ',''