c location, weather, etc.  It looks like an organic structure sprouted up in the city - very cool!','','',0,272,'Design',3028,'2009-09-25 17:26:38','2009-09-25 17:26:38','206.183.211.2'),(2040,'','When you sy: \"Only a genious could make it!\".\r\nIT\'S EXTRAORDINARY!!!!!!!!!!!','','',0,104,'Design',2996,'2009-09-25 17:44:29','2009-09-25 17:44:29','93.148.78.13'),(2041,'','When you say: \"Only a genious could make it!!\".\r\nIT\'S EXTRAORDINARY!!!!!!','','',0,104,'Design',2996,'2009-09-25 17:46:07','2009-09-25 17:46:07','93.148.78.13'),(2042,'','Nice!!','','',0,311,'Design',1591,'2009-09-25 17:52:49','2009-09-25 17:52:49','129.107.30.54'),(2043,'','love the design!\r\nvery cool!!','','',0,263,'Design',3051,'2009-09-25 17:59:14','2009-09-25 17:59:14','24.182.26.181'),(2044,'','- too large one-piece parts (the strips) to ship/transport\r\n- easy to vandalize\r\n- why would i want to fold on site or warehouse. not so practical and easy to bend this material properly. \r\n- standing or sitting people must be able to see the upcoming vehicles (bus) and they should be visible from the driver(s). this is a basic golden rule that has not been taken into consideration here. \r\n\r\nthe idea reminded me the foldable/mobile structures for the disaster areas. \r\nthe idea can be used for charity, aid structures etc...','','',0,184,'Design',2654,'2009-09-25 18:09:49','2009-09-25 18:09:49','219.78.46.223'),(2045,'','Aris. Great idea for portable/movable bus stop.','','',0,184,'Design',3066,'2009-09-25 18:28:42','2009-09-25 18:28:42','213.7.47.53'),(2046,'','very nice...good innovative design..','','',0,184,'Design',3064,'2009-09-25 18:29:56','2009-09-25 18:29:56','188.4.228.112'),(2047,'','Futuristic and impressive. Well done!','','',0,184,'Design',3063,'2009-09-25 18:31:48','2009-09-25 18:31:48','94.67.179.197'),(2048,'','it looks like the structure of the build would not handle very well a big storm or a hard rain...Sorry but i have to vote you down...Better luck next time...',