2009-09-25 19:31:18','2009-09-25 19:31:18','216.63.0.124'),(2056,'','The photovoltaic panels which provide warmth while waiting are necessary in the cold winter .The transparent glass is a good choice to provide personal space and  safety. Well done.','','',0,266,'Design',3089,'2009-09-25 19:31:32','2009-09-25 19:31:32','71.214.245.238'),(2057,'','the design captures more of the formality of a new typology of portable toilets rather than inspiring, comfortable spaces. in terms of referencing natural rock formations, it demonstrates more of a cartoon proposal that does not address the real design challenge of  sustainable design for architects. Further emphasizes my disappointed in what some architects consider to be responsible sustainable DESIGN. ','','',0,286,'Design',3096,'2009-09-25 19:34:28','2009-09-25 19:34:28','71.106.160.186'),(2058,'','If it doesnt look good photoshopped I\'m pretty sure it wont look good IRL...','','',0,263,'Design',3099,'2009-09-25 19:35:38','2009-09-25 19:35:38','195.74.255.152'),(2059,'','Sencilla. Espaciosa, y bien iluminada. Sin palabras. Me gustó.\r\nLaura.','','',0,263,'Design',3078,'2009-09-25 19:42:22','2009-09-25 19:42:22','200.42.132.178'),(2060,'','grate concept lads...','','',0,184,'Design',3127,'2009-09-25 20:19:02','2009-09-25 20:19:02','94.68.14.184'),(2061,'','i like very much this one, congratulations','','',0,263,'Design',3133,'2009-09-25 20:38:38','2009-09-25 20:38:38','190.113.146.23'),(2062,'','A winner!  Outstanding.','','',0,88,'Design',3136,'2009-09-25 20:41:26','2009-09-25 20:41:26','98.226.245.147'),(2063,'','nice graphics','','',0,252,'Design',1858,'2009-09-25 20:43:36','2009-09-25 20:43:36','72.166.17.131'),(2064,'','Average. it does nothing that hasn\'t been done before.','','',0,88,'Design',3137,'2009-09-25 20:53:20','2009-09-25 20:53:20','166.137.4.10'),(2065,'','Best design I\'ve seen.','','',0,266,'Design',2481,'2009-09-25 20:54:58','2009-09-25 20:54:58','24.230.104.189'),(2066,'','Use of heating panels i