INSERT INTO `designs` VALUES (3,'Bus-Shroom Station','There are three design elements to my bus station.  First, inside the cap of the mushroom attached to the top of the stem are radiating heaters that turn on at 40 degrees Fahrenheit or lower.  Second, there are multi-colored LED lights that start to flash when the bus is five minutes away and flash more and more until the bus is on minute away and the lights become solid.  Third, a \"take a paper, leave a paper\" system should be implimented at all bus stops in which someone who is done with his/her NY Times, Tribune, Deseret News, etc. can leave it at the station for someone else to read while waiting or riding the bus and leave it at the station the get on at, or the station they depart at for the next person to read.',8,'2009-05-15 20:41:09','2009-04-24 00:18:02','Bus-Shroom_Station.jpg','image/jpeg',181692,'2009-04-24 00:18:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),(4,'UTA Snack and Rest','It has a roof with 2 LED screens giving the news, weather and bus information. There is a snack cart that sells food for vegetarians and non-vegetarians. The snack cart also have books and magazines for rent while you are there. Also,  several tables and chairs to eat your food or play chess or checkers. There are 2 benches avalible if you are waiting for your bus.  If its below 50 there will be heat and if its above 75 there will be AC and water misters. Since this is an enviornmentally friendly bus stop there are recycling and trash cans. ',14,'2009-05-15 20:10:29','2009-04-24 00:18:39','UTA.jpg','image/jpeg',364069,'2009-04-24 00:18:34',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL),(9,'Bus Stop','I use the bus and shuttle system a lot. So my design has a screen that updates every five to ten minutes and shows what the next bus is and how close it is. It would also show the university shuttles using Shuttle Tracker (already used in the Union) which is a small map of campus and each arrow on the map is a shuttle bus which is colored appropriatly to which shuttle bus it is. That way students can see how soon the shuttle will be there. My design also features a bench since the current bus stop doesnt have one.\\r\\n',17,'2009-04-26 21:23:57','2009-07-24 19:03:08','bus_stop_two.jpg','image/jpeg',221298,'2009-04-26 21:23:53',NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,'0000-00-00 00:00:00',5,NULL),(14,'The Bus Lounge','A minimalist design that provides style and function. \r\n\r\nThis bus stop will be a college students dream. With free wi-fi, temperature controlled seating area, power outlets for phone and laptop charging, and a coffee bar all powered by 100% renewable energy located on top of the structure, which is covered with solar panels. \r\n\r\nThe drink bar will be a dispenser of hot beverages like coffee, hot chocolate, and tea. You will have to provide your own mug because coffee cups cannot be recycled, and it will allow the person to just fill up and get on the bus. \r\n\r\nThere will also be a flat screen monitor mounted above the coffee bar, which has breaking new stories, weather, and the location of current buses along with the arrival times. \r\n\r\nThe outside perimeter glows green with energy efficient LED bulbs once the batteries have become charged from the solar panels during the day. \r\n\r\nThe sitting area is separated into two sections completely surrounded by a 2-inch thick 100% recycled acrylic sheets made from plastic bottles.\r\n\r\nBy providing a place that is comfortable out of the elements that provides coffee and news, this will encourage more people to use public transportation because it combines all the errands people do in the morning into one place, therefore cutting down on their carbon footprint. \r\n\r\nThis bus stop will become a modern \"green\" oasis. \r\n   \r\n\r\n(Made from recycled building materials) \r\n\r\n',19,'2009-05-15 01:39:16','2009-04-28 01:39:16','bus_stop62.jpg','image/jpeg',586248,'2009-04-28 01:39:12',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL),(16,'U stop','This is a giant \"U\" that you can wait inside of. There is an entrance on each side of the U. There are benches all along the inside and a glass window in the middle to see when the bus is coming. Also their are heaters to keep you warm in the winter, because everyone always freezes in the cold waiting for the bus. And if you get fancy there are seat warmers!',22,'2009-05-15 02:21:42','2009-04-28 02:21:42','U2.jpg','image/jpeg',708159,'2009-04-28 02:21:37',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL),(17,'Clean Air','Allows smokers to be covered in the rain and not force others to share coverings with them.  Also this design should show if a bus is on time or late.',23,'2009-05-15 15:39:59','2009-04-28 15:39:59','Design.JPG','image/jpeg',431998,'2009-04-28 15:39:51',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL),(19,'Green Roof Bus Station','This design is based on the bus stations in Curitiba, Brazil with addition of LED lights and grass/flowers on the roof. \r\n\r\nThe LED lights start to flash when the bus is three minutes away and stay solid color when the bus is a minute away. The grass roof helps to make the environment greener! :)\r\n\r\nA big display of bus timetables and route maps is included inside the waiting area.  ',15,'2009-05-15 01:38:35','2009-04-29 01:38:35','busStop22.jpg','image/jpeg',347774,'2009-04-29 01:38:34',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL),(20,'Vase ','It\'s a bus stop and a cross walk. It has \'thorn\' seats and stairs and an elevator to get to the cross walk. ',21,'2009-05-15 03:01:06','2009-05-11 17:38:56','Vase.jpg','image/jpeg',748441,'2009-04-29 03:01:01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL),(22,'The Green Tree Bus Stop','I wanted to give the nature aspect since we do live in Utah and a lot of our activities are geared towards outdoor activities. My sketch isn\'t too good, but I want a big metal/wire tree where the branches extend over the bench for the bus stop. The leaves will be big green canopies of some sort. There will be big metal flowers at one side of the bench and a 25 cent trail mix machine at the other. There will be wooden or metal whatever tree house type latter steps up the side of the trunk with the different bus routes and schedules. Good nature feel is what I was going for.',25,'2009-04-29 16:59:36','2009-04-29 16:59:36','Next_Stop_Design-_Ali_Knudsen.jpg','image/jpeg',549602,'2009-04-29 16:59:27','[Null]','[Null]',NULL,'0000-00-00 00:00:00','[Null]','[Null]',NULL,'0000-00-00 00:00:00',18,NULL),(25,'Eco Friendly Stop','My Design is meant to support the environment and also to build awareness.  On the roof there are two wind mills for wind power and xeriscaping. On the south facing wall is a solar panel that rests at an angle and is supported by a metal hinge.Everything will be or should be powered by both the solar panel on the side and the wind mills on top. On the inside the celing is covered in rows of LED lights that will flash upward and is maybe colored to signal the distance of the aproaching bus.\r\n\r\nOn one side of the inside wall is a TV protected with a clear heavy plastic material or bullet proof glass. Underneath is a key pad to enter in different stations. On the other wall ins another screen with the bus info for both the UTA buses and U of U shuttles.On the back wall are three windows that can open and shut for ventilation.\r\n\r\nThe front entrance is all glass with a door in a metal fram for visibility. \r\n\r\nOn the floor there could be some kind of drawing. I drew a line that counts from 1-5, and thought there be a list of tips to become more environmentally friendly.\r\n\r\nIf it is really hot outside people can also sit on the benches attached to the wall coming out from the building. On the wall I was thinking there could be a collage of artwork that shows overpopulation, pollution, and other envirionmental problems, and then a solution to fixing those problems. They way I drew it was a big web, and thought there could be various facts on the wall.\r\n\r\nAlso outside there is a bike rack or two for people to lock up there bikes. Another addition could be plugs and portal for people to recieve the internet on their laptops.',9,'2009-05-15 06:40:13','2009-05-11 17:38:56','kathleen_brown_bus_stop.jpg','image/jpeg',126317,'2009-05-01 06:40:11',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,21,NULL),(29,'Digital Simplicity ','I am a fan of simplicity - and terrible at drawing - so I went with a design that is simple enough to be considered (at least I think so) but unique enough to stand out.\r\n\r\nIt would look like an ordinary bus stop, but on each side there would be digital ad space. The pictures could change every so often, like a slide show. Behind the seats, there would be physical ad space for posters and such. The rear would be for people to hang their bikes on, so they don\'t have to stand to the side with them. To prevent people from laying down on the seats, there would be arm rests on each one that extend to the bottom of the seat. This would also add a sense of personal space to people sitting. \r\n\r\nThe roof is the coolest part. It would light up a different color for each of the buses that come. When the bus is close, it would light up. When the bus arrived, it would flash. There would also be a PA system to accommodate the blind.',33,'2009-05-15 19:30:53','2009-05-03 19:30:53','bustop77.jpg','image/jpeg',205251,'2009-05-03 19:30:49',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,25,NULL),(31,'Wait in Comfort','My design is to make the bus stop look like a living room at home and be comfortable while waiting for the bus. The lamp will light up when buses are close and flash when they are there. The picture behind the couch/bench is showing the routes and bus times.',37,'2009-05-15 02:30:27','2009-05-11 17:38:56','bus_stop.jpg','image/jpeg',450358,'2009-05-04 02:30:23',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,27,NULL),(32,'Utes\' Bus Stop','Very simple and quite cheap.  This \"U\" will light up as the bus is nearing allowing those to know whether or not they need to hurry to catch it.  Mini red light bulbs will make up the \"U\".',38,'2009-05-15 03:38:47','2009-05-11 18:14:30','SimpleU2.jpg','image/jpeg',35632,'2009-05-04 03:38:46',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,28,NULL),(36,'Slanted Sidewalk Bus Stop','I designed this bus stop at the beginning of my senior year in my architecture class. It is meant to be placed on a sloped sidewalk, and present a comfortable unit for citizens who are waiting for the bus. I live in San Francisco, so the design also targeted to counter effect the wind chill, and also be a good use of public space in which pedestrians and commuters can relax. ',43,'2009-05-15 02:03:27','2009-05-14 02:03:27','Feiger_bus_stop.jpg','image/jpeg',314398,'2009-05-14 02:03:25',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,32,NULL),(38,'\"This is the Place\" Bus Stop','     I based my design on the history of Salt lake city.  I thought a covered wagon bus stop would be a fun way of showing that.  The area that would normally be covered with a canopy would be built with a transparent fiberglass material or some type of flexible plastic to allow the user to see the bus coming and going, and to provide cover during storms and harsh Utah winters.  The base could be built with wood or a synthetic material to immitate the covered wagon look.  For shade during the summer months I put two shade trees one on each side of the wagon and the leaves will fall during the winter allowing sunshine to heat the space.  A bus stop like this would not only attract attention but remind us all of the great history of Salt Lake City and Utah.',60,'2009-06-09 21:41:43','2009-07-01 21:14:05','Bus_Stop_Final1.jpg','image/jpeg',319589,'2009-06-09 21:41:41',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,34,NULL),(39,'A Stop for All','Design Features:  \r\n   The front supports are set 8’ from the curb with the roof cantilevered to extend over the curb and the bus entrance doors. The edge of bus shelter roof will be 12’ over the curb, enough  to clear a typical 11’ high bus. Thin tubular framing and clear tempered or plexi-glass panels will provide ample viewing through the structure. This enclosed area will be approximately 20’ long and 8’ deep.\r\n  The curve of the structure is designed to shed rain and snow easily. The walls of the shelter will end 6” above the sidewalk allowing air flow into the shelter. Summer heat will dissipate out quickly while blocking direct winter winds.   \r\n  New disabled driver parking spaces will be placed behind the structure and a new 1:15 curb cut will provide access to the sidewalk and bus stop from the parking lot. The shelter will provide various height seating and an open space to comfortably accommodate a wheelchair user. The bus schedules will be posted at two heights on either side of the central sign board. There will also be a “talking schedule” mounted on the sign board with speech recognition. A person with a visual impairment will touch a button and speak either the route number or the destination to find when the next bus is due. Display screens mounted to the ceiling will announce the next approaching bus visually and audibility. There will also be a video screen for silent advertisements.   \r\n    The shelter will be well lit. Solar panels will be on the roof to charge batteries that are stored in compartments under the structure. An emergency call box will be placed at one end of the structure. Security cameras will be mounted in the overhead display screen housing.',71,'2009-06-15 21:13:29','2009-07-02 16:37:59','Bus_Shelter-NDS.jpg','image/jpeg',1144009,'2009-06-15 21:13:15',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,35,NULL),(40,'UofU Business Loop Bus Station','Weather\r\n\r\nThe shelter is designed to be beneficial to transit rides all year round.  The bus stop is an enclosed structure with two entryways, one on the east side and one on the west side. Just behind the entryways is a tall clear glass or Plexiglas wind-breaker (View Image 3.3) to stop wind from entering either entryway. The wind-breakers also keep snow and rain from blowing into the shelter. In addition to the shelter two benches would be placed out side under the trees to the east of the existing bus shelter (View Image 3.4). During the warmer weather the windows on both the north and south side of the structure can be opened to allow for fresh breezes to circulate throughout the station \r\n(View Images 3.1- 3.2).\r\n\r\nLocation\r\n\r\nThe purposed shelter is positioned right up to the sidewalk, which is 10 feet wide. Currently the sidewalk bulbs out as the road curves which puts the bus station 17ft away from the street. By trimming down the sidewalk the extra room can be given a bus only section.  Between UTA and the U of U Shuttles the business loop at the University of Utah is a high traffic area for buses. Considering the width of the roadway, sidewalks and parking there is potentially room for bus only lanes. (For Specs View Image 1.1-1.3)\r\n	\r\nThe height of the shelter at its lowest point is 7ft, the roof height in the front is 9ft and the back is 7ft 7inches. The shelter is mostly made of glass and is highly transparent which keeps current view corridors and allows for new ones as well.\r\n\r\nAccess\r\n\r\nAt the back end (south side) of the shelter the curb slants down allowing wheelchair accessibility from the parking lot to the bus station and cub side. All bus route information can be posted on the wind barriers for both UTA and the U of U shuttle routes (View Image 2.1-2.2).\r\n\r\nSurfaces\r\n\r\nThe purposed ground surface is concrete because of its cost and durability. Tactile ground surfaces would be implemented at bus loading zones for those who are seeing impaired.\r\n\r\nHuman\r\n\r\nThe current bus stop offers one bench with room for one-two individuals. The purposed station has four large benches and one small bench. Depending on size and personal space the station can seat fifteen to twenty people, plus room for one wheelchair. Two additional benches would be positioned under the trees on the east end of the structure and the current bus stop sign would be moved west, close the benches. These benches would add another six to eight seats available to transit riders. The purposed station also includes a covered bike rack, which is positioned in the front of the structure.\r\n\r\n',62,'2009-06-15 21:18:21','2009-07-02 16:52:53','Image_one.jpg','image/jpeg',158540,'2009-06-15 21:17:41','Image_two.jpg','image/jpeg',189003,'2009-06-15 21:17:58','Image_three.jpg','image/jpeg',154586,'2009-06-15 21:18:12',36,NULL),(41,'Lounge','This bus stop is all about being comfy while you wait.',68,'2009-06-15 22:09:37','2009-06-15 22:09:37','bus_stop_design.jpg','image/jpeg',3030,'2009-06-15 22:09:37',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,37,NULL),(42,'University of Utah Teepee','     I designed this to create a fun and very different bus stop on the campus of the University of Utah.  It\'s obviously a teepee with a slight twist. The base is made of stone and from there a transparent plexi-glass material and on top of that a recylced material that would be painted red with the word \"Utes\" on the front to show the user they are on Ute territory.  \r\n     I planted Shade trees all around it to provide shade in the hot summer and because the trees shed their leaves in the winter they would allow sunlight to penetrate the plexiglass and heat the teepee.  This is a very economical and practical way to provide heat and shade for a bus stop.    \r\n     Behind the Ute teepee is a small wetland.  Utah is a desert it is important to preserve the little water we have.  To retain storm water in the area I sloped the pavement toward this wetland space instead of sloping it toward the road where it would go to the storm drain and be waisted.  This small wetland retention basin would absorb the water shed from the teepee and the space creating a more attractive eco-friendly space.  \r\n     The design would attract people from the city and especially the Students.  Because it\'s so different it would become a landmark on the great campus of the University of Utah.',60,'2009-06-19 04:26:51','2009-07-01 21:14:05','TEEPEE1.jpg','image/jpeg',580405,'2009-06-19 04:26:46','TEEPEE2.jpg','image/jpeg',665594,'2009-06-19 04:26:48','TEEPEE3.jpg','image/jpeg',620304,'2009-06-19 04:26:50',38,NULL),(43,'Bus Arc','The Bus Arc is both a bike storage facility and a bus stop waiting area. Resin sheets embedded with solar cells are rolled and simply attached to the steel ribs, allowing people to sit under shelter. The energy inverters allow users to charge devices while waiting for the bus. The 1” rolled resin bench is designed for user comfort. ',87,'2009-06-23 21:23:13','2009-06-23 21:23:13','BusArc_AtCaltrain.jpg','image/jpeg',757415,'2009-06-23 21:22:54','BusArc_.jpg','image/jpeg',253570,'2009-06-23 21:23:06','HalfArcWithBench_FacebookHeadquarterEntry.jpg','image/jpeg',440461,'2009-06-23 21:23:10',39,NULL),(44,'Waiting Capsule','The fundamental concept behind this design is to feature basic practicality and modern style. It\'s capsule-like form works so to complement and enforce the dynamic of queuing. It\'s structure also works so to maintain a relatively insulated temperature within for the convenience of waiting patrons; ideally it would dominantly feature tinted glass and a material with an aluminium-style finish (or appropriate substitutes). At the top of the design a led marquee is featured which reads the upcoming route name and a clearly-visible diagram of the bus route and timetable is featured in front of patrons waiting so that it\'s not impeded and easy to see.',90,'2009-06-26 02:57:51','2009-06-26 02:57:51','1.jpg','image/jpeg',79949,'2009-06-26 02:57:47','3.jpg','image/jpeg',61344,'2009-06-26 02:57:49','2.jpg','image/jpeg',77561,'2009-06-26 02:57:50',40,NULL),(47,'Open Air Curve Bus Stop','The concept of this bus stop is to make it looks modern and friendly to the environment by using curve design. With curve design that would create more space inside and air transferable, the bus stop would create a good atmosphere. By using curve glass that could trap the heat in cold weather and also keep the air transferable inside, passengers could feel comfortable. The curve glass could create more space for people to stand to not get overcrowded and track the sound from the outside. Also with wide space and curve chair to make more available seats for many people. The bus stop also has windows and could be a shelter in rainy days. With mostly glass the light could get in easy but not too much because of its transparency. The bus stop should place near the sidewalks or streets with many plants and public services like postbox or telephone to make it convenience. At last, the bus stop also attractive with its design, people could see it easily.',119,'2009-06-30 14:03:22','2009-07-01 21:14:05','three.jpg','image/jpeg',132969,'2009-06-30 14:03:18','3.2.JPG','image/jpeg',96356,'2009-06-30 14:03:20','3.1.JPG','image/jpeg',154559,'2009-06-30 14:03:21',43,NULL),(50,'SustainaStop','My goal was to design a bus stop that would provide shelter, safety, and information to users, incorporating principles of sustainability (especially concerning environmental protection and social equity issues).  I apologize for the lengthy explanation, and for the cheesy name.\r\n\r\nThe most important aspect is shelter that provides an optimal, self-regulated climate year round. A bus stop that is extremely cold during the winter months or hot during the summer months is not especially useful, and could discourage use of the system. This bus stop is designed to provide a shaded, cool haven for riders in the summer and a warm oasis in the winter, using renewable technologies that require little maintenance. \r\n\r\nFor all seasons, a solar array atop the structure (oriented somewhat southward to capture the maximum sunlight) would gather and store energy to power the stop’s lights, as well as fans during the summer and heating system during the winter. During summer months, solar energy collected by the rooftop array powers a set of small fans which would help to remove hot air from the interior of the shelter, bringing fresh cooler air in through the door openings as well as through small tubular vents near the floor of the shelter. The fans would force the heated air out and bring the cooler air upwards, resulting in more comfort for the user. Alternatively, the fans could be turned off and passively used as turbines, spinning with the flow of the hot air escaping the structure and complementing the energy being stored from the solar array. A clear roof is shielded from the sun by a blooming deciduous hedge, which grows with the spring (and increasing sun) to provide shade for users inside the shelter.\r\n\r\nDuring the winter months, energy stored from the solar array is utilized to operate a radiant heating floor, which occupies much of the bus stops bottom layer. The radiant heat would rise from the floor to provide a dry, nonslip floor surface and a warm atmosphere for riders, and could optionally be extended to provide radiant heat for those seated on the bench as well. The deciduous hedge would lose its leaves as the temperature drops, which allows more sunlight to penetrate the clear ceiling, providing further passive heat inside. The tubular vents near the floor would aid in drainage from the shelter of melting water from users’ boots during snowy or icy weather. Finally, the side walls of the entryway, as well as the wide middle support post, provide not only support to the mechanisms on the rooftop, but also an extra buffer from cold winds.\r\n\r\nFrom a safety perspective, large windows on all sides of the shelter provide excellent visibility into and out of the shelter, and solar energy stored during the day operates high efficiency LED light panels during service hours both inside the shelter and outside. The planter boxes on the rooftop work double duty as an extra shade from sun or snow but also as battery storage and a light fixture for the entrance of the shelter. An emergency telephone could easily be attached to the shelter, and a wi-fi accesspoint would be incorporated into the structure itself, for the convenience of those waiting with laptops or PDAs.\r\n\r\nTo best share service information to waiting riders, a map of each route is displayed on the inside walls of the shelter. There is also ad space available around the interior walls of the bus stop, to help support the costs of bus stop construction and maintenance, as well as providing a minor revenue stream for the system at large. A tone sounds and two lights on the center post alert riders by flashing when any bus is approaching (which light depends on the direction from which the bus is coming), and the placard with the route number also lights up when the corresponding bus is approaching. Such a system assumes a GPS-linked transportation network.\r\n\r\nTo ensure accessibility to all users, the raised floor is accessed by a gently sloping ramp, which is also colored bright yellow and covered in a bumpy textured surface, both to alert visually impaired users to the ramp but also to slow the speed of a wheelchair descending the ramp from within the shelter. The bench inside is cut off to allow one wheelchair a comfortable amount of space within the climate-controlled shelter. Finally, an audible tone would accompany the approach of any bus, and the route number would be spoken by a computerized voice to help visually impaired users (and others) identify the arriving bus.\r\n\r\nFinally, from an aesthetic point of view, the station is designed to match the colors of the UTA system for maximum recognition as a UTA stop, and the rooftop plants blooming during the summer, and large windows during the winter would provide a pleasant atmosphere in which to wait for a ride. The large windows would also make it easier for bus drivers to see passengers waiting in the shelter, so riders (esp. handicapped) would not necessarily have to step outside to flag the bus until they are ready to board. I did not include a trash facility in the bus stop’s design itself due to potential smells detracting from waiting riders’ comfort, but a single-stream recycling bin as well as a garbage can could be provided nearby (and downwind). \r\n',123,'2009-07-01 20:26:41','2009-07-24 20:59:09','bus_stop_1a.jpg','image/jpeg',432389,'2009-07-01 20:26:34','bus_stop_2a.jpg','image/jpeg',376204,'2009-07-01 20:26:37','bus_stop_3a.jpg','image/jpeg',371952,'2009-07-01 20:26:39',44,NULL),(52,'functional HUB','function hub\r\nGenerate a bus stop which integrates numerous additional functions, which are usually spread in public city spaces – as vending machines, information desks, time pieces, recycling stations, …\r\nThe functions are not simply add-ons, but integrated into the overal design. Each purpose is given a strong visual identity – which adds a unique character to the building.',145,'2009-07-03 09:54:38','2009-07-03 09:54:38','www.bk2a.de_nextstopdesign_01.jpg','image/jpeg',345110,'2009-07-03 09:54:32','www.bk2a.de_nextstopdesign_02.jpg','image/jpeg',246496,'2009-07-03 09:54:34','www.bk2a.de_nextstopdesign_03.jpg','image/jpeg',387054,'2009-07-03 09:54:36',45,NULL),(53,'organic streams','This design should be the bus stop of the future. It appears to the streams of the vehicles on the street and on the people on the sidewalk and let them flow into a waiting station. Elliptic chambers in the roof and the wall let enough light in it and make an atmosphere that reminds on streams going through them. The organic flow and the fact that it is made of one part should show the connection between both sides. Its color and form is recognizable. \r\nContents in the bus station: a wireless lan hot spot, seats, bicycle poles, a digital timetable, a light-band in front of the station;\r\nThere are also plates for advertisement and wind and rain safety from behind the seats.\r\n\r\nAll in all i hope you enjoy my newest design and vote with great 5 stars for me :-) , for any questions or new ideas you can write me an email to jergitsc@sbox.tugraz.at or go to my homepage www.schaubilder.at \r\n',153,'2009-07-03 20:52:06','2009-07-03 20:52:06','a.jpg','image/jpeg',152240,'2009-07-03 20:52:02','b.jpg','image/jpeg',172693,'2009-07-03 20:52:03','c.jpg','image/jpeg',186719,'2009-07-03 20:52:05',46,NULL),(54,'polystop','Polyhedra design forstyle and function. Glass and steel. Glass is a great insulation material for winter. and the right material can also be used to reflect heat for the summer as wellas opening sections for increased ventelation.',172,'2009-07-04 13:19:57','2009-07-04 13:19:57','polystop.jpg','image/jpeg',172350,'2009-07-04 13:19:54','polystop1.jpg','image/jpeg',71190,'2009-07-04 13:19:56',NULL,NULL,NULL,NULL,47,NULL),(55,'bus stop project','	\r\nThe idea of the design of the tail of the fish',179,'2009-07-05 01:39:58','2009-07-05 01:39:58','6.jpg','image/jpeg',1513515,'2009-07-05 01:39:45','12.jpg','image/jpeg',386035,'2009-07-05 01:39:50','11.jpg','image/jpeg',1192365,'2009-07-05 01:39:54',48,NULL),(56,'NaCi','Inspired by the dry salt deposits known as Halite, Which occurs as sedimentary evaporite minerals that result from the drying up of enclosed lakes, playas, and seas. ',184,'2009-07-06 05:24:39','2009-07-24 18:53:41','Front2.jpg','image/jpeg',700976,'2009-07-06 05:24:31','Inside.jpg','image/jpeg',610169,'2009-07-06 05:24:34','Side_Elevation.jpg','image/jpeg',634255,'2009-07-06 05:24:36',49,NULL),(57,'To space or not to space','We should all agree on the abundance of vertical building. Instead, we better build earthly. Or on the moon. ',186,'2009-07-06 12:16:28','2009-07-06 12:16:28','Way_Faster.png','image/png',791856,'2009-07-06 12:16:20',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,50,NULL),(58,'Dynamic Bus Stop.','This design attempts to bring bus stops to the basics. \r\n\r\nThe design has two clearly differenced parts. The waiting place iself (open), and a concealed space to be used in case of harsh weather. This assures a comfortable use at all times, all weathers.\r\n\r\nThe enclosed space is located in a way it won´t affect visibility from the open space.\r\n\r\nAccesibility is very important in this design, which features easy wheelchair access.\r\n\r\nThe curved ceiling (and its bright color) of the open space give the bus stop a dynamic feel.',180,'2009-07-07 00:33:21','2009-07-07 00:33:21','NextStopDesign1.jpg','image/jpeg',278830,'2009-07-07 00:33:18',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,51,NULL),(59,'CAPTAIN AMERICA','_\"I met a strange lady, she made me nervous; she took me in and gave me breakfast...\"_\r\n\r\n*Captain America*\r\n\r\nCaptain America doesn\'t want to solve design problems through its form, it rather represents a statement which creates a discussion; an Object which stimulates simultaneous a poetic reaction. Main Idea is to use Nature and to integrate systems (Biomimicry) in nowadays environment.\r\n\r\n\r\n_\"This used to be a good country. They are not scared about you, they are scared about what you represent. Oh no, what you represent to them is freedom, freedom in Design; that\'s what it is all about. \"_\r\n\r\n\r\nThe traditional Bus Stop, a place for Waiting, wasted time. Captain America is a place to visit, to hang around. A sculptural solution for a deserted place, located in the middle of the Mojave Desert. Not only for waiting, a shelter for wanderers, which delivers fresh water. It has as Designidol a spikey lizard, Moloch Horridus. The spiky skin gathers water through its extended surface from moisture, rain and humidity and directs it through semi-enclosed channels into the water pockets, which are located at the site of the sculpture. \r\nOn one side of the bus Stop is a Bio Algae Reactor which wont deliver Fuel or Energy as known. It creates an dry Algae Bio Matter, which will be substance to smoke. With this new natural tobacco it tries to set a new benchmark of freedom: water and cigarettes for everybody. \r\nThe big umbrella also provides shading for those who are waiting, the bench acts as place to sleep, secure hovered from the ground. Each \"Captain America\" is equipped with a phone, for emergency, but also links this idea to the traditional Mojave Phone Both (orig. number: 714-733-9969). Fans called the both, which is now removed, attempting to get a reply, and a few took trips to the booth to answer, often camping out at the site.\r\n',185,'2009-07-07 23:19:39','2009-07-07 23:19:39','main_1-lowres.jpg','image/jpeg',471397,'2009-07-07 23:19:33','main_3-lowres.jpg','image/jpeg',438224,'2009-07-07 23:19:35','main_4-lowres.jpg','image/jpeg',898305,'2009-07-07 23:19:37',52,NULL),(60,'Bus-Stop','1. Glass enclosure w/ a bench.\r\n2. Opens in to the sidewalk not to the traffic.\r\n3. Photovoltaic roof.',196,'2009-07-08 02:45:16','2009-07-08 02:45:16','Bus-Stop_01.jpg','image/jpeg',435088,'2009-07-08 02:45:09','Bus-Stop_02.jpg','image/jpeg',199422,'2009-07-08 02:45:11','03.jpg','image/jpeg',54012,'2009-07-08 02:45:14',53,NULL),(61,'flexible bus stop','1. Modular design for scale flexibility based on specific site traffic and growth over time. Individual modules can be replaced, added, or removed.\r\n\r\n2. Integration of necessary elements: bike rack, individual seat, signage/messaging panel, glass splash shield, and overhead coverage',204,'2009-07-08 15:10:31','2009-07-08 15:10:31','bus_STOP_1.jpg','image/jpeg',409086,'2009-07-08 15:09:49','bus_STOP_2.jpg','image/jpeg',1778208,'2009-07-08 15:10:06','bus_STOP_3.jpg','image/jpeg',1653942,'2009-07-08 15:10:20',54,NULL),(62,'Get Real!','I apologise for the length of this text, but have made a considered attempt to design something more considered  than a pretty shape, and hope you will indulge me.\r\n\r\n\r\nResponsible Sustainable Design:\r\n\r\nIf we bring this competition to its logical conclusion, to revolutionise the image of public transit as being  ahead of the curve, it becomes necessary to provide more than a superficial aesthetic makeover.   There is a  genuine opportunity here to give public transit a real moral high ground in an age of ecological awareness.   To  this end, we must preceed the question of \'what should a new bus stop be?\' with the more poignant question, \'do  we need a new bus stop in the first place?\'.   This is the most sustainable approach of all.\r\n\r\n\r\nReuse over Rebuild:\r\n\r\nI attempted to demonstrate these ideas by looking specifically at the existing site at the University of Utah,  listed as being the initial site for redevelopment.   I studied the existing structure to see how it might be  reused, only removing what I deemed to be truly worthless.   Five of the existing columns and two of the concrete  walls were retained, as concrete is one of the most useless materials once demolished.   This retained structure  would then support a new roof structure.\r\n\r\n\r\nTwo Part Intervention:\r\n\r\nThis redesign is composed of two parts - a roof and a screen.   The idea is that one part, probably the roof, is  used as a coherent means of corporate identity for the UTA, making all UTA stops instantly recognisable.   The  other part may vary greatly from stop to stop, individual pieces of eco-sculpture designed by emerging designers  looking for a means of expression.   Simultaneously, it is an expression of UTA\'s commitment to healthier design  and a commitment to aid young talent achieve the american dream in a time of utter hopelessness.\r\n\r\n\r\nScreen:\r\n\r\nThe screen I have designed here is composed of reconstituted glass fins.   They provide a certain amount of  shading and shelter, while not completely enclosing the commuters.   It allows the wind to pass through it like a  sieve, slowing down wind speeds without creating a wind tunnel.   It also provides for specific integrated  functions, such as seating and bicycle locking, reducing the material palette.\r\n\r\n\r\nRoof:\r\n\r\nUsing an asymmetrical load distribution in the roof, placing all of the weight over the columns, it is possible  to achieve large cantilevering spans.   This weight comes in the form of a solar panel generator, that takes  advantage of Utah\'s prolonged sunshine hours to create a self-sufficient bus hub.   By taking in the solar  radiation during the day, the roof can be lit at night.   This light radiates from a reconstituted plastic  \'lantern\' that wraps around the perimeter of the roof structure.   This plastic box is made to be as lightweight  as possible, and the remaining gap in the roof is filled with an etfe membrane or \'pillow\', another lightweight  and recyclable material, that is more transparent than glass.\r\n\r\n\r\nAccessories:\r\n\r\nMany of the designs for this competition so far have tried to integrate bins and vending machines into the stop  itself.   I have deliberately tried to avoid this, as these are commercial elements that are constantly embroiled  in evolutionary flux.   Their design and technology may change very quickly in the coming years.   This could  leave the bus stop feeling very dated, as it will be either complicated or expensive to upgrade these integrated  components.   Maintanence of standalone accessories is also much easier.\r\n\r\n\r\nVisibility/Security:\r\n\r\nThe considerable size of this shelter design, due to the anticipated large numbers of morning and evening student  & teacher commuters, makes it highly visible, and the large black \'UNIVERSITY\' tag makes it instantly  understandable to visitors, day and night.   The reason for lighting the bus stop so dramtically is so that it  becomes a visible beacon at night, a safe illuminated shelter distinguished from standard street lamps.   The  lighting should also discourage homeless people from moving in (the sensitivity of how to deal with the homeless  problem does not change the fact that public transport may be considered unsafe or \'low-brow\' if homeless people  are encouraged to sleep in bus shelters).   Finally, I have left a gap in the screen, primarily allowing access  to the car park, but also providing a means of escape should some thug attempt a mugging, or something equally  undesirable.',174,'2009-07-08 21:37:11','2009-07-08 21:37:11','stage_1_copy.jpg','image/jpeg',1129560,'2009-07-08 21:36:35','comp_test_4.jpg','image/jpeg',2057335,'2009-07-08 21:36:44','20090708135012_15h26m26s_copy.jpg','image/jpeg',507579,'2009-07-08 21:37:07',55,NULL),(63,'Bus Station Utah','Well This is just an idea for bus stations.i havent done much to make it nicer only for showing my idea.\r\nThanks ',223,'2009-07-09 15:14:49','2009-07-14 15:48:00','Bus_station.jpg','image/jpeg',253918,'2009-07-09 15:14:45','Bus_station_001_.jpg','image/jpeg',307481,'2009-07-09 15:14:47',NULL,NULL,NULL,NULL,56,NULL),(65,'Modular',':: Architecture\r\nThe stop uses a modular construction, using prefabricated concrete and glass panels. In this design, there are three units – a bike park, waiting area and shop. The materials used are somewhat cold-looking, so a bright crimson colour is used for the roof and details to counterbalance this. Plants are placed at each end to soften the visual impact.\r\n:: Passenger Comfort\r\nSeats are provided in the enclosed waiting area, and a veranda keeps the rain off the platforms. WiFi is available, and refreshments and newspapers can be purchased from the shop. Given that buses can often be delayed (sorry, it’s true) those passengers kept waiting may make impulse purchases. Customer Information Screens provide up-to-date information on bus running, these are accompanied by automated announcements.  Poster slots can be used by the operator, or sold for advertising.\r\n:: Operations\r\nTo help remain punctual, 2 platforms are used to allow 2 buses to load and unload simultaneously. Tickets are available from a Ticket Vending Machine, and also the shop – with pre-purchased tickets, boarding times should be quicker allowing for a prompt departure.\r\n:: Potential\r\nThe modular structure could be used across the network, with different units built where required – for instance a small residential stop might not need the coffee shop, but the city centre stop might need 2! The structure could also be used on light rail stops. This would help create a unified look.\r\n',230,'2009-07-10 14:55:34','2009-07-14 15:48:00','Features.jpg','image/jpeg',122127,'2009-07-10 14:55:29','features_2.jpg','image/jpeg',153154,'2009-07-10 14:55:31','Overview.JPG','image/jpeg',54387,'2009-07-10 14:55:33',58,NULL),(66,'GOT BRAINS?!?!','\r\n\"It is a truth universally acknowledged that a zombie in possession of brains must be in want of more brains.\"\r\n                                     -Seth Grahame-Smith\r\n\r\n\r\nOh no! Not Zombies!\r\n\r\nThat\'s right. The undead are rising and are hungry for brains and public transportation!\r\n\r\nThis rotting corpse has many attributes that make it more than just another spawn of Satan.\r\n\r\n1. Ease of Use\r\n    -Visitors can sit inside the vile creature\'s rotting head on one of the many \"tooth\" benches.\r\n    -The grasping fingers also serve as seating for when the weather is particularly nice.\r\n\r\n\r\n2. Curb Appeal\r\n    -Believe it or not, but zombies are very concerned with their appearance.  This zombie is no different.\r\n    -Complete with blood-spattering-from-last-brain-feasting detailing, the zombie\'s putred colored skin is not only true to the undead, but it also blends nicely with the surrounding scenery.\r\n\r\n3. Eco-Friendly\r\n   -It is a common fact that zombies care about the environment.\r\n   -This zombie is made almost entirely of recylced material.\r\n   -The \"Radioactive Waste\" barrels are actually rain barrels that collect rain water to irrigate the surrounding landscape. Perhaps this radioactive waste is what spawned this horrific creature?\r\n\r\n4.  Entertainment\r\n    -For your listening pleasure, a sound system is installed in the head and plays the zombie anthem \"Thriller\" by the late, great Michael Jackson 24 hours a day, seven days a week.\r\n\r\n \r\n\r\n\r\n',116,'2009-07-10 19:56:41','2009-07-14 15:48:00','ZOMBIE_.jpg','image/jpeg',539782,'2009-07-10 19:56:37',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,NULL),(67,'Organic Bus Stop','This project was designed a few years ago while working for a former Frank Lloyd Wright apprentice. The design encompasses the aspects of Organic Design by the use of materials in their natural states and colors and also by the structure’s fluid form. \r\n\r\nThe base of the bus stop is set at an angle to the street to allow users greater visibility of oncoming traffic. The base was designed to be either native stone or discarded concrete block pieces stacked horizontally. The theory was to create enough of a texture that it deters graffiti. Between the base columns stretches a curved bench made of wood. The wood could either be treated or a species that is naturally resistant to decay. Composite wood is also an option. The wood is a nice warm and soft contrast to the hard rough base columns. It provides comfort in the area where the user comes in contact with the structure.\r\n\r\nDepending on the site, the bus stop might need a wind break behind the bench. This could be a clear polycarbonate panel as shown in the rendering or a wooden slat wall. The benefit to the clear polycarbonate is that it allows the user clear view of activity behind them which results in greater safety. \r\n\r\nThe roof structure is composed of two curved beams separated by a ribbon of glass. The roof is set perpendicular to the street which means that it is offset from the base. This gives the structure a sense of movement and direction.  The ribbon skylight allows natural light into the structure while still providing protection from the elements. The roof itself sits above the walls on steel columns sticking out of the base. This lifts the roof up giving the appearance of it floating above the structure. \r\n\r\nThe roof was originally designed to be wood shingles. By decking the structure with treated stats, air would be allowed to flow around the shingles keeping them from rotting. This is much like old barns who still have their original wood shingles on them today. If designed correctly, maintenance should not be a problem. Another option would be concrete shingles that would keep the same look and feel yet be completely maintenance free.\r\n',235,'2009-07-11 04:32:18','2009-07-14 15:48:00','Organic_Bus_Stop.jpg','image/jpeg',1641671,'2009-07-11 04:32:09','Organic_Bus_Stop_Drawings.jpg','image/jpeg',592797,'2009-07-11 04:32:13','Busstop_007.jpg','image/jpeg',38807,'2009-07-11 04:32:17',60,NULL),(68,'Continuous Ribbon','The design concept takes the shape of a continuous \"ribbon\", made out of cross laminated timber and painted in a water proof glossy red. The use of cross laminated timber allows for a self sustaining and lasting structure. The glossy red creates a particular atmosphere inside the bus stop, and it also helps create a visual \"signal\" from afar.\r\n\r\nNot only are walls, floor, and roof transformed into a continuous shape, seating areas, tables and bike racks are as well, all in a flowing and natural way.\r\n\r\nIn addition, solar panels are inserted inbetween the ribbon strands, where the \"roof\" would be. Lastly, regular glass panels fill in the voids between the ribbon strands, where the \"walls\" would be.   ',219,'2009-07-13 23:56:51','2009-07-14 15:48:00','IMAGE_1.jpg','image/jpeg',107160,'2009-07-13 23:56:43','IMAGE_2.jpg','image/jpeg',226115,'2009-07-13 23:56:46','IMAGE_3.jpg','image/jpeg',194274,'2009-07-13 23:56:48',61,NULL),(69,'obsidian','glass scales that ventilate while providing protection from the elements and the security of high visibility.\r\n\r\nfins to deflect rain while creating interesting, trellis like patterns from the sun.',295,'2009-07-14 21:28:59','2009-07-14 21:28:59','d30.jpg','image/jpeg',20636,'2009-07-14 21:28:56','d31.jpg','image/jpeg',24429,'2009-07-14 21:28:57','d32.jpg','image/jpeg',22794,'2009-07-14 21:28:58',62,NULL),(71,'tube of motion','This design is created for an uncommitted client of mine, who did not care to come back to me after verbally commissioning me the work( as it often happens here in India).',319,'2009-07-18 10:03:17','2009-07-22 19:42:17','2bus_stop5.jpg','image/jpeg',357034,'2009-07-18 10:03:13','bus_stop6.jpg','image/jpeg',303775,'2009-07-18 10:03:15',NULL,NULL,NULL,NULL,63,NULL),(72,'Salt Lake bus stop','The goal of my project is to provide a sleek and modern design, so this form of architecture could be a recognizable image in the Salt Lake City urban area. Another objective was to put a spin on design with the vivid colors and use of bar relief texture (the timetable) so it gives an enjoyable effect to people while commuting.',344,'2009-07-20 20:56:30','2009-07-22 19:55:49','004.jpg','image/jpeg',45212,'2009-07-20 20:56:26','007.jpg','image/jpeg',58071,'2009-07-20 20:56:28','interior.jpg','image/jpeg',54859,'2009-07-20 20:56:29',64,NULL),(73,'BussStop','It was made in 2002',347,'2009-07-21 04:11:25','2009-07-24 19:03:10','001.jpg','image/jpeg',178570,'2009-07-21 04:11:20',NULL,NULL,NULL,NULL,'003.jpg','image/jpeg',367200,'2009-07-21 04:11:23',65,NULL),(81,'Stop and Go Green- The Eco-Bus stop','The “Stop and Go Green” bus stop is an eco-friendly shelter for commuters and tourists in Salt Lake City, Utah. Functioning as a bus stop, there is enclosed space for the cold winter months, and covered exterior space for the warm summer months. The translucent reflective material reflects hot summer sun and is curved to repel rain and snow. From the interior, commuters can enjoy the view of the surrounding trees and outdoor space. Amenities and details include solar panel powered lighting, dual bus route information and bulletin board, and bicycle racks to promote sustainable commuting.',370,'2009-07-22 15:13:38','2009-07-22 15:13:38','finalbus3.jpg','image/jpeg',633335,'2009-07-22 15:13:31','finalbus2.jpg','image/jpeg',290739,'2009-07-22 15:13:34','finalbus1.jpg','image/jpeg',466170,'2009-07-22 15:13:36',66,NULL),(82,'Modern Bus Stop','The “Modern Bus Stop” provides shelter from the outside elements featuring inside seating and standing room while still maintaining a clear view of all surroundings and oncoming buses. The bus stop also includes sufficient wall space for bus route maps and advertisements. Located parallel to the sidewalk, the bus stop allows for disabled and general pedestrian access, with bicycle racks located in the rear. On the exterior of the bus stop includes seating for days where an inside shelter is not necessary.',365,'2009-07-22 23:15:23','2009-07-24 18:44:05','BSF1.jpg','image/jpeg',519445,'2009-07-22 23:15:16','BSF2.jpg','image/jpeg',602674,'2009-07-22 23:15:18','BSF3.jpg','image/jpeg',311831,'2009-07-22 23:15:21',67,NULL),(83,'Folded Metal Bus Stop','A simple bus stop made of two folded metal plates and tempered glass. It offers protection from the elements and seating provided by additional folds in the metal structure. The station is situated between the sidewalk and the street, allowing for passengers to board and de-board the bus without having to cross pedestrian flow; a distinct advantage in college campuses and urban areas where pedestrian traffic is high. The color scheme and design of the stop are intended to increase the visibility of stops making them more apparent to citizens and increase the profile of bus travel as an option for daily transit.',285,'2009-07-24 06:36:48','2009-07-24 06:36:48','Perspective_copy.jpg','image/jpeg',986759,'2009-07-24 06:36:36','Front.jpg','image/jpeg',1000373,'2009-07-24 06:36:41','Rear.jpg','image/jpeg',982863,'2009-07-24 06:36:44',68,NULL),(84,'Sustainable Bus Stop','A bus stop is not just a structure but a shelter againts rain, snow etc. I want to design a sculptural yet functional bus stop with a distinctive feature for design inspiration to students, a place of delight. The curvature of the roof is to provide easy cleaning of snow, and as most of it would slide down, it decreases the amount of weight on the structure as well.\r\n\r\nThis is a sustainable structure that works with the environment, with PV-TV glazing integrated to provide 3.8 watts of electricity per square foot, which is above average of efficiency, to provide heating during the winter. The glazing also allows 10% of sunlight to penetrate through as that level of light transmission is optimal even during cloudy days whilst protecting againts excessive solar gain and ultraviolet ray. The glazing also provides good thermal insulation for the bus stop. The curve roof is fitted with green roof to provide the necessary insulation during winter as well. The green roof is layered with tree bark, stones and soil instead of the coventional method, just like how it is done in the past, cheap and functional.\r\n\r\nThe sturdy structure would be made from sustainable timber, and if broken, its easily replaceable and the broken piece can be use as fire woods or process into wood dust for building insulation. Although its sturdy, it is also portable as it is designed to be easily installed and un-installed to be loaded onto a lorry. It is made up from many elements which is being stuck together with polls using traditional methods to save cost. It can be a minimal structure if necessary.\r\n\r\nWifi is optional.\r\n\r\nHope you all enjoy my design.',375,'2009-07-24 22:20:28','2009-08-03 16:01:41','Final01_A3_2.jpg','image/jpeg',2166746,'2009-07-24 22:20:08','Final02_A3_2.jpg','image/jpeg',1947400,'2009-07-24 22:20:19','Final03_A3.jpg','image/jpeg',1238228,'2009-07-24 22:20:24',69,NULL),(85,'Organic Campus','Inspired by the spirit of the campus and city, Organic Campus provides an innovative solution for a bus stop that emphasizes environmental, social, and economical sustainability, as well as user experience and comfort. \r\n \r\nThe naturally flowing forms blur the lines between the walls and ceiling, the interior and exterior, the new and the pre-existing, poetically combining every aspect of the design together as one. This dynamic form represents a tree, a tree of growth and hope for the campus and city. \r\n\r\nThe tried and true green roof scheme provides space for plant life, as well as shade and cooling in the hot summers. Treated wood from local manufacturers is used in the interior to provide a sense of warmth and comfort for the user. There will be three trees planted for every tree used, to emphasize environmental sustainability. \r\n	\r\nAccessories include a scrolling LED display that notifies the user on when the next bus arrives, wireless hotspot, and additional seating for peak times. Fluorescent light is placed on top of the display for visibility and safety at night. Accessibility is emphasized, including easy wheelchair access, remote infrared audible signage for the visually impaired, and multiple escape routes. Bike racks and vending can be added onto the design. \r\n\r\nA symbol of sustainability, growth, and diversity, Organic Campus is a physical manifestation of the forward thinking spirit of the University of Utah and the Salt Lake City.  \r\n \r\nIf you like this, please give it a good rating and comment. \r\n',137,'2009-07-26 04:41:44','2009-08-03 16:01:42','Campus_Bus_Stop1.png','image/png',496358,'2009-07-26 04:41:37','Campus_Bus_Stop2.png','image/png',598232,'2009-07-26 04:41:40','Campus_Bus_Stop3.png','image/png',576957,'2009-07-26 04:41:42',70,NULL),(86,'Wayland Square','This design, as should all designs, is site specific. It is located in a garden area in Providence, RI. The shelter permits passage along the sidewalk, accessibility for all users, identifying language, a place for repose, and a place for signage. The long-lasting thin structure and perforated screens reduce graffiti surfaces while providing for ease of maintenance. Sadly missing in this shelter is a place for public posting as the Authority does not permit flammable surfaces. However, I believe that the shelter is a node for the intersection of the public and the local community. This is an opportunity for a community voice.',413,'2009-07-27 13:44:57','2009-07-27 13:44:57','From_the_Car.jpg','image/jpeg',1099066,'2009-07-27 13:44:46','Street_Elevation.jpg','image/jpeg',871361,'2009-07-27 13:44:51','Sidewalk_Elevation.jpg','image/jpeg',543913,'2009-07-27 13:44:54',71,NULL),(87,'Waterfront','This design, as should all designs, is site specific. It is located in a neighborhood that historically is focused on the water, from the earliest settlers in the 1600s, though the East India trading, to the waterfront park and water based uses of today. The form mimics waves with a folded aluminum roof. This is held up by four canted poles and stainless cabling evoking the sailing vessels. The combed concrete seating is based on pier structures, capped with story lines and photos telling the history of the site. All materials are durable and graffiti resistant. Missing is a neighborhood bulletin board and local map providing an additional entry points into the locale. These were omitted due to flammability concerns.',413,'2009-07-27 13:55:08','2009-07-27 13:55:08','Money_Shot.jpg','image/jpeg',1036131,'2009-07-27 13:54:56','Waveform_from_west.jpg','image/jpeg',221235,'2009-07-27 13:55:01','Waveform_Fox_Point_Seat.jpg','image/jpeg',1391957,'2009-07-27 13:55:04',72,NULL),(88,'Civic Respite','Utilizing every available production and design technology in an effort to produce a cost-effective, durable, and lovely design that is civic in character and timeless in appeal, TAG Design Group has produced a bus stop that will truly stop the traffic.\r\n\r\nProving that high-tech design does not have to be sterile or predictable, TAG has crafted cutting-edge, factory-friendly cast-steel elements which are molded into organic and delightful shapes in the same processes that makes them ready to bear their loads and withstand the elements with grace and panache.\r\n\r\nThe columns shown here are not precisely like any others that have come before, but they are inspired by the great bamboo and papyrus columns of North Africa and the Middle East, formalized by way of Europe and North America, and \"planted\" into the Salt Lake City soil as a statement about the nature of public investment in civic beauty, sustainability, and community--thereby representing an articulate and confident big-tent architectural legacy that can be pridefully claimed by all of Salt Lake City\'s residents, today and well into the future.\r\n\r\nIt would be a net loss for the environment and the local economy to cover an open-air structure with a green roof, but it makes an incredible amount of sense to cover one with solar-harvesting cells.  This is precisely what we have done, and we believe that the ecological (and economical) collection of green energy to run our twin clocks and augment our evening lighting is a crucial ingredient in the civic character of our design.  Furthermore, as every urban structure has not only a utilitarian duty but also an aesthetic one, we have kept our lights tucked into the deep roof to reduce the bus stop\'s contribution to urban light pollution, but filled all sides of the curvy roof pediments with clear glass to guarantee the shelter still provides an ambient glow as a beacon for evening travelers.\r\n\r\nAdditionally, we have designed LED banks in the easily accessible rear glass panels, providing a perfect place for schedule posting, public notices, and other important documents, which can be double-printed (an enormous paper-saver over time) and inserted into the protective glass panels for increased durability.\r\n\r\nThe spaces between our columns have been left open and high for seasonal hangings: small planted flower baskets in the spring, bright and cheerful holiday ornaments in winter, patriotic festoons in summer--the possibilities are endless, limited only by community imagination and democratic consensus.\r\n\r\nWaiting for the bus often provides travelers with an opportunity to \"stop and smell the roses,\" so to speak--and for this reason, we believe a bus stop that is tastefully rich in detail will be of unrivaled benefit to those thoughtful and sensitive citizens who enjoy observing life, tracing the world with their eyes and minds when the frantic pace of the daily grind finally grinds to a halt.  TAG Design Group has produced a bus stop that is meant to be sustainable on all counts--economically, ecologically, and aesthetically, and we believe that anything less is unworthy of a special place in the civic realm of Salt Lake City.\r\n\r\nTAG Design Group is:\r\nDanielle Potts\r\nJeffrey Preuss\r\nGreg Shue\r\nNathan Walker',415,'2009-07-27 21:37:20','2009-07-27 21:37:20','NextStop1.jpg','image/jpeg',628987,'2009-07-27 21:37:14','NextStop2.jpg','image/jpeg',570837,'2009-07-27 21:37:16','NextStop3.jpg','image/jpeg',554323,'2009-07-27 21:37:18',73,NULL),(89,'A Modernized Classic','   The design was created with usefulness in mind. The compact design will require a smaller amount of space on the sidewalk; the glass and minimal steel will allow shops and surrounding objects to remain visible to the people and tourists. The left wall is an LED panel which will serve on the outside for advertisement and will have the pertaining bus schedule on the inside. \r\n\r\n   An additional LED panel attached to the roof will provide advanced warning of arriving buses and updates to the commuters.\r\n\r\n   The glass walls and roof are supported by four pipes with spider grips.\r\n\r\n   The bench and armrests are attached to the pipes, allowing space for easy cleaning. \r\n\r\n   The bus stop is ADA accessible and the handrail on the right wall will help the disabled or the elderly stand up and reach the bus safely.\r\n\r\n   Cutting the back wall into three triangles with an angle pointing to the left wall, draws the attention to the information board and subtly directs the flow of traffic. \r\n\r\n   The right wall has an arrow-like pattern made up of small reflective dots; they create a noticeable sign for bus drivers. \r\n',232,'2009-07-28 15:43:33','2009-08-03 16:01:42','34_copy.jpg','image/jpeg',82643,'2009-07-28 15:43:21','33_copy.jpg','image/jpeg',130756,'2009-07-28 15:43:24','BUS_STOP_DESIGN_Layout1_2_.jpg','image/jpeg',409138,'2009-07-28 15:43:26',74,NULL),(94,'UNDER FULL SAIL','The main idea of UNDER FULL SAIL bus stop was to make kind of gate between academic and home life. Students going home, can see the sign that they are after school, they are free, like during sailing.\r\nImportant point was to design shape fitting to shape of people body, to create comfortable place to be.\r\nThe bus stop consist of:\r\n- main body, made of plastic, milky glass with steel rack hidden inside and aluminum support to take rest, \r\n- main panel which contain: screen with timetable and important information, ticket machine, name of bus stop and dustbin.\r\n',455,'2009-07-28 19:31:21','2009-07-28 19:31:21','UNDER_SAIL.jpg','image/jpeg',1841915,'2009-07-28 18:17:59',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,79,NULL),(95,'solar bus stop','The Solar Bus Stop is designed to optimize sunlight throughout the day and throughout the year. The bus stop consists of a shaded outdoor space adjacent to an enclosed waiting space for the winter months. Layered solar shading devices cover the bus stop and contain solar panels to store energy for night use. ',370,'2009-07-29 14:23:01','2009-07-29 14:23:01','solarstop1.jpg','image/jpeg',995826,'2009-07-29 14:22:54','solarbusstop2.jpg','image/jpeg',470027,'2009-07-29 14:22:57','solarbusstop3_.jpg','image/jpeg',945316,'2009-07-29 14:22:59',80,NULL),(96,'More than a bus stop?',':: Introduction\r\nThis design builds upon a previous submission, and takes on board comments made. The key changes regard the modular structure and retail provision. The intention is to provide a comfortable, hard-wearing stop. Passengers should be able to wait for their rush-hour services with space to sit and stand in safety and out of the rain, wind or heat. Good passenger information and facilities are vital for both commuting students and staff, and long-distance passengers wishing to change services. On a wider scale, can a bus stop provide additional services and features which could develop into a focal point for the area, providing facilities for the public and thus improving the passenger experience? I hope this design can effectively fulfil those demands, make a positive impact; please excuse the lengthy explanation (it\'s nearly as long as War and Peace). Once again I welcome comments.\r\n:: Architecture\r\nThe stop draws inspiration from modern transport architecture and design and is much more relaxing in appearance compared with the previous design. The architecture is inspired by Harlow Town Railway Station, designed in the late 1950s and a good example of architecture from the period. The materials at the bus stop are more modern though, using thick wooden panels (which should develop a rough and natural appearance with age) and charcoal-coloured frames. Signage is in Helvetica, and details are in a deep blue, inspired by British Rail’s 1960s rebranding. The reasoning behind the somewhat retro inspiration is that they have stood the test of time quite well – that should make the bus stop less prone to appearing outdated and unfashionable over the years.\r\n:: Operations\r\nPassenger seating is mostly separate from the platforms, to allow easier alighting and boarding given the large number of services calling at the stop. 2 platforms allow multiple buses to stop simultaneously, thus reducing waiting and improving journey times. A Ticket Vending Machine allows fares to be paid beforehand, reducing the need for the driver to spend valuable time selling tickets.\r\n:: Modular construction\r\n2 key components are used: 12.5cm thick support posts, and a 150cm frame. This frame is split into thirds horizontally, with different infill panels depending upon the use – window panels can be opened, door panels have fixed windows and solid panels use wood. The frame is used in both doors and windows – in the doors lightweight glass is used for ease of opening, in the windows thicker glass is used; this opens for ventilation. Glass is laminated for safety and coated in heat resistant film.\r\nThe modular components could in theory be used to build multiple structures. Larger waiting rooms would be feasible at bus stations, smaller open shelters would suit suburban stops. Sympathetic materials can be used in different locations when required.\r\n:: Passenger information\r\nSummary of departure screens list the next few bus services. Next Bus indicators closer to the platforms provide in-depth journey information, as well as live details about bus progress. These screens are freestanding, allowing for replacement upon damage or life expiry, and are housed in tough metal cases. Automated audio announcements provide additional information and are benefit to the visually impaired.\r\n(don’t worry, only 296 words left to go)\r\n:: Passenger comfort\r\nDuring cold, snowy or windy conditions, a waiting room is provided. Temperature is controlled using opening windows and forced air recirculation. Inside, passengers can take a seat on tough metal benches and perches. Outside, additional seats are provided and up to 12 cycles can be parked, all monitored by CCTV. A drinking fountain allows passengers to cool down in hot weather. Energy saving fluorescent spotlights and strip-lights are used throughout – these should last some time before replacement is needed. Large canopies provide shade and protection from the rain.\r\n:: Disability provision\r\nDoors are 1.5m wide, sufficient to allow wheelchair access. They are highlighted with blue paint. One door can be opened automatically, and one perch seat can be folded down to create a wheelchair space. The platform is raised to allow easier boarding and disembarking. \r\n:: Retail\r\nWith the old design, a point of controversy was a retail shop. This is now gone, instead space has been provided outside for retailers to allow greater flexibility. For instance, a coffee van could serve morning commuters, a snack bar could serve the lunchtime rush, and the evening newspaper can be distributed during the evening peak. Supply can be tailored better to daily and seasonal demand, and should services prove excessive, they can be cut back. With mobile units, stockholding space and overnight security will be less of an issue. Multiple businesses can be supported, important during these turbulent economic times.\r\n:: Development\r\nTrees and shrubs have been planted to provide aesthetic appeal, and to compensate for environmental damage. Given the large usage of the stop, leisure developments e.g. benches, tables, gardens etc. would be convenient for many people, and the space as a whole can develop further, with the upshot of improving the passenger experience.\r\n',230,'2009-07-29 21:56:34','2009-08-03 16:01:42','Overview.png','image/png',279496,'2009-07-29 21:56:27','Detail_1.png','image/png',556330,'2009-07-29 21:56:30','Detail_2.png','image/png',503367,'2009-07-29 21:56:32',81,NULL),(97,'PUNTO','Punto is the literal translation of \"Stop\" in Italian. As a regular commuter of public transportation, the design is approached to create a different experience visually and sensually while waiting for a bus.\r\n\r\nThe concept was derived from the simple postures of everyday life - reclining, sitting and standing. These various positions are carved and imprinted into a single box; thereby distinguishing it from a conventional bus stop. The intention is to create a visually appealing structure which would be perceived as a piece of art and design rather than just a simple shelter simultaneously rendering practicality and comfort. \r\n\r\nThis \"Punto\" design is just another stop, on our way of re-designing, re-thinking and igniting a renewed interest into the everyday public services and spaces which we often go unnoticed and have become mundane and obsolete.\r\n',218,'2009-07-30 19:35:51','2009-07-30 19:35:51','Punto_1_NB.jpg','image/jpeg',604174,'2009-07-30 19:35:39','Punto_2_copy.jpg','image/jpeg',702349,'2009-07-30 19:35:44','Punto_3_copy.jpg','image/jpeg',611754,'2009-07-30 19:35:47',82,NULL),(98,'Smart Bus Stop ','Practical, environmentally friendly, unique, and iconic. Smart Bus Stop is an innovative bus stop designed to improve Salt Lake City’s public transit experience.\r\n\r\nThe seats and roof is inspired by designer sofas. The philosophy behind the form is to have the exterior design convey the comfort that the user experiences in the interior, promoting more people to use public transit.  \r\n\r\nThe seating arrangement is based on the teepees traditionally used by the original inhabitants of Utah, the Ute tribe. The open, circular seating plan creates a sense of community for the city. \r\n\r\nTried and tested inflatable technology is used for the seats and roof. The form is cut by computer controlled CNC technology to give wrinkle free precision. Materials such as the Ferrari Precontraint 402 can be used as the skin. This material is made of fire retardant, UV stabilized material with high tenacity. The Texyloop process will make the skin completely recyclable, in order to benefit the environment. This technique also makes Smart Bus Stop one of the cheapest designs in the contest. \r\n\r\nSolar cells can be placed on top of the roof when the smart bus stop is placed in areas exposed to the sun to further demonstrate Smart Bus Stop’s commitment to the environment. The solar cells will power the multi-colored lights that are placed inside the translucent skin, creating a beautiful effect at night. \r\n\r\nA timetable is available for convenience, and there is a slot for advertisement in order to create a surplus in cash flow, allowing more bus stops to be built. The size of the Smart Bus Stop is modular and adjustable depending on the number of people using the bus stop at the specific site. To promote accessibility for all, the design is wheelchair accessible, includes multiple escape routes for safety, and includes remote infrared audible signage for the visually impaired. The design is minimalist, and all the other gadgets can be attached onto or placed near the bus stop if deemed necessary. \r\n\r\nThat pretty much sums everything up. We at Chen Design hope you enjoy our presentation and our effort to better Salt Lake City. \r\n\r\n',506,'2009-07-30 21:44:36','2009-08-03 16:01:42','SmartBusStop1.jpg','image/jpeg',118333,'2009-07-30 21:44:29','SmartBusStop2.jpg','image/jpeg',118284,'2009-07-30 21:44:32','SmartBusStop3.jpg','image/jpeg',137805,'2009-07-30 21:44:33',83,NULL),(99,'module BusStop','module BusStop. light construction.',510,'2009-07-31 07:59:24','2009-07-31 07:59:24','graphvic.jpg','image/jpeg',696637,'2009-07-31 07:59:17','graphvic1.jpg','image/jpeg',384527,'2009-07-31 07:59:21','graphvic3.jpg','image/jpeg',803125,'2009-07-31 07:59:22',84,NULL),(100,'SunBus','This is a Bus Station with solar and transparent adjustable roof. The photovoltaic cells enable the station to provide energy for the electronic message board, air condition, the digital advertisements and the changing of the roof transparency according to the sun sensors.\r\n',535,'2009-08-02 16:57:18','2009-08-03 16:01:42','cory-sunbus748-1.jpg','image/jpeg',430329,'2009-08-02 16:57:13','cory-sunbus748-2.jpg','image/jpeg',481495,'2009-08-02 16:57:16','2.jpg','image/jpeg',49120,'2009-08-02 16:57:17',85,NULL),(102,'black and white cubes','made from recycled  materials, plastic cubes\r\ncan be assembled easy,\r\nand easy disassembled ',543,'2009-08-03 11:58:27','2009-08-03 11:58:27','2.jpg','image/jpeg',1088630,'2009-08-03 11:58:05','3.jpg','image/jpeg',918727,'2009-08-03 11:58:18',NULL,NULL,NULL,NULL,87,NULL),(103,'hMD Studio - Athens Submission \'08','This is a recent entry for a bus shelter competition in Athens, Georgia. The shelter has a \'rock\' theme, as stipulated by the program. hMD Studio was shooting for conceptual simplicity, as well as buildability.  The submission was accompanied by a materials and construction schedule that held to the project budget.  more can be seen at:\r\n\r\nwww.formworksarch.com\r\nhMD Studio Architecture',548,'2009-08-03 16:08:42','2009-08-03 16:08:42','hMDStudio_athens01.gif','image/gif',622985,'2009-08-03 16:08:23','hMDStudio_athens02.gif','image/gif',401387,'2009-08-03 16:08:36',NULL,NULL,NULL,NULL,88,NULL),(104,'The Stop','mia.antoniomaggi@hotmail.com',390,'2009-08-04 10:08:31','2009-08-04 10:08:31','final_portfolio.jpg','image/pjpeg',331816,'2009-08-04 10:08:28',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,89,NULL),(106,'Dynamics.','Based on the inspiration of lightness and minimal contact with the site at hand, the bus stop takes on characteristics of the idea of the bus stop. Speed and Fluidity became the driving forces behind the gestural moves as the entire shceme is cantilevered from one end, emphasizing its balance and proportion in detail as to that of high automotive design.\r\n\r\nFunctionally the \"stop\" allows users to take advantage of sitting within shelter with others or for the introverts allows them to set within the natural sunlight separating themselves from others. ',556,'2009-08-04 20:18:12','2009-08-04 20:18:12','3.jpg','image/jpeg',237284,'2009-08-04 20:18:08','2.jpg','image/jpeg',191564,'2009-08-04 20:18:09','1.jpg','image/jpeg',279596,'2009-08-04 20:18:11',90,NULL),(107,'Mazen Design','the Concept is to have a modern design that performs light and shadow plays....and to be interesting to stand in...and allow to have comercial ads on it\'s solid walls...and trasperancy on the others.',558,'2009-08-04 22:51:30','2009-08-04 22:51:30','view_1_copy.jpg','image/pjpeg',117302,'2009-08-04 22:51:24','view_2_copy.jpg','image/pjpeg',134681,'2009-08-04 22:51:27','ele_01.jpg','image/pjpeg',35919,'2009-08-04 22:51:30',91,NULL),(108,'BUSstop','the concept of the bus stop is to think more of a modern design integrated with sculpture  to be distinct on the street, but at the same time providing the needs for public transportation. The bus stop can be access from both ends and one entry on the middle, it also provides sitting on both sides.  The structure provides a solid wall on one side for protection and part of the is cover with mess in order for transparency, it also deign to protect from sun major part of day.',559,'2009-08-04 23:21:53','2009-08-04 23:21:53','BZ1.jpg','image/pjpeg',209627,'2009-08-04 23:21:50','BZ2.jpg','image/pjpeg',291742,'2009-08-04 23:21:51','BZ3.jpg','image/pjpeg',280454,'2009-08-04 23:21:52',92,NULL),(109,'BamBooBus (Brazil)','Work with bamboo and plastic (Design by Hugo, Caio, Júlio and José from Architecture and Urbanism of UNIFEV University, SP, Brazil; Tutor: Prof. Evandro Fiorin)',564,'2009-08-05 16:39:32','2009-08-05 16:39:32','bamboobus_model_1.jpg','image/pjpeg',331639,'2009-08-05 16:39:24','bamboobus_1x1_2.jpg','image/pjpeg',160722,'2009-08-05 16:39:27','bamboobus_1x1.jpg','image/pjpeg',335521,'2009-08-05 16:39:29',93,NULL),(110,'Self Sufficient Design','Many bus designs are boxes with a few benches and no real design purpose but to shield those from inclement weather. With a Self Sufficient design we can change the way the bus stop looks and feels like, using materials that are industrial and street friendly with little up keep and an aesthetic appeal that will fit an urban or rural area. Solar panels adjusted to the sunlights rays, interactive bus routes and maps, wide windows to provide good circulation and bike racks that encourage those to travel to and from the stop in different ways will encourage those to travel with mass transportation. Promoting green energy and waste management and mass transit will help with our ability to tackle our addiction to energy and contribute to living sustainably.',490,'2009-08-05 19:10:32','2009-08-05 19:10:32','ACCamera.jpg','image/jpeg',304092,'2009-08-05 19:10:26','ACCamera_2_0.jpg','image/jpeg',392249,'2009-08-05 19:10:28','ACCamera_1.jpg','image/jpeg',345598,'2009-08-05 19:10:30',94,NULL),(111,'Anticipate','This bus stop shelter developed out of the experience of waiting in anticipation for the next bus arrival. The shelter is comprised of a concrete bench, aluminum framing, and structural glazing.',457,'2009-08-07 17:57:00','2009-08-07 17:57:00','bus_001_m.jpg','image/jpeg',193030,'2009-08-07 17:56:57','bus_005_m.jpg','image/jpeg',188644,'2009-08-07 17:56:58','bus_002_m.jpg','image/jpeg',107656,'2009-08-07 17:56:59',95,NULL),(112,'One Shelter','This is a bus shelter. At the heart, that is all a bus stop can hope to be. A bus stop will not present new social values or spiritually inspire an individual. It can greatly contribute to a site, it can be comfortable (physically and emotionally), it can be beautiful and damn it, it better cover you from the rain.\r\n\r\nSo the bus shelter is a large piece of sidewalk furniture (like bike racks, pay phones, parking meters, benches). Here, the street, the infrastructure for the bus, has curled up to provide shelter for its users. As a thank you, maybe, but more as an extension of the urban \"nature\" it grows from the ground.\r\n\r\nArchitecturally this stop is nearly maintainance free as the floor, roof, walls and furniture are of one piece. The transparancy of the glass allows the user to feel safe at night, and resists grafiti. It protects from rain and snow but is still open enough to vent properly and the curved back wall keeps garbage from collecting. The project is cheap, easy to construct and durable. The length of the stop can be adjusted based on the site without modifications to the structure, or adjusting the pre-fabricated glass panels and their standoffs. Sure it will get graffitied, so what? It could get painted or sandblasted, made or polished concrete or exposed aggregate. The form and the materials are simple, but true. The beauty will come from the detailing.',586,'2009-08-07 19:25:05','2009-08-07 19:25:05','oneshelter1.jpg','image/jpeg',772696,'2009-08-07 19:24:49','oneshelter2.jpg','image/jpeg',614599,'2009-08-07 19:24:54','oneshelter3.jpg','image/jpeg',981853,'2009-08-07 19:24:58',96,NULL),(113,'Promenade','My bus stop concept is to be as sustainable as possible:\r\nbamboo/recycled seating\r\nrecycling area\r\ngreen roof\r\nmix use site\r\nIt is pedestrian/area friendly because it not only invites people to come to the stop but also passer by\'s to stop at the cafe.\r\n',540,'2009-08-07 21:46:07','2009-08-07 21:46:07','bus_stop.jpg','image/jpeg',1601258,'2009-08-07 21:46:01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,97,NULL),(114,'Let\'s meet [B]us stop','What is waiting ? It’s loosing time !\r\n\r\nWhat is waiting for a bus ? Usually it’s seating (if there is some place), listening our own music, calling friends using mobile to be sure don’t speak with unknown people. Waiting a bus is like being in a bubble surrounded by other people in their own bubble, as if we were alone.\r\nAll societies are based on meeting and comprehension. Because it’s public and open to everybody, public transports can be a real support for society life, and bus stops can be social spaces.\r\n\r\nThe best way for people to meet and break distances is playing a game. So what is seating, what is leaning, what is resting, what is waiting ? They are ways to meet. In this bus stop, whatever you want to do needs two people. Seats are balances, so you have to be two to balance it, you can also lean on some elements but if you want to feel good you have to be two.\r\nA game is naturally beginning, and people have to communicate each other to find the best stability. By this way waiting a bus becomes a funny game in which people will play even if they don’t know each other.\r\n\r\nTo show it all the bus stop is like unstable, using scenography to animate the space and provide different feelings. Different areas, corresponding to different uses, are created by the move of the structure, expressing movement of the society.\r\nThe structure is created by a repetion and rotation of one steel strip, which length change. Some boxes becomes embedded in the structure to provide different functions like ticketing, food & drink dispensing, web and bus informations.\r\n\r\nThis bus stop is a real point of social life and happy time, using a game to establish communication between people without they never have spoke together. ',598,'2009-08-08 05:41:40','2009-08-08 05:41:40','LMBS-Board.jpg','image/pjpeg',1672011,'2009-08-08 05:41:31','LMBS-01.jpg','image/pjpeg',1054730,'2009-08-08 05:41:35','LMBS-02.jpg','image/pjpeg',876016,'2009-08-08 05:41:37',98,NULL),(115,'Sound balloon','We hate traditional bus stop !\r\nThey’re not places, we can’t feel nice, there is nothing to do, it’s not corresponding to us !\r\nWe want a place we can feel good and free !\r\n\r\nWhat is space ? How to define it ? How to build it ?\r\nThis bus stop is a new way, explorating how we can do space. Here the sound creates different places, spaces, feelings. Different spaces with different kind of music allow peoples to feel good, according to what they like (seating and listening classical music, dancing listening pop music, depending of their age and the kind of music they like).\r\nEye sense is also used, natural light is filtred by water on the roof (snow during the winter), giving different atmosphere. We can see water into the pillars to express it’s used. This water is always going from the earth to the roof, creating a conditioned place. In fact during winter the water is heating up by the earth, while in summer it’s cooling.\r\n\r\nSome projectors are conceal into pillars, projecting bus informations and news on the roof.\r\nDuring the night some lights in the pillars colors water with differents colours, giving a strong ambiance to this place, like the bus stop is doing a show. This place is like a funny friend !\r\n\r\n\r\nMaterials are plastic, plexiglass and resin. The ground and pillars basement are built with resin because of the facility of building, facility of cleaning and durability. Columns are plexiglass because it’s most safety than glass and more easy to do those shapes. The roof is plastic because of it’s lightness and it’s feeling. Those materials give a strong contemporean feeling to this space.\r\n\r\nIn this bus stop people are not just waiting a bus, they are listening music, moving from a place to an other, meeting, talking, dancing, forgetting problems and becoming happy.\r\n\r\nHere people can feel free like children ! \r\n',598,'2009-08-08 05:46:15','2009-08-08 05:46:15','SB-01.jpg','image/pjpeg',715047,'2009-08-08 05:46:08','SB-02.jpg','image/pjpeg',834705,'2009-08-08 05:46:10','SB-03.jpg','image/pjpeg',870759,'2009-08-08 05:46:13',99,NULL),(122,'New Life Worm Bus Station','Because the NEW bus station should be full of LIFE and WORM.\r\nNEW is the tehnology use to create all you need, like phone area, tickets area (with automatic machine), wireless internet connection.\r\nLIFE is the green area.\r\nWORM is the wood use in the seating area.\r\nSo you have all you need to feel good even if you just waiting for you bus to came.',385,'2009-08-08 21:36:55','2009-08-08 21:36:55','W.JPG','image/pjpeg',788100,'2009-08-08 21:36:35','32.jpg','image/pjpeg',186484,'2009-08-08 21:36:51','33.jpg','image/pjpeg',204914,'2009-08-08 21:36:53',106,NULL),(123,'WAITING TUBE','* Serves as a bus stop, a temporary shelter and a sign.\r\n* Can be be easily identified.\r\n* Simple in concept, elegant and modern.\r\n* Its parts can be easily manufactured,  assembled and installed.\r\n* Main materials include recyclable plastic and aluminium.\r\n* Additional tube-like components can expand the bus stop in length as necessary.\r\n',623,'2009-08-11 10:19:35','2009-08-11 10:19:35','BS-M01C-v3.jpg','image/pjpeg',226899,'2009-08-11 10:19:27','BS-M01C-v8.jpg','image/pjpeg',288813,'2009-08-11 10:19:31','BS-M01C-v7.jpg','image/pjpeg',280124,'2009-08-11 10:19:33',107,NULL),(124,'Bus-Stop  \" final design \"','Bus-Stop \"final design\" \r\n\r\nThe future of the bus-stop begins with some simple facts. First, the bus has to stop at the right location to pick up the passengers. \r\nSecond, the bus-stop has to support the line that the passengers form to aboard the bus. \r\nThird, make it obvious for everyone to exit to the rear of the bus. Training ourselves to be a better commuters will benefit us with better and reliable service.\r\n\r\nThis design starts with a name “BUS-STOP” signaling the bus drivers to stop at the right location. The right location is to align the bus door to the portal  within the bus-stop. The dots on the floor indicate a place for people to line up. At night the bus-stop will also attract people with it\'s glowing lights, providing information and a comfortable bench. \r\n\r\nSome might argue that the OLED and interactive map is a expansive materials. I think any new technology at first is costly. However, as designers it is our responsibility to use new materials in a creative way to improve our way of life, visually and functionally.\r\n\r\nThe design components.\r\n\r\nRoof  \r\nSolar panel ( Photovoltaic ) 30% clear glass opening for light penetration. It will generate electricity to run lights and display panels. \r\n\r\nFolded wall\r\nTri-fold OLED panel will provide a transparent inclosure for the people during the day and at night act as light panel for safety and digital advertisement for entertainment.\r\n \'OLED\' is a thin clear plastic sheet that can act as a light source or a visual display like LCD without a sold back panel. It generates 75% less heat than the standard LED. Therefor, just right amount of heat for the people waiting for the bus at night.\r\n\r\nOLED : Organic light emitting diode. \r\nAdvantage: 	\r\n1.Transparent display\r\n2.Flexible, fold-able and dual display\r\n3.Paper thin display\r\n4.Touch screen panel capable\r\n5.Free viewing angle.\r\n6.Low power consumption\r\n7.High contrast\r\n\r\nSolid wall\r\nMetal box that holds the standard advertisement on the outside and interactive touch screen map at top and general information below ( w/ weather bus schedules and announcements ) with language options. This wall also act as directional portal wall. \r\n',196,'2009-08-12 00:36:23','2009-08-12 00:36:23','Utah_Bus_stop_design_10a.jpg','image/jpeg',675675,'2009-08-12 00:36:13','Utah_Bus_stop_design_11a_06a.jpg','image/jpeg',1148102,'2009-08-12 00:36:17','Utah_Bus_stop_design_03b_03a.jpg','image/jpeg',613135,'2009-08-12 00:36:20',108,NULL),(125,'Canned bus stop','This bus stop is like a interactive piece of public art. It’s recognizeable from around and from inside the bus. Being different from all other bus stop, it gives a strong identity to this place, making itself a funny meeting point. It’s curve shape allows to steer people in differents ways according to what they want to do (ride, get off, stand by, seat, meet …).\r\nIt’s composed to be a funny convivial place with a graduation of fonctions according to space from rest / stand by to ride the bus. An enclosed box is detached, creating a landmark and closing the stand by space. This box is used during hot or cold days, using natural energy and architectural protections (during winter the sun will hit up, and during the summer it’s protected against sun using solar shaders and keep cold because of water falling onto the windows).\r\n\r\nThe structure is made of curved strips which join in the middle creating a covered open space, used as the lean space. Furnitures are thinked to serve multiple use and be convivial. So the lean furnitures allows us not only to lean but also serve as a bar table we can put onto a tumber or some food. People can lean on the other side and it realy become a meeting point. Of course there is also a trash receptacle into.\r\nA linear machine is placed in the first space of the bus stop (seating place). It’s made of Food&Drink dispenser, ticketing dispenser, phone and internet connection point. At the end is placed an information board. Into the box are disposed bus timing screen and information sreen.\r\n\r\nThe material choosen for the bus stop is steel for it’s longevity and ease maintenance. A mix of plastic and metal is used for outside furnitures while inside we use some new plastic materials which are more confortable (possibility of distortions). ',598,'2009-08-12 08:36:55','2009-08-12 08:36:55','CannedBS-01.jpg','image/pjpeg',683631,'2009-08-12 08:36:44','CannedBS-02.jpg','image/pjpeg',1044510,'2009-08-12 08:36:49','CannedBS-03.jpg','image/pjpeg',698008,'2009-08-12 08:36:52',109,NULL),(126,'Timber and Glass','This is my contribution.  I have used both timber and glass as I like the appearance of both materials.  ',633,'2009-08-12 10:11:48','2009-08-12 10:11:48','busstop.jpg','image/pjpeg',62773,'2009-08-12 10:11:45','busstop2.jpg','image/pjpeg',51257,'2009-08-12 10:11:46',NULL,NULL,NULL,NULL,110,NULL),(127,'Like a leaf...','Our goal is to develop a traffic building with a design that is inspired by dynamic, natural structures. This building should evolve into a space of „peace“ along the road , which freezes the busy moves of the traffic outside. The form of a leaf seems to meet all the requirements in all respects. If we look into nature a leaf or leafage gives shade and also protection against the elements. Furthermore a leaf shows a clear and direction-orientated dynamic at which the middle leaf vein forms an axis of symmetry. Along this symmetry axis and for this form the leaf is divided in two parts. One half is placed onto the other creating a cocoon as an inner casing. A leaf is also a natural power station using the solar power therefore this “leaf” is using the solar power by photovoltaic-cells, feeding the integrated lighting with the won energy. ',600,'2009-08-12 12:18:22','2009-08-12 12:18:22','Blatt1.jpg','image/jpeg',705242,'2009-08-12 12:18:01','Blatt2.jpg','image/jpeg',707643,'2009-08-12 12:18:11','Blatt3.jpg','image/jpeg',643027,'2009-08-12 12:18:17',111,NULL),(128,'U need it !','How to link a bus stop with a site ?\r\nHow to give it a strong identity ?\r\n\r\nWhat is the most representative thing of the U of U ? It’s its logo !\r\nThis logo is linked with the university, whith the students and the teachers, who are proud of it. When you think about the U of U you see its logo, and when you see this logo you think about U of U.\r\nTo link this bus stop with the university and to give it a strong identity, we used the U logo to do all kind of furniture you need. The U creates here a bean, a seat, a shelter, a lamp…\r\nThose furnitures can also be used for all the campus, so when you are walking you always know you are in the campus of the U of U, and not in an other place !\r\n\r\nThis use gives a real strong identity to the site !\r\n',598,'2009-08-15 04:09:57','2009-08-15 04:09:57','UNeedIt-01.jpg','image/pjpeg',1118857,'2009-08-15 04:09:45','UNeedIt-02.jpg','image/pjpeg',1437742,'2009-08-15 04:09:49','UNeedIt-03.jpg','image/pjpeg',932422,'2009-08-15 04:09:54',112,NULL),(129,'Simple Stop','The design of this bus stop emphasizes a simple and straightforward solution to the site-specific problems presented.\r\n\r\nAccess: In order to accommodate heavy pedestrian traffic, the bus stop is set back from the street and offers a very open front. Inside there is plenty of room for people to sit and move around as desired. The rear of the bus stop features an open half panel that permits foot traffic from the parking lot behind. A bike rack encourages bike traffic.\r\n\r\nWeather: The curved roof protects bus riders from sun, rain and snow and contains troughs (not shown) that drain water away from the structure’s openings. The walls provide basic protection from wind in the winter but are also open enough to ensure a fresh cooling breeze during the summer.\r\n\r\nLighting: On the roof of the bus stop are four solar panels. Although they power the lights of the structure, they also would collect enough energy to power nearby streetlights.\r\n\r\nRoute Info: For the convenience of bus riders there are two screens that give the current time as well as the arrival time of the next bus.\r\n',667,'2009-08-17 02:41:49','2009-08-17 02:41:49','Bus_Stop1.png','image/png',918765,'2009-08-17 02:41:41','Bus_Stop2.png','image/png',1266845,'2009-08-17 02:41:44','Bus_Stop3.png','image/png',541301,'2009-08-17 02:41:48',113,NULL),(130,'Rustic Bus Stop','The “Rustic Bus Stop” provides shelter from the outside elements featuring inside seating and standing room while still maintaining a clear view of all surroundings and oncoming buses. The bus stop also includes sufficient wall space for bus route maps and advertisements. Located parallel to the sidewalk, the bus stop allows for disabled and general pedestrian access, with bicycle racks located in the rear. On the exterior of the bus stop, seating for days where an inside shelter is not necessary.',365,'2009-08-18 14:13:27','2009-08-18 14:13:27','ACCamera_1_0.jpg','image/pjpeg',405696,'2009-08-18 14:13:20','ACCamera_8.jpg','image/pjpeg',418620,'2009-08-18 14:13:23','ACCamera_4.jpg','image/pjpeg',332431,'2009-08-18 14:13:25',114,NULL),(131,'easy','concrete|plastic + glass',698,'2009-08-18 17:43:55','2009-08-18 17:43:55','bus_stop_1.jpg','image/jpeg',436736,'2009-08-18 17:43:45','bus_stop_2.jpg','image/jpeg',394433,'2009-08-18 17:43:49','bus_stop_3.jpg','image/jpeg',405232,'2009-08-18 17:43:52',115,NULL),(132,'Eco Stop','Idea of this bus stop is to be easily produced, mounted and on end recycled. Trees shown on image, should be some fruit trees. I used apple trees. This trees except they would give fruit to anyone, they will produce fresh air too. They would take rain or other water trough grids at bottom. Also it is easy to clean bus stops like this and I think they would be interesting for users of urban transport and useful to anyone.  ',707,'2009-08-19 22:35:06','2009-08-19 22:35:06','Bus_Stop.png','image/png',1200854,'2009-08-19 22:35:03',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,116,NULL),(133,'Simple and functional bus stop','Sorry about my english....\r\nOne of the main objectives of this project is to prevent the entry of cold and rain through glass placed in front of the bus stop. \r\nThe idea of this bus stop was made to be simple and functional, with a simple but effective structure.',703,'2009-08-19 22:55:35','2009-08-19 22:55:35','bus1.jpg','image/pjpeg',432244,'2009-08-19 22:55:30','bus_2.jpg','image/pjpeg',335107,'2009-08-19 22:55:32','bus4.jpg','image/pjpeg',439607,'2009-08-19 22:55:33',117,NULL),(134,'GreenStop','The GreenStop\r\n\r\nThe heart of my bus stop design is a re-planted tree at the roadside, which provides both the structure for the shelter and also a fitting symbol for the \'GreenStop\' design. A steel clamp is securely fitted around the trees\' trunk, and it is this clamp which supports the two timber beams that run from the tree. The timber beams run to a brick wall that sits inside a steel frame, proudly displaying the simple structure of the shelter. \r\n\r\nThe roadside of the shelter is left open for easy access to the bus, and the clear PVC roof overhangs the timber beam at the opposite side to provide shelter further back behind the main stop. This roof is very slightly angled to the roadside so any rainwater can run into drains in the road. Bus timetables and next bus screens are placed on either side of a strengthened PVC \'wall\' (power for this screen and the lighting in the shelter is provided by a row of solar panels on the roof). The use of a clear material for the enclosing wall, and the positioning of the stop and its seats provide a perfect view of oncoming traffic.\r\n\r\nThe use of the tree would provide the stop with its own unique identity, with the simple structure being supported (and openly displayed) by the tree.\r\n\r\nMathew Mitchell',694,'2009-08-20 21:16:53','2009-08-20 21:16:53','greenstop_image1.jpg','image/jpeg',1745636,'2009-08-20 21:15:54','greenstop_image_2.jpg','image/jpeg',2028450,'2009-08-20 21:16:01','greenstop_image3.jpg','image/jpeg',1870360,'2009-08-20 21:16:23',118,NULL),(135,'frame_it','the idea of this project is to use the busstop as a frame for beautiful views or unforgetable shots. \r\nget rid of all the ads u use to have at a busstop. \r\nshow what the city has to offer: uniqueness. \r\nand frame it.',606,'2009-08-21 10:15:19','2009-08-21 10:15:19','plakat01.jpg','image/pjpeg',384634,'2009-08-21 10:15:13','plakat03.jpg','image/pjpeg',366566,'2009-08-21 10:15:15','plakat04.jpg','image/pjpeg',257892,'2009-08-21 10:15:17',119,NULL),(136,'Walla Stop','Creating the place where a public transport bus stops.\r\n- Photovoltaic roof panels\r\n- 17’ high (max.)\r\n- Sights opened (wall)/environmental friendly (usage-parking lots, and road sides)  \r\n',748,'2009-08-24 18:36:04','2009-08-24 18:36:04','f3.jpg','image/pjpeg',244593,'2009-08-24 18:35:58','f1.jpg','image/pjpeg',280458,'2009-08-24 18:36:00','f2.jpg','image/pjpeg',491686,'2009-08-24 18:36:02',120,NULL),(137,'Bus shelter for a tropical city','Design that I did thinking primarily in my city, Salvador.',775,'2009-08-25 14:36:15','2009-08-25 14:36:15','bus_stop_26.jpg','image/jpeg',331603,'2009-08-25 14:36:09','bus_stop_05.jpg','image/jpeg',282591,'2009-08-25 14:36:11','bus_stop_23.jpg','image/jpeg',487550,'2009-08-25 14:36:13',121,NULL),(138,'Next Stop','Just a simple design. I used the UTA logo to model the seating using the very same colors. Very easy for the bus driver to notice the stops from far away.',714,'2009-08-26 21:04:08','2009-08-26 21:04:08','BUSSTOP1.jpg','image/pjpeg',457678,'2009-08-26 21:04:02','BUSSTOP2.jpg','image/pjpeg',376172,'2009-08-26 21:04:05',NULL,NULL,NULL,NULL,122,NULL),(139,'Campus Stop','\"Campus Stop\" utilizes the concrete and brick elements of the surrounding buildings with the roof providing a modern flare.  It is important to make the statement that this bus stop is on the University of Utah campus, which is achieved through two sculptural elements that incorporate the signature \"U\" of the university.  For days with precipitation the entire structure has been move closer to the curb.  This also allows for circulation in front of and behind the structure. The interior of the bus stop provides ample covered space, seating and locations for route maps and schedules.  The rear of the structure could contain a campus emergency phone and a place for public postings.',798,'2009-08-27 08:53:33','2009-08-27 08:53:33','Next_Stop_1_-_CRDEESE.jpg','image/jpeg',361288,'2009-08-27 08:53:27','Next_Stop_2_-_CRDEESE.jpg','image/jpeg',454636,'2009-08-27 08:53:29','Next_Stop_3_-_CRDEESE.jpg','image/jpeg',434824,'2009-08-27 08:53:31',123,NULL),(140,'The Emblazon Stop','This design is on the basis of trying to help the blind or people that has viewing difficulty who takes the bus back and forth to school. The design consist of 4 bright colour lanes that is sided with a paving that has different characteristic to go with a colour. The different paving provides the blind a guide from every side towards the opening of the bus. This method also helps the people with viewing difficulty which is enhance by the bright strips that glows too during the night. The dark coloured bus stop is provide contrast to help emphasis on the colours. Both sides are integrated with small screens indicating time for the next bus for the others. The stop will also be fitted with a speaker to provide the blind information on the next bus arrival time. The design is not only to help, but to provide a funky shelter to students.',375,'2009-08-27 14:25:04','2009-08-27 14:25:04','Final_3rd_01.jpg','image/pjpeg',1131232,'2009-08-27 14:24:47','Final_3rd_05_copy.jpg','image/pjpeg',786012,'2009-08-27 14:24:53','Final_3rd_06.jpg','image/pjpeg',1440040,'2009-08-27 14:24:58',124,NULL),(143,'Solar powered bus station','Solar energy provides energy for LED-backlit LCD screens, to warm up the seats during cold season, as well as quick charging for USB-powered devices (iPOD, etc.)\nA pre-engineered metal structure, covered with plexiglass/laminated glass.\nThe bus station will present educational materials on the LCD screens – i.e. health facts like benefits of Omega 3,6,9 fatty acids, newest discoveries, city news, green trends, etc.',788,'2009-08-27 20:13:45','2009-08-27 20:13:45','1.png','image/png',745141,'2009-08-27 20:13:35','3.png','image/png',842630,'2009-08-27 20:13:39','4.png','image/png',778890,'2009-08-27 20:13:42',127,NULL),(144,'The Rusty Bus Stop','The Rusty Bus Stop\r\n\r\nDay\r\nPowered down in a state of hibernation and remains so until a bus is immanent. At eto-60secs, 60 seconds before the bus is due to arrive, the vessels light burns indicating the next bus is approaching and warning those at the station and those still on their way.\r\n\r\nNight\r\nIn between these bus arrival ‘power ups’, the beam projects the classic game ‘space invaders’ onto the road. The projected game can be accessed and played online at home or on the mobile devices of the waiting passengers',555,'2009-08-27 20:24:16','2009-08-27 20:24:16','rusty_bus_stop_lo.jpg','image/pjpeg',394384,'2009-08-27 20:24:03','rusty_bus_stop2lo.jpg','image/pjpeg',589069,'2009-08-27 20:24:09',NULL,NULL,NULL,NULL,128,NULL),(145,'RTG Design','This bus stop will be constructed with a standardized kit of parts. This allows the station to be adapted in size for various locations. It is equipped with solar panels to make it fully sustainable. The front facade is positioned close to the curb to maximize safety for waiting passengers. The curved facade prevents pedestrians from waiting to close to the street while buses arrive and depart. The station is equipped with L.E.D information boards at both ends of the station, a ticket vending located in the middle of the \r\nstructure, and is a LAN Wifi hotspot. There is a ledge for awaiting passengers to utilize. The structure extends to the rear which creates additional covered space for vending of food and beverages and relief from inclement weather for passing pedestrians. ',808,'2009-08-28 06:43:41','2009-08-28 06:43:41','Glick_Ryan_PG.jpg','image/pjpeg',922788,'2009-08-28 06:42:27','Glick_Ryan_PG2.jpg','image/pjpeg',1093604,'2009-08-28 06:43:02','Glick_Ryan_PG3.jpg','image/pjpeg',827890,'2009-08-28 06:43:22',129,NULL),(146,'\"SPEEDY\" Bus Stop','The shape of this bus station makes it \"moving\" and dynamic, based on the lifestyle of how people want to move from one place to another as soon as possible.\r\nThis shape also makes the snow easier to clean.\r\nAt the same time, the space around the bus station makes it more \"Alive\", to create public space, where people can sit and make interaction. \r\nBasically there are two connected shape of this bus station. The front part is the real bus stop.\r\nThe back part is optional if there is more space. It is a place where people wait for the bus, and they also can operate their laptop or just sit. ',770,'2009-08-29 06:33:45','2009-08-29 06:33:45','1.jpg','image/jpeg',699527,'2009-08-29 06:33:20','2.jpg','image/jpeg',613957,'2009-08-29 06:33:32',NULL,NULL,NULL,NULL,130,NULL),(148,'PEAK STOP','Waiting on a bus might get boaring. To provide some activity, this bus stop is equipped with a 15 feet high climbing wall. Simple, effective and cost - efficient. \r\n The design is iconic \r\n- you actually climb the mountain - \r\nboth the shape and the activity represent the olympic city and citizens can easily identify to it. \r\n Also, it is very flexible - could be equipped with WiFi hotspot, solar panels (to be fully independent), ticket machine etc. Of course, it is fully designed for disabled people (voice control, signs). Thanks to the translucent shell, the whole structure glows in the night, making it visible and even more iconic.',751,'2009-08-29 13:59:46','2009-08-29 13:59:46','B_kopie.jpg','image/jpeg',186618,'2009-08-29 13:59:38','C_kopie.jpg','image/jpeg',176405,'2009-08-29 13:59:40','E_kopie.jpg','image/jpeg',211515,'2009-08-29 13:59:43',132,NULL),(150,'U-Shaped Inspired Bus Stop','Designed for the campus of the University of Utah, the concept for this red, white and black bus stop is an attempt at exploiting the properties of the U-shape. \r\n\r\nThe users of this bus stop are encouraged to interact with these U-shaped elements as they vary in function, orientation and scale. \r\n\r\nIn essence, various degrees of transparencies along with an exploration of adjacencies and types of enclosures were investigated to create a sense of different places within this small space.\r\n\r\nMore information available on the image boards...\r\nThanks for viewing.\r\n\r\n\r\n ',841,'2009-08-30 07:59:53','2009-08-30 07:59:53','1-final.jpg','image/jpeg',1267607,'2009-08-30 07:59:13','2-final.jpg','image/jpeg',1278982,'2009-08-30 07:59:33',NULL,NULL,NULL,NULL,134,NULL),(151,'Recycled Cans','The design uses recycled cans to create a visual of what we put into the earth. When the bus stop is not in service, the cantilever fits back into the ground, and is lit. Thus, it becomes a sculpture when not in service.',900,'2009-08-30 23:39:53','2009-08-30 23:39:53','COMP2_copy.jpg','image/jpeg',266756,'2009-08-30 23:39:49','COMP3_copy.jpg','image/jpeg',395011,'2009-08-30 23:39:51','COMP1_copy.jpg','image/jpeg',254027,'2009-08-30 23:39:52',135,NULL),(152,'Recycled Cans ','Made out of recycled cans. Cantilever lowers into ground at night via air actuator. When the bus stop is not in service, it is a lit sculpture and a visual reminder of \"what we put into the earth.\"',900,'2009-08-30 23:52:15','2009-08-30 23:52:15','comp4_copy_mall.jpg','image/jpeg',1134315,'2009-08-30 23:52:08','COMP1_copy2.jpg','image/jpeg',514216,'2009-08-30 23:52:12','COMP3_copy.jpg','image/jpeg',395011,'2009-08-30 23:52:14',136,NULL),(153,'hyperbolic parabolyed','in this design i use the basic form of geomatry cube then tetra hydran and hyperbolic parabolied forms because i think tatra hydan is most stabled geometric shape which is is very effective against weather like wind and snow as well as self load. it looks complex but it is very simple and controled geometry like what the constructivest did. ',950,'2009-08-31 05:46:17','2009-08-31 05:46:17','front_view2.png','image/x-png',759943,'2009-08-31 05:46:10','back_view2.png','image/x-png',624369,'2009-08-31 05:46:13','interior_view2.png','image/x-png',693402,'2009-08-31 05:46:15',137,NULL),(154,'Bus Stop Space','The whole idea is to redefine the bus stop into a more colorful,open divided personalized spaces.\r\nThe space is accessible from the pedestrian route. where the concrete precast walls will be used from both sides for the public posting for the bus map and schedule.\r\nThe partitions are made of rough precast concrete to tolerate dirt. All sides of the partitions can be used for seating. The roof is made of corrugated sheets on precast concrete columns. Which all can be reused.\r\n\r\nThe randomness in the seating slabs and colors, for a more artistic approach. ',754,'2009-08-31 10:41:07','2009-08-31 10:41:07','1.jpg','image/jpeg',100364,'2009-08-31 10:41:03','3.jpg','image/jpeg',117911,'2009-08-31 10:41:05','8.jpg','image/jpeg',264929,'2009-08-31 10:41:06',138,NULL),(155,'Bus stop','  easly costructuble\r\n  easly mentenable\r\n  good during summer and winter time\r\n  it is histirical(horizontal and vertical elements)\r\nGeneraly i try to full fill the design consideration',855,'2009-08-31 11:56:39','2009-08-31 11:56:39','image1.jpg','image/pjpeg',103454,'2009-08-31 11:56:34','imege2.jpg','image/pjpeg',83402,'2009-08-31 11:56:36','abdura.jpg','image/pjpeg',72543,'2009-08-31 11:56:37',139,NULL),(156,'SIMPLE STOP','The intention of this stop is to be able to offer the biggest use quantity for the passer-by who needs every day a place where to be able to do a stop and decansar in an agreeable space to hope that it should come his bus to go to his destination.\r\nA device is provided with external banks, internal banks, parking lot for bicycles, glass closings for winter periods, for change of nappies and the electric power supply across solar cells.',576,'2009-08-31 19:33:17','2009-08-31 19:33:17','dos.jpg','image/jpeg',489892,'2009-08-31 19:33:10','uno.jpg','image/jpeg',357244,'2009-08-31 19:33:14','SEIS.jpg','image/jpeg',226178,'2009-08-31 19:33:15',140,NULL),(157,'Night Light','The bus stop is a very social building type and must be designed with such responsibility in mind.  New buildings in the contemporary world must fulfill multiple objectives, both stated and inherent.  To be successful, the design must solve present observed problems and future unforeseen problems.\r\n\r\nSo let’s think of the bus stop in a different way, looking at its history and possible future potentials.  Let’s say a brief history would be \"shelter from the elements\" and \"modular unit construction\".  But what is it today in society?  How do we USE the bus stop?  We can generate many more terms, such words as signage, pavilion, billboard, sculpture, beacon, and safety.\r\n\r\nMy design plays many roles simultaneously, the two most important being, safety and signage, but also culture, landscape, and icon.\r\n\r\nThe LED lighting, powered by an integrated photovoltaic system on the roof, is a beacon situated in the urban environment.  The lights transform the bus stop into a safe haven at night, which is very important in a city or university setting.  At the same time, the lights power the advertising signage of the bus stop.\r\n\r\nThe design is sculptural and adds to the culture of the city. A whole series of these bus stops, using multiple variations of the design, can be distributed throughout the city.  The bus route is transformed into a gallery hop, as the bus goes from one stop to the next.\r\n',793,'2009-09-01 05:01:40','2009-09-01 05:01:40','2009-08-31_board_1.jpg','image/pjpeg',1176548,'2009-09-01 05:01:28','2009-08-31_board_2.jpg','image/pjpeg',1409001,'2009-09-01 05:01:32',NULL,NULL,NULL,NULL,141,'76.197.162.177'),(164,'SELF SUFFICIENT MODULAR BUS STOP','BY DOING A MODULAR SYSTEM WE ALLOW THE DESIGN TO ADAPT TO THE NEEDS OF THE DIFFERENT SITES. ALL BUS STOPS WILL BE DIFFERENT IN TERMS OF THE MODULES THAT FORM THEM. ',560,'2009-09-01 14:07:25','2009-09-01 14:07:25','BUSSTOP_F-1_.jpg','image/jpeg',1909322,'2009-09-01 14:06:52','BUSSTOP_F-2_.jpg','image/jpeg',1428416,'2009-09-01 14:07:03','BUSSTOP_F-3_.jpg','image/jpeg',2062377,'2009-09-01 14:07:14',148,'68.160.196.135'),(165,'Zechner ZT GmbH','This construction kit system was designed for bus stops with high passenger turnarounds. By combining various units of the system, sheltered waiting areas as well as bicycle sheds can be installed cost effectively.',1008,'2009-09-02 01:30:12','2009-09-02 01:30:12','UBS25.JPG','image/pjpeg',28155,'2009-09-02 01:30:05','UBS26.JPG','image/pjpeg',31372,'2009-09-02 01:30:08','UBS27.JPG','image/pjpeg',32503,'2009-09-02 01:30:10',149,'112.95.250.228'),(166,'Ute News','The Ute News bus stop provides students, faculty, and Utah campus visitors the opportunity to grab a cup of coffee and get a glimpse of daily news headlines while waiting for a ride. The bus stop provides typical shelter while projectors stream video of news casts from around the globe on the interior overhead facade. The exterior facade of coffee hut scrolls daily news headlines, perhaps attracting commerce and viewership inside the bus stop, and perhaps even a spot for friends to meet.',976,'2009-09-02 17:01:48','2009-09-02 17:01:48','Bus_Stop_7.jpg','image/jpeg',433782,'2009-09-02 17:01:42','Bus_Stop_5.jpg','image/jpeg',505143,'2009-09-02 17:01:45','Bus_Stop_2.jpg','image/jpeg',433423,'2009-09-02 17:01:46',150,'147.226.108.99'),(167,'Rippin\' up the Concrete','This design\'s concept is to literally form the shelter out of ribbons of concrete torn from the sidewalk, as if peeling back the skin of the cityscape to form shelter from the elements. Plants are grown in the resulting bare soil \"scar\" where the concrete was \"pulled\" from.',701,'2009-09-03 04:40:26','2009-09-03 04:40:26','tornconcrete.png','image/png',122991,'2009-09-03 04:40:23',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,151,'76.202.192.221'),(168,'Recycled Bus','This bus stop is made from salvaged buses. Bus stop locations replace the route information.',701,'2009-09-03 04:42:09','2009-09-03 04:42:09','Recyclebus.png','image/png',105619,'2009-09-03 04:42:06',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,152,'76.202.192.221'),(169,'a bus-stop that speaks for itself','This bus-stop is designed as a generic typology. It can be produced in many materials and placed on all kind of locations in (almost) any country. It\'s a very clear, simple and recognizable busstop. Apart from the obvious usability as a busstop it is also a strong image and a nice object.',1059,'2009-09-04 15:22:15','2009-09-04 15:22:15','busstop_02.jpg','image/pjpeg',582675,'2009-09-04 15:22:06','busstop_01.jpg','image/pjpeg',518527,'2009-09-04 15:22:10','busstop_04.jpg','image/pjpeg',517890,'2009-09-04 15:22:12',153,'217.149.197.160'),(170,'Tickets Please...','This design offers a comfortable and safe retreat for all passengers awaiting the arrival of the bus. the structure is very eye catching and boasts a large bright yellow main support which stretches from the rear ground floor, up and over the shelter, until it passes through the front of the shelter into sight. The bus stop is fully sheltered and includes a bike park at the rear so that returning passengers can secure their bike in place and pick it up on their return journey. It also includes a display which informs the passengers how long they are expected to wait until the arrival of the next bus and the designated bus route is printed on the wall. Lights are provided to illuminate the front of the shelter so that it doesn\'t become dark at night and ensures the bus stop stays safe and comfortable at all hours of the day and night. The shelter is powered by a solar panel which is situated on the roof of the shelter so that no mains electricity is needed to power it. All aboard...',1010,'2009-09-04 16:29:00','2009-09-04 16:29:00','busstopdesign3.jpg','image/jpeg',345186,'2009-09-04 16:28:54','busstopdesign4.jpg','image/jpeg',285818,'2009-09-04 16:28:56','busstopdesign5.jpg','image/jpeg',269380,'2009-09-04 16:28:58',154,'86.148.219.32'),(171,'Bus Pavillion','The inspiration for my design began with a palm tree because of its canopy, organic, and logically erratic characteristics. A palm tree is similar to bus stop in which it must adapt to its surroundings. As a palm can grow in various climates from a tropical jungle to a desert a bus stop must adapt to its city\'s infrastructure and climate from rural to urban settings.\r\n\r\nThe design objective was to adhere to the rider experience. The bus pavilion needs to protect the rider from heat and rain and make a leisurely transition from the pavilion to the bus. Providing functions such as coffee/food stands, newsstands, public bathrooms, or flower shops will bring activity to the pavilions that will develop an urban and pedestrian pulse that most American cities lack.\r\n\r\nThe axon drawing represents how each steel screen is bolted together and how the metal roof is attached to the steel truss system allowing for a quick assembly.\r\n\r\nA modular expansion and reduction of the original adjusts to the different bus stop needs around the city. The two larger designs allow for a vendor space.\r\n\r\nImproving public transportation is an essential solution in conserving energy and combat global warming and designing iconic, cordial bus pavilions will effectively increase rider use.',975,'2009-09-04 18:18:18','2009-09-04 18:18:18','akaparis1.jpg','image/jpeg',925946,'2009-09-04 18:17:33','akaparis2.jpg','image/jpeg',1334915,'2009-09-04 18:17:36','akaparis3.jpg','image/jpeg',1874662,'2009-09-04 18:17:56',155,'129.171.233.75'),(172,'Public Mast','The strong architectural wing provides permeable protection from solar elements while imbuing a visually ambiguous sense of enclosure.  Paired with simple yet sculptural seating and other elements, this bus stop is a clean and adaptable prototype of a system which can be used throughout a service district.  ',1067,'2009-09-04 18:56:54','2009-09-04 18:56:54','view_4.jpg','image/jpeg',931089,'2009-09-04 18:56:45','view_6.jpg','image/jpeg',1143151,'2009-09-04 18:56:48','plan.jpg','image/jpeg',1062786,'2009-09-04 18:56:51',156,'147.226.104.120'),(173,'Center Drive','The design in named after the street which it is located.  \r\n\r\nThe design intent is to allow the preexisting spatial context and programmatic elements (below) to define the form.\r\n\r\nThe overall form (1) mimics and responds to the curvature of the street which it serves (3). \r\n\r\nSeating is positioned to be protected from wind and rain, yet a transparent wall allows visual site lines towards the direction of the buses arrival. (2).\r\n\r\nSpace is created between a vegetative screen and a wall to provide opportunities to chain bicycles. (4)\r\n\r\nA few practical amenities are built into the structure of the design: trash can, newspaper dispenser, overhead plane that leads riders from seating area to the door of the bus. (5)\r\n\r\nThe site as a whole functions as a gateway (between parking lot and university) for automobile commuters, bus riders, and cyclists (5&6)\r\n\r\nLighting leads to a sense of security during evening hours (7).\r\n',768,'2009-09-04 19:42:50','2009-09-04 19:42:50','3.jpg','image/pjpeg',1543332,'2009-09-04 19:42:43','2.jpg','image/pjpeg',705898,'2009-09-04 19:42:46','4.jpg','image/pjpeg',1024828,'2009-09-04 19:42:48',157,'147.226.104.89'),(174,'Kaleidoscope Stop','The kaleidoscope stop plays on light, color, and how they move.  The panels dividing the bus stop are light paintings, which use the interaction of light and colored glass to create works of art.  In this case the lights are mounted on a track in the frame, allowing people to move them creating different works of art with each change.  The overhead structure is composed of stainless steel, which will reflect the light and providing a continually changing scene as people move around it.  With its glowing lights and changing appearance, the kaleidoscope stop would become an instantly recognizable beacon on campus.',1070,'2009-09-04 19:50:11','2009-09-04 19:50:11','Approaching_from_Campus_Center_Dr..jpg','image/pjpeg',1306847,'2009-09-04 19:49:44','Approaching_from_parking_lot.jpg','image/pjpeg',1248091,'2009-09-04 19:49:55','views.jpg','image/pjpeg',169331,'2009-09-04 19:50:06',158,'147.226.103.77'),(175,'Ribbon Shelter','The new bus stop is formed by metal ribbons that emerge from the ground, which then expose natural elements such as vegetation, sand, and stone.  The glass in the back of the shelter protects bus riders from wind, rain and snow.  The ribbon forms are convex to the ground plane and react to the tree canopy through looping.  ',767,'2009-09-04 19:58:52','2009-09-04 19:58:52','Board_1.jpg','image/jpeg',1694928,'2009-09-04 19:58:42','Board_2.jpg','image/jpeg',1684830,'2009-09-04 19:58:46','Board_3.jpg','image/jpeg',1572239,'2009-09-04 19:58:49',159,'147.226.104.204'),(176,'More than a bus stop','The main ideas of this proposal were to incorporate the pedestrian traffic crossing the road with the bus stop and to provide a gateway and nature scenes in the parking lot. By offering a rest area at the gate way, the bus stop has three different sections: less calm (get on, drop off area), music/radio news room, and calm corner where pedestrians can take a break. They are semi outdoor, indoor, and outdoor spaces which provide various types of microclimate for different seasons. Landscaping plays a role of connecting all these spaces together.',980,'2009-09-04 20:27:44','2009-09-04 20:27:44','19.jpg','image/pjpeg',192013,'2009-09-04 20:27:36','1.jpg','image/pjpeg',217468,'2009-09-04 20:27:38','21.jpg','image/pjpeg',1794657,'2009-09-04 20:27:39',160,'68.51.105.250'),(177,'Jo\'s Stop','A rectilinear shelter made of board-form concrete, structural glass, and recycled rough-sawn timber. The glass at the side of the stop facing the street serves to deflect water spraying from passing vehicles, yet open enough to allow ventilation.  The board form concrete is only a veneer applied to a steel substructure anchored at the rear of the stop.  The skylight allows for natural lighting by day, and is equipped with cove lighting by night.  The bus route number is integrated into the concrete veneer as a relief or an extrusion. The stop measures 12\'w. x 7\'d x 9\'h.',1077,'2009-09-05 00:39:35','2009-09-05 00:39:35','Shutter_Stop2_copy.jpg','image/jpeg',191529,'2009-09-05 00:39:30','Shutter_Stop.jpg','image/jpeg',177624,'2009-09-05 00:39:32','Shutter_Stop3.jpg','image/jpeg',168994,'2009-09-05 00:39:34',161,'67.175.162.225'),(179,'TriStop','A triangular form made of fiberglass, structural glass, concrete, and recycled timber.  This bus stop plays on a simple form, the triangle, and develops with it a sleek shelter that delivers only the essentials.  The main white form is a hollow fiberglass shell with an applied super-graphic that would vary to indicate each particular stop.  The stop measures 15\'L x 8\'W x 9\'H.',1077,'2009-09-05 18:16:21','2009-09-05 18:16:21','Tri_Stop_3.jpg','image/jpeg',198753,'2009-09-05 18:16:16','im1251909880.jpg','image/jpeg',109530,'2009-09-05 18:16:18','Tri_Stop_4.jpg','image/jpeg',156680,'2009-09-05 18:16:20',162,'67.175.162.225'),(180,'rain or shine (a destination)','This design seeks to combine elegance, simplicity of concept (and construction) with user-adaptability. \r\n\r\nUtah is a state that in a general sense experiences a wide range of temperature and weather extremes throughout a given year.  Throughout the summer the sun\'s influence is predominant.  Throughout the winter, wind and precipitation are forces to be reckoned with, but any sunlight would be welcomed.  This shelter provides a hybrid of thermal protection protection.  The glass and steel \"cocoon\" allows sunlight to penetrate into the space, but keeps out the wind and precipitation.  The opaque shed roof provides shade in the summer months to protect the user from direct sunlight.  \r\nIn order to allow the user to be guaranteed shade or direct sunlight at any time of the day, this shelter utilizes a system that harkens to the precedent of a ski lift.  All of the seating is on tracks allowing the user to slide their seat along a track until a desirable condition is reached (in the shade, or in the sun).  Just the ability to control one\'s environment will increase the well-being of the inhabitant.  \r\nThis shelter is essentially perpendicular to the flow of traffic to allow the user to sit and look straight-ahead at on-coming traffic to watch for an incoming bus.  This addresses the problem of sitting in a bus shelter that is parallel to the road which lead to a more uncomfortable viewing experience.\r\nThe project takes advantage of direct sunlight by sporting a roof deck populated by photovoltaic cells which transfer energy to a battery system suspended on the under-side of the sloped roof.  This energy powers the shelter\'s lights at night.\r\n ',392,'2009-09-05 19:49:17','2009-09-05 19:49:17','Holt_Final_01.jpg','image/jpeg',678837,'2009-09-05 19:48:54','Holt_Final_02.jpg','image/jpeg',1775368,'2009-09-05 19:49:03','Holt_Final_03.jpg','image/jpeg',1383484,'2009-09-05 19:49:10',163,'84.80.163.19'),(181,'Up and Over','A fiberglass structure with structural glass and recycled timber.  The form doubly shelters those waiting for the bus as well as being a shape that funnels water back down toward the planter at its end.  A digital display shows the bus route and its expected arrival time.  The stop measures 15\'L x 7\'W x 9\'H.',1077,'2009-09-05 22:40:06','2009-09-05 22:40:06','Image_2.jpg','image/jpeg',109220,'2009-09-05 22:40:03','Image_3.jpg','image/jpeg',119380,'2009-09-05 22:40:04','Image_5.jpg','image/jpeg',80720,'2009-09-05 22:40:05',164,'67.175.162.225'),(182,'Twisting Bus Stop','Design shenanigan by orange line on street and twister shelter to pedestrian',998,'2009-09-06 14:17:06','2009-09-06 14:17:06','day_night_mini.jpg','image/pjpeg',398845,'2009-09-06 14:17:01','Front_View.jpg','image/pjpeg',229517,'2009-09-06 14:17:03','Facade.jpg','image/pjpeg',83507,'2009-09-06 14:17:05',165,'89.144.145.132'),(183,'Bus Stop','I was inspired by light and the bringing of nature into the shelter.  I wanted the riders to be able to see the world around them while waiting for their bus while being comfortable and protected from the weather.',1150,'2009-09-07 13:31:17','2009-09-07 13:31:17','Jades_bus_stop_front_iso.png','image/png',357484,'2009-09-07 13:31:11','Jades_bus_stop_top.png','image/png',457974,'2009-09-07 13:31:13','Jades_bus_stop_front.png','image/png',88033,'2009-09-07 13:31:16',166,'24.151.123.212'),(184,'Folding BusStop','Folding BusStop\r\nSix stripes which have exactly the same size (length and width), put next to each other, being stretched and given various shapes form the bus stop. These stripes do not just repeat and vary though. Having the same perimeter when their ends come together, the stripes form a system, consisting of 6 modules. The stripes react to stretching and folding and so does the whole system. A modulated shelter is the new bus stop introduced.\r\n',818,'2009-09-07 14:22:30','2009-09-07 14:22:30','1.jpg','image/pjpeg',1429961,'2009-09-07 14:22:20','2.jpg','image/pjpeg',541787,'2009-09-07 14:22:24','3.jpg','image/pjpeg',617584,'2009-09-07 14:22:27',167,'94.67.255.128'),(185,'Manifestation','The design is a naturally occurring manifestation of the street-scape. a planted green strip rises up from the pavement level to form the canopy roof. beneath the canopy a timber boardwalk strip naturally lifts out of the ground to form the seating.  ',474,'2009-09-07 18:28:20','2009-09-07 18:28:20','Manifest_1.jpg','image/jpeg',1154556,'2009-09-07 18:27:42','Manifest_2.jpg','image/jpeg',1030624,'2009-09-07 18:27:51','Manifest_3_Concept.jpg','image/jpeg',1449053,'2009-09-07 18:28:01',168,'193.82.117.141'),(186,'Site Specific Shelter','*How should we respond to something that already exists? *\r\n\r\nI chose to evaluate the Campus Center Dive’s current bus stop shelter through site examination together with a revisiting of the fundamental intent of a bus stop shelter. \r\n\r\n*The current shelter is structurally sound, however it (1) is physically removed from the actual bus stop pickup, (2) remains cramped, and (3) has limited seating. *\r\n\r\nIn order to make right these issues, I observed the site for answers. My initial response was to remedy the current shelter, but since a bus cannot stop on a street curve, I decided to bring the shelter as close as possible to the bus pickup. I noticed the strip of grass right in front of the the bus stop sign was worn from waiting passengers. Since the entire length of the of grass has been worn, and because historically waiting passengers would prefer personal space together with a view to see oncoming busses, I decided to design a linear shelter on this strip of grass. In order to lessen the shelter’s footprint, I incorporated the existing trees in the shelter’s plan. Lastly, because the current shelter provided only limited seating, which in turn became cramped when more than a few waiting passengers were present, I designed seating that would undulate to create clusters. These seats would accommodate single passengers as well as groups of passengers simultaneously. \r\n\r\nThe extruded undulation of the seats also double as lateral strength for the south wall and the cantilevered canopy. The south wall provides voids for both views and ventilation, while the use of concrete is utilized to provide protection and to create a heat-sink to waiting passengers. As a result of the south facing wall, the concrete will shade and absorb heat by day, while releasing heat by night. The shelter is only partially fully cladded in glass due to Salt Lake City’s weather. January is the coldest month of the year; with an average temperature of 29.1 °F (-1.6 °C), cladding the shelter entirely would cause the shelter to overheat during the majority of the shelter’s usage. This shelter would book-end the existing shelter, which I propose not to be demolished but rather to be fitted to shelter bicycles and house a university emergency telephone post.\r\n\r\nFundamentally, a bus stop shelter must provide comfort for waiting passengers. Using opportunities and clues derived from the site, my response is: *The Site Specific Shelter.* A shelter detailed for Campus Center Drive, Utah. ',1219,'2009-09-08 02:36:11','2009-09-08 02:36:11','Bus_stop-_site_specific_shelter1.jpg','image/jpeg',621671,'2009-09-08 02:35:57','Bus_stop-_site_specific_shelter2.jpg','image/jpeg',898515,'2009-09-08 02:36:04',NULL,NULL,NULL,NULL,169,'96.30.128.182'),(187,'Solar Radiator ','\r\nThe concept behind the design focuses on providing warmth, a problem which I notice the most with UK bus stops is that when you stop to sit or stand your body cools down. We can solve this problem with considered material selection; for this Bus Stop Shelter the base and upstand and constructed from a dense material such as concrete with a high thermal mass, this enables the material to absorb the suns energy during the day time, it will draw more of the suns energy if it is coloured black, then, at night time when the temperature falls the concrete will radiate the heat which absorbed earlier. This creates a passive form of heating fueled by the sun.\r\n\r\nThe Roof of the shelter should be made of a much lighter weight material such as timber so that it can be filled with insulation, the underside should be reflective to bounce light and heat back down over the seating area. The roof should be fixed with an engineer designed steel structure that embeds in the concrete form.\r\nThe long seating area provides rest spots in the shade as well as in the open, and will be furnished with timber slats. Lighting can be installed in the floor in the form of low wattage LED clusters and can be joined to the mains street lighting circuit, the upwards thrown light can be bounced back down from the reflective underside of the canopy.\r\n \r\nThe design is a simple striking shape without fuss or detail, there are sufficient flat spaces to display travel route information and advertising.\r\nDue to the minimal pallet of materials it is possible to manufacture this bus stop in most places of the world, substituions can be made inb the concrete mix with, the help of an engineer, to include a wide variety of innovative building materials such as those suggested on my drawings, perhaps it could even be built in a strong form of adobe.\r\n\r\n',1013,'2009-09-08 08:41:22','2009-09-08 08:41:22','Next_Stop_sheet_3.JPG','image/jpeg',684847,'2009-09-08 08:41:06','Next_Stop_sheet_2.JPG','image/jpeg',48770,'2009-09-08 08:41:18','Next_Stop_sheet_1.JPG','image/jpeg',65313,'2009-09-08 08:41:21',170,'86.148.219.32'),(188,'\"CARE\"','This is my idea of how a bus stop can adapt with the weather and environment. It can be opened and closed manually. Basic materials are glass and steel. ',770,'2009-09-09 05:13:50','2009-09-09 05:13:50','Untitled-2_copy.jpg','image/jpeg',1021957,'2009-09-09 05:13:39',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,171,'119.160.162.192'),(189,'Glow stop','The Glow Stop is characterized by its unique tent structure, responsive seating, and its innovative power sources. The tent structure not only envelopes the seating area, standing areas, and the public restroom, but it also funnels water from rain and snow into the support columns, and generates power, using  photovoltaic fabric. Stored water is used in the restrooms and to water nearby vegetation. The energy generated from the photovoltaic fabric is used to power the interactive glowing signals that alert students with bus is about to arrive.  The seating design maximizes seating by adapting a stadium style seating arrangement. Unlike regular stadium seats U stop seating allows people to sit in multiple positions such as cross-legged, leaned back, or stretched out. One of the main power sources for the U Stop is generated using the pavegen systems. The system generates energy from people walking. The pavegen blocks have been place in high areas of traffic such as in front of the library, at cross walks, by the stadium and most importantly at the bus station. This system not only generates power but it also increases student’s awareness of the bus stops.  In front of the stop in the crosswalk area the pavegens light up to indicate which bus is arriving. Check-up stations have also been placed around campus, so that students can track the route of the bus and see how much time they have to get to the station.  Typically there would be three to four near the stop. ',790,'2009-09-09 19:35:32','2009-09-09 19:35:32','final_board.jpg','image/pjpeg',1744089,'2009-09-09 19:35:11',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,172,'130.39.0.211'),(190,'University of Utah Bus Stop','The intent here was to give the University of Utah a bus stop that not only gives the campus a more contemporary feel but to enhance the site around it. This concept shown here is two spaces sliding into and out of one another that sit right below the tree line. Being that so many people come to this bus stop from the pay lot behind and the light rail across the street, it was necessary to provide an amply amount of space for everyone.  By doing so, this design provides extended coverage space (90 linear feet) for the people needed. This space serves the people who need to take a rest and sit down and/or get out of the sun or harsh weather.  Also, it is slipped in right below the tree line. This provides extra shade during the hot summers and sufficient sun during the cold winters of the year.  On the ground are pave stones that extend across the street from the outer limits of the new designed bus stop.  This provides a new plaza area that lets individuals cross the street immediately after exiting the bus or getting on.  Also, it specifies where the bus stop begins and ends to those using vehicles. For night safety, the main space is constructed using translucent panels. These would be provided with lights within the structure so it makes the space like a glowing box, very noticeable at night. On the roof of the main space, photo-voltaic cells would be installed to provide the electricity needed to run the lights behind the translucent panels at night.  Over all, this design is what the university needs for a bus stop to keep the pedestrians safe and comfortable while keep waiting for the bus. ',1360,'2009-09-09 19:36:27','2009-09-09 19:36:27','Bus_stop_board_1-_flat.jpg','image/pjpeg',246614,'2009-09-09 19:36:23','Bus_stop_board_2-_flat.jpg','image/pjpeg',189843,'2009-09-09 19:36:25',NULL,NULL,NULL,NULL,173,'130.39.0.211'),(191,'food + A FREE RIDE','Sitting around waiting on the next bus to come can be a bore, but it doesn’t have to be that way. At the new University of Utah transit HUB, commuters no longer have to sit staring off into space as they wait for the next bus to come by. GPS trackers offer real-time arrival data for all awaiting passengers to have an idea of how long they have to wait and an attached snack shop that offers coffee, candy, soda pop, and delicious cookies make the wait a little more bearable. Its location is also key to the convenience of this centrally located bus stop. It is located adjacent to the University’s visitor parking, it is aligned with a major thorough fare, and it a central node in the pedestrian linkage between the light rail stop to the southeast and the University quad to the northwest. This also makes it a prime spot for being more than a bus stop. It has the potential for being the break spot for more than the commuters who use it. Students and Faculty can use this to pick up their cup(s) of coffee or other refreshments between classes as well as a spot to congregate with other peers in the sitting area. The building’s form, with its 24’ high tower acts a beacon landmark from far around to draw in its users. \r\n\r\nLocated attached to the bus stop is a small 150 sq. ft. snack shop. It is intended to give the convenience of a vending machine but the personal interacting of a café. The snack shop is large enough to accommodate a coffee shop, candy and cold drinks, as well as delicious baked goods. The open air counter is exposed and engages to the public space directly in front of the shop along the main pedestrian path. It is a large enough open space to serve customers at the counter as others are passing through the space.\r\n\r\nThe benefit of having an attached for-profit retail space has many layers. I was most interested in two aspects that I felt can be to solution to problems that have plagued most bus stops: security and cleanliness. The first was the added eyes at the bus stop to provide a sense of security to the commuters. This would allow for more people to feel comfortable taking the bus who may have been uneasy about it prior. The second is the retail shop’s stake in the appearance and upkeep of the bus stop. Since it is a part of the retailer’s image and well as the transit authority’s, it would be a part of the retailer’s responsibility to maintain the area since they are ever present.\r\n\r\nIn my attempt to make a mixed use space that incorporated uses that may have varying hours of operation, there was the task of creating a solution that could function not only as barrier for after-hours security but to also keep  the spatial feel of unit as a whole. The result would have to give full access to the retail space during the day and at night still function as a landmark for those looking to ride the transit bus. The result was to take a segment of the wall from the rounded-plan snack shop and put it on guiding tracks. During the day the wall would be tucked away at the back of the counter where it would be out of the way leaving the front counter open to serve customers. After the snack shop has closed, the wall would be rolled around to in front of the counter to fully and securely enclose the store. The segment has been punched with the University of Utah’s logo that would be back lit to serve as a pedestrian level landmark.\r\n',1365,'2009-09-09 19:41:23','2009-09-09 19:41:23','Page_1.jpg','image/jpeg',1317647,'2009-09-09 19:41:11','Page_2.jpg','image/jpeg',1588165,'2009-09-09 19:41:17',NULL,NULL,NULL,NULL,174,'130.39.0.211'),(192,'U of U: BUS STOP','	A BUS STOP OFFERS THE PUBLIC A PLACE OF REST AND WAIT BEFORE ONE CONTINUES ON THEIR JOURNEY. FOR THIS PROJECT, A BUS STOP OFFERS NOT ONLY A PLACE TO WAIT BUT A PLACE TO LEARN AND BE INFORMED. IT IS A PLACE THAT RELIEVES ONE FROM THE SWELTERING SUN OR THE BITTER WIND OF THE UTAH WINTERS. THE SAFETY OF THE PEDESTRIANS BECOMES A PRIORITY AS WELL DUE TO THE HIGH FOOT TRAFFIC IN THE AREA. IN ORDER TO ADDRESS THIS, THE STREET BECOMES AN EXTENSION OF THE SIDEWALK. THE FORM OF THE DESIGN IS A RELFLECTION OF THE NATURAL WIND CARVED PLATUES THAT COVER UTAH. IT’S A FORM THAT CAN BE SEEN FROM ALL AROUND AS AN INDICATOR OF THE BUS STOPS LOCATION.\r\n\r\n		THE INTERACTIVE INFORMATION SCREEN OFFERS A PLACE FOR THE MOST CURRENT NEWS, WEATHER, SPORTS, BUS INFORMATION, BUS TIMES, AND ROUTES TO BE DISPLAYED COLLECTIVELY. THE SCREEN IS COMPLETELY INTERACTIVE ALLOWING EACH PEDESTRIANS USE OF THE MEDIA TO BE DIFFERENT. THE DIGITAL TECHNOLOGY ALSO ALLOWS FOR ADVERTISING TO BE MORE FLEXIBLE. \r\n\r\n		IN ORDER TO ACCOMMADATE FOR THE HUMAN COMFORT, THE BUS STOP IS DESIGNED TO OFFER MULTIPLE DEGREES OF SHELTERING. THE MOST SHELTERED AREA OF THE BUS STOP IS ONE THAT IS BEST SUITED TO PROTECT AGAINST THE WINTER CONDITIONS OF UTAH. THIS IS ACHIEVED BY USING WALLS TO BLOCK THE WINTER WIND AND A STRUCTURE OVERHEAD TO PROTECT AGAINST THE SNOW. FOR PEDESTRIANS WANTING TO ESCAPE THE SUMMER SUN OR A SUDDEN RAIN SHOWER, A CANOPY IS USED TO PROTECT THEM. \r\n\r\n\r\n		THE INTERACTIVE INFORMATION SCREEN OFFERS A PLACE FOR THE MOST CURRENT NEWS, WEATHER, SPORTS, BUS INFORMATION, BUS TIMES, AND ROUTES TO BE DISPLAYED COLLECTIVELY. THE SCREEN IS COMPLETELY INTERACTIVE ALLOWING EACH PEDESTRIANS USE OF THE MEDIA TO BE DIFFERENT. THE DIGITAL TECHNOLOGY ALSO ALLOWS FOR ADVERTISING TO BE MORE FLEXIBLE. \r\n\r\n		IN ORDER TO ACCOMMADATE FOR THE HUMAN COMFORT, THE BUS STOP IS DESIGNED TO OFFER MULTIPLE DEGREES OF SHELTERING. THE MOST SHELTERED AREA OF THE BUS STOP IS ONE THAT IS BEST SUITED TO PROTECT AGAINST THE WINTER CONDITIONS OF UTAH. THIS IS ACHIEVED BY USING WALLS TO BLOCK THE WINTER WIND AND A STRUCTURE OVERHEAD TO PROTECT AGAINST THE SNOW. FOR PEDESTRIANS WANTING TO ESCAPE THE SUMMER SUN OR A SUDDEN RAIN SHOWER, A CANOPY IS USED TO PROTECT THEM. \r\n',1364,'2009-09-09 19:42:00','2009-09-09 19:42:00','a.jpg','image/jpeg',127640,'2009-09-09 19:41:55','b.jpg','image/jpeg',119144,'2009-09-09 19:41:58',NULL,NULL,NULL,NULL,175,'130.39.0.211'),(193,'U of U: a bus stop','	A BUS STOP OFFERS THE PUBLIC A PLACE OF REST AND WAIT BEFORE ONE CONTINUES ON THEIR JOURNEY. FOR THIS PROJECT, A BUS STOP OFFERS NOT ONLY A PLACE TO WAIT BUT A PLACE TO LEARN AND BE INFORMED. IT IS A PLACE THAT RELIEVES ONE FROM THE SWELTERING SUN OR THE BITTER WIND OF THE UTAH WINTERS. THE SAFETY OF THE PEDESTRIANS BECOMES A PRIORITY AS WELL DUE TO THE HIGH FOOT TRAFFIC IN THE AREA. IN ORDER TO ADDRESS THIS, THE STREET BECOMES AN EXTENSION OF THE SIDEWALK. THE FORM OF THE DESIGN IS A RELFLECTION OF THE NATURAL WIND CARVED PLATUES THAT COVER UTAH. IT’S A FORM THAT CAN BE SEEN FROM ALL AROUND AS AN INDICATOR OF THE BUS STOPS LOCATION.\r\n\r\n		THE INTERACTIVE INFORMATION SCREEN OFFERS A PLACE FOR THE MOST CURRENT NEWS, WEATHER, SPORTS, BUS INFORMATION, BUS TIMES, AND ROUTES TO BE DISPLAYED COLLECTIVELY. THE SCREEN IS COMPLETELY INTERACTIVE ALLOWING EACH PEDESTRIANS USE OF THE MEDIA TO BE DIFFERENT. THE DIGITAL TECHNOLOGY ALSO ALLOWS FOR ADVERTISING TO BE MORE FLEXIBLE. \r\n\r\n		IN ORDER TO ACCOMMADATE FOR THE HUMAN COMFORT, THE BUS STOP IS DESIGNED TO OFFER MULTIPLE DEGREES OF SHELTERING. THE MOST SHELTERED AREA OF THE BUS STOP IS ONE THAT IS BEST SUITED TO PROTECT AGAINST THE WINTER CONDITIONS OF UTAH. THIS IS ACHIEVED BY USING WALLS TO BLOCK THE WINTER WIND AND A STRUCTURE OVERHEAD TO PROTECT AGAINST THE SNOW. FOR PEDESTRIANS WANTING TO ESCAPE THE SUMMER SUN OR A SUDDEN RAIN SHOWER, A CANOPY IS USED TO PROTECT THEM. \r\n',1364,'2009-09-09 19:48:48','2009-09-09 19:48:48','a.jpg','image/jpeg',1508890,'2009-09-09 19:48:41','b.jpg','image/jpeg',986517,'2009-09-09 19:48:46',NULL,NULL,NULL,NULL,176,'130.39.0.211'),(194,'dat chopper city','\r\n  The Intent of the design was to mimic the surrounding  mountains while creating a sustainable bus stop with an   emphasis on comfort and safety to the commuter. The bus stop is elongated to provide the patron an option of being out in the elements or in shelter. The stop is oriented to protect the patron against the winter’s prevailing wind. The walls are galvenized steel cages with rocks in between, gabion retaining walls, which compliment the surrounding mountains. The roof is a high tensile fabric with a wire skeleton that mimics the mountains snow capped peaks. Thin photovoltaic\r\npanels provide energy for the street lights, which gives safety to commuters who ride at night. The south side of the stop has a covered bicycle rack for commuters. The bus stop will   enhance the view of public transportation at The University of Utah.',1363,'2009-09-09 19:49:13','2009-09-09 19:49:13','next_stop_design_j.jpg','image/pjpeg',1960435,'2009-09-09 19:48:31','next_stop_design_part_2_j.jpg','image/pjpeg',1759833,'2009-09-09 19:48:53',NULL,NULL,NULL,NULL,177,'130.39.0.211'),(195,'Campus Center Drive Bus Stop','The reinforced concrete structure folds around the trees and cantilevers out over the waiting/walking space. On top of the concrete structure is light-weight and strong ETFE panels. The panes of ETFE are spaced almost 4 inches apart with an air gap between which traps solar radiation as heat so that snow in the winter will melt off.  The top pane has a thin film photovoltaic layer (clear) which provides electricity to light the bus stop at night. The primary shading is the trees - taking advantage of their desiduous properties of shading in the summer, and not in the winter. The seating and openings in the structure are arranged such that people have a choice to sit or stand in sun or shade. Bus route information is embedded into the sidewalk in front of each array of seating. Electrical outlets are provided on a small ledge just behind the seating. Adjustments to the curb include extending a portion out into a no traffic zone, creating an alley of trees approaching or extending from the bus stop. The smaller stop across the street (previously non-existent) provides for the bus line traveling in that direction, and also creates a travel \"place.\"',1358,'2009-09-09 19:52:51','2009-09-09 19:52:51','bs1.jpg','image/pjpeg',534428,'2009-09-09 19:52:41','bs2.jpg','image/pjpeg',548739,'2009-09-09 19:52:45','bs3.jpg','image/pjpeg',102006,'2009-09-09 19:52:50',178,'130.39.0.211'),(196,'Enjoying the wait...','The goal of this bus stop is to create a pleasant waiting environment that is fully sustainable. The structure itself is semi-enclosed and made almost entirely out of glass to allow for a clear view of approaching buses. The roof is made of semi-transparent solar panels that incorporate the University’s colors and adjust their opacity according to sun sensors. At the top and bottom of the walls there are temperature and wind activated semi-transparent solar powered louvers that open and close based on the amount of air flow needed. For hot days there are two solar powered ceiling fans for increased air circulation. Solar charged light fixtures are located on the on the ceiling to provide lighting at night. For convenience, there is an interactive display board located on the back wall to track the location of buses and message boards on either side. There are two centrally located seating pods within the structure as well as well as two benches that line the northeast and southwest interior walls and extend through the wall to create more seating on the exterior shaded by the extended roof. The roof also covers a bike rack located in the back. For more pleasant days there is a row of benches located adjacent to the building as well as two sets surrounding the base of trees for those who prefer shade.',791,'2009-09-09 20:03:56','2009-09-09 20:03:56','Next_Stop_Design_pg_1_.jpg','image/pjpeg',1665402,'2009-09-09 20:03:14','Next_Stop_design_pg_2.jpg','image/pjpeg',2055313,'2009-09-09 20:03:35',NULL,NULL,NULL,NULL,179,'130.39.0.211'),(197,'Tree Top Stop','Waiting at a bus stop can be one of the most dreaded and stressful events of the day. It can make a good day bad or a bad day worse.\r\n\r\nWith the Treetop Stop, it is meant to be an enjoyable experience, one to look forward to, and a place to relax.\r\n\r\nThe outside space creates a calm and natural setting through the use of trees. It is placed within a forest of trees with an upper, treetop level and a lower fround level. The paths in and out of the walkway or bordered by trees. The effect within in the space is also felt on the outside. Because the trees are so abundant and concentrated they block views of the parking lot, buildings, and large areas of cement walkways creating a different experience of campus while passing by.\r\n\r\nTrees are a prominent feature on University of Utah’s campus. The state’s arboretum is located on the edge of campus, holding a variety of trees, some rare and others native. The bus stop brings this important part of campus into the center, which is an area of high traffic. Now everyone just passing through can enjoy and appreciate the trees if only for awhile.',792,'2009-09-09 20:09:50','2009-09-09 20:09:50','view1.jpg','image/pjpeg',971596,'2009-09-09 20:09:32','view2.jpg','image/pjpeg',925660,'2009-09-09 20:09:38','view3.jpg','image/pjpeg',1010025,'2009-09-09 20:09:44',180,'130.39.0.211'),(198,'Bus Stop Design','A new innovative idea.',1362,'2009-09-09 20:10:23','2009-09-09 20:10:23','utahfinalposterveronica2.jpg','image/pjpeg',284703,'2009-09-09 20:10:22',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,181,'130.39.0.211'),(199,'Moving Forward','     Public Transportation is one of the most common means of navigating the University of Utah’s campus. In addition to to the transit system and the sustainable shuttle system, it is common for students to take advantage of the bus system that’s available to them. Although it is free of charge and the inconvenience of having to drive and park a car is eliminated, the experience of waiting for a bus can be unpleasant. Exposure to the elements can make people uncomfortable and interaction with other people is not always desirable. A bus stop that makes the experience more \r\ntolerable if not enjoyable would be welcome by anyone. \r\n\r\n     The central idea behind the bus stop is to make the time waiting for the bus go by faster. The semi-covered space gives people the option to hide from precipitation or the hot sun, or to enjoy the openness on a beautiful day, The two separated tiered seating components allow people to choose whether they want to socialize or just keep to themselves. Visitors can drink from the water fountain while news, weather, and school announcements are played on the TV monitor that;s powered by the photovoltaic panels located on the roof. \r\n\r\n     The aesthetics of the bus stop also contribute to the pleasant experience of waiting for the bus. The curved shape of the seating and the slanted openings on the back wall create the feeling of motion, which helps take ones mind off the static nature of waiting. The bus stop becomes a place people enjoy visiting and perhaps even a gathering point for a study group or just a friendly meeting.\r\n\r\n',1361,'2009-09-09 20:12:58','2009-09-09 20:12:58','title.jpg','image/jpeg',1953632,'2009-09-09 20:11:51','1.jpg','image/jpeg',1990641,'2009-09-09 20:12:13','2.jpg','image/jpeg',1957089,'2009-09-09 20:12:37',182,'130.39.0.211'),(200,'Educational Sustainability','\r\n\r\n\r\nThe goal of the bus stop is to reinforce the university’s attempt at incorporating sustainability into its identity. Since visitors to the campus are the main users of this bus stop, it is important that the new bus stop set the sustainable bar for what will soon be a fully sustainable campus. The design accomplishes this by becoming a living showcase for the energy used and produced by the bus stop. Firstly, the shape of the structure offers specific views so that the visitor is able to very clearly see the types of sustainable solutions offered by the design. The sustainable solutions include site orientation for both optimum solar rays and shading and solar panels to collect all of this energy. Secondly, within the bus stop there is an electronic system that measures how much energy is being harvested as well as how much is being used. Lastly, at the end of the day when the Blue Route Evening Shuttle Schedule comes into effect, the bus stop will use its conserved energy to stay lit to provide safety for its riders. \r\n	It is important to remember that the structure is first and foremost a bus stop. As such, within the structure and electronic system, the already existing Shuttle Tracker is implemented so that as riders approach the bus stop, they are already aware of how long they have to wait for the bus and can therefore decide to take a seat for a long wait or simply lean against the structure for a little rest before their bus arrives. \r\n\r\n',1370,'2009-09-09 20:18:21','2009-09-09 20:18:21','render2.JPG','image/jpeg',101448,'2009-09-09 20:18:16','render1.jpg','image/jpeg',180158,'2009-09-09 20:18:17','daytime.jpg','image/jpeg',281155,'2009-09-09 20:18:19',183,'130.39.0.211'),(201,'University of Utah Bus Stop','An exposed steel, structural system erects out of the earth with smooth curves and strong lines.  The large, angled column is shaped in such a way to resist the overturning moment from the roof.  The moment of the roof is decresed by the tension cables tied to the tip of the angled column.  To resist the overturning moment from the uplifting wind force, tension cables tie the tip of the roof to the base.    \r\n\r\nA shading screen is attached to these cables to block the hot, western sunlight.  The reverse side of this screen has a digital projection of the  bus location of each route.    \r\n\r\nThis bus stop seats 30 people comfortably and allows for many more to stand and wonder freely in shade.  The scale of the stop allows for circulation to freely flow infront on the street side and behind on the parking lot side.  ',1359,'2009-09-09 20:20:47','2009-09-09 20:20:47','left_page_for_upload.jpg','image/jpeg',1534448,'2009-09-09 20:19:26','right_page_for_upload.jpg','image/jpeg',1369600,'2009-09-09 20:19:53',NULL,NULL,NULL,NULL,184,'130.39.0.211'),(202,'Utah Bus Stop','A sustainable design that provides comfort throughout the year. A light and temperature activated louver system adjusts the translucent louvers accordingly during different weather.  The system allows for cool breezes during hot summer months, and blocks wind during the colder, winter time.  Benches made out of recycled rocks and aggregate packed tightly is a sustainable way to provide seating while waiting for the next bus.',1366,'2009-09-09 20:26:15','2009-09-09 20:26:15','bus_stop_board_1.png','image/x-png',1815771,'2009-09-09 20:26:09','bus_stop_board.png','image/x-png',1687075,'2009-09-09 20:26:12',NULL,NULL,NULL,NULL,185,'130.39.0.211'),(203,'Utes.','There were two major issues addressed in my design.  The weather was a big focus.  It was designed to allow a cool shady area during the summer with good win flow.  At the same time, the stop had to become a refuge from the cold wind and snow during the winter.  The other major design issue was to make a safe stop for pedestrians.  The bus stop is split on each side of the road because there are buses running both directions.  There is also a large lifted crosswalk between the two to slow traffic down.',1371,'2009-09-09 20:51:14','2009-09-09 20:51:14','Kale_Theriot.jpg','image/jpeg',1639656,'2009-09-09 20:51:10',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,186,'130.39.0.211'),(204,'Campus Center Drive Bus Stop','The Wi-Fi enabled bus shelter acts as a public social networking hub, equipped with electrical outlets and a large interactive display. Riders and passers-by can post ads and community announcements on a digital bulletin board, enabling the bus stop to function as a public space. The system uses GPS tracking to display real-time bus locations and relevant wait times. Users can choose a location on the interactive map and the bus stop will display the shortest bus route, which bus to take, and expected arrival times. Waiting riders can use the web based system to view news, entertainment, weather, and tourist information. Announcements from the university are displayed, as well as emergency alert notifications.\r\n\r\nThe two separate curved precast concrete forms create a shelter for the interactive display and pedestrians below. The shape helps remove water runoff during the summer and snow during the winter. Designed to be two separate entities, the forms can be separated so that only one may be used where space constraints or low traffic density exist.\r\n\r\nAn integrated bicycle rack brings together two different types of transportation. The rack doubles as a vegetative screen which filters sunlight and displays the changing of the seasons. Amorphous silicon photovoltaic panels feed the grid during the day to offset the cost of powering the lighting system at night. To further save, the bus shelter uses a motion sensor system to power down the displays and lights if no movement is detected for 5 minutes. A built-in recycling center beneath the panels encourages riders, as well as passers-by, to recycle.\r\n\r\n\r\n\r\n',814,'2009-09-09 21:49:55','2009-09-09 21:49:55','BOARD_1.jpg','image/pjpeg',1876598,'2009-09-09 21:49:14','BOARD_2.jpg','image/pjpeg',2068861,'2009-09-09 21:49:35',NULL,NULL,NULL,NULL,187,'72.219.45.148'),(205,'A prototype for the Utah Transit Authority','The design of this bus stop prototype for the Utah Transit      Authority consists of a cantilevered bench and of a steel canopy, both supported by an angled structural concrete  column. During rain and snow, operable panels slide open, doubling the size of the bus stop’s canopy, keeping pedestrians sheltered. The canopy also provides adequate  shading during the morning and late afternoon hours when the sun is in the East and West.  The hardscaping has been re-configured to accommodate the three steps that elevate the bus stop 18 inches from the ground. ',1398,'2009-09-10 01:48:28','2009-09-10 01:48:28','next_stop_design_board_copy.jpg','image/jpeg',1446363,'2009-09-10 01:48:04','bus_stop_render_6.jpg','image/jpeg',361760,'2009-09-10 01:48:25',NULL,NULL,NULL,NULL,188,'130.39.0.254'),(206,'A bus stop is more than just a place for waiting...','A bus stop is more than just a place for waiting -it\'s a place of gathering where students can socialize and create a sense of community. The intent of my design is to create a simple, functional and visible bus stop for the University of Utah Campus. The design has a primary shelter which is used yearly and two secondary shelters which are used during the spring and summer seasons. \r\n\r\nThe method of construction is straight forward. The main structure will be built out of concrete with a dark granite stone cladding. The side walls will be constructed using 2x4 wood members. The wood slat walls has a 2\" spacing allowing the users to see oncoming buses from the turn, while providing shelter from the wind and other elements. The secondary structures will also be built of 2x4 members and follow a typical pergola method of construction.\r\n\r\nThe idea of the bus stop as a social receptacle is reinforced by the elliptical design. At the center of the stop is a rock garden where students can sit and wait.\r\n\r\nThis simple, cost-effective, bus stop allows riders to be aware of their surroundings while also becoming a key public space for the University of Utah Campus.',83,'2009-09-10 06:44:10','2009-09-10 06:44:10','viewsfinal.jpg','image/jpeg',1013537,'2009-09-10 06:43:48','2nd_page_site_plan_1.jpg','image/jpeg',327926,'2009-09-10 06:44:06','exploded_axo_1.jpg','image/jpeg',264805,'2009-09-10 06:44:08',189,'75.152.167.98'),(207,'the curtain','the basic form is a simple folded element. In order to be able to adapt to external conditions like rain, wind e.g. there is a transparant curtain that can be opened or closed. \r\nOther facilities like a clock and time-table and arrival notification are incorperated in the design. ',1059,'2009-09-10 11:30:06','2009-09-10 11:30:06','blad_01.jpg','image/pjpeg',794440,'2009-09-10 11:29:36','blad_02.jpg','image/pjpeg',827952,'2009-09-10 11:29:46','blad_03.jpg','image/pjpeg',1081800,'2009-09-10 11:29:55',190,'217.149.197.160'),(208,'campus bus stop','* construction:\r\n- stainless steel\r\n- tempered glass\r\n \r\n* function:\r\n- place to sit\r\n- place to stand\r\n- place to lean\r\n \r\n- electronic touch display providing various bus route\r\n- phone/ internet access\r\n- ticketing\r\n \r\n* accessible for handicapped\r\n* enclosure/ refuge\r\n* prospect/ visibility of surrounding\r\n* possibility of being solar powered\r\n',848,'2009-09-10 14:15:42','2009-09-10 14:15:42','3.jpg','image/pjpeg',226427,'2009-09-10 14:15:37','1.jpg','image/pjpeg',201225,'2009-09-10 14:15:38','2.jpg','image/pjpeg',282530,'2009-09-10 14:15:40',191,'24.239.169.172'),(209,'University of Utah Sound Walk','In public transportation systems throughout the world, people find their commute eased by a poor musician reinterpreting a few lines of Bob Dylan or a man on a keyboard playing a piece of a Sonata from J.S. Bach. Regardless of genre, there is something unique to the addition of music to the rythmic nature of a commute. Sound became the driving force behind the design of this bus stop. \r\n\r\nThe University of Utah is the home of the Western Soundscape Archive. A Soundscape is defined by the Handbook for Acoustic Ecology as “an environment of sound with emphasis on the way it is preceived and understood by the individual, or by a society . . . Since a soundscape is shaped by both the conscious and subliminal perceptions of the listener, soundscape analysis is based on perceptual and cognitive attributes such as foreground, background, contour, rhythm, silence, density, space and volume . . . .”\r\n\r\nThe form of the bus stop was derived by exploiting graphs of the soundscape of some available data from Utah and then further manipulating those results to acheive a space condusive to heightening the experience of soundmaking. The space of the bus stop is designed as an informal performance space where music students from the University could practice their instrument in front of an audience rather than in a practice room within the school of music without the appreciation of any random passersby. \r\n\r\nMusically inclined students represent an incredibly small sampling of the sound emitting population of the campus. While the bus stop acts as the nexus of the project, the entire Sound Walk is meant to focus people’s attention upon the cacauphony of sounds that occur on campus on a daily basis that might be taken for granted and if given a little more consideration might be worth being appreciated.\r\n\r\nThe intent of this project is to engage in making place by use of heightening people’s auditory experience. By allowing people to take a few moments to consider the sound of the light rail train as it eases over the tracks or the sounds of leaves rustling in a nearby tree as a bird is in mid-song. The act of listening intently connects people to their place by making them aware of movement around them (since sound is merely the vibration of molecules of air at a frequency that is audible) and allows people to have the chance to appreciate a variety of sounds from things that might be otherwise considered as just noise to the bus stop that is dedicated to music.',1423,'2009-09-10 15:47:47','2009-09-10 15:47:47','NSD_1.jpg','image/jpeg',359368,'2009-09-10 15:47:41','NSD_2.jpg','image/jpeg',505909,'2009-09-10 15:47:43','NSD_3.jpg','image/jpeg',305215,'2009-09-10 15:47:45',192,'130.39.0.211'),(210,'COMMUNITY HUB BUS STOP','The concept of my design was to maximize the usage of the space available for the bus stop to make maximum covered seating for the large community that is associated withe the bus stop and its related activities. Though I also have provided some informal semi covered seating for the students and others to enjoy the views and the environment in moderate conditions. In order to bring in more safety and comfort, I developed the bicycle parking in a manner that it is easily viewable for all. Sloppy roof designed in two directions will help to drain out the rain water and water from snow too. To enhance my view, i have proposed maximum glass on the front side of the bus stop to maximize the view but help avoid problems of cars gushing dirty water on the people sitting in the open bus stops. All entrances and exits have been given proper passages with slopes and handrails to help the special people. A plasma screen tv has been introduced to provide entertainment to the waiting people along with information of the bus route and view of the bus from a camera placed on the top of the bus stop on the front side. Small vertical opening have been provided on all sides of the bus stop to help proper lighting and ventilation too. Display columns on the outside will make the bus stop visible to drivers and visitors even from some far distance. My orientation of the building was in such an order that waiting people can attain sunlight in winter but can easily avoid it in the summer. Interior floor pattern of the bus stop has been inspired from the famous spiral jetty of the salt lake city.',181,'2009-09-10 16:02:32','2009-09-10 16:02:32','sheet.jpg','image/pjpeg',1824243,'2009-09-10 16:02:23','sheet01.jpg','image/pjpeg',820931,'2009-09-10 16:02:28','03.jpg','image/pjpeg',185422,'2009-09-10 16:02:31',193,'203.99.190.146'),(211,'New Wave','*New Wave:* Bus Shelter Concept\r\n\r\nThis is my design for a bus shelter.  I call it “New Wave” because it is part of a new generation (or wave) of bus shelters, that consider form just as much as function.  It also gets that name from its no doubt resemblance to a wave.  \r\n\r\nThe wave shaped roof is a double feature as it adds a sculptural element to the structure, and it provides the obvious function of shelter.  The lookout balcony just below is a new feature I decided to add in because whenever I am waiting for the bus I always get splashed as I lean into the road to see the arriving bus, and I am always in the way of the people on the sidewalk.  So, I decided to elevate this up out of the way so that you could see the buses arriving from a long enough distance away that you would still have time to descend and meet the bus.  The fact that this balcony and the roof extend out from the shelter itself provides shelter for the people that might be waiting below just out front of the lower level.  \r\n\r\nThese people might be reading the new LCD screens I decided to add to the center console of the main shelter.  I put three specifically to have one to display arrivals, like at an airport, one to display a map of edmonton and the bus routes, and the last to display a count down to the next arriving bus.  Underneath I decided to put a pull out garbage and recycling bin because they will be at the location anyway, so they may as well be a part of the design rather than distracting from it.  \r\n\r\nThe main shelter itself is basically a glass box with a steel surround approximately 3 feet high with another steel rod that wraps around the structure.  This rod could be used as a handrail to help the elderly into and back up out of the bench inside.  This rod is seen again in the handrail ascending the stairs, and wrapping around the balcony.  The handrail on the stairway is located in the center in order to direct traffic of people entering or leaving the balcony.  Inside the structure I put a simple steel seat that extends the entire width of the shelter, I chose this design because it will allow passengers a place to rest between rides, and yet it will not be so inviting as to encourage the homeless to stay and cause problems, and deter others from using the space.  The entrance and exit of the shelter are on either side of the center console, and are 3 feet wide to allow handicap accessibility. ',1447,'2009-09-10 20:34:40','2009-09-10 20:34:40','Picture_3.png','image/png',408092,'2009-09-10 20:34:36','Picture_4.png','image/png',804001,'2009-09-10 20:34:38',NULL,NULL,NULL,NULL,194,'76.11.117.230'),(212,'DOMINOES bus station','This is my vision of the Utah State bus station. It is a simple form. So that people could easely remember it. The station is supplied with bright screens on wich advertising is showen. On the both (right and left) sides of the station there are colorful creeping lines with such useful iformation as: \"The bus for Salt Lake City is arriving in 5 minutes\" etc. It is also decorated with fasteners inspired with the dominoes. Screens on the roof part will also be reflected on the road. So, both, the one who is seeting on the bench and  the other who is standing, will be able to see it. Due to the advertising screens the bus station does not need any other illumination. It will always be seen at day and night time.',1090,'2009-09-11 09:46:07','2009-09-11 09:46:07','7777.jpg','image/pjpeg',184130,'2009-09-11 09:46:00','5555.jpg','image/pjpeg',655052,'2009-09-11 09:46:02','1111.jpg','image/pjpeg',246961,'2009-09-11 09:46:05',195,'121.88.65.225'),(213,'Ski Slopes','The design resembles the mountain slopes of Utah since Salt Lake City became well known from the 2002 winter olympics.  ',1486,'2009-09-11 19:23:00','2009-09-11 19:23:00','left_perspective.jpg','image/jpeg',295249,'2009-09-11 19:22:54','night.jpg','image/jpeg',266724,'2009-09-11 19:22:56','right_perspective.jpg','image/jpeg',277548,'2009-09-11 19:22:58',196,'130.39.0.211'),(214,'Convergence','CONVERGENCE:\r\n\r\nThe approach toward a definite value, a definite point, a common view or opinion, fixed or equilibrium state\r\n\r\nCONCEPT:\r\n\r\nThis design is considered both a conceptually driven piece and an object in the landscape.  As an object this structure was designed to very specifically fit into the exact location the bus stop is (both on campus and whereabouts in the city).  To drive the form the design of the structure took on a very conceptual thinking, which in turn yielded the final consideration - a symbiosis between interior and exterior space (where most bus stops focus solely on interior) \r\n\r\nConsidering weather conditions, location and the inevitable high-use volume the design adopts a sprawling structure which creates both interior and exterior space.  These two significantly different components (the internal space and external structure) create an effective symbiosis between interior and exterior space.  Adapting very specifically to the vast weather changes throughout the year, the enclosed structure keeps heat in during the cold winters and mild temperatures during the hot summers.  Coupled with the interior space is the bold exterior structure-which in its own right acts as a separate yet unified exterior space.\r\n\r\n\r\nSTRUCTURE:\r\n\r\nSUPPORT SYSTEM - The support structure derives its curves from the specific location the bus stop is on the campus.  From here these supports act as both structural support and a landscape element.  As a result each of the supports creates a mini-landscape of its own and thus a new exterior space is created where the support merges into the ground-plane.\r\n\r\nENCLOSED STRUCTURE - The enclosed structure creates the interior waiting area for the users. The front door is on sliders which allow the whole front end of the space to be opened up or completely closed-in turn this makes the interior and exterior space feel more like one continuing piece as opposed to two separate pieces.  Coupled with this is the use of seating which lines both in and outsides of the structure.\r\n\r\nCOLOR and WEATHER - The structure is a stark red and black structure, with white accent-specifically chosen to represent the University of Utah’s school colors.  When implemented into physical manifestations these abstract color representations adopt an organic form which erupts from the ground into support beams which simultaneously structurally hold the bus stop together and act as art pieces that can be seen from key spots throughout the campus.  Coupled with this is the stark contrast the beams will bring the structure amidst the snow-laden winter landscape - again acting as a sculptural art piece. \r\n\r\nGEOGRAPHY:\r\n\r\nDIRECTION - Bold lines move form the middle interior space of the structure outwards towards the more prominent and most important buildings on campus.  This allows for an effective visual on the site as well as guides the user to which building they need to go.  For the user who is not familiar with the campus layout, upon arriving at this central bus stop location they will intuitively know where to go as a result of these lines.  The lines point to the center of Salt Lake City (2.69 miles away), the Library (856 feet away), the Museum (298 feet away), the Stadium (1737 feet away), to the physical Salt Lake (18.45 miles away), the Church (1100 feet away), the Light Rail (880 feet away), the Hunt Center (1045 feet away) and the Hospital (1350 feet away).  \r\n',597,'2009-09-11 23:41:16','2009-09-11 23:41:16','Perspective.png','image/png',1099959,'2009-09-11 23:41:07','Main.png','image/png',696492,'2009-09-11 23:41:11','Section1.png','image/png',306481,'2009-09-11 23:41:14',197,'24.180.7.51'),(215,'Next Stop in Motion','The concept for the “Next Stop Design” was derived from an Olympic downhill speed skier. The shell of the Next Stop mimics the form of a skier in a crouching position and the front reveal gives the impression that it’s in motion. The shell is made from a composite material such as carbon fiber or fiber glass so a mold can be made and it can be massed produced. The bench takes its cues from the skies of the downhill skier. One end of the bench is formed out of the concrete walk and is the anchor point for the wood seats that extend out mimicking the skies tucked under the skier. The Next Stop is enclosed by pre-formed glass panels to provide protection from wind and cold weather. \r\n\r\nIncorporated into the shell is a Photovoltaic System that provides the energy needed for the Next Stop. An interactive screen at the front of the shell provides information on schedules and routes for both busses and light rail. Also at the front is a ticket machine. When the interactive screen is not being accessed the screen can be programmed for advertisement use. Wi-Fi is also available.\r\n',1505,'2009-09-12 06:52:11','2009-09-12 06:52:11','Next_Bus_Stop_view_2s.jpg','image/pjpeg',941287,'2009-09-12 06:52:01','Next_Bus_Stop_image_board_s.jpg','image/pjpeg',1486593,'2009-09-12 06:52:04','Next_Bus_Stop_view_4s.jpg','image/pjpeg',866868,'2009-09-12 06:52:08',198,'68.121.54.37'),(216,'University of Utah Bus Stop','University of Utah - Bus Stop',1526,'2009-09-12 18:48:10','2009-09-12 18:48:10','Upload_1.jpg','image/jpeg',1873896,'2009-09-12 18:47:57','upload_2.jpg','image/jpeg',1987543,'2009-09-12 18:48:03',NULL,NULL,NULL,NULL,199,'72.207.239.194'),(217,'iMT:intra-media-transport','The idea of transportationvv within a city continues to be a problem not only locally but globally.  Increases in greenhouse gases inflate the need to provide more public transportation.  Coupled with this concern lives a techonlogy begging for connectivity.  To promote wider range of the urban traffic, we propose to combine these needs in iMT:intra-media-transport.\r\n\r\n	INTRA- functioned from within\r\n	MEDIA- routes, virtual, and building\r\n	TRANSPORT- routes, virtual, and physical aesthetic\r\n\r\nThrough the use of vinyl products, the building provides folded stock variants in weaved skin, scrap slices, extruded mold compenents and coated photovoltaics.  Thin slices of scrap vinyl weave to create weather tight skin.  Larger slices of recylced vinyl are oriented, sliced and coupled to make a honey patterned roof.  To comply with honeycomb scraps, a generative creation of cells creats a molded component system that can be assembled through 100% vinyl means.  Completing the roof, translucent vinyl coats non-conventional photovoltaic cells like a crown.  In opposition, PVC piping of various sizes cradle the delicate structure of the roof and generate the main structure.  These function as multi use in roof, floor, and furniture.  Floor bends to form wall, and chair becomes counter display.  Various types of generic transformable joints are constructed to facilitate the connection of difficult angles.  Thermal coils and fiber optics weave in and out of the various tubing creating heat and hard lined connections powered by the sun.\r\n\r\nAddressing the other concern of the project, three typologies generate motion and transportiation to the site.  Direct connection to the city is major concern, so buses are welcomed to the site by iMT’s sweeping curves.  A proposed ‘hyperskin’  displays a real time tracking of bus routes and provides a virtual advertisement space.  Complimented by wireless updatws via pda and cell phones.  iMT provides a seamless link for business man needing to stay connected.  Finally to more energy efficent, photovoltaics absorb and transform the suns energy, facilitating function.\r\n\r\nUsing these techniques, this proposal intends to provide motion and media by means of virtual and physical space.  iMt ccreates a ‘telehub’  that promotes activity between growing professional via mass transit, the innovative use of vinyl products through evolving digital technologies.',1530,'2009-09-12 20:34:38','2009-09-12 20:34:38','iMT_two.jpg','image/jpeg',499404,'2009-09-12 20:34:25','iMT_one.jpg','image/jpeg',391103,'2009-09-12 20:34:32',NULL,NULL,NULL,NULL,200,'208.120.233.205'),(218,' Enjoy Bus stop','  Enjoy natural everything in the meantime the half opens of feeling nature of of each moment. Don\'t just make to wait for is boring by abundant space variety....And is mutual to communicate ',1516,'2009-09-13 09:35:22','2009-09-13 09:35:22','1.jpg','image/pjpeg',177862,'2009-09-13 09:35:20','SketchUp_1.jpg','image/pjpeg',41568,'2009-09-13 09:35:22',NULL,NULL,NULL,NULL,201,'61.225.46.241'),(220,'A Campus Stop','Concept: to create a lively environment that fosters collaboration and interaction between student, faculty and public life that is fitting with the mission of the university.',1584,'2009-09-13 15:39:56','2009-09-13 15:39:56','page_1_.jpg','image/jpeg',1819466,'2009-09-13 15:38:55','page_2.jpg','image/jpeg',1574847,'2009-09-13 15:39:16','page_3.jpg','image/jpeg',1558460,'2009-09-13 15:39:36',203,'72.207.233.208'),(221,'Bus Stop','The bus stop may be a commonly neglected structure that quietly resides in our busy lives.  Few people realize how often spaces like these become a big part of their lives, even if it is for just a few minutes a day.  The idea that one has to wait is usually not one that many people appreciate.  With both of these ideas in mind, it would seem that almost any thought given to the idea of design within the bus stop itself would immediately find the need to answer a few basic questions.  Safety, comfort, sustainability and aesthetics are just a few of those questions that we should consider when given the privilege to take on a design project of this kind.  Though it would seem that something that is relatively small in most cases, and that which is only used by individuals for short periods of time take steps to lead to a structure that is simple, elegant, and useful in design.  ',1610,'2009-09-14 04:28:09','2009-09-14 04:28:09','busstopboardtoupload2.jpg','image/jpeg',2011755,'2009-09-14 04:27:57','20090909052108_15m3s.jpg','image/jpeg',959159,'2009-09-14 04:28:03','widerearviewbusstoprenderjpg.jpg','image/jpeg',1114073,'2009-09-14 04:28:06',204,'130.39.0.211'),(222,'Bird Bus Stop','This is a Bird Bus Stop. Thanks.',1621,'2009-09-14 16:14:58','2009-09-14 16:14:58','Bus_Stop_01-Model.jpg','image/pjpeg',275261,'2009-09-14 16:14:52','Bus_Stop_02-Model.jpg','image/pjpeg',288772,'2009-09-14 16:14:56',NULL,NULL,NULL,NULL,205,'168.226.99.48'),(224,'Trees','Not back to nature but intergrate nature method into \r\nthe design, to bring the original idea of living or WAITING.\r\n\r\nSeasons contemplation. Structure dynamic.\r\n\r\nLiving together with nature. ',1474,'2009-09-15 01:53:19','2009-09-15 01:53:19','Trees.jpg','image/pjpeg',1848340,'2009-09-15 01:53:13',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,206,'61.90.29.202'),(225,'Next Stop Design','Design Strategy:\r\n\r\nThe design strategy objective is to unclutter the all-in-one bus stop  - to create specific zones for one\'s everyday routine, allowing it to be a more enjoyable space.\r\n\r\nThere are four programmatic zones: (1) seating and standing, (2) information and ticket kiosk, (3) boarding, and (4) path for those persons not using the bus stop.  The street side is active; therefore, the bus stop begins to expand and contract depending on its use, whereas the rear is contained and only allows for views into the space.  Near the street edge a low wall acts as a protective barrier against oncoming traffic  - this same wall also features an LED display that notifies commuters of the estimated arrival time of the buses or upcoming delays.\r\n\r\nThe seating and standing area is covered to protect commuters from the natural elements because that area has a long-term use.  The information and ticket kiosk is the opposite - this area is used during short amounts of time and therefore remains uncovered.  The canopy of the bus stop is broken into two parts: (1) above the standing area, the canopy is solid with recessed lighting for use at night, and (2) above the seating area, the canopy opens up and the structural members are exposed, allowing natural light to filter through.  On the top of the canopy, photovoltaic panels convert the sun\'s energy into electricity, which is used to light the bus stop during darkness and to power the information booth.  Rainwater is collected in a trough and is harvested to hydrate the surrounding landscape.\r\n\r\nA small garden is used to connect the programmatic zones and brings a natural element to the bus stop.  Using plants such as Karl Foerster or Stipa Tenuissima, the garden will be easy to maintain and drought tolerant during all seasons.  By allowing the plants to grow to full size, they will help define the rear of the bus stop and add movement between the screens.\r\n\r\nThe choice and placement of material were determined base on use.  The shell of the bus stop would be cast-in-place concrete using recylced aggregates.  Recyled wood is used for seating and screening, providing a warm and fine texture.  An unglazed porcelain tile - which has a recyled content, no additives, colorants, resins, VOCs or toxins - is used for the paving to providing a durable, high-impact, slip, scratch, stain and fade-resistant surface.  By using a combination of recyclable materials, we are able to help reduce the amount of waste in our landfills. ',1455,'2009-09-15 18:13:22','2009-09-15 18:13:22','090925_Next_Stop_Design_-_FINAL_BOARD_1.jpg','image/jpeg',980727,'2009-09-15 18:13:10','090925_Next_Stop_Design_-_FINAL_BOARD_2.jpg','image/jpeg',1826030,'2009-09-15 18:13:15','090925_Next_Stop_Design_-_FINAL_BOARD_3.jpg','image/jpeg',717537,'2009-09-15 18:13:19',207,'207.180.155.240'),(226,'Folding Band','Ideas behind this design is provide all facilities in minimum cost. and have minimum maintenance. The design is an attempt to create an URBAN SPACE which generates rich, pleasurable and stimulating experience and a timeless aesthetics to be enjoyed by all.\r\n# Its has buffer space used as insulation in hot summer season. \r\n# It has Solar Panel ( Renewable energy source ) which provide light to bus stop in night. and also provide light to hoarding.\r\n# Seating  is provided at different level for different height of people or age. lower level ( Children preferred). middle level ( Ladies preferred ). heights level ( Gents preferred )\r\n# Slope roof which avoids water and snow to stop on the roof and it also gives aesthetic form to design. \r\n# Opening on both side, which helps public to observe the bus which going to arrive and also display is provided above the opening for the arrival / departure. \r\n',1674,'2009-09-16 03:16:43','2009-09-16 03:16:43','bus_stop-Model_copy.jpg','image/jpeg',620885,'2009-09-16 03:16:33',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,208,'122.161.172.196'),(227,'Canyon Stop','The Design was inspired by the natural canyon formations that most intrigued me while researching the state of Utah. the canyons are such a dramatic feature of the state. The layout of the design protects users from hazards of the roadside by enclosing users in a canyon formation with its access at both ends of the structure. bench seating flanks both sides of the space.While a continuous skylight illuminates the space mimicking the feeling of the natural canyon wonders. photo voltaic panels are employed on the roof to provide power for the electronic signage system that will displaying bus route information and, security lighting for night use. The design focuses in bringing the natural beauty of the state to the corners of the city.',1701,'2009-09-16 03:30:57','2009-09-16 03:30:57','Bus_Stop_Presentation_1_copy.jpg','image/jpeg',653308,'2009-09-16 03:30:49','Bus_stop_presentation_2_copy.jpg','image/jpeg',616170,'2009-09-16 03:30:53',NULL,NULL,NULL,NULL,209,'98.199.248.17'),(228,'Phenomenal Architects.','The design is based upon a deliberate opposition to the emotionally cold, and purely functional existing bus stop.\r\n\r\nRather than try to re imagine the bus stops role (and design) through either a misinterpretation of Le Corbusian principles, a poor imitation of today\'s ‘Starchitects’ or an illogical forced introduction of  modern (but immediately redundant) features, the design shows an awareness of sculptural responsibility, and  through the methods of interaction  provided, offers  users direct control of their immediate environment.\r\n\r\nBoth the bench and external wall are positioned on rails, allowing these sections to orbit the interior/exterior of the design. This not only allows users both environmental and sculptural control, but through the space itself aims to encourage communication.\r\nA prototype animation can be found here http://bit.ly/phenomenalstop\r\n\r\nTime has already told that many architectural designs where form has been controlled purely by function generally provoke little, or no reaction from either its users, or the public.\r\n\r\nArchitects continued willingness to create these structures equates to a continued willingness to bluntly ignore their sculptural responsibilities, and the social consequences of their structures.\r\n\r\nThis design can be easily manufactured using Perspex and recycled plastic, proving that a good idea needs to be no more expensive than a generic one.\r\n',221,'2009-09-16 15:54:14','2009-09-16 15:54:14','page1.jpg','image/jpeg',2025235,'2009-09-16 15:53:13','page2.jpg','image/jpeg',1897859,'2009-09-16 15:53:33','page3.jpg','image/jpeg',1758748,'2009-09-16 15:53:53',210,'90.197.90.250'),(229,'TIMBER BUS STOP','The principal theme was to find a solution that allows the best flexibility without to compromise the visibility of signage and to find a solution in regard of environment.\r\nSo the choice is to use timber module, because it allows various compositions, future expansion and it is interesting about the life cycle of  “product”; also the next bus stop is designed in order to be self sufficient by a wind power micro system put on lighting system.\r\n\r\nThe distribution is organized by two access: the first is on perpendicular axis, it is thought for allowing to connect the shelter with back side or side walk (bikers or people coming from parking ); the other allows the usability of desabled person helped also by raise floor to go into buses. Inside the shelter a multi functions panel and seats are present, the panel can give information about bus route information, traffic information, ticketing, urban plan, wheather or events on town.\r\n \r\nThe surface treatment of walls and roof  lets in the day light making parts directly illuminated and parts in the shade.\r\nLighting system rides around the glass strip that divide the roof from the block system of  shelter and it allows to be visibility from afar also at night.\r\nThe glass strip is used to hide a micro wind power system that provides with renewable energy both  lighting system and multi functions panel. ',1759,'2009-09-16 17:34:31','2009-09-16 17:34:31','00.jpg','image/pjpeg',428898,'2009-09-16 17:34:22','01.jpg','image/pjpeg',590205,'2009-09-16 17:34:26','02.jpg','image/pjpeg',574759,'2009-09-16 17:34:28',211,'87.17.213.43'),(230,'utah rocks','A sample of boulders indicative of the wide range of natural beauty present throughout Utah are re-appropriated (or recycled) into a sheltering bus stop.\r\nThe smaller stacked boulders act as keystones, stabilizing the structure by preventing the larger rocks from rolling outward. The steel pipe columns take the form of a broken truss, triangulating the gravity forces and resisting sheer, thus providing more support than a vertical column, also allowing the diameter of each member to be reduced. ',1645,'2009-09-16 23:45:44','2009-09-16 23:45:44','nextstop.jpg','image/jpeg',844681,'2009-09-16 23:45:35',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,212,'66.108.252.77'),(231,'MultiFunctionTransit - MFT','Next Stop Design – Multi Function Transit Hub \r\n\r\nWeather\r\nThe overhanging umbrella roof provides deep shelter to the occupants.  \r\nThe “s” shaped glass screen (laminated/toughened) serves as a window and a rain/wind screen.\r\nRain is directed to the centre of the roof and directed via hollow steel columns to drains.\r\nSnow is captured and melted suing excess energy from the PV panels or Wind Turbines.\r\nWind is re-directed away from the occupant by the glass screens.\r\nThe “s” shape envelopes the occupant providing an integral seat on the inner apex of the screen. \r\n\r\nLocation\r\nThe screens deflect traffic generated sound waves that impair street side locations.\r\nThe diagonal and staggered glazed screens control access ensuring safe use.\r\nThe narrowness of the plan and the possibility of modular roll out allow flexible adaptation to local conditions.\r\nThe height of the unit is no greater than the height of the bus it serves.\r\nViews are possible throughout with minimal structural interference.\r\n\r\nAccess\r\nAccess for wheelchair and assisted travelers between select screens.\r\nThe narrow profile allows it to occupy reservations, grass margins and pavements.\r\nAccess is available at the ends, from the back, and front along the whole plan.\r\n\r\nLighting and Electronics\r\nLighting is embedded in the ceiling and the glass screens are illuminated.\r\nThe glass screens can be illuminated to communicate waiting occupant (yellow) or danger (red).\r\nThe high visibility throughout allows for great occupant safety.\r\nThe use of PV and wind turbines provides all the necessary lighting (and heating) energy.\r\nAdditional power generation (cell phone/laptop) take off is possible.\r\nInformation poles are dotted through the structure depending on demand.\r\nSignage and buss information is “projected” within the glass panels/screens\r\nThe stop is clearly identifiable from afar.\r\n\r\nSurfaces\r\nThe slanted stone/concrete base with accentuates joints ensures good floor grip.\r\nThe materials are specifically chosen for their durability; stone/concrete/steel/glass/copper (roof).\r\nSnow is melted by natural power systems and drained through the rainwater channels through the hollow steel columns.\r\n\r\n \r\nHuman\r\nSeats are bolted through the glass screens and are largely individual in character. \r\nThe distribution of seats depends on the type of stop.\r\nThe system has a multifunctional capacity to adapt to changing scenarios.\r\nThe occupants can chose to be alone or in groups.\r\nThe screens afford a high degree of protection and visibility simultaneously.\r\nAmenities\r\nNext bus information is provided in illuminated screens\r\nTrash is to be handled in the same way as the information columns.\r\nPhone and internet access is possible via a mobile internet connection via the hollow columns to aerials.\r\nTicketing is via the information columns located through the structure.\r\n\r\nMicro Environmental Issues\r\nWater, sound and dirt Pollution from the street and buses is kept at bay with the glass screens.\r\nThe glass screens are easy to maintain and keep clean.\r\nThe screens are self supporting requiring less structural input.\r\n',315,'2009-09-16 23:56:59','2009-09-16 23:56:59','396_Sheet1a.jpg','image/pjpeg',1587880,'2009-09-16 23:56:39','396_Sheet2a.jpg','image/pjpeg',1421412,'2009-09-16 23:56:45','396_Axon5.jpg','image/pjpeg',1865109,'2009-09-16 23:56:50',213,'78.152.250.3'),(232,'Invisible','The project saught,with a tight shedule and budget, to create a simple and elegant shape which would merge the furniture to the covering structure in a single and continuous volume. The material: 13mm thick fiberglass reiforced cement panels.',1757,'2009-09-17 02:37:22','2009-09-17 02:37:22','Principal.jpg','image/pjpeg',172013,'2009-09-17 02:37:18','you_can_see.jpg','image/pjpeg',149271,'2009-09-17 02:37:20','Descricao.jpg','image/pjpeg',538034,'2009-09-17 02:37:21',214,'201.68.109.89'),(233,'An Applicable Bus Stop Design','It\'s an applicable bus stop design.I gave as much as possible information on images.So you can find many informations on images.Thank you..',963,'2009-09-17 07:23:39','2009-09-17 07:23:39','uth-brs-01.jpg','image/pjpeg',1994075,'2009-09-17 07:22:35','uth-brs-02.jpg','image/pjpeg',2049449,'2009-09-17 07:22:56','uth-brs-03.jpg','image/pjpeg',1991938,'2009-09-17 07:23:17',215,'78.176.87.133'),(234,'[ Modern Bus Stop ]','[ University of Utah ] [ Bus Stop ]\r\n\r\nMy proposal for University of Utah bus stop consists of one main curved “corpus”, which could be materialized in lightweight concrete. The inside is divided into two separated spaces - room for bicycles and room for passengers who would like to sit or for those who seek shelter from the rain. This bus stop could be air-conditioned, so it could be enjoyed throughout the whole year. \r\nBesides this “indoor” space, there is also planned “outdoors” for enjoying in summer days and nice weather, which also could be used as the information area. \r\nThe main construction consists of three pairs of steel columns. Their role is to “hold” lightweight concrete, or any other material that is used for building the roof slab. They also have very big esthetic role, so that combination of color and light should appeal to users of this space. \r\nLight and color are those factors from which esthetics is consisted from. “Main body” is red-colored, just as the logo of University of Utah, and other parts are in complimentary colors. Light accents important parts of this structure, and “plays” with the environment, making comfortable environment for all users. \r\nThere are several ways regarding materialization of University of Utah, Bus Stop. It could be built in traditional ways - concrete, steel and glass, but if we are talking about bigger budget, there are some other materials that could be used, like PVC materials, structural plastics and high-end lightning which could result in highly attractive design. \r\nNow - users. There are several choices for users who come and have to wait for their bus. They can stand in “informational area”, or they can use “indoor” area to sit and read a book or hang out with their friends. For useres who come with tehirs bicycles, there is a parking where they can leave their rides, and wait for the bus inside or in the open space.\r\n',1149,'2009-09-17 16:38:56','2009-09-17 16:38:56','Page_1.jpg','image/jpeg',911078,'2009-09-17 16:38:49','Page_2.jpg','image/jpeg',296730,'2009-09-17 16:38:52','Page_3.jpg','image/jpeg',872187,'2009-09-17 16:38:54',216,'77.46.213.20'),(235,'ByPass Stop','This Bypass Stop is a bus stop representing tranquility juxtaposed against a busy urban environment and implements a hierarchy of structure. This environmentally-friendly design primarily uses wood to create a warm and appealing atmosphere which is to act as shelter against cold climate in Salt Lake City.  A simple yet effective layout, this design allows for fluid exit and entry as well as allowing ample room for wheelchairs. The right wall is to serve as a bulletin board and bus schedules, the back wall is to act as a backrest for weary travelers, and the left wall, made primarily of glass, is to maximize the visibility of oncoming buses while acting as a shield against the rain. ',1490,'2009-09-17 18:15:07','2009-09-17 18:15:07','1.jpg','image/jpeg',284650,'2009-09-17 18:14:55','2.jpg','image/jpeg',284475,'2009-09-17 18:14:59','3.jpg','image/jpeg',232117,'2009-09-17 18:15:03',217,'75.165.72.249'),(236,'green strip','The concept was brought to life in the shape taken by the links between the existing green spaces (previously, the bus station had represented a barrier), through the simplest method at our disposal, by using natural and cheap materials that do not incur great production and maintenance costs. Knowing that the users are mainly students, the project creates areas for developing social interpersonal relations, containing, as well, folding benches along the two walls. The map that is projected on the surface of the street using natural light during the day and artificial low energy consuming light, as the glass beholds the role of projection lens, represents an interactive element.\r\nIts sustainability resides in its energetic independence insured by the photovoltaic panels and by the piezoelectric floor, as the energy is stored in batteries that are placed under the bus station. The interactive frame is insured by the digital panel, as well as by the bus trips information poster. The project has been conceived as a social interaction space as well as a reading space, but also as a luminous reference point. \r\nThe characteristics of the concept promote a space that wishes to be appropriated, subjectivized, but which, at the same time, manages to maintain the relationship with the proximities, creating a reference point, a dynamic element, able to metamorphose, promoting a “genius loci”.',1846,'2009-09-18 00:23:07','2009-09-18 00:23:07','1ds.jpg','image/jpeg',349408,'2009-09-18 00:22:54','2ds.jpg','image/jpeg',368578,'2009-09-18 00:23:00',NULL,NULL,NULL,NULL,218,'79.117.5.152'),(237,'Time Catcher','Bus stops must be more functional for people. People who use use bus stops everyday knows that timetables and seats makes them crazy. Firstly TIME CATCHER had an huge clocks becouse people always wanted to know how much time they have to wait the bus. Secondly while people are waiting the bus they always look to the road. So I put the seats not vertical. I put it different angle so they can look the road directly. Bus stops are great places for being social.It\'s for everyone... USE IT!',1602,'2009-09-18 10:01:12','2009-09-18 10:01:12','time_catcher.jpg','image/jpeg',85761,'2009-09-18 10:01:07','time_catcher_2.jpg','image/jpeg',42876,'2009-09-18 10:01:09','bus_stop3.jpg','image/jpeg',55113,'2009-09-18 10:01:10',219,'78.172.76.140'),(238,'Columbus Family Academy Bus Stop','Columbus Family Academy Bus Stop in New Haven, CT\r\n\r\n\r\nBy the simple resource of modifying the standard bus stop used throughout the city of New Haven we incorporated colors and artwork related to the adjacent school, heralding its presence and creating a safe place where the students can still be curious and challenged while waiting for their transportation.\r\n \r\nThe bus stop is the first-ever city shelter emblazoned with the name of a nearby educational institution although worldwide, museums, schools or hospitals had been linked before with train, subway stations and shelters used by their public.\r\n\r\nTerrazzo discs and aluminum stars, discarded samples of the school lobby flooring, are embedded in the concrete floor to suggest the starry sky that must had enveloped Christopher Columbus small fleet on their historic voyage of discovery.\r\n\r\nThree Kynar custom colors and a sandblasted Lexan panel representing wind swirls and the waves of the Atlantic face the street and remind the users of the value of public art.\r\n\r\nFernando Pastor\r\nSenior Designer for Svigals + Partners\r\n',294,'2009-09-18 19:19:35','2009-09-18 19:19:35','Columbus_FA_Bus_Stop.jpg','image/pjpeg',1960743,'2009-09-18 19:19:19','NEW-BUS-STOP.jpg','image/pjpeg',503942,'2009-09-18 19:19:29','Bus_stop_mural_small.jpg','image/pjpeg',231104,'2009-09-18 19:19:33',220,'71.235.61.9'),(239,'tube of  waiting','THIS BUS STOP IS SUPPOSED TO BE BUILT IN AN INFANTRY AREA IN MY CITY.',319,'2009-09-19 04:31:13','2009-09-19 04:31:13','bus_stop_tube.jpg','image/pjpeg',303775,'2009-09-19 04:31:12',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,221,'122.168.204.170'),(240,'#  BEST   DESIGN  #  ( Farzad Mirshafiei )','In this design, I paid especial attention to movements and the effects of transportation in our modern life. The life and human perceptibility in 21st century is rather different from what it was before.My responsibility as an architect is to propose designs that excite the sense of curiosity in today’s humans; especially in this project that targets the university society. To do so, I used both visible and hidden geometries. Visible geometry because the exterior surface of the bus stop is designed according to the proportions existing in snail shells.\r\nThe bus station is designed in a dynamic form by using natural shapes, like spiral structures in sea shells, keeping all proportions, symmetries, harmonies and by applying the golden ratio. Actually the outer line is a logarithmic spiral from a sequence of golden triangles. Five critical points on these triangles are used to develop the idea and they are all put in the right way to result in an esthetic appeal.\r\nThis was the hidden aspect of the geometry.\r\n \r\n\r\nThank you for your vote.\r\nFARZAD MIRSHAFIEI',1763,'2009-09-19 08:51:00','2009-09-19 08:51:00','bus_stop_1.jpg','image/pjpeg',1645288,'2009-09-19 08:50:28','bus_stop_2.jpg','image/pjpeg',1408058,'2009-09-19 08:50:36','bus_stop_3.jpg','image/pjpeg',2069473,'2009-09-19 08:50:41',222,'94.182.150.139'),(241,'sciomorph (morphing the shadows)','the big IDEA of this design\r\n\r\n1. Morphing the shadows - three projections over the sitting area a). Solar panel - to store solar energy b). Polycarbonate sheet supported on metal frames c). Fabric projection - for high solar angles\r\n\r\n2. Power generator - Solar panel placed on the top angled according to the site solar angle. Wind tower specially for outskirts bus stops with give an IDENTITY to the stop. Power will be stored beneath the seat.\r\n\r\n3. Gleaming aesthetics - to create an image of the stop.\r\n\r\n4. Metal louvres - to minimize vehicle wind to enter the sitting area.\r\n\r\n5. LED display at the back.\r\n\r\n6. Stainless steel structure - can be mounted and maintained very easily. ',1738,'2009-09-19 12:07:32','2009-09-19 12:07:32','3D_View_6.jpg','image/jpeg',296302,'2009-09-19 12:07:22','Bus_Stop.jpg','image/jpeg',160463,'2009-09-19 12:07:25','3D_View_11.jpg','image/jpeg',158104,'2009-09-19 12:07:29',223,'220.227.157.77'),(242,'Mies Van','A steel and glass shelter that is partly solar-powered to power the status and info screen as well as the lighting and illuminated map and advertisement boards. The \"tower\" atop the shelter, above the service status screen, doubles as a stop identifier and a solar power collector and storage unit.\r\n\r\nThe glass panes are silk-screened with service/operator/stop identifiers as large-scale text graphics. The lettering is opaque on clear glass, except behind the benches, where the all-opaque panes have a clear, see-through lettering. \r\n\r\nThere is space for two illuminated advertisements within the shelter and in front of the shelter stands a separate map display of the surrounding area as well as timetable information. This stand can be used as a \"static\" map/timetable showcase or as an interactive, networked touch-screen unit, depending on the level of sophistication needed. The smaller status display on the side of the arriving buses gives information about service delays etc. as well as the expected arrival of next buses. \r\n\r\nAs well as the possibility of making the modular shelter in different sizes to suit the stop needs, on certain stops there may also be a glass-roofed extension like the one shown, acting as extra shelter space as well as a covered way for boarding the bus.',1920,'2009-09-19 19:01:20','2009-09-19 19:01:20','busstop.jpg','image/jpeg',354323,'2009-09-19 19:01:17',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,224,'88.112.192.159'),(243,'Blazberry Hwy. Bus Shelter','Blazberry Hwy.\r\n\r\nIn thinking about, driving on, riding along, walking by, the ribbons of roads, ADD (Athens Design Development), presents Blazberry Hwy., a design proposal for the University of Utah Bus Shelter competition.\r\n\r\nBlzsberry Hwy. Is one continuous ribbon of steel, rolled and curled into one shape incorporating seating, shelter, sculpture and graphic design.  The main element of formed steel design includes “foot” to be bolted in to place.\r\n\r\nOther than the main component of fluid metal, there is a lacey frieze of water-jet cut graphics inspired by and integrating abstractions of urban plans for parks and neighborhoods.  The repeating pattern also mirrors the shape of the bus shelter Blazberry Hwy. design and the façade of the actual BUS vehicle.  As the southern sun and Utah clouds pass overhead, the graphics will provide beautiful changing interior patterns and shadows.\r\n\r\nAnd finally, the design’s namesake, Blasberry Chromolusion Auto Body Paint, a hybrid surface application.  Blasberry reflects a multitude of hues beaming on the curved surface of the shelter design.  The pigment at once is purple as an Iris, blue as the Sky and pink as a cherry.  Blazberry Hwy. will provide an inspiring and striking  place to wait on a warm or cool day.  Blasberry Hwy. will shimmer in the sun and glow under a street light like a jewel on the side of the Utah’s roads.\r\n\r\nAthens Design Development\r\n585 Barber Street Studio B\r\nAthens GA 30602\r\n706 255 3224\r\ndididunphy@gmail.com',1947,'2009-09-19 22:28:30','2009-09-19 22:28:30','Blazberry_5.jpg','image/jpeg',793758,'2009-09-19 22:28:24','Blazberry-2.jpg','image/jpeg',301790,'2009-09-19 22:28:28','on_the_truck.JPG','image/jpeg',55762,'2009-09-19 22:28:29',225,'72.145.227.223'),(244,'A no-fuss, no-drama shelter','I took the notion of shelter at its most literal and basic, the main consideration being the climate: cold in winter, hot in summer. After all, if the climate were perfect, there would not be a need for a shelter at all, maybe a bench under a tree,and perhaps a sign.\r\n\r\nA shelter by its nature is sustainable: they consume little energy, use few building materials, and produce no carbon. (The bus would ideally run on propane, fuel cells, hydrogen, hybrid, or power lines overhead — similar to trolleys.)\r\n\r\nThe shelter is high enough to allow a bus to pull under – a nice thing to have in inclement weather. This gives it also a more gracious proportion in the city scape, aligning with a tree canopy. Material are simple: 1\" recycled steel plate, pre-rusted, clearcoat sealed, polycarbonate glazing, graphics. The polycarbonate glazing provides wind protection in winter, with a gap at top to allow hot air to escape in summer. The canopy allows the low winter sun to warm the surfaces, and provides shade from the high summer sun. Lighting is in the paving for ease of maintenance.\r\n\r\nThe shelter can be easily installed with modular components, and unbolted and relocated as needs require.\r\n\r\nAn optional “flex” area can be a built-in table and benches, protected by a low wall and hedges. Other options are a bike storage area (with possible steel canopy similar to main shelter), ticketing machine, space for vendors — pushcarts or stalls.\r\n\r\nThe goal was a simple, attractive no-fuss shelter.',1697,'2009-09-20 04:58:39','2009-09-20 04:58:39','View_4.jpg','image/jpeg',157190,'2009-09-20 04:58:34','View_7.jpg','image/jpeg',223487,'2009-09-20 04:58:36','Vignettes.jpg','image/jpeg',34350,'2009-09-20 04:58:38',226,'71.98.166.33'),(245,'bu[s]top','Bus stops serve as markers along a journey. This design pursues the notion of marking a spot. It takes inspiration from a flag, anchoring itself to the ground, while being light and cantilevering into the air.',1942,'2009-09-20 14:10:18','2009-09-20 14:10:18','main.jpg','image/jpeg',545387,'2009-09-20 14:10:07','exp.jpg','image/jpeg',229144,'2009-09-20 14:10:12','3.jpg','image/jpeg',137944,'2009-09-20 14:10:16',227,'76.113.8.52'),(246,'process_stop','The process_stop is the result of the use of an array of formal manipulation techniques which aimed at creating a simply sensuous form.\r\n\r\nThe process_stop does not aim to be a piece of modernist trash, in the form of a glass box, sitting by the side of the road.\r\n\r\nThe sensory experience is given primacy. The process_stop is meant provoke and stimulate. You are invited touch the process_stop\'s sleek composite shell. Color is celebrated. Plexi-sides comment on its roots. The connectivity console begs for interaction.\r\n\r\nOh, and it will tell you when the next bus will arrive.',1855,'2009-09-21 00:29:48','2009-09-21 00:29:48','pStop_pStudio.jpg','image/jpeg',243763,'2009-09-21 00:29:41','pStop_pStudio2.jpg','image/jpeg',229003,'2009-09-21 00:29:44','pStop_pStudio3.jpg','image/jpeg',253520,'2009-09-21 00:29:46',228,'66.50.234.223'),(247,'Stop[N]Charge','Why not have a tech savvy bus stop + using ecological principles in the development. With a solar panel on top this will supply enough power to charge bus users cell phones, ipods, pda\'s and laptops. This bus stop provides a more sheltered seating area that still has access to the charging devices and continues to have natural day lighting in the small space from the skylight. The materials used are concrete + glass, whereas concrete is durable against any weather condition.',2018,'2009-09-21 01:30:44','2009-09-21 01:30:44','next-bus-stop-1.jpg','image/pjpeg',158852,'2009-09-21 01:30:41','next-bus-stop2.jpg','image/pjpeg',99005,'2009-09-21 01:30:42','next-bus-stop3.jpg','image/pjpeg',111012,'2009-09-21 01:30:43',229,'75.128.12.98'),(248,'Tectonic Bus Stop','We propose to design the bus stop under a tectonic vision allowing immediate identification as furniture participating public transport system, but in turn easily express and convey their constructability and cutting-edge technological aspect.\r\n\r\n\"Proponemos diseñar la parada de autobus bajo una vision tectonica que permita su identificacion inmediata como mobiliario urbano que participa del sistema de transporte publico, pero a su vez que exprese de manera sencilla su constructibilidad y trasmita un aspecto tecnologico y vanguardista\"',1007,'2009-09-21 15:17:32','2009-09-21 15:17:32','tectonic_bus_stop.JPG','image/pjpeg',125085,'2009-09-21 15:17:26','View_0_3.jpg','image/pjpeg',177825,'2009-09-21 15:17:29',NULL,NULL,NULL,NULL,230,'190.202.82.98'),(249,'Spirited Stop','This bus stop design for the University of Utah blends fun and function. Inspired by the Utes Logo, the overlapping feather design emerges from the stop’s bench seats to create a striated covering overhead. The use of the U of U colors, crimson and white, provides a punch of school spirit.\r\n\r\nThe stop is outfitted with plenty of seating both outdoors and underneath the roof structure, most of which is accented by planters and trees. One of the greatest benefits of this stop is that it provides a barrier between pedestrians and vehicular traffic, which decreases the chances of auto-pedestrian accidents.\r\n\r\nThe brick walkway is constructed of severe weather bricks to resist cracking in multiple types of weather conditions; including the heat and dryness of the summer sun, and the scraping, shoveling, or salting of ice and snow. \r\n\r\nThe glass wall/roof sections allow for maximum visibility and passive heating in the winter, and may be outfitted with solar collection devices to power lights and heaters. The non-enclosure of the roof structure allows for passive cooling and shaded areas in the summer time. \r\n\r\nThis design provides a unique and spirited environment for students, faculty and residents to relax and unwind while making their way across campus. \r\n',2050,'2009-09-21 15:34:35','2009-09-21 15:34:35','1.jpg','image/jpeg',237729,'2009-09-21 15:34:30','2.jpg','image/jpeg',300509,'2009-09-21 15:34:33',NULL,NULL,NULL,NULL,231,'173.30.25.57'),(250,'Tectonic Bus Stop II','This variant of the so-called Bus stop tectonic elements implements solar and wind protection, plus it incorporates an additional area for motorized police or other institutional use, we reaffirm the proposal easily express and convey their constructability and cutting-edge technological aspect\r\n\r\n\"Esta variante de la llamada parada de autobus tectonica implementa elementos de protección solar y del viento, además se incorpora un área adicional para los policias motorizados u otro uso institucional, reafirmamos la propuesta que exprese de manera sencilla su constructibilidad y trasmita un aspecto tecnologico y vanguardista\"',1007,'2009-09-21 15:59:44','2009-09-21 15:59:44','tectonic_bus_stop_II.JPG','image/pjpeg',130128,'2009-09-21 15:59:41','fach_ppal.JPG','image/pjpeg',19134,'2009-09-21 15:59:43',NULL,NULL,NULL,NULL,232,'190.202.82.98'),(251,'Original Tectonic Bus Stop','Original design tectonic bus stop, easy to manufacture and modular according to the requirements, you can locate any transport arrival of their long faces and most importantly, make the furniture with a character that you own and technological gives a cutting edge look',1007,'2009-09-21 16:16:07','2009-09-21 16:16:07','lamina_bus_stop_el_tigre.JPG','image/pjpeg',37309,'2009-09-21 16:16:05','foto_1.JPG','image/pjpeg',11213,'2009-09-21 16:16:06',NULL,NULL,NULL,NULL,233,'190.202.82.98'),(252,'the terrarium ','Utah shares an interesting and dynamic relationship with the history of the earth. The terrain has been morphed over millions of years to create many distinct yet related spaces. The purpose of the design is to integrate architecture with an abstract representation of the landscape simultaneously creating distinct spaces for gathering and relaxation.',2080,'2009-09-21 20:28:06','2009-09-21 20:28:06','boardjpeg1.jpg','image/jpeg',1738716,'2009-09-21 20:27:29',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,234,'130.39.0.211'),(253,'Scrolling LED Display','The concept for the design of this bus shelter is a series of long LED display boards, cranked 2/3 of the way providing live information. This is in the form of countdown bus information, daily news, sport results and fixtures, horoscopes, university information, and almost any message intended for commuters. The cranked layout provides suitable shelter from the elements and good vision corridors for arriving buses. The LED display also gives good street illumination at night for rider safety. Ticketing and bus circuit information is provided at one end of the shelter. ',1618,'2009-09-21 21:23:48','2009-09-21 21:23:48','Image_01_A_copy.jpg','image/jpeg',1360876,'2009-09-21 21:23:01','Image_02_A_copy.jpg','image/jpeg',1653896,'2009-09-21 21:23:17','Image_07_A_copy.jpg','image/jpeg',1254070,'2009-09-21 21:23:32',235,'87.187.31.120'),(254,'Interactive Waiting','INTERACTIVE WAITING.\r\nin an era of technological advancements, i choose to see the Bus Stop as a public element, creating Interaction and connections in a sustainable and renewable way.\r\n        with the use of ready-available materials (2\"x 4\" timber lengths + recycled aluminium/ plastic/ rubber) the Bus Stop becomes a functioning sculpture, housing its temporary occupants while creating a fulcrum for its surrounds.\r\n                 in the use of timber, we revert back to the origins of shelter, while using recycled materials connects us to the present.\r\n\r\nIDEA. the idea behind this scheme is that, in the materials used, a debate between temporary and permanent is born while creating a proposal of transient structures.\r\n                                 with diversity, the typical monotonous Bus Stop is transformed into a focal point, interacting with its community and enhancing the Bus Stop function.',1560,'2009-09-22 02:18:45','2009-09-22 02:18:45','timber_pres_1.jpg','image/jpeg',729065,'2009-09-22 02:18:30','timber_pres_2.jpg','image/jpeg',459333,'2009-09-22 02:18:36','timber_pres_3.jpg','image/jpeg',1163026,'2009-09-22 02:18:40',236,'75.71.156.118'),(255,'The Zen Stop','*A BETTER STOP DESIGN*\r\n\r\n\r\n*The Zen Stop*\r\nThe main idea was to design a light, “temporary” but fully functional bus stop. It can provide shelter, day and night and it includes a bike rack. The folding part is constructed by glass reinforced fiberglass, which is strong enough, resistant to weathering and at the same time recyclable. When the stop is not needed anymore, the folding is removed, and the concrete part can be transformed into urban art.\r\n',1035,'2009-09-22 03:26:14','2009-09-22 03:26:14','poster_final01.jpg','image/jpeg',1645304,'2009-09-22 03:25:56','poster_final02.jpg','image/jpeg',436660,'2009-09-22 03:26:08','poster_final03.jpg','image/jpeg',333398,'2009-09-22 03:26:11',237,'66.108.49.123'),(256,'earthwork|artspace','<p>Nobody likes to wait. <strong>earthwork|artspace</strong> offers a student-curated <strong>multi-sensory</strong> experience to commuters, one tucked into a contemporary, contextual, and  climate conscious landform pavilion.</p>\r\n<p>This bus station arises from a modulation of the <strong>topography</strong>,  a reference to the University of Utah\'s<strong> landscape tradition</strong> but one  updated to reflect today\'s <strong>climate</strong> concerns. Two earthworks are <strong>spliced</strong> together: a plane of landscape is lifted to produce a <strong>shelter</strong>, while  hardscape elements are manipulated to produce seating and bicycle storage  underneath. Technological elements are spliced into the ensemble: linear <strong>heating</strong> elements allay winter chills, <strong>high efficiency</strong> LED light fixtures  embedded in the sidewalk offer a welcoming glow, and <strong>photovoltaic panels</strong> supply energy to the power grid during peak daytime hours that can be consumed  by the lighting and heating elements at night. Pavilion walls house an LED <strong>Digital Canvas</strong>, offering students a  unique medium for the production, curation, and display of contextual and  interactive visual art. Speakers in recessed parabolic domes offer focused <strong>sonic</strong> experiences.  <strong>Drought tolerant</strong> seedums populate the  canopy structure and adjacent landscape elements; a climate-conscious and  water-sensitive <strong>reinterpretation</strong> of the University of Utah campus\'  landscape tradition. Bead blasted stainless steel plate--the material used for  the underside of the canopy, seating, and bicycle storage elements--is a <strong>95%  recycled</strong> material, is <strong>durable</strong> and inherently vandal-resistant, and  makes a <strong>contextual</strong> link to the adjacent Huntsman Center. </p>\r\n<p>The shelter acts as a visual <strong>buffer</strong>,  directing the commuter\'s eye away from the adjacent parking lot and toward  desirable <strong>views</strong> of the campus and the valley. The canopy provides <strong>relief</strong> from the hot summer sun and protection from strong canyon winds from the east. </p>\r\n<p><strong>earthwork|artspace </strong>makes an unabashedly <strong>contemporary</strong> design statement, but one  deeply rooted in the University of Utah campus <strong>context</strong>. It provides  commuters an engaging way to pass time, and offers students a powerful <strong>new medium</strong> for the dissemination of  public art.</p>',2009,'2009-09-22 03:58:33','2009-09-22 03:58:33','board1.jpg','image/pjpeg',1656620,'2009-09-22 03:58:24','board2.jpg','image/pjpeg',814507,'2009-09-22 03:58:29',NULL,NULL,NULL,NULL,238,'68.40.201.203'),(258,'The Convenient stop','Focus on simplicity and functionality has lead to the above clean and crisp design. \r\nPrecast concrete panels and concrete louvers – easy to manufacture and mass produced - form the main body of the bus stop. \r\n\r\nStress is laid on more seating space for the passengers and ample visibility of the approaching bus and the surroundings. The recessed seating in the front gives the dual advantage of saving people from the natural elements (sun, rain, snow) and water splashes from vehicles as well as enabling people to sit either side. A ramp at both ends exists for the physically challenged people and an area for the wheelchair is kept vacant at one end. To make the purchasing of tickets a faster and convenient affair a ticket vending machine has been installed in the centre of the back wall. \r\n\r\nThe road facing top façade of the bus stop is kept blank and can be used for advertisements where as its inner side comprises of LED display stating the routes of the various buses halting at the stop. \r\nThe inclined roof takes care of the irregular snowfall and the solar panels mounted on it provide the power required for lighting and the LED display, thus making an energy sufficient bus stop.\r\n',856,'2009-09-22 14:30:18','2009-09-22 14:30:18','view_-_overall.jpg','image/jpeg',432961,'2009-09-22 14:30:06','view_no_2.jpg','image/jpeg',339047,'2009-09-22 14:30:10','view_3.jpg','image/jpeg',398263,'2009-09-22 14:30:16',240,'59.182.139.147'),(259,'simple steel bars confection','This concept relate about \"steel-bars and welding\". A simple construction work. The shelter surface is made by 10 mm polycarbonates panels. Under the shelter: an automated tickets machine, tuist information guide panel, etc..',1943,'2009-09-22 16:45:14','2009-09-22 16:45:14','gsea_bus-stop2.jpg','image/jpeg',216710,'2009-09-22 16:45:07',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,241,'213.233.101.124'),(260,'BU (S) TOP','BU (S) TOP\r\n\r\nThis bus stop derives straight from the nature; it combines some of the most prominent elements of the nature, wood and water, framed by glass and concrete. The sitting area is a concrete bench that refers to the flow of the water. It penetrates a wooden structure which is the main, covered bus stop area. The wooden structure consists of large wooden beams which occasionally contain a tree – part of the streetscape. \r\n\r\nWhile repeating and transferring the natural elements in the city there are a few alternations in order to adapt into an urban environment; the tree logs have been fractured to provide a cover and shading for the passengers, while they shorten from the street side and inwards to provide the sense of depth and shelter. Besides, the smooth lines and edges of the natural elements in their natural environment are sharpened as they adapt in the streetscape. This sharpness of every element of the bus stop provides a sense of dynamic movement and temporariness that characterize city life and especially traffic and transportation.\r\n\r\nThe structure is also flexible to adjust in the dimensions of the sidewalks; the fractured logs can become more or less, adding or deducting the bus stop’s depth, depending on the width of the pavement and the streetscape requirements and allowing convenience of the pedestrian movement. The rear side of the bus stop ends with a short concrete wall that facilitates the bus routes, schedules, and advertisements. A glass panel covers the space between the wooden roof and the wall which provides protection from rain and wind. Overall, it is an environmental-friendly structure, adapted not only in the urban landscape, but also in the surrounding rich natural environment of Utah. \r\n',152,'2009-09-22 16:58:00','2009-09-22 16:58:00','T-Pin1.jpg','image/jpeg',541866,'2009-09-22 16:57:51','T-Pin2.jpg','image/jpeg',299237,'2009-09-22 16:57:54','T-Pin3.jpg','image/jpeg',472853,'2009-09-22 16:57:57',242,'94.68.182.45'),(261,'Bus stop in Sochi','For people who tired from waiting their transport on the bus stop, next bust stop include small shop and viewing platform. ',2208,'2009-09-22 21:37:13','2009-09-22 21:37:13','5_bus_stop.jpg','image/pjpeg',332040,'2009-09-22 21:37:07','4_.jpg','image/pjpeg',184159,'2009-09-22 21:37:09','5_.jpg','image/pjpeg',346093,'2009-09-22 21:37:11',243,'85.173.18.9'),(262,'FLYING LEAVES','The spinning wheels of the bus rustle the leaves on the ground and sent them dancing in the air.\r\n\r\nThis moment/scene forms the basis of inspiration that give the  bus-stop its shape. The design was conceived as a dynamic piece of sculpture that marks the landscape/urbanscape while also serving as a visual interest to the waiting passenger. ',2087,'2009-09-22 21:38:22','2009-09-22 21:38:22','utah_1_copy.jpg','image/jpeg',296693,'2009-09-22 21:38:15','utah_2_copy.jpg','image/jpeg',499378,'2009-09-22 21:38:17','utah_3_copy.jpg','image/jpeg',395357,'2009-09-22 21:38:19',244,'220.255.7.232'),(263,'LIGHT OF THE FUTURE ','Everyday students wait for their future on the bus stop. The most important events start right there, hopes, dreams, loves, start over and over again everyday.  The light of the future could be one light on the way. Go and take the bus, the world is yours.',1774,'2009-09-23 00:14:39','2009-09-23 00:14:39','VIEW_01.jpg','image/jpeg',647715,'2009-09-23 00:14:30','VIEW_02.jpg','image/jpeg',643354,'2009-09-23 00:14:33','VIEW_03.jpg','image/jpeg',633337,'2009-09-23 00:14:36',245,'190.113.146.23'),(264,'Shelter Utah','The shape of the shelter is driven by the mountains, the salt crystal, and the site. The mountains and salt share a sharpened crystalline form that translated into the diamond shapes of the skin. The diamond sides are positioned to force a north and south exposure. The roof takes advantage of this by providing solar collectors to the south and a clear polycarbonate to the north. This will allow maximum collector exposure and provide for the north light without the heat in the summer. The walls are made of perforated metal screen. This will allow airflow while reducing the wind velocity and providing visibility for safety. In the night these panels will be highlighted by the interior solar-powered lighting that will produce a \"glow\". \r\n\r\nThe shelter provides four \'salt crystal\' rotating chairs. The rotation and arrangement will allow for shared group space or privacy depending on the user/s. The individual seating will deter extended loitering. The chair backs provide space for University and Museum promotions along with other campus happenings and bus route information.\r\n\r\nThe repetition of the form eases construction cost and labor cost. All materials are durable and graffiti resistant.',413,'2009-09-23 01:16:00','2009-09-23 01:16:00','UTAH_1.jpg','image/jpeg',152392,'2009-09-23 01:15:54','UTAH_2.jpg','image/jpeg',150204,'2009-09-23 01:15:57',NULL,NULL,NULL,NULL,246,'72.195.137.101'),(265,'Live. Work. Transport. ','the follies of transportation, are simple yet provide shelter and basic venues for users and visitors to experience the act of being put on display. Because as we moved towards a future where public transportation is key to continue and save the environment, we use the idea of \"Live Advertisement,\" to become examples for the rest of society. ',2245,'2009-09-23 03:53:38','2009-09-23 03:53:38','23_copy.jpg','image/jpeg',275852,'2009-09-23 03:53:35',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,247,'69.86.88.25'),(266,'Smart Stop','Bus Stops are inhabited by dozens of users daily.  For some, A bus stop is merely a place to stand out of the sun or the rain.  For others, it is a place to relax for a few minutes between the day\'s tasks.  A bus stop can also serve as a physical landmark or a place to reorient oneself.  The elements of thermal comfort, transparency, visibility, lighting, constructability, and sustainability should be well considered.  With this in mind, many bus stop designs fall into one of two categories.  There are those that focus strictly on function and those that strive too hard to make a formal statement.  The \"Smart Stop\" in not formally aggressive, but it is quite sophisticated in its detailing and its response to fuction and use.  \r\n \r\nWaiting in a public place with strangers can be awkward experience.  transparent or translucent glass is used as a primary cladding material for this very reason.  The glass provides shelter from the wind, rain, and street activity, and it also allows for visual access and ventilation.  \r\n \r\nThe \"Smart Stop\" responds the issues of thermal comfort and lighting quite well.  Photovoltaic panels provide shade for bus stop users on hot days, and they power four radiant heat panels on colder days.  A significant portion of the lighting load is powered by the photovoltaics making the structure largely self sufficient and sustainable.  Adequete lighting is particularly important to the safety of nighttime users.    \r\n \r\nAlthough the detailing of the \"Smart Stop\" is quite complex, the basic structure makes use of standard steel components such as galvanized steel tubes.  Many of the components could be prefabricated and assembled onsite for ease of construction.  \r\n \r\nFinally, all bus stops must find a way to become physical landmarks.  They must be visible without being too \"loud\".  The \"Smart Stop\" does just that.  With the use of color, graphics, and signage, bus stop users can locate the stop easily and orient themselves to this location.  The slight taper to roof allows rainwater runoff into a garden of sorts that helps bring the design down to the scale of the pedestrian and blend it with its context.  \r\n \r\n \r\n\r\n',2225,'2009-09-23 04:53:45','2009-09-23 04:53:45','Board_3-raster.jpg','image/pjpeg',848299,'2009-09-23 04:52:47','Board_2.jpg','image/pjpeg',638343,'2009-09-23 04:53:07','Board_1.jpg','image/pjpeg',1083073,'2009-09-23 04:53:22',248,'208.107.71.64'),(267,'Bus_Stop','Bus_Stop_Design',2269,'2009-09-23 11:57:15','2009-09-23 11:57:15','Bus_Stop.jpg','image/pjpeg',419709,'2009-09-23 11:57:09',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,249,'89.53.208.150'),(268,'Bus Hub by MADdesigns','INFORMATION\r\n\r\nThe concept for this bus stop/hub is to provide a busy university bus route with a stylish and recognisable bus shelter that is a landmark for the university students and can be used as a meeting place.\r\n\r\nThe design lends itself to the new build and the recycled build - the random design of the glazing gives the opportunity for the use of recycled glazing to be used instead of new glazing. The timber seating pods could also be built from recycled material. The energy requirements of the hub can be met by using environmentally friedly energy generation such as solar. The design allows for the new build or a recycled build depending on the desires of the local people.\r\n\r\nThe result is a bus shelter/hub that is a visual landmark for the students who will use it and a statement of the style and energy of a university campus area within a busy urban landscape.',2274,'2009-09-23 13:22:41','2009-09-23 13:22:41','SHEET_ONE.png','image/x-png',1763495,'2009-09-23 13:22:28','SHEET_TWO.png','image/x-png',1283444,'2009-09-23 13:22:35',NULL,NULL,NULL,NULL,250,'86.162.204.115'),(269,'Basic Principles & Needs','contact us at prabh@atelier.co.in',2263,'2009-09-23 13:31:02','2009-09-23 13:31:02','1.jpg','image/pjpeg',266145,'2009-09-23 13:30:48','2.jpg','image/pjpeg',504584,'2009-09-23 13:30:54',NULL,NULL,NULL,NULL,251,'122.161.212.158'),(270,'convergent node','Convergent node.   The notion of a bustop must evolve when placed in a transit environment.  Society today is in flux, blackberry, netbook, mocha choka latte, tweet me, download, upload.  Technology and people converge and while waiting many things can be accomplished today that could not be done 30 years ago.  Most transit stop are still 30 years behind, this campus “node” has the unique opportunity to not only satisfy the transit aspect but also all other aspects of life today with a structure that is multi-faceted and in flux.  \r\n\r\nthe structure is derived from two identical forms that mimic the flux between positive(people) and negative(technology) space. the mountains become a generator for solids and voids.',2281,'2009-09-23 14:25:46','2009-09-23 14:25:46','utah_bus_stop_final_1_copy.jpg','image/jpeg',76244,'2009-09-23 14:25:40','utah_busstop7_copy.jpg','image/jpeg',114393,'2009-09-23 14:25:42','utah_busstop_mountain_generator.jpg','image/jpeg',112444,'2009-09-23 14:25:44',252,'71.111.214.84'),(271,'Art+Nature','Concept:more art, more nature into cities! Letś find inspiration of nature.\r\n\r\n-reclaimed wooden columns with natural facetexture, partly painted.\r\n-backwall:timber and/or plywood.\r\n-sides:coated glass.\r\n-roof:stainless steel, high polished under-surface, \"crushed\".\r\n-massive woodblocks for sit and lean.\r\n\r\nThis is one example of endless line of ideas,what wood afford.Tree as art-piece, created by Nature. Each shelter unique.\r\nNo limits in forms and colors, more or less scultural, no geometric restriction (exept constructive). For 3 or 30 waiting person depend by needs.For intensive urban environment or garden city area. Site-specific style and character.\r\n\r\nLast ten years I  have been dealing with \"small architecture\" -  park- and gardenshelters, pavillions, my portfolio contains many designs and scetches. Why not waiting-shelters.\r\n\r\nVisit my web-site: www.terranum.com (coming in october).  ',589,'2009-09-23 15:04:54','2009-09-23 15:04:54','Utah1.jpg','image/pjpeg',788277,'2009-09-23 15:04:22','Utah2.jpg','image/pjpeg',583591,'2009-09-23 15:04:33','Utah3.jpg','image/pjpeg',713546,'2009-09-23 15:04:44',253,'217.159.219.86'),(272,'Bus-Non-Stop','The design is based on simplicity by rewarding recycled materials go along with the structure. This bus station may also be used as a train station and have the ability to expand for different circumstances. Proposed skin materials can vary from recycled license plates to recycled glass or recycled metal. The idea is to create a self supported structure which can be later covered up by local recycled materials of the region. Materials can be hand picked based on the weather conditions of the area that it serves. Random pattern of the skin would allow materials to come in any size without the need of a second adjustment. The effort can also be achieved in a workshop like activity in order to provide social interaction between public and institutions which would give them an awareness of conserving. Each random unit on the skin would also be designed by different artist of the region. ',2303,'2009-09-23 17:34:00','2009-09-23 17:34:00','busstop_board_1.jpg','image/jpeg',1148117,'2009-09-23 17:33:46','busstop_board2.jpg','image/jpeg',1175892,'2009-09-23 17:33:54',NULL,NULL,NULL,NULL,254,'69.234.31.95'),(273,'Journey to an alternative destination.','\r\nThis bus stop is located in one of the cultural hubs of Salt Lake City. Situated in the grounds of the University of Utah, it stands with the Utah Museum of Fine Arts just meters away and the Utah Museum of Natural History within walking distance. Along with being one of the leading research institutions within the U.S.A. the University of Utah is renowned for its innovative and environmentally responsible approach towards transportation and sustainability. In line with such an initiative this bus stop is an eco-friendly, practical and durable structure that encourages the use of public transport. However, the design has not been restricted by necessity alone. For, the bus stop is also a multi-sensory piece of sculpture, which itself contributes towards the appeal of its prestigious setting. \r\n\r\nThis is a bus stop that defies the standard specification that others adhere to. The revolutionary design not only protects from the elements but also directly incorporates them into the design. For, the entire structure of the bus stop moves in accordance with the direction of the wind. This motion echoes the beautiful movement of blades of grass in the breeze or sea kelp in the incoming tide. The motion also reflects the significance of continuous cycle, which is an essential element in bus routes and also more broadly daily routine. The shape of the structure provides an open, social area for people wait and interact with one another. Furthermore, there is easy access to and from the bus stop facilitating the needs of the disabled or parents with pushchairs.\r\n\r\nThe natural elements are also incorporated into the design via the use of solar cells that run either side of the structural spine. These solar cells power multiple lights that run parallel to them. The lights indicate how soon the next bus will take to arrive. That is, when the bus leaves all lights will be dimmed down. The lights will then gradually light up one by one until the next bus arrives. This ingenious design almost eliminates the need for a timetable for passengers will be able to see how long it will be before the next bus arrives, even from a considerable distance. \r\n\r\nThe structure is made from steel chain-link that allows flexibility for movement. The outer skin is comprised from translucent, recycled, industrial rubber. Such material protects the core of the structure whilst also enhancing flexibility of movement. \r\n\r\nDigital images can be displayed on the upper two thirds of the structure including the usual bus timetables and advertising billboards. However, why not be a bit more adventurous and utilise the space as an exhibition area for local artists or even enable individuals to upload images from their phones or laptops themselves. The possibilities really are endless here. \r\n\r\nThis is a bus stop so incredible it could be listed as a destination on the bus route itself!\r\n',2320,'2009-09-23 18:25:31','2009-09-23 18:25:31','Next_stop_design_sheet_1_.jpg','image/jpeg',1245508,'2009-09-23 18:25:18','Next_stop_design_sheet_2_.jpg','image/jpeg',995233,'2009-09-23 18:25:25',NULL,NULL,NULL,NULL,255,'78.146.194.141'),(274,'Green Gateway bus shelter','The design has been inspired by the open landscape that surrounds Salt Lake City, highlighting the importance of sustainability in a climate with extreme weather conditions.\r\n\r\n \r\nThe shelter acts as a landmark by its streamlined form shaped like an arch, as the symbol of an entrance/exit to the campus site and merging with the landscape surrounding salt lake city.\r\n\r\nOne side of the bus shelter is closed loop water feature, which mimics the waterfalls in the nearby mountains. Coloured lights that are embedded into the ground within the bus shelter will provide a colourful display during night time, and combined with the glass panels will provide a sense of safety for the users.\r\n\r\nThe roof is planted with sedum, which requires very little ongoing care and can be left to develop naturally to form a dense carpet. Mixing a wide variety of sedum species will display a beautiful selection of colourful hues including greens, reds, purples and yellows combined with a rich textural mix.\r\n\r\nThe structure and glass panels provide shelter from natural and traffic generated wind, and protection from snow and rain. The sedum roof has the added advantage of keeping the structure cool during hot summer months\r\n\r\nThe shelter will be powered by solar panels running along one side of the shelter.\r\n\r\nMaterial: Sustainably sourced wood, steel and glass structure.\r\n\r\nLighting: LED light display for bus timings. Multi coloured spot lights on ground in purple, green and orange.\r\n\r\n',1581,'2009-09-23 20:05:29','2009-09-23 20:05:29','IMG_0537.JPG','image/jpeg',377314,'2009-09-23 20:04:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,256,'90.200.162.42'),(275,'Trivial Prosthetic','This is not a bus stop design,\r\nbut an interest in the abundant number\r\nof existing bus stops all over the world.\r\nLike the bus riders, bus stops come in\r\nall shapes and sizes with a variety\r\nof style, taste and expression.\r\nTRIVIAL PROSTHETIC celebrates this\r\ndiversity by creating an attachment to \r\nexisting bus stops. This prosthetic \r\neliminates uncertainty by informing\r\nriders when the next bus will arrive.\r\nFormailty is deluded as the prosthetic\r\ncreates a common moment between\r\nriders with shared trivia questions.\r\n',2333,'2009-09-23 20:19:14','2009-09-23 20:19:14','BOARD.jpg','image/pjpeg',1904746,'2009-09-23 20:18:28',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,257,'69.222.50.165'),(276,'Moebius strip','The morfogeny based on Moebius strip that has only one surface and only one boundary element. Semantics of this shape means so an endless of being and so a necessity of recycling. The strip creates two spaces. One with racks for bikes and another for passangers. There the infobox with actual bus schedule viewed from both spaces. The passengers\' space is equiped also with the cash machine, the city infobox and the ticket terminal. These gizmos go out from the shell structure. The structure uses renewable energy of sun via PV batteries on the roof. Drainage of the stop provides into a local drainage system. There are a few segregation-based refuse bins. Wi-Fi access is available.',671,'2009-09-23 22:43:47','2009-09-23 22:43:47','04_copy.jpg','image/jpeg',320138,'2009-09-23 22:43:26','06_copy.jpg','image/jpeg',217036,'2009-09-23 22:43:41','08_copy.jpg','image/jpeg',166479,'2009-09-23 22:43:43',258,'89.105.244.186'),(277,'A Modular Stop','The Modular Stop consists of three differently sized, interlocking frames that create modifiable bays.  Determined by the number of people that it can shelter, the structure can expand or contract as required by the site.  The other construction elements all lend themselves to complete flexibility as well: the wood slats that form the backside, the length of bench used, the gutter placement, an optional bike rack, the plastic laminate displays used for maps and information, even the trash or recycling bin within each frame, all can be lengthened, shortened, moved, or outright excluded.  The frames are lit from within and act as a signal for the bus stop at night, as well as a backlight for the information displays.\r\n\r\nThe layout of the Modular Stop at the University of Utah bus stop is based on several factors.  The entrances (breaks in the form of the shelter) are located where pedestrian traffic already flows, the trees and grass of the site are utilized within the structure to allow for varying typologies in the waiting areas, and the overall form of the shelter flows with the sidewalk.  The wood slats are used to block the direct sunlight from the south, while the sloped roof allows more indirect northern light into the shelter.  The red plastic laminate utilizes the University\'s color to act as a symbol in the night, as well as a beacon for the stop\'s location, readily visible from across the parking lot or along the sidewalks.  Two bike racks are located behind the central shelter, where a small plaza is created to act as a funnel from the parking lot to the bus stop.  ',783,'2009-09-24 01:09:42','2009-09-24 01:09:42','Board_01.jpg','image/pjpeg',1940699,'2009-09-24 01:09:09','Board_02.jpg','image/pjpeg',2017092,'2009-09-24 01:09:23','Board_03.jpg','image/pjpeg',2091540,'2009-09-24 01:09:32',259,'216.178.74.186'),(278,'Ship + It','This design seeks to both provide the necessary and convenient functions and amenities of a proper bus stop, and to also allow the user an interactive and evocative relationship on a daily basis.\r\n\r\nThe potential construction method allows for the form to be manipulated in ways that best serve the site and its users, monitoring light intake, views, seating, and display.',1454,'2009-09-24 04:58:42','2009-09-24 04:58:42','Sheet_B.png','image/png',431703,'2009-09-24 04:55:17','Sheet_A.png','image/png',228225,'2009-09-24 04:58:37',NULL,NULL,NULL,NULL,260,'66.65.133.83'),(279,'University of Utah Bus Stop  |  Prototype','This design endeavors to create a conglomeration of individual personal spaces as a public node of assembly, while being capable of organically nesting in various site geometries.   \r\n\r\nEach unit provides a 3-sided shell for personal respite from the sun, wind, precipitation, and public view.  The unit attaches to the spine structure above where it receives stability and electrical service for lighting.  Space above the unit may be utilized for future solar panel arrays.  A unit is typically used for seating, but can be adapted for support purposes, such as ticket machines and trash receptacles.\r\n\r\nThe space inside segments for multiple views of the surroundings and allows for various ANSI/ADAAG accessible entrances inside.  Its openness makes it a defensible space, addressing any concern for safety since it is such a public area at all hours of the day.\r\n\r\nPrimary materials:  \r\n- 3/4\" plate steel, galvanized with TNEMEC zinc primer, painted white and gray as shown\r\n- 1\" ice finish extruded polycarbonate panel edged with bent steel channel, painted red as shown\r\n- spine:  EXTIRA composite panels, edged to fit, unfinished as shown, over steel superstructure, galvanized with TNEMEC zinc primer',1056,'2009-09-24 04:58:50','2009-09-24 04:58:50','SethUTAsubmit_01.jpg','image/jpeg',226614,'2009-09-24 04:54:45','SethUTAsubmit_02.jpg','image/jpeg',413550,'2009-09-24 04:58:37','SethUTAsubmit_03.jpg','image/jpeg',420583,'2009-09-24 04:58:42',261,'173.29.151.141'),(280,'Time-Shift Stop','vishnu_kokcha@yahoo.co.in',2380,'2009-09-24 05:09:19','2009-09-24 05:09:19','1.jpg','image/pjpeg',125477,'2009-09-24 05:09:14','2.jpg','image/pjpeg',64610,'2009-09-24 05:09:17','3.jpg','image/pjpeg',54832,'2009-09-24 05:09:18',262,'122.161.219.91'),(281,'\'Light Box\'','The Light Box is a unique project, made for the public users of Salt Lake City, Utah. The architectural shelter is defined by light, wooden material (walnut) and signage which specifically is design for visibility. It has a centrally heated core to provide comfort; the shelter is meant to face north so it won’t suffer solar gain in the summer.  Visitors have a sensory activated sliding front door made from low iron glass with metal framing to ensure clear color light inside. There is double glazed roof to ensure anti sagging in the roof. The rear wall has a light effect to notify the user when the next bus will arrive as it changes colors to tell you when and how far the bus arrives. For example, red is for ten minutes, yellow for five minutes and green for one minute.  \r\n\r\nOnce inside the experience is completely shut off to the outside space. The box then becomes a chamber to create a divide from the inner space from the outer space. \r\n',1503,'2009-09-24 06:50:48','2009-09-24 06:50:48','Light_Box.jpg','image/jpeg',150797,'2009-09-24 06:50:42',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,263,'129.2.175.106'),(282,'\'Light Box\'','The Light Box is a unique project, made for the public users of Salt Lake City, Utah. The architectural shelter is defined by light, wooden material (walnut) and signage which specifically is design for visibility. It has a centrally heated core to provide comfort; the shelter is meant to face north so it won’t suffer solar gain in the summer.  \r\n\r\nVisitors have a sensory activated sliding front door made from low iron glass with metal framing to ensure clear color light inside. There is a double glazed roof to ensure anti sagging in the roof. The rear wall has a light effect to notify the user when the next bus will arrive as it changes colors to tell you the proximity of the bus . For example, red is for ten minutes, yellow for five minutes and green for one minute.  \r\n\r\nOnce inside the experience is completely shut off to the outside space. The box then becomes a chamber to create a divide from the inner space from the outer space. \r\n',1503,'2009-09-24 06:53:46','2009-09-24 06:53:46','Light_Box.jpg','image/jpeg',150797,'2009-09-24 06:53:43',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,264,'129.2.175.106'),(283,'STOP TO MOVE','UTAH STATE  experiences extreme climatic conditions ....\r\nso what is \"next\" ?\r\n\r\nnext is sustaiable \r\nnext is free movement \'\r\nnext is self transforming\r\nnext is experience\r\nnext is better future??\r\n\r\nso we pause for a moment and give ourself a time lapse ...for a design that is transforming , developing.and thus gets\r\n adapted to the surrounding and the mass around it..self transforming is the \"buzz\" word for a form were people \r\nstop to move and change the direction and the way of movement..(mode of transport=bus)\r\nthe stop that is designed from utah ,for the people of utah..thus being a part of utah ..a form that evolves from\r\nthe surounding movements ..which are:-\r\n\r\n1)the climate. (sustainable)\r\n2)type of people (privileges)\r\n3)orientation(open facade from where the bus arrives)\r\n\r\n1)SUSTAINABLE TO CLIMATE\r\n	considering the extremely varying weather ,the design is made collapsible .\r\n..a)the fabric shutters - the shutters are design to collect snow during the winter and water when it rains. The collectors collapse down by the weight \r\nof the snow/water collected over it..thus protecting it from cold /rain... \r\nwhen the water evaporates during spring /summer the fabric moves up(due to elastic coil) and thus providing good ventilation\r\n\r\nduring winter as  the fabric encloses the bus stop, green house effect takes place where in the cool air enters from the bottom (cold air being heavy). \r\nwarm air created due  to green house effect remain collected due to the CAP effect ,a smaller outlet is provided at the top (as a vent).\r\n\r\nb)METAL panels- which are made from bus scrap reflecting the bus in the bus stop itself.\r\n these panels are inclined over the main concrete structure in such a way that it collects the snow during winter which itself acts as an insulator.\r\nalso, these panels are not in total contact with the structure, so even if the metal gets heated up in summer, the heat is not transferred to the\r\n internal environment.\r\n\r\nc)solar panels-to provide energy to the privilege kiosk\r\n\r\n\r\n2)A PRIVILEGE FOR THE PEOPLE.\r\n     a)considering the students and youth crowd , the privilege kiosk is prvided with mordern amminities such as \r\nwifi, gps..etc \r\nb)on the southern facade(entrance) there is a glass door (opening inside and outside convenient for handicap) , \r\nc)on the wesern facade when you slide the door to move out(exit) the movement is simple as the applied force is divided by the help of simple pulleys,\r\n the metal panels create an exploded effect( for more details of its working visit http://www.facebook.com/photo.php?pid=2318054&id=516639522) ,creating a transforming experience...thus becoming the stop for you to move!!!\r\n\r\n\r\nby MATTERS\r\n\r\nsachin sabhlok\r\nnaved junani\r\nsudhir ray\r\nshruti jain\r\n(S.Y.B.Arch, Rizvi College Of Architecture)\r\n\r\nand\r\nPooja Gada\r\n(S.Y.FA, Sir J.J.college of applied arts) \r\n\r\n\r\n',2387,'2009-09-24 09:06:04','2009-09-24 09:06:04','Slide2.jpg','image/jpeg',68946,'2009-09-24 09:06:00','Slide3.jpg','image/jpeg',120263,'2009-09-24 09:06:01','Slide4.jpg','image/jpeg',99460,'2009-09-24 09:06:02',265,'115.184.36.140'),(284,'Urban Lights: Architecture and Public Art','Architecture: defined as a continuous piece that emerges from earth and culminates in the far seating area.\r\n\r\nStructure: cast-in-place concrete walls and seating area. Light gauge aluminum frame canopy. Structural glass wall\r\nand molliums for canopy support.  \r\n\r\nLight: LED ribbon strips and fluorescent light fixtures. \r\n\r\nConcept: to create a public art with function. The continuous ribbon effect is the lyricism of the bus stop.  A bus stop is not only an object that remains in its place.  Although static, it represents the fluidity of a city.  It is in our memory when we are still at home or at work and it travels with us. It does not want to be static, it wants to move. It wants to embrace us and protect us while waiting. This design concept is the representation of this metaphor.  It also \"moves\" at night, becoming, through the photons of lights, a part of the urban landscape. It reaches you and invites you to seat and wait for your next ride.\r\n',1858,'2009-09-24 14:07:28','2009-09-24 14:07:28','Bus_Stop.jpg','image/jpeg',1709983,'2009-09-24 14:06:55','Night_02.jpg','image/jpeg',65649,'2009-09-24 14:07:20','Night_03.jpg','image/jpeg',128011,'2009-09-24 14:07:24',266,'76.184.105.22'),(285,'Covered','A great concept!',853,'2009-09-24 14:14:26','2009-09-24 14:14:26','BJR26.JPG','image/pjpeg',68640,'2009-09-24 14:14:25',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,267,'58.250.105.219'),(286,'BUS STOP AS OBJECT WITHIN LANDSCAPE','NEXT STOP DESIGN: \r\nA NEW INTERPRETATION TO THE TRADITION:\r\nBUS TOP AS OBJECT WITHIN THE LANDSCAPE:\r\n\r\nTHE CHALLENGE OF THE BUS STOP DESIGN WAS HOW TO INCORPORATE MORE PUBLIC USAGE OF MASS TRANSPORATION WHILE PROVIDING SUFFICIENT PROTECTION FROM THE NATURAL ELEMENTS.  THE APPROACH OF DESIGN WAS TO CREATE AN INTERACTIVE BUS STOP OF INTRIGUE THROUGH VARIOUS SIMPLE OBJECTS AS MASSINGS IN THE LANDSCAPE WHICH WOULD CREATE VARIOUS UNIQUE SPACES OF USER SHELTER AND INVOLVEMENT.  \r\n\r\nINSPIRATION AND DEVELOPMENT\r\nDUE TO THE INHERENT ABILITY TO PROVIDE SHELTER FROM THE ELEMENTS, THE ROCK AND BOULDER FORMATIONS OF THE UTAH TERRAIN NATURAL WERE A FORM OF INSPIRATION AND DROVE THE DESIGN DEVELOPMENT. \r\n\r\nHUMAN\r\nSIT - STAND - LEAN - ENCLOSURE - VISIBILITY - PROXIMITY: VARIABLE \r\n\r\nDESIGN CONSIDERATIONS\r\nTHE BUS STOP IS CREATED AS AN INDIVIDUAL OBJECT WITHIN THE LANDSCAPE AND CAN BE ARRANGED IN VARYING POSITIONS DEPENDING ON THE SPECIFIC SITE LOCATION AND DESIRED APPEARANCE.  THE BUS STOP PROVIDES SHELTER FOR THE USER WHILE THE COMPLEMENTARY OBJECTS ACT AS OBJECT ART AND AMENITIES WITHIN THE LANDSCAPE AND OPPORTUNITY FOR VARIABLE INVOLVMENT.  THE BUS STOP ALLOWS THE USERS TO CHOOSE THEIR PERSONAL SPACES WHILE WAITING FOR THE MASS TRANSPORATION.  A MICROCLIMATE WITHIN THE BUS STOP IS FORMED THROUGH THE USE OF NATIVE LANDSCAPING AND WATER DRAINAGE POOLS.  THE OBJECTS ARE CREATED UTILZYING SUSTAINABLE MATERIALS AND CONSTRUCTION TECHNIQUES.  THE OBJECT AS MASSING WITHIN IN LANDSCAPE HOPES TO INCREASE PUBLIC PARTICIPATION OF MASS TRANSPORTATION.      \r\n\r\nCONSTRUCTION AND MATERIALS\r\nRECYCLED FOAM INSULATION COVERED WITH PLASTER SHELL\r\nTHIN FILM PHOTOVOLTAIC SOLAR MODULE FOR ELECTRICITY\r\nRECYCLED WOOD SEAT FOR USER\r\nMETAL VENTS FOR AIR CICULATION\r\nRECYCLED GLASS WITH BUILT IN LIGHTING AND SIGNAGE DISPLY\r\n\r\nDESIGNED BY:\r\nSTEPHEN STRUGALA\r\nSTEPHENSTRUGALADESIGN@GMAIL.COM\r\n\r\n',2399,'2009-09-24 14:18:20','2009-09-24 14:18:20','page_1.jpg','image/pjpeg',402593,'2009-09-24 14:18:04','page_2.jpg','image/pjpeg',479107,'2009-09-24 14:18:10',NULL,NULL,NULL,NULL,268,'116.236.228.187'),(287,'Bus Stop!','Great Stop!',853,'2009-09-24 14:20:40','2009-09-24 14:20:40','Front_Entrance.JPG','image/pjpeg',57548,'2009-09-24 14:20:16','Interior_5.JPG','image/pjpeg',88254,'2009-09-24 14:20:21','Interior_4.JPG','image/pjpeg',83524,'2009-09-24 14:20:23',269,'58.250.105.219'),(288,'Bus Stop!','Great Stop!',853,'2009-09-24 14:21:18','2009-09-24 14:21:18','Front_Entrance.JPG','image/pjpeg',57548,'2009-09-24 14:21:09','Interior_5.JPG','image/pjpeg',88254,'2009-09-24 14:21:15','Interior_4.JPG','image/pjpeg',83524,'2009-09-24 14:21:16',270,'58.250.105.219'),(289,'Next Stop: Clean Air','“We will never achieve ethical architecture that is beautiful and sustainable until nature is integrated and at the core and at the substance and being of the architecture, not added on to it.”- Steve Kieran\r\n\r\nIn an urban world continually concerned with air quality, designing places that can cleanse the air of impurities is of great importance. Nature has made the best air cleaners on the planet, and building these directly into   our structures are to the benefit of all. Using a simple steel structure, and air cleaning plants as part of the enclosure, this design  changes the expectations of what our buildings should be in the world today.',2366,'2009-09-24 14:32:12','2009-09-24 14:32:12','ADC-1.jpg','image/jpeg',1091947,'2009-09-24 14:31:52','ADC-12.jpg','image/jpeg',654081,'2009-09-24 14:31:59','ADC-13.jpg','image/jpeg',807737,'2009-09-24 14:32:06',271,'98.211.91.82'),(290,'Next Stop','Easy to build.',853,'2009-09-24 14:55:13','2009-09-24 14:55:13','BJR10.JPG','image/pjpeg',68837,'2009-09-24 14:55:06','Platform_Aerial_View.JPG','image/pjpeg',74477,'2009-09-24 14:55:09','South_Elevation.JPG','image/pjpeg',26818,'2009-09-24 14:55:11',272,'58.250.105.219'),(291,'Waiting under flowers like a bug ...','Many colorful umbrellas open like many fllowers.People stand in the bus stops(which will be set up by using many umbrellas) like little bugs under flower waiting for their next trip...',614,'2009-09-24 15:14:23','2009-09-24 15:14:23','1.jpg','image/pjpeg',447420,'2009-09-24 15:14:17','3.jpg','image/pjpeg',453555,'2009-09-24 15:14:19','2.jpg','image/pjpeg',421982,'2009-09-24 15:14:21',273,'218.82.108.160'),(292,'Intuition','Green!',853,'2009-09-24 15:16:17','2009-09-24 15:16:17','Aerial_Perspective.JPG','image/pjpeg',69740,'2009-09-24 15:16:08','Elevation_Detail.JPG','image/pjpeg',104821,'2009-09-24 15:16:13','Side_Elevation_2.JPG','image/pjpeg',55191,'2009-09-24 15:16:16',274,'58.250.105.219'),(293,'SHoP','SHoP Design!',853,'2009-09-24 15:22:20','2009-09-24 15:22:20','Detail_10.JPG','image/pjpeg',45144,'2009-09-24 15:22:14','Detail_8.JPG','image/pjpeg',53198,'2009-09-24 15:22:16','Detail_1.JPG','image/pjpeg',47679,'2009-09-24 15:22:18',275,'58.250.105.219'),(294,'Together','Group project.',853,'2009-09-24 15:38:44','2009-09-24 15:38:44','Aerial_View.JPG','image/pjpeg',74182,'2009-09-24 15:38:38','North_Elevation.JPG','image/pjpeg',80694,'2009-09-24 15:38:39','Perspective_2.JPG','image/pjpeg',96888,'2009-09-24 15:38:41',276,'58.250.105.219'),(295,'Retro Bus Stop for Utah','A good bus shelter is an essential part of any successful urban mass-transit system. A good shelter is one that has low maintenance requirements and is vandal-resistant. From the rider\'s point of view, an ideal shelter is one that allows visibility and easy access to the bus, is comfortable and convenient, provides clear information, and is safe.\r\n\r\nThe bus stop design is fairly basic. It has been developed as a uniform design concept for Utah in order to convey a harmonious overall image of the urban area. Modern elements and clear lines enable a universal use of this bus shelter.',1634,'2009-09-24 18:49:26','2009-09-24 18:49:26','Bus_stop_design.jpg','image/jpeg',605013,'2009-09-24 18:49:13',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,277,'59.177.100.17'),(296,'Shelter-Skelter.','This project centers on the premise of temporary shelter. The form is simple and reassuring, the unfolding roof resembles the mountainous landscape of Salt Lake City and gives dynamism to the design.  The materials and basic structural theory ensures the quick and effortless construction and the design\'s versatility.\r\n ',1052,'2009-09-24 18:55:01','2009-09-24 18:55:01','busstop.jpg','image/jpeg',152978,'2009-09-24 18:54:57','busstop_perspective.jpg','image/jpeg',79873,'2009-09-24 18:54:59',NULL,NULL,NULL,NULL,278,'128.62.173.115'),(297,'Breaking the edge of the city','the core of this piece It\'s about to create a space of waiting. the breaking of the edge of the city. the theme of this project It\'s about leaving the public space, when the break of this edge of public space and the city becomes an statement of the act of waiting in this \"leaving\" space (a space to leave)\r\nThis space is reduced to the basic, having in mind the ephemeral of staying, reading a news, meeting someone, etc. the cover, the news panel and the bench put in a specific angle to wait the bus, open the panorama of the traffic.',2099,'2009-09-24 20:16:38','2009-09-24 20:16:38','lamina_1.jpg','image/jpeg',623802,'2009-09-24 20:16:16','lamina_2.jpg','image/jpeg',284194,'2009-09-24 20:16:27','lamina_3.jpg','image/jpeg',193069,'2009-09-24 20:16:32',279,'200.86.50.172'),(298,'Speed','The design springed from the thought process of \'speed\' and how it relates to a bus stop design. The interplay of speed and rest and how the bus stop needs to be an ideal rest space for the users. ',2705,'2009-09-24 20:36:16','2009-09-24 20:36:16','Bus_Stop_Donahue_C..jpg','image/jpeg',746616,'2009-09-24 20:36:10',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,280,'72.236.254.110'),(299,'Speed and Rest','Fluid and organic shapes create a dynamic space to serve as a bus stop.',2705,'2009-09-24 20:37:55','2009-09-24 20:37:55','Bus_Stop_Schrantz_C..jpg','image/jpeg',650149,'2009-09-24 20:37:49',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,281,'72.236.254.110'),(300,'FTA bu[s]top ','  The Idea of the shape comes from the graphic sign of The United State Department of transport, Federal Transit Administration. \r\nWe started drawings that logo in 3d scale and came up with a very simple and minimalist shape of the bus stop, which is built from a metal frame structure partially cover with fabric, coated with Polyurethane; which makes sheltering more durable and waterproof. The height of the FTA stop is 5 meters to fit double deck buses or coach. On the metal structure, one of the arms is positioned over half of the road to guide the buses in and to show them where to stop.\r\nThen we enhanced the idea with the interior values like:\r\nThe seating structure is a very simple double tube made from metal or hard plastic to prevent people from sleeping at the bus stop, (however, if we are going to use metal, one of its properties is that it is very cold, so we thought to use solar panels which are situated on the top of the metal structure which will heat up the seats). \r\n  This bus stop is on the university campus, consequently there are students who use bicycles, and therefore we placed metal bicycle racks behind the bus stop.\r\nOf course a bus stop will need to have a ticket machine, so we placed two machines there, as well as a stand with a touch screen that has maps and bus routes. \r\nThe lights on the bus stop are situated on the metal structure, and they become brighter when there is someone at the bus stop or when a bus is due.\r\n',2358,'2009-09-24 23:57:18','2009-09-24 23:57:18','111.jpg','image/pjpeg',1421016,'2009-09-24 23:56:41','555.jpg','image/pjpeg',631136,'2009-09-24 23:57:07',NULL,NULL,NULL,NULL,282,'141.163.66.132'),(301,'The straw bale bus station','A sustainable design should incorporate (at least in great part if not in whole) natural, recycled and recyclable materials. This bus station is made up mostly of straw bales, stone, timber, and recycled metal panels and brick. All these materials can be found lying around us: straw bales on farms, stone around rivers and in the mountains, timber can be responsibly harvested or found in the form of fallen trees, metal and brick can be found in abandoned warehouses, factories, train stations, etc. \r\nThe straw bale walls in this bus station are covered with adobe and they create a great barrier against the elements; the openings high above create natural ventilation without exposing the traveler who is waiting inside; the stone base gives the impression of sturdiness and strength; the curved recycled metal roof aids water/snow to drain away from the entrance and helps the wind flow over the structure; the floor inside is recycled brick for a pleasant feel.\r\n',2707,'2009-09-25 00:13:11','2009-09-25 00:13:11','The_bus_station_2.jpg','image/pjpeg',2043912,'2009-09-25 00:13:01','The_bus_station_3.jpg','image/pjpeg',1853744,'2009-09-25 00:13:06',NULL,NULL,NULL,NULL,283,'76.103.96.19'),(302,'solid_void','Minimal.Contemporary.Prefab.Shade.Shelter.Lighting.',2790,'2009-09-25 02:35:53','2009-09-25 02:35:53','nsd.jpg','image/pjpeg',670973,'2009-09-25 02:35:48','nsd2.jpg','image/pjpeg',709254,'2009-09-25 02:35:51',NULL,NULL,NULL,NULL,284,'68.248.154.104'),(303,'University of Utah Bus Stop','Bus stop for the University of Utah.  Closed space & open/covered spaces.  Made of stone/brick (local materials).',1356,'2009-09-25 03:06:32','2009-09-25 03:06:32','IMAGE_01.jpg','image/jpeg',1693307,'2009-09-25 03:05:28','IMAGE_02.jpg','image/jpeg',1311344,'2009-09-25 03:05:48','FINAL.jpg','image/jpeg',1718364,'2009-09-25 03:06:10',285,'70.41.178.49'),(304,'containerSTOP','containerSTOP [ken-ta-ner stap]: noun: \r\n1. a way of utilizing discarded shipping containers, removing them from over crowded ports and shipping yards \r\n2. a method of creating habitable space from an object intended to contain inanimate cargo\r\n3. a solution to provide shelter for those waiting for public transportation\r\n4. an iconic symbol of sustainability',2107,'2009-09-25 04:45:50','2009-09-25 04:45:50','Image_1.jpg','image/jpeg',1379327,'2009-09-25 04:45:38','Image_2.jpg','image/jpeg',299148,'2009-09-25 04:45:46','Image_3.jpg','image/jpeg',343367,'2009-09-25 04:45:48',286,'72.199.212.242'),(305,'A bus stop ','    Made in china\r\n                    just for fun\r\n                                       a chinese student    \r\n                                      \r\n                                 Ha ha!',1932,'2009-09-25 12:38:14','2009-09-25 12:38:14','Bus_stop.jpg','image/pjpeg',690453,'2009-09-25 12:38:09',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,287,'119.99.131.82'),(306,'waiting under the trees','many years ago, people are waiting for the fetching for other person under the trees. This bus stop main concept is try to repeat that habbit but with new material, the real trees are still using by planting vine upper the roof, this vine will sticks out all over the transparant roof, so then it will shows the harmony between the artificial brach and the vine. the floor pattern be in the form of branch mixed with the shadow of the roof, should be a perfect harmony too.',2271,'2009-09-25 12:46:38','2009-09-25 12:46:38','1EgohPageOne.jpg','image/jpeg',137078,'2009-09-25 12:46:33','2EgohPageTwo.jpg','image/jpeg',104382,'2009-09-25 12:46:35',NULL,NULL,NULL,NULL,288,'203.190.116.86'),(307,'BLOSSOM. MOTION.','A bus stop is a place of  action. So it must be the motion by itself. It shouldn’t be static because of the change of situation. \r\nWarm morning sun - you are able to see the sky.\r\nRainy day - you need roof to feel comfortable.\r\n\r\nIn the dark - you need  light.\r\nShelter seems to be light and easy.It is made of tent material,  which dissolves sunshine as well as artificial light. Shelter has a flexible skeleton, which can change its form, depending on environment situation.',2952,'2009-09-25 14:08:56','2009-09-25 14:08:56','1.jpg','image/jpeg',881254,'2009-09-25 14:08:39','2.jpg','image/jpeg',346007,'2009-09-25 14:08:45','4.jpg','image/jpeg',480029,'2009-09-25 14:08:48',289,'193.219.160.2'),(308,'Colorful_Utah_Bus_Stop','Imagine a bus stop full of beautiful colors and pleasant smells as plants/flowers have the possibility to grow vertically on the structure of it and its roof is used as a water-collector for the flowers…\r\n\r\n…a bus stop which is constructed of non-toxic/recycled materials and is energy-free by the use of photovoltaic panels on top of it…\r\n \r\n…a bus stop which uses ‘air-curtains’ attached to its roof thusly providing a cozy atmosphere (hot air) during winter and a comfortable atmosphere (cool air) during summer. Specially designed folded glass panels also protect passengers from heavy side-rain/wind or hot sun.\r\n\r\nHydraulic bars, placed at the front of the bus stop, gently move up/down when a bus arrives/departs, and remain still if a high speed vehicle/bus approaches. Screens – speakers inform passengers about the bus routes and play music creating a relaxing ‘waiting mode’.\r\n\r\nFinally lights and vibrating seats inform passengers having a hearing/visual problem that a bus approaches…\r\n',2430,'2009-09-25 16:22:47','2009-09-25 16:22:47','CUBS.jpg','image/pjpeg',813400,'2009-09-25 16:22:16',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,290,'94.65.238.209'),(309,'Invisible all seasons bus stop','Auto tilt solar panel roof powers summer cooling/misting fans, and radiant heat (in floor) in winter. Plexiglass wall contruction for invisibility. Tilting roof provides flow through ventilation for all seasons.',3003,'2009-09-25 16:32:14','2009-09-25 16:32:14','bustop.JPG','image/pjpeg',101340,'2009-09-25 16:32:12',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,291,'199.104.92.15'),(310,'An eco stop','AN ECO STOP\r\nUSE OF THROWN AWAY, SCRAP AND WASTE MATERIAL IS THE BASIC IDIA BEHIND THIS DESIGN\r\nA CRAETION OF RECYCLED MATERIAL\r\nEVERYBODY IS AWARE OF PRESENT SENARIO OF ENERGY ISSUES.\r\nMOST OF THE TIME OLD BUSES DECAYED IN THE JUNKYARD FOR YEARS. NOBODY BOTHER ABOUT IT. CREATION FROM SUCH SCRAP MATERIAL ITSELF IS A GREEN MESSAGE TO PEOPLE.\r\n',974,'2009-09-25 17:36:03','2009-09-25 17:36:03','An_eco_stop.jpg','image/pjpeg',1701683,'2009-09-25 17:35:52',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,292,'115.96.115.207'),(311,'S4: Self Sufficient Solar Shifter','  S4 is a Self Sufficient Solar Powered Public Station.  Dynamic armatures adjust  solar arrays and track the suns path for maximum efficiency.  The Station is tied into the city’s grid so as to help provide energy for the pubic and redistribute excess energy to neighbors and the community.  S4 is also an interactive information station where the public can have access to news, wireless, information regarding local events, and internet access.  The proposed materials consist of recycled aluminum, cast metal, and interactive digital media. The rear of the station allows for bicycle parking to encourage using the station as not simply a bus stop but also  public gathering place.  Interactive screens keep the public in touch by supplying both visual and auditory information about bus schedules and real time bus tracking. The station illuminates different colors depending on the bus that is arriving which to allows patrons of the pubic transportation system to know when a particular bus is about to arrive.  ',1591,'2009-09-25 17:51:27','2009-09-25 17:51:27','rusher_bus_stop_01.jpg','image/jpeg',278951,'2009-09-25 17:51:25',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,293,'129.107.30.54'),(312,'silhouette stop','The aim of the project is to provide distinctive and recognisable piece of urban furniture. No longer a simple shelter, the bus stop has the potential to become a unique sculpture in the urban landscape and a meeting point. ',3053,'2009-09-25 18:24:38','2009-09-25 18:24:38','BS1.jpg','image/jpeg',486033,'2009-09-25 18:24:21','BS2.jpg','image/jpeg',510754,'2009-09-25 18:24:26','BS3.jpg','image/jpeg',507619,'2009-09-25 18:24:32',294,'85.26.183.25'),(313,'Adaptation','The bus stop design here would be aesthetically pleasing while being capable of adapting to the changing weather.  It opens up and self ventilates during hot sunny weather.  When there is a storm, whether rain or snow, or just cold temperatures, the unit closes up and releases any thermal energy stored from the day.  It is a simple and clean design. ',2330,'2009-09-25 19:04:22','2009-09-25 19:04:22','Adaption_Sunny.jpg','image/jpeg',1238632,'2009-09-25 19:04:01','Adaptation_Rain.jpg','image/jpeg',1476050,'2009-09-25 19:04:11','Parts-and-Views.jpg','image/jpeg',636767,'2009-09-25 19:04:17',295,'69.86.7.102'),(314,'TImeless Geometry','I have used two simple geometric forms colliding with each other to create this design.\r\n I used a cuboid to pierce a second larger cuboid along an axes that was defined by the natural shortcut taken by the students and the public from the carpark behind to the road crossing.\r\nThe sleek modern form is transformed at night to become a beacon on the road side\r\n\r\nI have tried to create timeless functional architecture, that will not date over time. ',3056,'2009-09-25 19:23:00','2009-09-25 19:23:00','TG1.jpg','image/jpeg',1445184,'2009-09-25 19:21:58','TG4.jpg','image/jpeg',1176128,'2009-09-25 19:22:22','TG2.jpg','image/jpeg',1662690,'2009-09-25 19:22:38',296,'87.114.87.9'),(315,'Modular stop','Modular Stop uses cast concrete modules to construct a bus stop shelter.',3139,'2009-09-25 21:19:12','2009-09-25 21:19:12','MCM_DESIGN.png','image/png',1285091,'2009-09-25 21:19:08',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,297,'128.205.16.147'),(316,'Flex:Pull','Focusing on the urban proximity to downtown Salt Lake City and\r\nthe environmental climate necessities facing the bus stop site\r\nand the greater University of Utah campus, the proposed design\r\nseeks to connect those using the stop to the greater campus\r\nand city around them. Using the supporting armature to gesture\r\nthe the interconnectedness of the city’s streets and blocks, it\r\nwas my intention to create an atmosphere of being “already on\r\nyour way” while waiting for the bus, light rail or commuter\r\nshuttle. The structure is composed of an insulated glazing\r\nsystem with a concrete and wood envelope, which reflects the\r\nheat and glare of the sun and keeps transit-goers safe from\r\nwind, rain and snow.',1992,'2009-09-25 22:11:54','2009-09-25 22:11:54','Aaron_Levine_Flex-Pull_1.jpeg','image/jpeg',871953,'2009-09-25 22:06:33','Aaron_Levine_Flex-Pull_2.jpeg','image/jpeg',263542,'2009-09-25 22:10:06',NULL,NULL,NULL,NULL,298,'76.212.15.68'),(317,'URBAN BUS STOP  ','The proposed bus stop assumes a location within an urban environment comparable with downtown St. Lake City. The shelter plan is approximately 16’-9”(L) x 5’-4”(W) x 10’-0”(H) that provides multiple points of access to sitting or standing areas offering protection from the weather. Riders have visibility of their surroundings from each direction of adjacent sidewalks and the street. \r\n\r\nThe material composition of the shelter is a structural steel tube frame painted with high gloss polyurethane finish. The steel frame is either infilled with tinted laminated glazing or ornamental brick. The roof is composed of structural galvanized steel panels with rigid insulation and 5V crimp metal roofing. The roof system supports a series of Uni-Solar photovoltaic panels supplying power for (6) LED architectural downlights, LED bus route information / mapping, and IT equipment for WIFI connection.   \r\n\r\nThe design solution for the bus stop is a secure enclosure for passengers and an identifiable icon within the community. The objective of the architecture is to encourage citizens to utilize the many advantages of public transportation.       \r\n\r\n',1848,'2009-09-25 22:37:28','2009-09-25 22:37:28','BusStop_View1.jpg','image/pjpeg',141839,'2009-09-25 22:37:21','BusStop_View2.jpg','image/pjpeg',147708,'2009-09-25 22:37:23','BusStop_View3.jpg','image/pjpeg',138650,'2009-09-25 22:37:25',299,'209.4.45.49'),(318,'Mobius Bus Shelter','The Mobius Bus Shelter is based off the concept of a Mobius Strip, a surface with only one side and only one boundary component. Each Mobius Structure is designed to appear to be constructed from a single continuous loop of tube steel. Combined the structures create larger bus shelters while also affording the flexibility of being stand alone stops.',1843,'2009-09-25 22:57:54','2009-09-25 22:57:54','mobius_set.jpg','image/jpeg',73103,'2009-09-25 22:57:29',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,300,'24.19.39.114'),(319,'The Practical Bus Stop','This bus stop has many things which are missing from your average stop. It has boards which show the next three buses due to arrive and how far they are away; three touch-screens that enable a passenger to find and book routes and seats at the touch of a, well, screen; and three buttons marked 1, 2 or 3 which, when pressed, flag down the first, second or third next buses. For each seat there\'s an electric socket, and (guess what?) a cup holder. Yep, this design has everything. \r\nBy way of hygiene it has a composting toilet with a waste hatch at the back to enable cleaners to remove the compost. It also has recycling but I seem to have forgotten a composting bin. There\'s also a tap for drinking water and even some plastic cups.\r\nFor heating we have underfloor heating, and for summer we\'ve got air con. Both turn on and off automatically. \r\nRainwater is collected from the roof into a tank, and is the filtered and pumped up to the taps. Of course, there won\'t always be enough rainwater so it\'s automatically topped up by mains water if it gets too low.',726,'2009-09-26 00:28:47','2009-09-26 00:28:47','Bus_stop_front_view.gif','image/gif',74819,'2009-09-26 00:28:32','Bus_stop_interior.gif','image/gif',339131,'2009-09-26 00:28:40','Bus_stop_interior_2.gif','image/gif',360756,'2009-09-26 00:28:43',301,'125.239.81.167'),(320,'Clear & Comfortable','As a frequent bus rider in college, one thing I found lacking in bus stops was a design that is appealing, but still provides adequate shelter from the elements.  This is especially a concern during Utah winters.  Hence, this stop has glass panels enclosing a seating area.  To avoid heat buildup during warmer months, panels may be opened to allow air to pass through, or riders may wait in front of the enclosure, under the fabric canopy that shades from summer sun.  A fabric roof over the enclosure allows for ventilation year round while preventing cold winter winds from chilling passengers by allowing them to be directed from the sides to the front of the stop.  Glass panels could be engraved with designs and graphics, similar to some MAX line stops.  These could include UTA signage, route numbers, contact information for UTA, and more.  Images are shown in June.',3247,'2009-09-26 01:13:28','2009-09-26 01:13:28','bus_stop_east_am.jpg','image/jpeg',541467,'2009-09-26 01:13:13','bus_stop_south_noon.jpg','image/jpeg',499223,'2009-09-26 01:13:20','bus_stop_evening.jpg','image/jpeg',553074,'2009-09-26 01:13:24',302,'74.81.243.253'),(321,'stop n plant ','Not just a bus stop but the concept is where we can stop and plant there. Yes, Plant the tress and vegetables or fruit in small spaces. Bus stop user can bring seed from their homes and planttheir seed here. it is mean producing foods while waiting bus to stop.\r\n\r\nThis bus stop equipped with solar panel and small wind turbine which produce electricity to pump ground water or charging phone cells.',2855,'2009-09-26 01:55:04','2009-09-26 01:55:04','nexx.jpg','image/jpeg',148293,'2009-09-26 01:54:57','1.jpg','image/jpeg',85117,'2009-09-26 01:54:59','4.jpg','image/jpeg',180576,'2009-09-26 01:55:01',303,'117.20.60.192'),(322,'The Bus Stops Here','If you want a cheap bus shelter, there are many companies that will provide a pre-fab off-the-shelf unit, the kind that you see in most cities. For that matter, the most cost-effective solution to the prototype site would be to do nothing, or invite students to \"have at it\" with spray paint one Saturday morning. I suspect that this is not what UTA et al had in  mind.\r\n\r\nThe roof is inspired by various \"western\" forms without literal pastiche (mountains, stage coaches, sweeping skys, etc). The form allows for rain and snow to be caught and harvested for irrigation, provides an image, sweeps up to catch the bus (keep dry in the rain & snow), and forms a surface for nighttime indirect lighting.\r\n\r\nThe design uses a module of 12\' bays. For this large stop, multiple bays are used with multiple functions: shelter, bike storage, portal. One by is left open for standing and accessible access (with floor markings).\r\n\r\nThe portals line up with the crosswalk with a mirror portal forming a \"carstop: on the commuter lot side, thus organizing the circulation paths.\r\n\r\nThe bolsters add wind protection, divide the bays, are high enough off the floor to not be a security hazard, and are inspired by Utah landforms. Materials are core-ten steel or anodized aluminum. They also hold lighting for up and dowlighting effects and ticketing machines (for farecards - similar to most modern metros), as well as information boards pertaining to schedules & routes.\r\n\r\nIs the shelter a wi-fi hotspot? Sure, but most likely the campus is already.\r\n\r\nThe roof materials: anodized aluminum panels on steel framming, white PVC roof & trough for top roof finish.\r\n\r\nThe rear glazing provides psychological protection, is semi-transparent with alternating bands of translucent and clear lining up with bolster horizontal lines. They also offer wind protection in the winter, while the gap at the top allows hot air to escape and breezes to flow in the summer.\r\n\r\nThe roof offers ample shade in summer, while allowing the winter sun to penetrate.  The bottom of the trough/beam incorporates yellow quartz lights/heaters for the darkest and coldest winter days.\r\n\r\nEnergy Considerations:\r\n\r\nLights -- LED throughout (long-lasting, most light per watts with current technology, offer color effects).\r\nNo other power used, other than quartz lights for select winter days. \r\nNo provision for solar panels or photovoltaics due to relatively small roof area, and relatively small use of power. These can be remotely clustered, however. \r\n\r\nSo, the bus stops here. Get on the bus, not under it.\r\n\r\nA better bus shelter.\r\n\r\nBy.................Mennen\r\n\r\n',3257,'2009-09-26 02:57:14','2009-09-26 02:57:14','The_Bus_Stops_Here.jpg','image/pjpeg',1452473,'2009-09-26 02:56:44','Notes_Information.jpg','image/pjpeg',1009606,'2009-09-26 02:56:54','Side_View_Aproach.jpg','image/pjpeg',570971,'2009-09-26 02:57:03',304,'64.3.55.130'),(323,'Dancing Shaows ','Concept: \r\n“Lake Effect” in Salt lake city  which cause “ Greatest snow on Earth”. This has contributing a factor when Salt Lake City hosted 2002 Winter Olypmics.  \r\nMy Bus Stop design concept was inspired by the geographical location of the University, the studies of the formation of salt and snow and their structures. \r\n\r\nDesign:\r\nThe “room” surrounded by the irregular shape façade with glass protected could be advantage for weather protection . The chairs inside the room were purposely designed to be rectangular to set a huge contrast to the room.  The “room” could allow space for ticketing, vending machines etc.  Also, wireless for internet involves in this programmed. \r\nThe irregular furniture outside the” room” has served for the purpose to stand or lean. And it fits to the site context. \r\nAs you all could see, helping with sustainability, I have used solar tube and green roof for better environment.\r\nThe bus stop is a form of art and it is definitely eye catching in a far distance.\r\nDo not hesitate to ask for plan, sections and elevations and the design process in details. \r\n',320,'2009-09-26 03:07:54','2009-09-26 03:07:54','Features01.jpg','image/pjpeg',191534,'2009-09-26 03:07:45','Frontview02.jpg','image/pjpeg',76020,'2009-09-26 03:07:52',NULL,NULL,NULL,NULL,305,'86.10.74.156');
