INSERT INTO `ideas` VALUES (11,'It is important that the weather in Utah is considered when these designs are being submitted.  It is cold and snowy in the winter and deathly hot in the summer.  So, a shelter that can protect people in both scenarios would be ideal - and would increase ridership',NULL,'2009-06-02 17:50:28','2009-06-02 17:50:28',5,1,NULL),(12,'A minaret like what surrounds the Taj Mahal can use no outside energy to heat or cool those waiting  within the minaret natural chimney effect air flow through grating for the floor.  Some underground air loop tunneling is required. The height will make it a more visable bus stop.',NULL,'2009-06-08 05:12:35','2009-06-08 05:12:35',57,2,NULL),(13,'The Bus Stop needs to be LOW maintanence.  Vending machines, LED T.V.\'s and so on will require security features that will cost the city money that doesn\'t need to be spent. Bus stops are open all the time and need to be free of expensive equipment.    ',NULL,'2009-06-09 22:03:33','2009-06-09 22:03:33',60,3,NULL),(14,'Locate the bus stop in the median of the road at an elevation connecting to a pedestrian overpass.  It will serve both directions with park n ride connections. The bus will be heading uphill for easier braking. It will be heading down hill for resuming acceleration.',NULL,'2009-06-08 04:31:40','2009-06-08 04:31:40',57,4,NULL),(15,'Add communications between rider and bus. Bus technology can tell the station when it\'s coming, but at a stop served by multiple routes, riders could push a button that tells the drivers which bus is required, via a numbered light flashing on the station roof (rather than getting into pinging back to the actual bus...). Such a service would keep routes moving more smoothly as drivers wouldn\'t need to slow to query riders, and riders don\'t have to evolve elaborate \'not my bus, pass on by\' routines to indicate they don\'t need a bus to stop.',NULL,'2009-06-10 23:12:52','2009-06-10 23:12:52',64,5,NULL),(16,'Using remote infrared audible signage, making next bus information accessible to people with vision loss by installing a text to voice converter and transmitting the dynamic message via infrared to a receiver carried by a person with vision loss.  See www.talkingsigns.com',NULL,'2009-06-11 02:36:07','2009-06-11 02:36:07',66,6,NULL),(17,'\'Like the idea of crowdsourcing.\r\n\r\nI think the key to a future-orientated bus stop is its integration with its surrounding. Depending on the size, type and function of the bus stop - urban, suburban, transfer bus-train, transfer park&ride - requires different approaches. \r\n\r\nDesigning a technology-overloaded, generic structure that will be placed everywhere cannot be the answer. \r\n\r\nMaybe a bus stop should become more of a small public space, or part of one, where waiting for the bus is only one function of many.\r\n\r\nMaybe it would have been better to supply three or four typical locations for the design ideas.',NULL,'2009-07-02 03:22:52','2009-07-02 03:22:52',115,7,NULL),(18,'function hub\r\nGenerate a bus stop which integrates numerous additional functions, which are usually spread in public city spaces - as vending machines, information desks, time pieces, recycling stations, ...\r\nThe functions are not simply add-ons, but integrated into the overal design. Each purpose is given a strong visual identity - which adds a unique character to the building.\r\n',NULL,'2009-07-03 09:06:29','2009-07-03 09:06:29',145,8,NULL),(19,'Hello. What do you think of water fountains as a non-visual archictecture that can also be helpful and enjoyed by blind people? ',NULL,'2009-07-08 21:37:20','2009-07-08 21:37:20',137,9,NULL),(20,'<a href=\'http://nextstopdesign.com/images/ideas/busstopcafe.jpg\' target=\'_blank\'>This</a> is an actual screenshot of the Bus Stop Cafe in the West Village in NYC\nwith the bus going by (there is a bus stop in front of the cafe) - it\'s great\nfor the cafe and the stop users to have it there - maybe you could have a cafe\nnear your stop! <a href=\'http://nextstopdesign.com/images/ideas/busstopcafe.jpg\' target=\'_blank\'>view image here</a>','[Null]','2009-07-16 16:20:27','2009-07-16 16:20:27',309,10,NULL),(22,'So just a thought...After looking at these great designs pop up over time, it seems that everyone is just giving their competetion one star so they don\'t have good ratings and to make their own look better, so my question is do the ratings even matter? Because they don\'t seem to be very accurate.  ',NULL,'2009-07-18 04:35:47','2009-07-18 04:35:47',140,11,NULL),(23,'2 things I noticed about bus stop seats. \r\n\r\n1) Drunk people pee on the seats, so many people prefer not to sit on there. \r\n\r\n2) Two strangers will prefer to not sit closer than 10 meters away from eachother. \r\n\r\nI know that this sounds unprofessional, but is an important aspect to consider, which is why on my bus stop design in my main account, I did not put a lot of consideration on seating. ',NULL,'2009-07-19 04:50:25','2009-07-19 04:50:25',316,12,NULL),(24,'I was riding a bus this one time, and the bus driver slows as he approaches the sidewalk. The person waiting was holding a walking stick, and is obviously blind. Upon seeing this, the bus driver speeds up, ignoring the blind person. The blind person got mad a banged on the side of the bus with his walking stick. ',NULL,'2009-07-26 04:24:29','2009-07-26 04:24:29',316,13,NULL),(25,'i wonder why nobody seem to question the current location of the waiting area. \r\n\r\nthe buses actually seem to stop in that bay just in front of the pedestrian crossing - and not half-way through the street curve - what would be quite dangerous anyway.\r\n\r\nthe current structure is quite far away and disconnected. so if it is raining, snowing  or just very hot, it seems uncomfortable that one must leave the rain/snow/sun shelter and walk quite a bit to reach the point on where to board the bus.\r\n\r\nmaybe it is reasonable to get rid of a few parking lots and place the waiting area right next to where the buses stop, between the pedestrian crossing and the current location of the hut.',NULL,'2009-07-27 08:54:22','2009-07-27 08:54:22',115,14,NULL),(26,'A budget?',NULL,'2009-07-27 14:11:31','2009-07-27 14:11:31',413,15,NULL),(27,'MOVE STOP MOVE STOP MOVE STOP MOVE STOP MOVE STOP MOVE STOP MOVE STOP MOVE STOP MOVE STOP',NULL,'2009-08-10 02:36:52','2009-08-10 02:36:52',614,16,NULL),(28,'The bus \"cone\" (or \"tree\").  A metal pole 8-10\' high placed in a  concrete pad with a traction insert (as used in sidewalks).  Atop the pole is a cone, wide enough to provide shelter from sun, rain and snow.  A simple seat can be attached to the pole. The cone is visible to bus drivers, passengers and pedestrians, less likely to blow down in heavy wind, can be made of recycled materials and bus-stop signs can be attached to the pole-eliminating the need for a separate sign post.  The \"cone\" is simple, inexpensive, attractive, functional, \"green\" (and can be painted green), can be used in limited space, graffiti-resistant and compliments tree-lined city streets.  \r\n\r\nA bonus-feature:  The bus can be driven near or under the cone creating an \"umbrella\" for passengers who exit and enter the bus (considerations should be made for disabled passengers, maybe additional concrete \"padding\" to \"land\" the wheel-chair ramp). ',NULL,'2009-08-11 18:36:37','2009-08-11 18:36:37',631,17,NULL),(29,'BEFORE DESIGN THE BUS STOP FOR THE FUTURE PLEASE TAKE IN CONSIDERATION ALL THE BRIEF!!! IT IS NOT JUST ABOUT HAVING A ROOF ON THE HEAD WHILE WAITING FOR THE BUS, ITS ABOUT THE BRIEF!!! IF WAS ONLY TO HAVE A ROOF ON THE HEAD, UMBRELLAS HAVE ALREADY BEEN INVENTED!!!! THANK YOU',NULL,'2009-08-11 20:23:43','2009-08-11 20:23:43',390,18,NULL),(30,'Redesign the BUS to make it\'s use more attractive and comfortable for the user. Once this has been accomplished, there will be a reason to design a new bus stop. ',NULL,'2009-08-17 04:21:16','2009-08-17 04:21:16',688,19,NULL),(31,'A Drinking fountain for rainfall catchment....',NULL,'2009-08-26 01:53:48','2009-08-26 01:53:48',771,20,NULL),(32,'How about we quit submitting all this postmodern deconstructivist \"architecture p0rn,\" and try something that is sensitive to its program and context.  Somebody try thinking about urban design.',NULL,'2009-09-01 19:26:27','2009-09-01 19:26:27',999,21,'204.65.34.246'),(34,'I would like to see a bus stop that +pops up out of the ground+ during travel times and +disappears back underground+ when services are not running: +sundays and night times+ for example.\r\n\r\n*Reclaim the streets....*\r\n\r\nConcept By Simwoo',NULL,'2009-09-08 13:39:06','2009-09-08 13:39:06',1013,22,'86.148.219.32'),(35,'I believe that we must concentrate on the issues related to the functions of a bus stop and then give proper solutions that are feasible, diverse, aesthetical and long lasting so that most of us can see them as a common community object shared by every1 and cared by every1....',NULL,'2009-09-10 18:36:30','2009-09-10 18:36:30',181,23,'203.99.186.14'),(36,'One key consideration:\r\ntime, or the waiting period\r\nI am still surprised it has been mentioned in the consideration list.\r\nthe lack of clear and simple information in bus shelters or station is on eof the key issue in order to comfort people (users) and build up confidence on the raliable service the community is supposed to deliver to the public.\r\nThe today defiance has build up bad reputation on the public services which today cost more than provide the expected services for the public.\r\nVery costly for the public administration it is still poor designed far too much fancy and not effective. Internationaly, Bus stop is the \"shop window\" of public services and they are still poorly designed promoting unconvenient service image. \r\nAs a unique convergeance point it could a perfect image and well service design driven area, fun attractive and well-coming. \r\nOlivier clerc, service designer.',NULL,'2009-09-11 16:06:30','2009-09-11 16:06:30',1482,24,'90.178.74.233'),(37,'Enjoying \r\n',NULL,'2009-09-13 09:16:13','2009-09-13 09:16:13',1516,25,'61.225.46.241'),(39,'A gross assumption is made on behalf of this website in dealing with the issue of public transportation. A bus stop will never increase usage, nor will it do much besides entice young architect students to possibly visit the monumental structure. A adequate proposition to increase ridership would be to expand people\'s knowledge of the system AND secondly to increase the locations of public transportation. Instead of trying to centralize public knowledge onto a bus stop, which is already a backwards idea considering most people (who don\'t use public transporation) would be in their cars while passing it, we should attempt to scatter the information throughout the city/town/area. Buildings should work as a map for public transportation. There should be a placard on every door to every building showing a map of how to get to that specific point using public transportation. Using graphic design it would help illustrate the ease of use and increase awareness. As a bus traveler even I know that bus routes with their schedules are sometimes confusing so to clarify this information in a simple to read map would be enlightening. \n\nSorry for the rant.\n\n<a href=\'http://nextstopdesign.com/images/ideas/bus_route_map.jpg\' target=\'_blank\'>Map Image</a>',NULL,'2009-09-14 16:14:56','2009-09-14 16:14:56',1631,27,'71.94.63.101'),(41,'ddddd',NULL,'2009-09-17 08:13:56','2009-09-17 08:13:56',1786,28,'61.231.184.238'),(42,'All bus stops should have a place to sit.',NULL,'2009-09-17 20:12:48','2009-09-17 20:12:48',1836,29,'75.165.72.249'),(43,'In this design, I paid especial attention to movements and the effects of transportation in our modern life. The life and human perceptibility in 21st century is rather different from what it was before.My responsibility as an architect is to propose designs that excite the sense of curiosity in today’s humans; especially in this project that targets the university society. To do so, I used both visible and hidden geometries. Visible geometry because the exterior surface of the bus stop is designed according to the proportions existing in snail shells.\r\nThe bus station is designed in a dynamic form by using natural shapes, like spiral structures in sea shells, keeping all proportions, symmetries, harmonies and by applying the golden ratio. Actually the outer line is a logarithmic spiral from a sequence of golden triangles. Five critical points on these triangles are used to develop the idea and they are all put in the right way to result in an esthetic appeal.\r\nThis was the hidden aspect of the geometry.\r\n \r\nThank you for your vote.',NULL,'2009-09-19 08:17:24','2009-09-19 08:17:24',1763,30,'94.182.150.139'),(44,'I took the notion of shelter at its most literal and basic, the main consideration being the climate: cold in winter, hot in summer. After all, if the climate were perfect, there would not be a need for a shelter at all, maybe a bench under a tree,and perhaps a sign.\r\n\r\nA shelter by its nature is sustainable: they consume little energy, use few building materials, and produce no carbon. (The bus would ideally run on propane, fuel cells, hydrogen, hybrid, or power lines overhead -- similar to trolleys.)\r\n\r\nThe shelter is high enough to allow a bus to pull under - a nice thing to have in inclement weather.  This gives it also a more gracious proportion in the city scape, aligning with a tree canopy. Material are simple: 1\" recycled steel plate, pre-rusted, clearcoat sealed, polycarbonate glazing, graphics.  The polycarbonate glazing provides  wind protection in winter, with a gap at top to allow hot air to escape in summer.  The canopy allows the low winter sun to warm the surfaces, and provides shade from the high summer sun. Lighting is in the paving for ease of maintenance.\r\n\r\nThe shelter can be easily installed with modular components, and unbolted and relocated as needs require.\r\n\r\nAn optional \"flex\" area can be a built-in table and benches, protected by a low wall and hedges. Other options are a bike storage area (with possible steel canopy similar to main shelter), ticketing machine, space for vendors -- pushcarts or stalls.\r\n\r\nThe goal was a simple, attractive no-fuss shelter.',NULL,'2009-09-20 04:39:02','2009-09-20 04:39:02',1697,31,'71.98.166.33');
