INSERT INTO `pages` VALUES (3,'User Registration (18 years +)','adult-consent','Important Information About Your Participation on this Site\r\n\r\nThis site is part of a research project being conducted by researchers from the University of Utah, in conjunction with the Utah Transit Authority (UTA). The purpose of this project is to learn how online communities can play a role in improving the way bus stops are designed in Utah. Ultimately, what is learned from this project will help organizations like UTA design better transportation systems.\r\nYou have been asked to take part in this study by participating in this site as a registered user.\r\n\r\nThe primary risk involved in participating in this study is the loss of your time you invest on the site. Also, if you choose to submit your own bus stop designs in the competition, those designs will be public, and people may give your design negative feedback and leave negative comments on your design. There are no direct benefits for taking part in this study. However, the information from this study may help develop a greater understanding of online communities and using the Web to improve transit planning.\r\n\r\nThe registration process on the next screen will ask you to create a username and password for your account, to provide your e-mail address and ZIP code, and to give some information regarding your background. The registration screen also includes a brief survey about how you use public transportation, how you learned about the site, and how involved you are in transit planning activities in your area. It should take you less than 5 minutes to complete the registration process and survey.\r\n\r\nParticipation in this study is voluntary. It is up to you to decide whether to take part in this study. Refusal to participate or the decision to withdraw from this research will involve no penalty or loss of benefits to which you are otherwise entitled. This will not affect your relationship with the researchers or with UTA. There is no cost to participate in this study, and no compensation will be provided for your participation in this study.\r\n\r\nPersonal information you provide in the registration process on the next page will be kept confidential and only known by the researchers. Information that can personally identify you (including your name or e-mail address) will never be used in any publicly available format of the results of this study, such as in publications, reports, or presentations. Your information will be stored on password protected computers kept in locked offices, accessible only by the researchers. Your information will never be sold or released to a third party.\r\n\r\nIf you have questions, complaints, or if you feel you have been harmed by this research, please contact the researcher, Daren Brabham, at (801) 633-4796 or daren.brabham@gmail.com. If you have questions regarding your rights as a research participant, contact the University of Utah\'s Institutional Review Board (IRB). Also, contact the IRB if you have questions, complaints, or concerns which you do not feel you can discuss with the investigator. The University of Utah IRB may be reached by phone at (801) 581-3655 or by e-mail at irb@hsc.utah.edu. You may also contact the Research Participant Advocate (RPA) by phone at (801) 581-3803 or by e-mail at participant.advocate@hsc.utah.edu.\r\n\r\nIf you would like a copy of this consent form, print this page now, using your Web browser’s \"print\" function. Thank you for your participation in this study!\r\n\r\nCONSENT\r\n\r\nBy clicking the \"Next\" button at the bottom of this page, I confirm I have read the information in this consent form and have had the opportunity to ask questions of the investigator. I understand that if I would like a copy of this consent form, I should print this page using my Web browser’s \"print\" function at this time, before proceeding. I voluntarily agree to take part in this study.','2009-03-18 18:43:47','2009-03-18 19:07:52'),(4,'User Registration','minor-consent','h1. Important Information About Your Participation on this Site\r\n\r\nThis site is part of a research project being conducted by researchers from the University of Utah, in conjunction with the Utah Transit Authority (UTA). The purpose of this project is to learn how people can play a role in improving the way bus stops are designed in Utah by using the Internet. What is learned from this project will help organizations like UTA design better transportation systems for you.\r\n\r\nYou have been asked to take part in this study by participating in this site as a registered user.\r\nBy being on this site, you are spending time here which you cannot get back. Also, if you choose to submit your own bus stop designs in the contest, your designs will be public. People may not like your design, and they may leave feedback on your design which doesn\'t make you happy. Being in this study may help us understand how online communities can use the Web to take part in government activities.\r\n\r\nThe registration process on the next screen will ask you to create a username and password for your account, to provide your e-mail address and ZIP code, and to give some information regarding your background. The registration screen also includes a brief survey about how you use public transportation, how you learned about the site, and how involved you are in transit planning activities in your area. It should take you less than 5 minutes to complete the registration process and survey.\r\n\r\nIf you don\'t want to be in this study, you don\'t have to be in it. Remember, being in this study is up to you and no one will be upset if you don\'t want to participate. You can change your mind later if you want to stop. Please talk this over with your parents before you decide whether or not to participate. Even if your parents say \"yes,\" you can still decide not to do this. You don\'t have to pay to be in this study, and we will not pay you for being in it either.\r\nAll of your personal information—such as your name and e-mail address—will be kept locked up so no one else can see them except the researchers. Your information will be kept on password protected computers in locked offices. Your information will not be sold or given to anyone else to use either.\r\n\r\nYou can ask any questions that you have about this study. And if you have a question later that you didn\'t think of now, you can ask it later. If you have questions or you feel like this research has hurt you, you can contact the researcher, Daren Brabham, at (801) 633-4796 or daren.brabham@gmail.com. Or, you can contact the University of Utah\'s Institutional Review Board (IRB), which is an office that can help you if you have questions or concerns. The University of Utah IRB may be reached by phone at (801) 581-3655 or by e-mail at irb@hsc.utah.edu. You may also contact the Research Participant Advocate (RPA) by phone at (801) 581-3803 or by e-mail at participant.advocate@hsc.utah.edu.\r\n\r\nIf you want a copy of this form, print this page now, using your Web browser\'s \"print\" function.\r\n\r\nThank you for your being in this study!\r\n\r\nCONSENT\r\n\r\nBy clicking the \"Next\" button at the bottom of this page, I confirm I have read the information in this consent form and have had the opportunity to ask questions of the researcher, and that my parents know and approve of me being on this site. I understand that if I would like a copy of this consent form, I should print this page using my Web browser\'s \"print\" function now, before I go to the next page. I voluntarily agree to take part in this study.','2009-03-18 18:49:11','2009-03-18 18:50:22'),(5,'Thank You','registration-complete','Your registration is complete. We sent you an email with your user name and password for your records.\r\n\r\nHave fun!','2009-03-18 19:12:37','2009-03-18 19:12:37'),(6,'Forgot Username or Password','forgot','h1. Don\'t worry at all\r\n\r\nSimply enter the email you used to sign up with and we\'ll send you your username and password. You\'ll be using the site again in no time.','2009-03-18 21:09:40','2009-03-18 21:39:45'),(7,'About','about','h1. Competition Information\r\n\r\nCompetition closes September 25, 2009, 11:59 p.m. MDT (GMT -6:00). Due to technical difficulties and inconsistencies with information communicated to the press, the contest will remain open until 11:59 p.m. September 25 rather that the originally posted 5 p.m. time. Designs with at least 25 votes are eligible to win the competition. Highest rated eligible designs by the competition closing date will win.\r\n\r\nh1. About This Website\r\n\r\nThis website is part of a research project called \"Crowdsourcing Public Participation in Transit Planning.\" Traditionally, government agencies ask for public input on planning projects by holding open meetings and workshops. The purpose of this project is to get this public input in a different way: online.\r\n\r\nThis project is a collaboration between the \"Department of City & Metropolitan Planning\":http://cmpweb.arch.utah.edu/ and \"Department of Communication\":http://communication.utah.edu/ at the \"University of Utah\":http://www.utah.edu and the \"Utah Transit Authority\":http://www.rideuta.com. The project is supported by \"U.S. Federal Transit Administration grant 2008-DOT-FTA-PTPP: Innovative Small Research Projects to Advance Public Participation Related to Public Transportation Planning\":http://www.fta.dot.gov/planning/programs/planning_environment_5925.html.\r\n\r\nh1. About Our Initial Bus Stop Site\r\n\r\nWe are currently designing for a specific bus stop location. \"Click here\":http://www.nextstopdesign.com/about/site/ to learn about this location, the weather, download photos, and more.\r\n\r\nh1. Design Considerations\r\n\r\nWhenever you design something, you\'re not figuring out how it looks as much as you are how it works. How well it works means taking things into consideration that you might not initially think about. To help out, we\'ve put together a list of design considerations for you. Take a look and see if it helps you design a better bus stop. \"Design Considerations\":http://www.nextstopdesign.com/about/considerations/\r\n\r\nh1. Design Tools\r\n\r\n\"Here\'s a list of some tools and downloads\":http://www.nextstopdesign.com/about/tools/ that you might find helpful when designing your bus stop. Have fun.\r\n\r\nh1. Questions? Feedback?\r\n\r\n\"Contact us\":http://www.nextstopdesign.com/contact to let us know if you have any questions about the site. We also would love your input on how we can make this project better.\r\n\r\nh1. Media Inquiries\r\n\r\n\"Contact us\":http://www.nextstopdesign.com/contact is you\'re a media organization that wants to get in touch with us to learn more about this project. Also, visit our \"Press page.\":http://www.nextstopdesign.com/press','2009-03-22 21:56:57','2009-09-26 01:52:17'),(8,'Learn','learn','h1. Learn About This Website\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.\r\n','2009-03-22 21:57:14','2009-03-24 23:33:00'),(9,'Contact','contact','h1. Contact Us\r\n\r\nFor all questions, media inquiries, or suggestions for improvement to the website, please send an email to:\r\n\r\n\"NextStopDesign@gmail.com\":mailto:nextstopdesign@gmail.com\r\n\r\nMedia organizations should also visit our \"Press\":http://www.nextstopdesign.com/press page.','2009-03-22 22:07:43','2009-06-02 18:19:12'),(10,'Splash Text','splash_text','h1. Hello There!\r\n\r\nThis project is an experiment in community design. We want you to design a new bus stop in Salt Lake City, Utah, USA. On this site, you can learn about the challenge, submit your own ideas, and score the design submissions of your peers.\r\n\r\nThe highest rated designs will have the chance to actually be built as bus stops in Salt Lake City.\r\n','2009-03-24 18:13:26','2009-04-05 17:51:44'),(11,'Terms of Use','tou','h1. Terms of Use, Code of Conduct & DMCA\r\n\r\nCompetition closes September 25, 2009, 11:59 p.m. MDT (GMT -6:00). Due to technical difficulties and inconsistencies with information communicated to the press, the contest will remain open until 11:59 p.m. September 25 rather that the originally posted 5 p.m. time. Designs with at least 25 votes are eligible to win the competition. Highest rated eligible designs by the competition closing date will win.\r\n\r\nTerms of Use\r\n \r\nWelcome! By using the Next Stop Design project web site (the “Website”) you agree to operate under the following terms and conditions, which include this Terms of Use, the \"Privacy Policy and Information Collection Statement\":privacy-policy, the Community Code of Conduct, and the directions on Providing Notice of Copyright Violations Pursuant to the Digital Millennium Copyright Act (together, the “Terms of Use”). \r\n \r\nh3. Project Overview\r\n \r\nThe Next Stop Design Website enables third parties (“Contributors”) to provide design submissions and commentary relating the design of a bus stop for the Utah Transit Authority. This Website represents a public participation activity to get input on transit planning issues. \r\n \r\nh3. Privacy Policy\r\n \r\nThe Next Stop Design project strongly believes in the importance of Contributor privacy as a fundamental design philosophy. Please review the \"Privacy Policy and Information Collection Statement\":privacy-policy.\r\n \r\nh2. Code of Conduct\r\n \r\nContributors to the Website are expected to know these requirements and to follow them in all circumstances. \r\nWe hope that you will have a rewarding experience. \r\n \r\nh3. 1.0 Interactions with other Peers/Contributors \r\n \r\n1.1 Assume Good Faith \r\nAssume that Contributors to the Website are trying to help it, not hurt it. Enabling a larger and more diverse community to submit designs, ideas, and comments will better inform transit planners. Better information results in higher quality bus stops. \r\n \r\n1.2 Civility \r\nContributors shall participate with decorum and courtesy. Contributors shall not behave or communicate in a rude, insensitive, or petty manner. Contributors shall refrain from offending others as well as discourage others from being uncivil. Contributors shall refrain from unwanted communication with other Contributors outside the context of the Website. Contributors shall not make personal attacks anywhere on the Website. Personal attacks damage the community and deter participation. \r\n \r\n1.3 Educate Yourself for Participation \r\nNext Stop Design contains educational materials to help prepare Contributors for submitting designs and ideas. Please make use of these materials, consistent with your background, to optimize the effectiveness of your contributions. \r\n \r\n1.4 Commercial Solicitation\r\nNo Contributor shall use the Website to advertise or perform any commercial solicitation, including, but not limited to, solicitation of Contributors to become subscribers of other web sites. \r\n \r\n2.0 Disclosure and Self-Identifcation \r\nPlease also see the \"Privacy Policy and Information Collection Statement\":privacy-policy for information about privacy and confidentiality of postings on the Website.\r\n \r\n2.1 Contributor Account \r\nContributors shall register one and only one account. Contributors may not use multiple accounts to create the illusion of greater support for or criticism against a submission, or to mislead in any way. \r\n \r\n2.2 Username \r\nContributors shall register under their own name or a neutral pseudonym. Contributors are encouraged (but not required) to register under their own names; by appearing with a name rather than a pseudonym, Contributors help to create a strong community.\r\n \r\nPseudonyms shall not be misleading, offensive or infringing. A pseudonym should not be the name of another natural person, nor be designed to mislead in any way. \r\n \r\n3.0 Providing Commentary\r\n \r\n3.1 Moderators\r\nThe Website is moderated by the Next Stop Design researchers, which reserves the right to not post or to remove content with or without notice to the Contributor posting the content. Offensive and commercial content, including spam, will be removed. \r\n \r\n3.2 Posting, in General \r\nContributors shall post designs, ideas, and comments in a specific, neutral, objective, and reasonable manner. These postings are intended to put forth new ideas or to constructively critique others\' designs. Postings are not intended as a personal critique of the submitters. Postings should be written in such a way as to guide and inform Contributors so that they, or others, may submit improved designs.\r\n \r\n3.3 Scoring \r\nContributors may score any design once. Attempting a second vote will replace the Contributor\'s previous vote with the new one.\r\n \r\nh2. Providing Notice of Copyright Violations Pursuant to the Digital Millennium Copyright Act (DMCA)\r\n \r\nNext Stop Design, a project of the University of Utah in cooperation with the Utah Transit Authority (“we”), will respond to allegations of copyright violations on www.nextstopdesign.com (the “Website”) pursuant to the Digital Millennium Copyright Act (DMCA), 17 USC 512.\r\n \r\nThe DMCA provides a process for a copyright owner to give notification to an online service provider concerning alleged copyright infringement. When a valid DMCA notification is received, the service provider responds under this process by taking down the offending content and, if appropriate, putting it back. \r\n \r\nOn taking down content under the DMCA, we will take reasonable steps to contact the owner of the removed content so that a counter-notification may be filed. On receiving a valid counter-notification, we may restore the content in question.\r\n \r\nPlease note that you may be liable for damages (including costs and attorneys\' fees) if you materially misrepresent that content on the Website is infringing your copyrights.\r\n \r\nh3. Filing a Notification\r\n \r\nYour request for take-down must be made in writing, and must include the following:\r\n \r\n1.Identify in detail the copyrighted work that you believe has been infringed.\r\n \r\n2.Identify the material that you claim is infringing the copyrighted work listed in item #1 above and which you \r\nrequest be removed or disabled. This identification must be in sufficient detail to permit us to locate the material.\r\n \r\n3.Provide information reasonably sufficient to permit us to contact you, such as your email and mailing address.\r\n \r\n4.Provide information, if possible, sufficient to permit us to notify the owner/administrator of the allegedly infringing content (email address is preferred).\r\n \r\n5.Include the following statement: \"I have a good faith belief that use of the copyrighted materials described above, in the manner complained of, is not authorized by the copyright owner, its agent, or the law.\"\r\n \r\n6.Include the following statement: \"I declare, under penalty of perjury, that the information in the notification is accurate and that I am the copyright owner or am authorized to act on behalf of the owner of an exclusive right that is allegedly infringed.\"\r\n \r\n7.Sign the notification with the physical or electronic signature of a person authorized to act on behalf of the owner of the copyrighted work that is claimed to have been infringed.\r\n \r\nSend the written communication to:\r\n \r\nDaren C. Brabham, Investigator, Next Stop Design, Department of Communication, University of Utah, 255 S. Central Campus Dr., Rm. 2400, Salt Lake City, UT 84112 USA.\r\n \r\nh3. Filing a Counter-Notification\r\n \r\nThe submitter of affected content may make a counter-notification pursuant to sections 512(g)(2) and (3) of the DMCA. We may reinstate the material in question after receiving a counter-notification.\r\n \r\nTo file a counter-notification with us, you must provide a written communication by mail that sets forth the items specified below. Please note that you may be liable for damages (including costs and attorneys\' fees) if you materially misrepresent that the content complained of is not infringing upon copyrights of others.\r\n \r\nTo expedite our ability to process your counter-notification, please use the following format:\r\n \r\n1.Identify the specific material that we have removed from the Website or to which we have disabled access, and the location at which the material appeared before it was removed or disabled.\r\n \r\n2.Include the following statement:\r\nI declare, under penalty of perjury, that I have a good faith belief that the material was removed or disabled as a result of mistake or misidentification of the material to be removed or disabled. \r\n \r\nMy name, address, e-mail address and telephone number are as follows:\r\n(address here)\r\n \r\nI hereby consent to the jurisdiction of Federal District Court for the judicial district in which I reside (or, if my address is outside the United States, any judicial district in which University of Utah may be found).\r\nI agree to accept service of process from the complainant.\r\n \r\nMy signature follows:\r\n(actual or electronic signature here) \r\n \r\n3.Include the following statement: \"I declare, under penalty of perjury, that I have a good faith belief that the material identified above was removed or disabled as a result of a mistake or misidentification of the material to be removed or disabled.\"\r\n \r\n4.Sign the paper.\r\n \r\nSend the written communication to:\r\n \r\nDaren C. Brabham, Investigator, Next Stop Design, Department of Communication, University of Utah, 255 S. Central Campus Dr., Rm. 2400, Salt Lake City, UT 84112 USA.\r\n \r\n \r\nUpdated: May 4, 2009; contest ending time updated September 24, 2009.','2009-03-24 22:20:31','2009-09-26 01:51:21'),(12,'Privacy Policy','privacy_policy','h1. Privacy Policy and Information Collection Statement\r\n\r\nNext Stop Design, a project of the University of Utah in cooperation with the Utah Transit Authority (“we”, or the “Website”), believes in the importance of openly sharing ideas to improve decision-making in government. We want to build a community that will improve public participation in transit planning. At the same time, we believe in mutual respect for the use of each other’s private information.\r\n \r\nWe gather/publish information from you on this Website in three primary ways:\r\n \r\n1) Information entered by you during the registration process, some of which is published and some of which is private;\r\n \r\n2) Information we gather indirectly about your activity on the Website; and\r\n \r\n3) Information you publish through your own designs and ideas, and in comments on your own or others\' designs or ideas.\r\n \r\nYour name, as entered during your registration on the site, is publicly available when you post designs or comments. All other information you enter during the registration process is known only to the researchers conducting this study.\r\n \r\nThis Privacy Policy and Information Collection Statement forms part of the \"Terms of Use\":terms-of-use of this Website. We reserve the right to update this Privacy Policy and Information Collection Statement at any time and without prior notice.\r\n \r\nh1. 1) Information Entered By You during the Registration Process:\r\n\r\nYour name, entered during the registration process, will be publicly visible when you post designs, ideas, or comments. All other personally identifiable information you enter during the registration process, such as your email address and birthdate, will be kept confidential, available only to the researchers for research purposes and to manage the Website. We comply with applicable laws and industry standards when transferring, receiving, and storing this information.\r\n \r\nYou may decline to provide your legal name when completing the registration process and may, instead, use a pseudonym. However, we encourage you to identify yourself as a means to create a strong reputation for yourself as part of the Next Stop Design community.\r\n \r\nIf you have any question about whether or not you should participate on this Website on the job, you should consult with your employer.\r\n \r\nh1. 2) Information We Collect About Your Activity on the Website:\r\n \r\nAll your Activity on the Website (“Activity” may include, but is not limited to, the (1) number of designs, ideas, and comments posted, and (2) number and names of designs you have posted) will be collected by the researchers and used for research purposes. Data from this Activity may be made publicly available as part of the research and reporting process.\r\n \r\nWe may track and collect IP Addresses in order to ensure the security and integrity of the system. Access to IP Address information is limited to those who require the information to provide and manage the Website. We comply with applicable laws and industry standards when transferring, receiving, and storing this information. We collect information about how you arrive at the Website and your browsing habits while on the Website, such as length of time spent on the Website, what pages you view, and paths you take through the Website. We collect this information to assess the performance of the Website and for research purposes. Your browsing habits will not be made publicly available in a way that can personally identify you.\r\n \r\nh1. 3) Information published by you on the design, ideas, or comments sections of the Website:\r\n \r\nInformation that you affirmatively post, such as designs, ideas, and comments, may be available for public viewing and archived.\r\n \r\nh1. 4) Other Uses or Disclosure of Information About You:\r\n \r\nIn the following limited circumstances, we may access or disclose information about you, your account and/or the content of your communications, in order to: (1) comply with the law or legal process served on us; (2) enforce and investigate potential violations of the Terms of Use, including use of the Website to participate in, or facilitate, activities that violate the law; or (3) protect the rights, property, or safety of others.\r\n\r\nIn order to provide you the services of the Website, we may collect certain information about service performance, your machine and your service use. We may automatically upload this information from your machine. This data will not personally identify you. \r\n \r\nNext Stop Design welcomes your questions and comments about privacy on the Website. Please direct any communications to \"NextStopDesign@gmail.com\":mailto:nextstopdesign@gmail.com. \r\n \r\nPrivacy Policy - Next Stop Design\r\nAttn: Daren C. Brabham\r\nDepartment of Communication\r\nUniversity of Utah\r\n255 S. Central Campus Dr., Rm. 2400\r\nSalt Lake City, UT 84112\r\nUSA\r\n \r\nThis Privacy Policy and Information Collection Statement forms part of the \"Terms of Use\":terms-of-use of this Website.\r\n \r\nUpdated: May 4, 2009\r\n','2009-03-24 22:20:54','2009-05-04 21:37:03'),(13,'Underage','underage','h1. Sorry, you are not old enough to participate\r\n\r\nYou need to be at least 13 years old to participate in this site.','2009-03-24 23:28:24','2009-03-24 23:28:24'),(14,'Ideas','submit-ideas','h1. Submit An Idea\r\n\r\nHave a great idea for improving our current bus stops? Tell us about it here. Ideas are open to rating and discussion.\r\n',NULL,'2009-04-28 00:32:28'),(15,'Inspiration','inspiration','Here are a few designs that will hopefully inspire you to create your own.',NULL,NULL),(16,'Site','site','h1. Our First Bus Stop (of many)\r\n\r\n﻿﻿﻿﻿﻿<iframe width=\"700\" height=\"394\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"http://maps.google.com/maps/sv?cbp=12,136.94,,0,5.29&amp;cbll=40.761154,-111.843119&amp;v=1&amp;panoid=&amp;gl=&amp;hl=en\"></iframe><br /><small><a id=\"cbembedlink\" href=\"http://maps.google.com/maps?cbp=12,136.94,,0,5.29&cbll=40.761154,-111.843119&ll=40.761154,-111.843119&layer=c\" style=\"color:#0000FF;text-align:left\">View Larger Map</a></small>\r\n\r\n<b>About This Bus Stop</b>\r\nThis bus stop is centrally located on the University of Utah campus, near a light rail train stop, the Utah Museum of Fine Arts, the University Services Building, two campus cafes, a pay visitor parking lot, and the academic buildings for the Colleges of Education and Business. The university has about 30,000 students and 18,000 employees.\r\n\r\nThe bus stop is a busy and important transfer stop for several city bus routes, as well as campus shuttles, and there is considerable foot traffic around the stop. Many students and employees at the University of Utah commute to and from campus via the bus and the nearby light rail train. The stop is located on a small street that loops into the campus (also known as the \"Business Loop\") off of a major road. This street, though small, experiences steady vehicular traffic, and a pedestrian crosswalk guides individuals on the sidewalk across this small street to the bus stop.\r\n\r\nSalt Lake City\'s summers are hot and dry and winters are moderate with snow. Near downtown Salt Lake City, the university campus is at a higher elevation part-way up a mountain and thus receives a bit more snow in the winter than downtown. At this bus stop, most types of weather conditions will exist in a given year--heat, cold, snow, rain, wind, and harsh sunlight. \"Click here\":http://en.wikipedia.org/wiki/Climate_of_Salt_Lake_City for more information on the climate of Salt Lake City.\r\n\r\n<b>General Design Considerations for Bus Stops</b>\r\nThere is a lot to think about when designing a functional bus stop. Check out these \"design considerations.\":http://www.nextstopdesign.com/about/considerations',NULL,'2009-07-02 22:59:27'),(17,'Tools','tools','h1. Tools & Downloads\r\n\r\nThe very best design tools are a stack of plain paper and some sharpened pencils. That said, there are other design tools that you might have fun using:\r\n\r\n\"!http://nextstopdesign.com/images/sketchup_logo.png!\":http://sketchup.google.com\r\n\r\nOnce you\'ve got your ideas on paper, you can get fancy by downloading and using some digital tools to help you take your design further. A really useful tool (and free) is Google Sketchup. This is a 3D modeling tool that is very easy to use. Be sure to watch their great instructional videos if you are using Sketchup for the first time.\r\n\r\nDownload a copy of Sketchup here: \"Google Sketchup\":http://sketchup.google.com.\r\n',NULL,'2009-06-04 16:51:50'),(18,'Submit A Design','submit','h1. Submit A Design\r\n\r\nThanks for taking time to contribute a design. Please fill in the fields below and click the button labeled \'upload new design\' below.\r\n\r\nCompetition closes September 25, 2009, 5 p.m. MDT (GMT - 6:00).',NULL,'2009-07-04 17:09:35'),(19,'Press','press','h1. Press\r\n\r\n\"Background\":http://www.nextstopdesign.com/press#background\r\n\"What is Crowdsourcing?\":http://www.nextstopdesign.com/press#crowdsourcing\r\n\"Meet the Project Team\":http://www.nextstopdesign.com/press#team\r\n\"Press Mentions\":http://www.nextstopdesign.com/press#coverage\r\n\r\n<a id=\"backgrounder\" name=\"background\"></a>\r\n\r\nh2. Background\r\n\r\nNext Stop Design is part of a research project by a team of researchers at the University of Utah, in cooperation with the Utah Transit Authority and funded by a grant from the U.S. Federal Transit Administration. The purpose of the project is to use the Web to bring in new voices and different ideas to the public participation process for transit planning. The site is designed to test the \"crowdsourcing model\":http://www.nextstopdesign.com/press#crowdsourcing as a way to improve this public participation process.\r\n\r\nThe research team applied for \"Federal Transit Administration grant 2008-DOT-FTA-PTPP: Innovative Small Research Projects to Advance Public Participation Related to Public Transportation Planning\":http://www.fta.dot.gov/planning/programs/planning_environment_5925.html and were awarded a grant. The first round of testing involves the design of a bus stop for the University of Utah campus\' \"business loop,\" a major transfer stop for the area.\r\n\r\nThe hope is that Next Stop Design will shed light on the ways people participate in government decision making and design activities--such as bus stop design--online, and that similar projects can be undertaken to solve other public problems and needs.\r\n\r\n<a id=\"crowdsourcing\" name=\"crowdsourcing\"></a>\r\n\r\nh2. What is Crowdsourcing?\r\n\r\nCrowdsourcing is an online, distributed problem solving and production model. \"Coined in June 2006\":http://www.wired.com/wired/archive/14.06/crowds.html by <i>Wired</i> magazine contributing editor Jeff Howe, \"crowdsourcing\" refers to an open creative process combined with a centralized, managed production and implementation process. Crowdsourcing is similar to--but certainly not the same as--open source production.\r\n\r\nThe crowdsourcing model is most notably a for-profit model used by companies such as \"Threadless,\":http://www.threadless.com \"InnoCentive,\":http://www.innocentive.com and in contests such as the \"Goldcorp Challenge\":http://goldcorpchallenge.com and user-generated advertising campaigns. The \"Peer to Patent Community Patent Review\":http://peertopatent.org project is a non-profit, government example of crowdsourcing, using the power of the crowd to make the patent application review process more efficient for the U.S. Patent and Trademark Office.\r\n\r\n!http://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Crowdsourcing_process2.jpg/350px-Crowdsourcing_process2.jpg!:http://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Crowdsourcing_process2.jpg/750px-Crowdsourcing_process2.jpg\r\n\r\nUnderpinning the crowdsourcing model is the notion of collective intelligence, which assumes a base of talent in a large network, as well as \"crowd wisdom,\" which suggests that the aggregate of individual ideas in a crowd is often quite valuable. Next Stop Design is an attempt to leverage the collective intelligence of an online community for public good, to crowdsource a public design problem to citizens in an innovative way. The hope is to translate the lessons learned from innovative Web-based business practices into problem solving tools for the greater good.\r\n\r\n<a id=\"team\" name=\"team\"></a>\r\n\r\nh2. Meet the Project Team\r\n\r\n<b>Thomas W. Sanchez</b>, Principal Investigator\r\n\"Thomas W. Sanchez\":http://cmpweb.arch.utah.edu/faculty/bio/2 is an associate professor and chair of the Department of City and Metropolitan Planning at the University of Utah. He conducts research in the areas of transportation, land use, environmental justice, and the social aspects of planning and policy. His research has been published in leading urban affairs and planning journals, including the <i>Journal of the American Planning Association</i>, <i>Housing Policy Debate</i>, <i>Urban Studies</i>, <i>Journal of Planning Education and Research</i>, and the <i>Journal of Urban Affairs</i>. Sanchez is also a nonresident senior fellow of the Brookings Institution, review editor for the <i>Journal of the American Planning Association</i>, and chair of the Transportation Research Board Social and Economics Factors Committee.\r\n\r\n<b>Daren C. Brabham</b>, Project Lead\r\n\"Daren C. Brabham\":http://www.darenbrabham.com is a Ph.D. candidate and graduate teaching fellow in the Department of Communication at the University of Utah, as well as an associate graduate researcher for the Lab for Communicating Complexity with Multimedia at the University of Maryland-College Park. He is among the first to publish on the topic of crowdsourcing, with research in <i>Convergence</i>, <i>Planning Theory</i>, <i>First Monday</i>, and <i>Flow</i>. Next Stop Design is the focus of his dissertation, directed by Joy Pierce.\r\n\r\n<b>Jim Agutter</b>, Investigator\r\n\"Jim Agutter\":http://tinyurl.com/pff5jt is a research assistant professor in the School of Architecture and assistant director of the Center for the Representation of Multi-Dimensional Information at the University of Utah. He is also vice-president of Intellivis Incorporated and CEO of Applied Medical Visualizations. He has worked extensively on information design challenges and has been involved in the research area of information design for the past seven years.\r\n\r\n<b>Keith Bartholomew</b>, Investigator\r\nAn environmental lawyer, \"Keith Bartholomew\":http://cmpweb.arch.utah.edu/faculty/bio/1133 is an assistant professor in the Department of City and Metropolitan Planning at the University of Utah. He is a member of the Oregon State Bar, the Education Chair for the Utah Chapter of the American Planning Association, and a Trustee for the Utah Transit Authority. His recent publications have appeared in the <i>Journal of the American Planning Association</i>, <i>Fordham Urban Law Journal</i>, and the <i>Journal of Urbanism</i>, in addition to <i>Growing Cooler</i>, a book he co-authored in 2008 published by the Urban Land Institute.\r\n\r\n<b>Ryan E. Smith</b>, Investigator\r\n\"Ryan E. Smith\":http://tinyurl.com/ppmhtm is an assistant professor and assistant director of the Center for Integrated Design and Construction in the School of Architecture at the University of Utah. He teaches in the areas of materials and process of design to construction, sustainability of materials, digital means that facilitate design to construction, and building technology ~ studio integrative pedagogy.\r\n\r\n<b>Mike Davie</b>, Web Designer\r\n\"Michael Davie\":http://backwardm.com is a freelance Web developer and graphic designer in Salt Lake City.\r\n\r\n<b>Annie Maxfield</b>, Public Relations Manager\r\n\"Annie Maxfield\":http://www.hum.utah.edu/communication/?module=facultyDetails&personId=1112&orgId=296 is a public relations and marketing professional in Salt Lake City, as well as an associate instructor in the Department of Communication at the University of Utah. Her research interests include new media literacy, social justice, and communication.\r\n\r\n<a id=\"coverage\" name=\"coverage\"></a>\r\n\r\nh2. Press Mentions\r\n\r\n<b>Personal Democracy Forum Blog</b>, \"Next Stop Design: Three months later\":http://personaldemocracy.com/blog-entry/next-stop-design-three-months-later - September 4, 2009\r\n<b>Spacing Toronto</b>, \"World Wide Wednesday: Bus stops, a back alley ampitheatre and Gehry\'s wave of the hand\":http://spacing.ca/wire/2009/08/26/world-wide-wednesday-bus-stops-a-back-alley-ampitheatre-and-gehrys-wave-of-the-hand/ - August 26, 2009\r\n<b>Urban CSA</b>, \"New model for citizen engagement?\":http://urbancsa.wordpress.com/2009/08/24/908/ - August 24, 2009\r\n<b>NorthWest Hub</b>, \"Transit for the people by the people?\":http://www.northwesthub.org/crowdsourcing%20next%20stop%20design - August 21, 2009\r\n<b>Spreading Science: Science 2.0 and Beyond Blog</b>, \"Using crowds to solve problems\":http://www.spreadingscience.com/2009/08/12/using-crowds-to-solve-problems/ - August 12, 2009\r\n<b>Confessions of an Aca-Fan: The Official Weblog of Henry Jenkins</b>, \"Get ready to participate: Crowdsourcing and governance\":http://henryjenkins.org/2009/08/get_ready_to_participate_crowd.html - August 10, 2009\r\n<b>The Official Google SketchUp Blog</b>, \"Design a better bus stop\":http://sketchupdate.blogspot.com/2009/06/design-better-bus-stop.html - June 29, 2009\r\n<b>The Daily Debrief with Chris Dorobek and Amy Morris, Federal News Radio 1500 AM</b>, \"Bus stops, crowdsourcing and your agency\":http://federalnewsradio.com/?nid=19&sid=1700384 - June 19, 2009\r\n<b>White House Blog</b>, \"New technologies and participation\":http://www.whitehouse.gov/blog/New-Technologies-and-Participation/ - June 12, 2009\r\n<b>Human Transit Blog</b>, \"Crowdsourcing bus stop design\":http://www.humantransit.org/2009/06/crowdsourcing-bus-stop-design.html - June 10, 2009\r\n<b>The Transit Wire</b>, \"Next stop - a better bus stop\":http://www.thetransitwire.com/2009/06/10/next-stop-a-better-bus-stop/ - June 10, 2009\r\n<b>Making Places (The Project for Public Spaces Blog)</b>, \"Places in the news\":http://blog.pps.org/places-in-the-news-june-8-2009/ - June 8, 2009\r\n<b>Personal Democracy Forum Blog</b>, \"DoT tries a more democratic approach to design\":http://personaldemocracy.com/blog-entry/dot-tries-more-democratic-approach-design - June 7, 2009\r\n<b>Transport Access Outside Blog</b>, \"Crowdsourced placemaking in Utah\":http://accessoutside.blogspot.com/2009/06/crowsourced-placemaking-in-utah.html - June 2, 2009\r\n<b>CoolTown Studios Blog</b>, \"First fed funded crowdsourced placemaking!\":http://www.cooltownstudios.com/2009/06/01/first-fed-funded-crowdsourced-placemaking - June 1, 2009\r\n<b>Planetizen Blog</b>, \"Top 10 free Web applications for planning\":http://www.planetizen.com/node/38952 - May 27, 2009',NULL,'2009-09-04 15:28:51'),(20,'Design Considerations','considerations','h1. Design Considerations\r\n\r\nFunctional Criteria to Consider When Designing a Bus Stop\r\nWritten by Ryan E. Smith, Assistant Professor\r\n\r\n*Weather*	\r\nHigh angled hot summer sun\r\nCold of the winter\r\nRain and snow\r\nNatural and traffic generated wind\r\n\r\n*Location*\r\nProximity of the shelter to the street\r\nLocation of the shelter in relation to the sidewalk (is it in front, or in back of primary pedestrian traffic?)\r\nHeight of the shelter\r\nView corridors from and around the shelter\r\n\r\n*Access*\r\nDisabled access from kiss and ride, park and ride, and sidewalk to the stop\r\nGeneral access from parking, sidewalk, street to the stop\r\nTransition from other modes of public transport (i.e. BRT, light rail, commuter rail)\r\n	\r\n*Lighting*	\r\nSafety of riders\r\nMaintenance of lighting\r\nRenewable energy source\r\nVisibility of signage and bus route information\r\nIdentification from afar\r\n\r\n*Surfaces*\r\nFriction of ground surface\r\nDurability of pedestrian surface traffic\r\nEase of snow removal and cleaning\r\nWater drainage\r\nVariety in surface treatment\r\nVegetation\r\n	\r\n*Human*\r\nPlaces to sit\r\nPlaces to stand\r\nPlaces to lean\r\nProximity to other riders\r\nBus route information\r\nEnclosure/refuge\r\nProspect/visibility of surroundings\r\n\r\n*Amenities*\r\nNext bus information\r\nTrash Receptacle\r\nPhone/Internet Access\r\nTicketing\r\n\r\n*Micro Environmental Issues*\r\nSplash from vehicles\r\nVehicle exhaust (including from buses)\r\nVehicle noise (including from buses)\r\n\r\nDo you have something to add to this list? \"Let us know!\":/ideas/new\r\n',NULL,'2009-06-12 17:57:24'),(21,'One More Step, Please','verification_sent','h1. One More Step Please\n\nWe\'ve just sent a verification email to the address you supplied. Please check your mail and click on the link to verify your new account.',NULL,NULL),(22,'Verification Succeeded','verification_confirmed','h1. Verification Succeeded',NULL,NULL),(23,'Verification Failed','verification_failed','h1. Dang.',NULL,NULL);
